eval("module.exports = [{\"type\":\"recto\",\"manuscript\":\"Ms-101,8r[4] (1914--0822) (NB)\",\"ger\":\"Die Logik mu fr sich selber sorgen.<br>\",\"eng\":\"Logic must take care of itself. [5.473 (1)]<br>\",\"date\":\"1914-08-22\",\"pt-number\":\"53062\",\"pt-page\":\"52[4]\",\"tlp-number\":\"5473 (1)\",\"cross-references\":\"22.8.14 (1)  13.10.14 (1)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,8r[5] et 9r[1] (1914--0822) (NB)\",\"ger\":\"Wenn sich syntaktische Regeln fr Funktionen <span class='underline_single'>berhaupt</span> aufstellen / lassen, dann ist die ganze Theorie der Dinge, Eigenschaften etc. berflssig. Es ist auch gar zu auffllig da weder in den Grundgesetzen noch in den Principia Mathematica von dieser Theorie die Rede ist. Nochmals: denn die Logik mu fr sich selbst sorgen. Ein <span class='underline_single'>mgliches</span> Zeichen mu auch bezeichnen knnen. Alles was berhaupt mglich ist, ist auch legitim || erlaubt. Erinnern wir uns an die Erklrung warum Sokrates ist Plato unsinnig ist. Nmlich darum weil <span class='underline_single'>wir</span> eine willkrliche Bestimmung nicht getroffen haben, aber <span class='underline_double'>nicht</span> darum weil das Zeichen an und fr sich etwa illegitim sei!<br>\",\"eng\":\"If syntactic rules for functions can be set up <span class='underline_single'>at all</span>, then the whole theory of things, properties etc. is superfluous. It is also very remarkable that neither <em>Basic Laws</em> nor <em>Principia Mathematica</em><em> </em>speak of such a theory. Once again: because logic must take care of itself. A <span class='underline_single'>possible</span><em> </em>sign must be able to signify too. Whatever is possible at all is also legitimate (permissible). Lets remember the explanation why Socrates is identical is nonsense. That is, because <span class='underline_single'>we</span> have not set up an arbitrary convention, <span class='underline_double'>not</span> because a sign is illegitimate in and of itself! [<em>Cf. </em>5.473 (2-3).]<br>\",\"date\":\"1914-08-22\",\"pt-number\":\" 53063\",\"pt-page\":\"52[5]\",\"tlp-number\":\"5473 (2-3)**\",\"cross-references\":\"22.8.14 (2)*  2.9.14 (1)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,12r[2] et 13r[1] (1914--0902) (NB)\",\"ger\":\"Wir mssen in einem gewissen Sinne uns nicht in der Logik irren knnen. Dies ist schon teilweise / darin ausgedrckt: Die Logik mu fr sich selbst sorgen. Dies ist eine ungemein tiefe & wichtige Erkenntnis.<br>\",\"eng\":\"It must, in a certain sense be impossible for us to go wrong in logic. This is already partly expressed by saying: Logic must take care for itself. This is an extremely profound & important insight. [<em>Cf. </em>5.473 (2-3).]<br>\",\"date\":\"1914-09-02\",\"pt-number\":\"53063\",\"pt-page\":\"52[5]\",\"tlp-number\":\"5473 (2-3)**\",\"cross-references\":\"22.8.14 (2)*  2.9.14 (1)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,13r[2] (1914--0902) (NB)\",\"ger\":\"Frege sagt: jeder rechtmig gebildete Satz mu einen Sinn haben und ich sage: jeder mgliche Satz ist rechtmig gebildet & wenn er keinen Sinn hat so kann das nur daran liegen da wir einigen seiner Bestandteile keine Bedeutung <span class='underline_single'>gegeben</span> haben. Wenn wir auch glauben es getan zu haben.<br>\",\"eng\":\"Frege says: any well-formed sentence must make sense. And I say: any possible sentence is well-formed, and, if it doesnt make sense, that can only be because we have not <span class='underline_single'>give</span><span class='underline_single'>n</span> any meaning<em> </em>to some of its constituents. Even if we think we have. [<em>Cf. </em>5.4733 (1-2).]<br>\",\"date\":\"1914-09-02\",\"pt-number\":\" 53064\",\"pt-page\":\"53[2]\",\"tlp-number\":\"54733 (1-2)*\",\"cross-references\":\"2.9.14 (2)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,13r[3] et 14r[1] (1914--0903) (NB)\",\"ger\":\"     Wie ist es mit der Aufgabe der Philosophie vereinbar da die Logik fr sich selbst sorgen soll? Wenn wir z.B. fragen: ist die & die Tatsache von der Subjekt-Prdikat Form / dann mssen wir doch wissen was wir unter der Subjekt-Prdikat Form verstehen. Wir mssen wissen <span class='underline_single'>ob</span> es so eine Form berhaupt gibt. Wie knnen wir dies wissen? Aus den Zeichen! Aber wie? Wir haben ja gar keine <span class='underline_single'>Zeichen</span> von dieser Form. Wir knnen zwar sagen: Wir haben Zeichen die sich so benehmen wie solche von der Subjekt-Prdikat Form, aber beweist das da es wirklich Tatsachen dieser Form geben mu? Nmlich: wenn diese vollstndig analysiert sind. Und hier frgt es sich wieder: gibt es so eine vollstndige Analyse? <span class='underline_single'>Und wenn nicht</span>: Was ist denn dann die Aufgabe der Philosophie?!!?<br>\",\"eng\":\"How can the task of philosophy be reconciled with logics having to look after itself? For example, if we ask: Is such and such a fact of the subject-predicate form? / then we must know what we mean by the \\\"subject-predicate form\\\". We must know <span class='underline_single'>whether</span> there is such a form at all. How can we know this? \\\"From the signs!\\\" But how? For we havent got any <span class='underline_single'>signs</span> of this form. To be sure, we can say: We have signs that behave like those of the subject-predicate form, but does that prove that there really must be facts of this form? Namely: if those signs are completely analyzed. And here the question is again: Is there such a complete analysis? <span class='underline_single'>And if not</span>: what is the task of philosophy then?!!? [<em>Cf. </em>4.1274 (2)] (~NB)<br>\",\"date\":\"1914-09-03\",\"pt-number\":\" 410227254\",\"pt-page\":\"35[6]\",\"tlp-number\":\"41274 (2)**\",\"cross-references\":\"3.9.14 (1)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,14r[2] et 15r[1] (1914--0903) (NB)\",\"ger\":\"Also knnen wir uns fragen: Gibt es die Subjekt-Prdikat Form? Gibt es die Relationsform? Gibt es berhaupt / irgend eine der Formen von denen Russell und ich immer gesprochen haben? (Russell wrde sagen: ja! denn das ist einleuchtend. <span class='underline_single'>Jaha</span>!)<br>\",\"eng\":\" So we can ask ourselves: Does the subject-predicate form exist? Does the relational form exit? Do any / any of the forms exist at all that Russell and I have always spoken? (Russell would say: \\\"Yes! Because thats self-evident.\\\" <span class='underline_single'>Ha</span><span class='underline_single'>h</span>!)<br>\",\"date\":\"1914-09-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,15r[2] (1914--0903) (NB)\",\"ger\":\"Also: wenn <span class='underline_single'>alles</span> was gezeigt werden braucht durch die Existenz der Subjekt-Prdikat <span class='underline_double'>Stze</span> etc. gezeigt wird dann ist die Aufgabe der Philosophie eine andere als ich ursprnglich annahm. Wenn dem aber nicht so ist so mte das Fehlende durch eine Art Erfahrung gezeigt werden und das halte ich fr ausgeschlossen.<br>\",\"eng\":\"So: if <span class='underline_single'>everything</span> that needs to be shown is shown by the existence of subject-predicate <span class='underline_double'>sentences</span> etc. then the task of philosophy is different from what I originally assumed. But if that is not so, then what is lacking would have to be shown by some kind of experience and I consider that to be out of the question.<br>\",\"date\":\"1914-09-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,15r[3] (1914--0903) (NB)\",\"ger\":\"Die Unklarheit liegt <span class='underline_single'>offenbar</span> in der Frage worin eigentlich die logische Identitt von Zeichen und Bezeichnetem besteht! Und diese Frage ist (<span class='underline_single'>wieder</span>) eine Hauptansicht des ganzen philosophischen Problems.<br>\",\"eng\":\"The obscurity <span class='underline_single'>obviously</span> resides in the question What does the logical identity of a sign and what it signifies really consist in?! And this question is (<span class='underline_single'>once again</span>) a principal way of framing the whole philosophical problem.<br>\",\"date\":\"1914-09-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,16r[1] et 17r[1] (1914--0903) (NB)\",\"ger\":\"Es sei eine Frage der Philosophie gegeben: etwa die ob  A ist gut ein Subjekt-Prdikat Satz sei; oder die ob A ist heller als B ein Relationssatz sei!<span class='underline_single'> Wie </span><span class='underline_single'>lt</span><span class='underline_single'> sich so eine Frage berhaupt entscheiden?!</span> Was fr eine Evidenz kann mich darber beruhigen da  <span class='underline_single'>zum Beispiel</span>  die erste Frage bejaht werden mu? (Dies ist eine ungemein wichtige Frage). Ist die einzige Evidenz hier wieder <span class='underline_single'>jenes hchst zweifelhafte Einleuchten??</span> Nehmen wir eine ganz hnliche Frage die aber einfacher & grundlegender ist; nmlich diese: ist ein Punkt in unserem Gesichtsbild ein <span class='underline_single'>einfacher Gegenstand</span>, ein <span class='underline_single'>Ding</span>? Solche Fragen habe ich doch bisher immer als die eigentlichen philosophischen angesehen  und sie sind es auch gewi in einem Sinne  aber / nochmals: welche Evidenz knnte so eine Frage berhaupt entscheiden? Ist hier nicht ein Fehler in der Fragestellung denn es scheint als leuchtete mir ber diese Frage <span class='underline_single'>gar nichts</span> ein; es scheint als knnte ich mit Bestimmtheit sagen, da diese Fragen berhaupt nie entschieden werden knnten.<br>\",\"eng\":\"Consider some philosophical question, such as whether \\\"A is good\\\" is a subject-predicate proposition; or whether \\\"A is brighter than B\\\" is a relational proposition. <span class='underline_single'>How can such a question be </span><span class='underline_single'>resolv</span><span class='underline_single'>ed at all</span>? What kind of evidence can reassure me that - <span class='underline_single'>for example</span> - the first question must be answered in the affirmative? (This is an exceptionally important question). Is the only evidence here once again <span class='underline_single'>that extremely dubious \\\"self-evidence</span>\\\"? Let's take a very similar question, which is however simpler & more fundamental, namely this one: Is a point in our visual field a \\\"<span class='underline_single'>simple object</span>\\\", a <span class='underline_single'>thing</span>? Up to now, I have always regarded such questions as the real philosophical ones - and they surely are in some sense - but / once again: what evidence could resolve such a question? Isn't there a mistake in the formulation of the qustion here, for it seems to me that <span class='underline_single'>nothing at all</span> were self-evident to me about this question; it seems to me that I can say with certainty that these questions could never be resolved at all.<br>\",\"date\":\"1914-09-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,17r[2] (1914--0904) (NB)\",\"ger\":\"Wenn nicht die Existenz des Subjekt-Prdikat <span class='underline_single'>Satzes</span> alles Ntige zeigt dann knnte es doch nur die Existenz irgend einer besonderen Tatsache jener Form zeigen. Und die Kenntnis einer solchen kann nicht fr die Logik wesentlich sein.<br>\",\"eng\":\"If the existence of the subject-predicate <span class='underline_single'>sentence</span> does not show everything necessary, then it could surely only be shown by the existence of some specific fact of that form. And knowing such a fact cannot be essential for logic.<br>\",\"date\":\"1914-09-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,17r[3] et 18r[1] (1914--0904) (NB)\",\"ger\":\"Gesetzt den Fall wir htten ein Zeichen das <span class='underline_single'>wirklich</span> von der Subjekt-Prdikat Form wre, wre dieses fr den Ausdruck von Subjekt-Prdikat Stzen irgendwie geeigneter als unsere Subjekt-Prdikat Stze? Es scheint nein! / Liegt das an der bezeichnenden Relation?<br>\",\"eng\":\"Suppose we had a sign that <span class='underline_single'>really</span> was of the subject-predicate form, would this be somehow more suitable for expressing subject-predicate propositions than our subject-predicate sentences are? It seems not! / Does this arise from the signifying relation?<br>\",\"date\":\"1914-09-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,18r[2] (1914--0904) (NB)\",\"ger\":\" Wenn sich die Logik ohne die Beantwortung gewisser Fragen abschlieen lt dann <span class='underline_single'>mu</span><span class='underline_single'> sie ohne</span> sie abgeschlossen werden.<br>\",\"eng\":\"If logic can be completed without answering certain questions then it <span class='underline_single'>must</span> be completed <span class='underline_single'>without</span> answering them.<br>\",\"date\":\"1914-09-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,18r[3] (1914--0904) (NB)\",\"ger\":\"Die logische Identitt von Zeichen & Bezeichnetem besteht darin da man im Zeichen nicht mehr & nicht weniger wiedererkennen darf als im Bezeichneten.<br>\",\"eng\":\"The logical identity of a sign and what it signifies consists in ones not being allowed to recognise more or less in the sign than in what it signifies.<br>\",\"date\":\"1914-09-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,18r[4] (1914--0904) (NB)\",\"ger\":\" Wren Zeichen & Bezeichnetes <span class='underline_single'>nicht</span> ihrem vollen logischen Inhalte nach identisch dann mte es noch etwas Fundamentaleres geben als die Logik.<br>\",\"eng\":\"If a sign and what it signifies were <span class='underline_single'>not</span> identical with regard to their entire logical content then there would have to be something even more fundamental than logic.<br>\",\"date\":\"1914-09-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,18r[5] (1914--0905) (NB)\",\"ger\":\"\",\"eng\":\"\",\"date\":\"1914-09-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,18r[6] et 19r[1] (1914--0905) (NB)\",\"ger\":\"Erinnere dich da die Worte Funktion Argument Satz etc. in der Logik nicht / vorkommen drfen!<br>\",\"eng\":\" Remember that the words \\\"function\\\", \\\"argument\\\", \\\"sentence\\\", etc. may not occur in logic!<br>\",\"date\":\"1914-09-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,19r[2] (1914--0905)\",\"ger\":\"\",\"eng\":\"\",\"date\":\"1914-09-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,19r[3] (1914--0905) (NB)\",\"ger\":\" [ZZ].  .x xx ...<br>Von zwei Klassen zu sagen sie seien identisch sagt etwas. Von zwei Dingen dies zu sagen sagt nichts dies schon zeigt die Unzulssigkeit der Russellschen Definition.<br>\",\"eng\":\" [ZZ].  .x xx ...<br>To say of two classes that they are identical says something. To say it of two things says nothing. This by itself shows the inadmissibility of Russell's definition.<br>\",\"date\":\"1914-09-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,19r[4] (1914--0906)\",\"ger\":\"\",\"eng\":\"\",\"date\":\"1914-09-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,19r[5] (1914--0906) (NB)\",\"ger\":\"Der letzte Satz ist eigentlich nichts anderes als der uralte Einwand gegen die Identitt in der Mathematik. Nmlich der da wenn 2  2 wirklich <span class='underline_single'>gleich</span> 4 wre da dieser Satz dann nicht mehr sagen wrde als a = a.<br>\",\"eng\":\"The last sentence is actually nothing more than the age-old objection against identity in mathematics. Namely that if 2  2 really were really the <span class='underline_single'>same</span> as 4, then this proposition would say no more than a = a.<br>\",\"date\":\"1914-09-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,19r[6] (1914--0906) (NB)\",\"ger\":\"Knnte man sagen: Die Logik kmmert die Analysierbarkeit der Funktionen mit denen sie arbeitet <span class='underline_single'>nicht</span>.<br>\",\"eng\":\"Could one say: Logic does <span class='underline_single'>not</span> care about the analyzability of the functions with which it works.\\t\\t <br>\",\"date\":\"1914-09-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,20r[1] (1914--0906)\",\"ger\":\"\",\"eng\":\"\",\"date\":\"1914-09-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,20r[2] (1914--0907) (NB)\",\"ger\":\"Bedenke da auch ein unanalysierter Subjekt-Prdikat Satz etwas <span class='underline_single'>ganz Bestimmtes</span> klar aussagt.<br>\",\"eng\":\"Remember that even an unanalyzed subject-predicate sentence is a clear statement of something <span class='underline_single'>completely</span><span class='underline_single'> definite</span>.<br>\",\"date\":\"1914-09-07\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,20r[3] et 21r[1] (1914--0907) (NB)\",\"ger\":\"Kann man nicht sagen: Es kommt nicht darauf an da wir es mit nicht analysierbaren Subjekt-Prdikat Stzen zu tun haben sondern darauf da unsere Subjekt-Prdikat Stze sich in <span class='underline_single'>jeder</span> Beziehung so wie solche benehmen d.h. also da die Logik <span class='underline_single'>unserer</span> Subjekt-Prdikat Stze dieselbe ist wie die Logik jener anderen. Es kommt uns ja nur darauf an die Logik abzuschlieen und unser Haupteinwand gegen die nicht-analysierten Subjekt-Prdikat Stze war der, da wir ihre Syntax nicht aufstellen knnen solange wir ihre Analyse nicht kennen. Mu aber nicht die Logik eines / scheinbaren Subjekt-Prdikat Satzes dieselbe sein wie die Logik eines wirklichen? Wenn eine Definition berhaupt mglich ist, die dem Satz die Subjekt-Prdikat Form Form gibt ?<br>\",\"eng\":\"Cant we say: It all depends, not on our dealing with unanalyzable subject-predicate-sentences, but on the fact that our subject-predicate-sentences behave in the same way as such sentences in <span class='underline_single'>every</span> respect, i.e. that the logic of <span class='underline_single'>our</span> subject-predicate-sentences is the same as the logic of those other ones. The point for us is simply to complete logic, and our main objection against unanalyzed subject-predicate sentences was that we cannot set up their syntax until we know their analysis. But must not the logic of an apparent subject-predicate sentence be the same as the logic of a real one? If a definition giving the proposition the subject-predicate form is possible at all...?<br>\",\"date\":\"1914-09-07\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,21r[2] (1914--0908) (NB)\",\"ger\":\"Das Einleuchten von dem Russell so viel sprach kann nur dadurch in der Logik entbehrlich werden da die Sprache selbst jeden logischen Fehler verhindert. Und es ist klar da jenes Einleuchten immer gnzlich trgerisch ist & war.<br>\",\"eng\":\"There is only one way in which self-evidence, which Russell mentioned so often, can become dispensable in logic: language itself is to forestall every logical mistake. And it is clear that that self-evidence is and always was completely deceptive. [<em>Cf. </em>5.4731]<br>\",\"date\":\"1914-09-08\",\"pt-number\":\" 530631\",\"pt-page\":\"53[1]\",\"tlp-number\":\"54731*\",\"cross-references\":\"8.9.14\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,21r[3] (1914--0919) (NB)\",\"ger\":\"Ein Satz wie dieser Sessel ist braun scheint etwas enorm Kompliziertes zu sagen, denn wollten wir diesen Satz so aussprechen da uns niemand gegen ihn Einwendungen die aus seiner Vieldeutigkeit entspringen machen knnte so wrde er endlos lang werden mssen.<br>\",\"eng\":\"A proposition like \\\"this chair is brown\\\" seems to say something enormously complicated, for if we wanted to make this proposition explicit in a way that nobody could object to it because of its ambiguity, it would have to be infinitely long.<br>\",\"date\":\"1914-09-19\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,22r[1] (1914--0920) (NB)\",\"ger\":\"<em>Da</em><em> der</em> Satz ein logisches Abbild seiner Bedeutung ist leuchtet dem unbefangenen Auge ein.<br>\",\"eng\":\"That a sentence is a logical depiction of its meaning is obvious to the unbiased eye.<br>\",\"date\":\"1914-09-20\",\"pt-number\":\" 401\",\"pt-page\":\"8[2]\",\"tlp-number\":\"401 (1)\",\"cross-references\":\"20.9.14 (1)+  27.9.14 (4)**  27.10.14 (7)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,22r[2] (1914--0920) (NB)\",\"ger\":\"Gibt es Funktionen von Tatsachen? Z.B. Es ist besser wenn dies der Fall ist als wenn jenes der Fall ist.<br>\",\"eng\":\"Are there functions of facts? E.g. \\\"It is better for this to be the case than for that to be the case.<br>\",\"date\":\"1914-09-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,22r[3] (1914--0920) (NB)\",\"ger\":\"Worin besteht denn die Verbindung zwischen dem Zeichen p und den brigen Zeichen des Satzes: Es ist gut da p der Fall ist.? Worin besteht diese Verbindung??<br>\",\"eng\":\"What, then, is the connection between the sign p and the other signs in the sentence \\\"It is good that p is the case\\\"? What does this connection consist in??<br>\",\"date\":\"1914-09-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,22r[4] (1914--0920) (NB)\",\"ger\":\"Der Unbefangene wird sagen: offenbar in der rumlichen Beziehung des Buchstaben p zu den zwei Nachbarzeichen. Wenn aber die Tatsache p eine solche wre in welcher keine Dinge vorkommen??<br>\",\"eng\":\"The unbiased person will say: obviously in the spatial relationship of the letter p to the two neighboring signs. But what if the fact \\\"p\\\" were such as to contain no things?<br>\",\"date\":\"1914-09-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,22r[5] et 23r[1] (1914--0920) (NB)\",\"ger\":\" Es ist gut <span class='underline_single'>da</span> p kann wohl analysiert / werden in p . es ist gut <span class='underline_single'>wenn</span> p.<br>\",\"eng\":\"\\\"It is good <span class='underline_single'>that</span> p\\\" can presumably be analyzed into \\\"p . it is good <span class='underline_single'>if</span> p\\\".<br>\",\"date\":\"1914-09-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,23r[2] (1914--0920) (NB)\",\"ger\":\"<span class='underline_single'>Wir setzen voraus: p sei </span><span class='underline_double'>nicht</span><span class='underline_single'> der Fall</span>: Was heit es dann zu sagen, es ist gut da p? Wir knnen ganz offenbar sagen, der Sachverhalt p sei gut ohne zu wissen ob p wahr oder falsch ist.<br>\",\"eng\":\"<span class='underline_single'>We</span><span class='underline_single'> suppose</span><span class='underline_single'> p is </span><span class='underline_double'>not</span><span class='underline_single'> the case</span>: now what does it mean to say \\\"it is good that p? Quite obviously, we can say that the state of things p is good without knowing whether \\\"p\\\" is true or false.<br>\",\"date\":\"1914-09-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,23r[3] (1914--0920) (NB)\",\"ger\":\"Der Ausdruck der Grammatik: Ein Wort bezieht sich auf ein anderes wird hier beleuchtet.<br>\",\"eng\":\"This sheds light on the grammatical expression: \\\"One word refers to another\\\".\\t<br>\",\"date\":\"1914-09-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,23r[4] (1914--0920) (NB)\",\"ger\":\"Es handelt sich in den obigen Fllen darum anzugeben wie Stze in sich zusammenhngen. Wie der <span class='underline_single'>Satz-Verband</span> zustande kommt.<br>\",\"eng\":\"The point of the cases above is to say how propositions are connected internally.  How a <span class='underline_single'>propositional</span><span class='underline_single'>-</span><span class='underline_single'>compound</span> comes about.<em> </em>[<em>Cf. </em>4.221.]<br>\",\"date\":\"1914-09-20\",\"pt-number\":\" 541011\",\"pt-page\":\"94[3]\",\"tlp-number\":\"4221 (2) \",\"cross-references\":\"20.9.14 (8)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,23r[5] (1914--0920) (NB)\",\"ger\":\"(  )         ( )<br>Wie kann sich eine Funktion <span class='underline_single'>auf einen Satz beziehen</span>???? Immer die uralten Fragen!<br>\",\"eng\":\"(  )         ( )<br>How can a function refer <span class='underline_single'>to a proposition</span>????  Always the age-old questions!<br>\",\"date\":\"1914-09-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,24r[1] (1914--0920) (NB)\",\"ger\":\"Nur sich nicht von Fragen berhufen lassen; nur es sich bequem machen!<br>\",\"eng\":\"Don't let yourself get overwhelmed by questions; just take it easy!<br>\",\"date\":\"1914-09-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,24r[2] et 25r[1] (1914--0920) (NB)\",\"ger\":\" (x): Nehmen wir an uns sei eine Funktion eines Subjekt-Prdikat Satzes gegeben und wir wollen die Art der Beziehung der Funktion zum Satz dadurch erklren da wir sagen: Die Funktion bezieht sich unmittelbar nur auf das Subjekt des Subjekt-Prdikat Satzes und was bezeichnet ist das logische Produkt aus dieser Beziehung und dem Subjekt-Prdikat Satzeichen. Wenn wir das nun sagen so knnte man fragen: wenn du den Satz so erklren kannst warum erklrst du dann nicht auch seine Bedeutung auf die analoge Art & Weise. Nmlich sie sei keine Funktion einer Subjekt-Prdikat Tatsache sondern das logische Produkt einer solchen & einer Funktion ihres Subjektes? Mu nicht der Einwand der gegen diese / Erklrung gilt auch gegen jene gelten?<br>\",\"eng\":\" (x):\\tSuppose we are given a function of a subject-predicate proposition and we want to explain the way the function is related to the proposition by saying: The function only relates immediately to the subject of the subject-predicate proposition and what signifies is the logical product of this relation and the subject-predicate propositional sign. Now, if we say this, one might ask: If you can explain the proposition in this way, why don't you give an analogous explanation of its meaning? Namely: \\\"It is not a function of a subject-predicate fact but the logical product of such a fact and of a function of its subject\\\"? Must not the objection to the latter explanation hold against the former too?<br>\",\"date\":\"1914-09-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,25r[2] (1914--0921) (NB)\",\"ger\":\"Es scheint mir jetzt pltzlich in irgend einem Sinne klar da eine Eigenschaft eines Sachverhalts immer intern sein mu.<br>\",\"eng\":\"Now it suddenly seems to me in some sense clear that a property of a state of things must always be internal.<br>\",\"date\":\"1914-09-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,25r[3] (1914--0921) (NB)\",\"ger\":\"a, b, aRb. Man knnte sagen der Sachverhalt aRb habe immer eine gewisse Eigenschaft, wenn die beiden ersten Stze wahr sind.<br>\",\"eng\":\" a, b, aRb. One could say the state of things aRb always has a certain property, if the first two propositions are true.<br>\",\"date\":\"1914-09-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,25r[4] (1914--0921) (NB)\",\"ger\":\"Wenn ich sage: Es ist gut da p der Fall ist dann mu dies eben <span class='underline_single'>in sich</span> gut sein.<br>\",\"eng\":\" If I say: It is good that p is the case, then this must be good <span class='underline_single'>in itself</span>.<br>\",\"date\":\"1914-09-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,25r[5] (1914--0921) (NB)\",\"ger\":\"Es scheint mir jetzt klar da es keine Funktionen von Sachverhalten geben kann.<br>\",\"eng\":\"It seems clear to me now that there cannot be functions of states of things.<br>\",\"date\":\"1914-09-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,25r[6] (1914--0923)\",\"ger\":\"\",\"eng\":\"\",\"date\":\"1914-09-23\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,25r[7] (1914--0923)\",\"ger\":\"\",\"eng\":\"\",\"date\":\"1914-09-23\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,26r[1] (1914--0923) (NB)\",\"ger\":\"Man knnte fragen: wie kann der Sachverhalt p eine Eigenschaft haben, wenn es sich am Ende gar nicht so verhlt?<br>\",\"eng\":\" One could ask: how can the state of things p have a property, if in the end //it isnt//things arent// that way at all?<br>\",\"date\":\"1914-09-23\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,26r[2] (1914--0924) (NB)\",\"ger\":\"Die Frage, wie ist eine Zuordnung von Relationen mglich, ist identisch mit dem Wahrheits-Problem.<br>\",\"eng\":\" The question how a correlation of relations is possible is identical to the problem of truth.<br>\",\"date\":\"1914-09-24\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,26r[3] (1914--0925) (NB)\",\"ger\":\"Denn dies ist identisch mit der Frage wie ist die Zuordnung von Sachverhalten mglich (einem bezeichnenden & einem bezeichneten).<br>\",\"eng\":\"For that is identical with the question how the correlation of states of things is possible (one that signifies and one that is signified).<br>\",\"date\":\"1914-09-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,26r[4] (1914--0925) (NB)\",\"ger\":\"Sie ist nur durch die Zuordnung der Bestandteile mglich; ein Beispiel bietet die Zuordnung von Namen & Benanntem. (Und es ist klar da auch eine Zuordnung der Relationen auf irgend eine Weise stattfindet.)<br>\",\"eng\":\"It is only possible by correlating the constituents; the correlation of name and named is an example. (And it is clear too that there is a correlation of relations in some way).<br>\",\"date\":\"1914-09-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,26r[5] (1914--0925) (NB)\",\"ger\":\"Hier wird ein einfaches Zeichen einem Sachverhalt zugeordnet.<br>\",\"eng\":\"Here a simple sign is correlated with a state of things.<br>\",\"date\":\"1914-09-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,27r[1] (1914--0926) (NB)\",\"ger\":\"Worauf grndet sich unsere  sicher wohl begrndete  Zuversicht da wir jeden beliebigen Sinn in unserer zweidimensionalen Schrift werden ausdrcken knnen?!<br>\",\"eng\":\"What is the basis for our - certainly well-founded - confidence that we will be able to express any sense we like in our two-dimensional writing?<br>\",\"date\":\"1914-09-26\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,27r[2] (1914--0927) (NB)\",\"ger\":\"Ein Satz kann seinen Sinn ja nur dadurch ausdrcken da er dessen logisches Abbild ist!<br>\",\"eng\":\"A proposition can express its sense <span class='underline_single'>only</span> by being its logical depiction.<br>\",\"date\":\"1914-09-27\",\"pt-number\":\" 4071\",\"pt-page\":\"48[3]\",\"tlp-number\":\"403 (4)\",\"cross-references\":\"27.9.14 (1)**  3.10.14 (3)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,27r[3] (1914--0927) (NB)\",\"ger\":\"Auffallend ist die hnlichkeit zwischen den Zeichen aRb und aR  Rb.<br>\",\"eng\":\" The similarity between these signs is striking: <br>\",\"date\":\"1914-09-27\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,27r[4] (1914--0929) (NB)\",\"ger\":\"<em>Der allgemeine</em> Begriff des Satzes fhrt auch einen ganz allgemeinen Begriff der Zuordnung von Satz und Sachverhalt mit sich: Die Lsung aller meiner Fragen mu <span class='underline_single'>hchst</span> einfach sein!<br>\",\"eng\":\"The general concept of the proposition also carries with it an entirely general concept of the correlation of proposition and state of things: The answer to all my questions must be <span class='underline_single'>extremely</span> simple!<br>\",\"date\":\"1914-09-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,28r[1] (1914--0929) (NB)\",\"ger\":\"Im Satz wird eine Welt probeweise zusammengestellt. (Wie wenn im Pariser Gerichtssaal ein Automobilunglck mit Puppen etc dargestellt wird.) <br>\",\"eng\":\" In a proposition an arrangement of a world is tried out. (As when in a Parisian courtroom a car accident is represented using dolls etc.). [<em>Cf. </em>4.031 (1).]<br>\",\"date\":\"1914-09-29\",\"pt-number\":\" 40711\",\"pt-page\":\"48[2]\",\"tlp-number\":\"4031* (1)\",\"cross-references\":\"29.9.14 (2)**  15.10.14 (5)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,28r[2] (1914--0929) (NB)\",\"ger\":\"Daraus mu sich (wenn ich nicht blind wre) sofort das Wesen der Wahrheit ergeben.<br>\",\"eng\":\"This must yield the essence of truth straight away (if I were not blind).<br>\",\"date\":\"1914-09-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,28r[3] (1914--0929) (NB)\",\"ger\":\"Denken wir an hieroglyphische Schriften bei denen jedes Wort seine Bedeutung darstellt! Denken wir daran da auch <span class='underline_single'>wirkliche</span> Bilder von Sachverhalten <span class='underline_single'>stimmen</span> und <span class='underline_single'>nicht stimmen</span> knnen.<br>\",\"eng\":\"Let us think of hieroglyphic writing in which each word represents its meaning. Let us think also of the fact that <span class='underline_single'>real</span> pictures of states of things can be <span class='underline_single'>right</span> or <span class='underline_single'>wrong</span>. [<em>Cf </em>4.016 (1).]<br>\",\"date\":\"1914-09-29\",\"pt-number\":\"  40115\",\"pt-page\":\"26[7]\",\"tlp-number\":\"4016 (1)**\",\"cross-references\":\"29.9.14 (4)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,28r[4] et 29r[1] (1914--0929) (NB)\",\"ger\":\"  : Wenn in diesem Bild der rechte Mann den Menschen A vorstellt und bezeichnet der linke den Menschen B so knnte etwa das Ganze aussagen A ficht mit B. Der / Satz in Bilderschrift kann wahr und falsch sein. Er hat einen Sinn unabhngig von seiner Wahr- oder Falschheit. An ihm mu sich alles Wesentliche demonstrieren lassen.<br>\",\"eng\":\" If the man on the right in this picture the right represents person A and the one on the left man represents person B, then the whole thing could say \\\"A fences with B\\\". The proposition in picture writing can be true or false. It has a meaning independent of its truth or falsity. It must be possible to demonstrate everything essential by considering this case. \\t<br>\",\"date\":\"1914-09-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,29r[2] (1914--0929) (NB)\",\"ger\":\"Man kann sagen wir haben zwar nicht die Gewiheit da wir alle Sachverhalte in Bildern aufs Papier bringen knnen wohl aber die Gewiheit da wir alle <span class='underline_single'>logischen</span> Eigenschaften der Sachverhalte in einer zweidimensionalen Schrift abbilden knnen.<br>\",\"eng\":\"One can say that while we are not certain of being able to turn every state of things into pictures on paper, still we are certain that we can depict every <span class='underline_single'>logical</span> property of states of things in a two dimensional script.<br>\",\"date\":\"1914-09-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,29r[3] (1914--0929) (NB)\",\"ger\":\"Wir sind hier noch immer sehr an der Oberflche aber wohl auf einer guten Ader.<br>\",\"eng\":\"We are still very much on the surface here, but may well have struck a rich vein.<br>\",\"date\":\"1914-09-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,29r[4] et 30r[1] (1914--0930) (NB)\",\"ger\":\"Man kann sagen in unserem Bilde stellt der Rechte etwas dar und auch der Linke, <span class='underline_single'>aber</span> selbst wenn dies nicht der Fall wre so knnte / ihre gegenseitige Stellung etwas darstellen. (Nmlich eine Beziehung)<br>\",\"eng\":\" One could say that in our picture the right hand figure represents something and also the left hand one, <span class='underline_single'>but</span> even if this were not the case, their relative position could represent something. (Namely a relationship.)\\t\\t <br>\",\"date\":\"1914-09-30\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,30r[2] (1914--0930) (NB)\",\"ger\":\"Ein Bild kann Beziehungen darstellen die es nicht gibt!!! Wie ist dies mglich?<br>\",\"eng\":\"A picture can represent relations that do not exist!!! How is that possible?<br>\",\"date\":\"1914-09-30\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,30r[3] (1914--0930) (NB)\",\"ger\":\"Jetzt scheint es wieder als mten alle Beziehungen logisch sein damit ihre Existenz durch die des Zeichens verbrgt sei.<br>\",\"eng\":\"Now once more it looks as if all relations must be logical in order for their existence to be guaranteed by that of the sign.<br>\",\"date\":\"1914-09-30\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,30r[4] (1914--1002) (NB)\",\"ger\":\"Was in aRb  bSc a & c verbindet ist nicht das    Zeichen sondern <span class='underline_single'>das Vorkommen desselben Buchstaben</span> b in den beiden einfachen Stzen.<br>\",\"eng\":\"What connects a and c in \\\"aRb  bSc\\\" is not the \\\"  \\\" sign but <span class='underline_single'>the occurrence of the same letter</span> \\\"b\\\" in the two simple sentences.<br>\",\"date\":\"1914-10-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,30r[5] (1914--1002) (NB)\",\"ger\":\"Man kann geradezu sagen: statt dieser Satz hat diesen & diesen Sinn: dieser Satz stellt diesen & diesen Sachverhalt dar!<br>\",\"eng\":\"Instead of \\\"this proposition has such and such a sense\\\" one can just say \\\"this proposition represents such and such a state of things. [<em>See</em> 4.031 (2).]<br>\",\"date\":\"1914-10-02\",\"pt-number\":\" 40712\",\"pt-page\":\"48[4]\",\"tlp-number\":\"4031 (2)*\",\"cross-references\":\"2.10.14 (2)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,31r[1] (1914--1002) (NB)\",\"ger\":\"\",\"eng\":\"\",\"date\":\"1914-10-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,31r[2] (1914--1002) (NB)\",\"ger\":\"Nur so kann <span class='underline_single'>der Satz</span> wahr oder falsch sei: nur dadurch kann er mit der Wirklichkeit bereinstimmen oder nicht bereinstimmen da er <span class='underline_single'>ein Bild</span> eines Sachverhaltes ist.<br>\",\"eng\":\"Only in this way can <span class='underline_single'>a</span><span class='underline_single'> proposition</span> be true or false: it can only agree or disagree with reality by being a <span class='underline_single'>picture</span> of a state of things. [<em>See</em> 4.06.]<br>\",\"date\":\"1914-10-02\",\"pt-number\":\" 409\",\"pt-page\":\"8[4]\",\"tlp-number\":\"406*\",\"cross-references\":\"2.10.14 (4)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,31r[3] (1914--1003) (NB)\",\"ger\":\"Nur in <span class='underline_single'>soweit</span> ist der Satz ein Bild eines Sachverhalts als er logisch gegliedert ist! (Ein einfaches  ungegliedertes  Zeichen kann weder wahr noch falsch sein.)<br>\",\"eng\":\"A proposition is a picture of a state of things only in <span class='underline_single'>so</span><span class='underline_single'> </span><span class='underline_single'>far</span> as it is logically articulated. (A simple  non-articulated  sign can be neither true nor false). [<em>See</em> 4.032 (1).]<br>\",\"date\":\"1914-10-03\",\"pt-number\":\" 4072\",\"pt-page\":\"48[5]\",\"tlp-number\":\"4032 (1)\",\"cross-references\":\"3.10.14 (1)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,31r[4] (1914--1003) (NB)\",\"ger\":\"Der <span class='underline_single'>Name</span> ist <span class='underline_single'>kein</span> Bild des Benannten!<br>\",\"eng\":\"A <span class='underline_single'>name</span> is <span class='underline_single'>not</span> a picture of whats named!<br>\",\"date\":\"1914-10-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,31r[5] (1914--1003) (NB)\",\"ger\":\"Der Satz <span class='underline_single'>sagt nur insoweit etwas aus</span>, als er <span class='underline_single'>ein Bild</span> ist!<br>\",\"eng\":\"A proposition <span class='underline_single'>states</span><span class='underline_single'> something only insofar</span> as it is a <span class='underline_single'>picture</span>! [<em>See</em> 4.03 (4).]<br>\",\"date\":\"1914-10-03\",\"pt-number\":\" 4071\",\"pt-page\":\"48[3]\",\"tlp-number\":\"403 (4)\",\"cross-references\":\"27.9.14 (1)**  3.10.14 (3)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,31r[6] et 32r[1] (1914--1003) (NB)\",\"ger\":\"Tautologien sagen nichts aus, sie sind nicht Bilder von Sachverhalten: Sie sind / selber logisch vollkommen neutral. (Das logische Produkt einer Tautologie und eines Satzes sagt nicht mehr noch weniger aus als dieser allein.)<br>\",\"eng\":\" Tautologies state nothing, they are are not pictures of states of things. They are themselves logically completely neutral. (The logical product of a tautology and a propostion says neither more nor less than the latter by itself.) [<em>See</em> 4.462 and <em>cf</em>. 4.465.]<br>\",\"date\":\"1914-10-03\",\"pt-number\":\"4449\",\"pt-page\":\"45[6]\",\"tlp-number\":\"4465**\",\"cross-references\":\"3.10.14 (4)  25.5.15 (4)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,32r[2] (1914--1004) (NB)\",\"ger\":\"Es ist klar da in xRy das bezeichnende Element einer Relation enthalten sein kann auch wenn x & y nichts bezeichnen. Und dann ist die Relation das einzige was in jenem Zeichen bezeichnet wird.<br>\",\"eng\":\"It is clear that \\\"xRy\\\" can contain an element signifying a relation even if \\\"x\\\" & \\\"y\\\" do not signify anything. And then the relation is the only thing that is signified in that sign.<br>\",\"date\":\"1914-10-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,32r[3] (1914--1004) (NB)\",\"ger\":\"Aber wie ist es dann [bezieht sich auf frher] mglich, da in einem Code Kilo heit: es geht mir gut? Hier sagt doch ein <span class='underline_single'>einfaches Zeichen</span> etwas aus und wird bentzt andern etwas mitzuteilen!! <br>\",\"eng\":\"But in that case [referring back] how is it possible for \\\"kilo\\\" in a code to mean \\\"Im all right\\\"? Here surely <span class='underline_single'>a simple sign</span> does state something and is used to tell others something! <br>\",\"date\":\"1914-10-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,32r[4] (1914--1004) (NB)\",\"ger\":\"Kann denn in der vorigen Bedeutung das <span class='underline_single'>Wort</span> Kilo nicht wahr oder falsch sein?!<br>\",\"eng\":\"For cant the <span class='underline_single'>word</span> \\\"kilo\\\", with that meaning, be true or false?!<br>\",\"date\":\"1914-10-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,33r[1] (1914--1005) (NB)\",\"ger\":\"Jedenfalls kann man doch ein einfaches Zeichen dem Sinne eines Satzes zuordnen. <br>\",\"eng\":\"At any rate surely a simple sign can be correlated with the sense of a sentence. <br>\",\"date\":\"1914-10-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,33r[2] (1914--1005) (NB)\",\"ger\":\"Nur die Wirklichkeit interessiert die Logik. Also die Stze <span class='underline_double'>nur</span> insoweit sie <span class='underline_single'>Bilder</span> der Wirklichkeit sind.<br>\",\"eng\":\"Logic is interested only in reality. And so in sentences <span class='underline_double'>only</span> in so far as they are <span class='underline_single'>pictures</span> of reality.<br>\",\"date\":\"1914-10-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,33r[3] (1914--1005) (NB)\",\"ger\":\"Wie aber kann <span class='underline_double'>ein</span> <span class='underline_single'>Wort</span> wahr oder falsch sein? Es kann jedenfalls nicht den <span class='underline_single'>Gedanken</span> ausdrcken, der mit der Wirklichkeit bereinstimmt oder nicht bereinstimmt. Der mu doch gegliedert sein!<br>\",\"eng\":\" But how can <span class='underline_double'>one</span> <span class='underline_single'>word</span> be true or false? However that may be, it cannot express a <span class='underline_single'>thought</span> that agrees or disagrees with reality. That <span class='underline_single'>must</span> be articulated.<br>\",\"date\":\"1914-10-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,33r[4] (1914--1005) (NB)\",\"ger\":\"Ein Wort kann nicht wahr oder falsch sein in <span class='underline_single'>dem</span> Sinne, da es nicht mit der Wirklichkeit bereinstimmen kann, oder das Gegenteil.<br>\",\"eng\":\"A single word cannot be true or false in <span class='underline_single'>this</span> sense: it cannot agree with reality, or the opposite.\\t<br>\",\"date\":\"1914-10-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,33r[5] et 34r[1] (1914--1006) (NB)\",\"ger\":\"Der allgemeine Begriff zweier Komplexe von denen der eine das logische Bild des / <br>andern sein kann, also in <span class='underline_single'>einem</span> Sinne <span class='underline_single'>ist</span>.<br>\",\"eng\":\"The general concept of two complexes, one of which is the logical image of the other, and so <br>\",\"date\":\"1914-10-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,34r[2] (1914--1006) (NB)\",\"ger\":\" / \\\\\\tDie bereinstimmung zweier Komplexe ist offenbar <span class='underline_single'>intern</span> und kann daher nicht ausgedrckt sondern nur gezeigt werden.<br>\",\"eng\":\"The agreement of two complexes is obviously <span class='underline_single'>internal</span> and for that reason can not be expressed but only shown.<br>\",\"date\":\"1914-10-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,34r[3] (1914--1006) (NB)\",\"ger\":\" / \\\\\\tp ist wahr sagt nichts anderes aus als p!<br>p ist wahr ist  nach dem Obigen  nur ein Scheinsatz wie alle jene Zeichenverbindungen die scheinbar etwas sagen was nur gezeigt werden kann.<br>\",\"eng\":\"\\\"p\\\" is true, says nothing else but p.<br>\\\"'p' is true\\\" is - according to the above - only a pseudo-proposition like all those combinations of signs, which apparently say something that can only be shown.<br>\",\"date\":\"1914-10-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,34r[4] (1914--1007) (NB)\",\"ger\":\"Wenn ein Satz a gegeben ist so sind mit ihm auch <span class='underline_single'>schon</span> alle seine logischen Funktionen (~a etc.) mitgegeben!<br>\",\"eng\":\"If a proposition a is given, then <span class='underline_single'>at the same time</span> all its logical functions (~a, etc.) are given. [<em>Cf</em>. 5.442.]<br>\",\"date\":\"1914-10-07\",\"pt-number\":\" 5234\",\"pt-page\":\"36[1]\",\"tlp-number\":\"5442**\",\"cross-references\":\" 7.10.14**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,34r[5] (1914--1008) (NB)\",\"ger\":\"Vollstndige und unvollstndige Abbildung eines Sachverhaltes.<br>\",\"eng\":\"Complete and incomplete depiction of a state of things.<br>\",\"date\":\"1914-10-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,35r[1] (1914--1008) (NB)\",\"ger\":\"\",\"eng\":\"[5 coded lines from the middle of 7.10.14 diary entry]<br>\",\"date\":\"1914-10-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,35r[2] (1914--1008) (NB)\",\"ger\":\" (Funktion und Argument wird durch Funktion und Argument abgebildet.)<br>\",\"eng\":\"(Function plus argument is depicted by function plus argument.)<br>\",\"date\":\"1914-10-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,35r[3] (1914--1008) (NB)\",\"ger\":\"Der Ausdruck nicht mehr weiter zerlegbar ist auch einer der mit Funktion, Ding etc. auf dem Index stehenden; wie aber wird das <span class='underline_single'>gezeigt</span> was wir durch ihn ausdrcken wollen?<br>\",\"eng\":\"The expression \\\"not further analysable\\\" is one of those on the Index, along with \\\"function\\\", \\\"thing\\\" etc.; but how does what we try to express by it get <span class='underline_single'>shown</span>?<br>\",\"date\":\"1914-10-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,35r[4] (1914--1008) (NB)\",\"ger\":\" (Man kann natrlich weder von einem Ding noch von einem Komplex sagen sie seien nicht mehr weiter zerlegbar.)<br>\",\"eng\":\"(Of course, it cannot be said--neither of a thing nor of a complex--that it is not further analysable).<br>\",\"date\":\"1914-10-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,35r[5] et 36r[1] (1914--1009) (NB)\",\"ger\":\"Wenn es eine unmittelbare Zuordnung von Relationen gbe so wre die Frage: wie sind dann die Dinge zu einander zugeordnet die in diesen Relationen stehen? Gibt es / eine direkte Zuordnung von Relationen ohne Rcksicht auf ihren <span class='underline_single'>Sinn</span>?<br>\",\"eng\":\"If there were such a thing as an immediate correlation of relations, the question would be: how are things that stand in these relations correlated with one another? Is there such a thing as a direct correlation of relations without considering their <span class='underline_single'>sense</span>?<br>\",\"date\":\"1914-10-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,36r[2] (1914--1009) (NB)\",\"ger\":\"Ob wir zu der Annahme von Beziehungen zwischen Beziehungen nicht nur irregefhrt werden, durch die scheinbare Analogie zwischen den Ausdrcken:<br>Beziehungen zwischen Dingen<br>und Beziehungen zwischen Beziehungen?<br>\",\"eng\":\"Arent we misled into assuming \\\"relations between relations\\\" merely by the apparent analogy between the expressions<br>\\\"relations between things\\\"<br>and \\\"relationships between relationships\\\"?<br>\",\"date\":\"1914-10-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,36r[3] (1914--1009) (NB)\",\"ger\":\"<span class='underline_single'>Ich mache bei allen diesen berlegungen irgendwo </span><span class='underline_single'>irgend einen</span><span class='underline_single'> </span><span class='underline_double'>grundlegenden Fehler</span>.<br>\",\"eng\":\"<span class='underline_single'>In all these considerations I am somewhere making some sort of </span><span class='underline_double'>fundamental mistake</span>.<br>\",\"date\":\"1914-10-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,36r[4] (1914--1009) (NB)\",\"ger\":\"Die Frage nach der Mglichkeit von Existenzstzen steht nicht in der Mitte sondern am Uranfang der Logik.<br>\",\"eng\":\"The question about the possibility of existence propositions does not come in the middle but at the very first beginning of logic.<br>\",\"date\":\"1914-10-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,36r[5] (1914--1009) (NB)\",\"ger\":\"Alle Probleme die das Axiom of Infinity mit sich bringt sind schon im Satze (x) x = x zu lsen!<br>\",\"eng\":\"All the problems that come along with the \\\"Axiom of Infinity\\\" have already to be solved in the proposition \\\"(x) x = x\\\".  [<em>Cf</em>. 5.535 (2).]<br>\",\"date\":\"1914-10-09\",\"pt-number\":\"533412\",\"pt-page\":\"59[5]\",\"tlp-number\":\"5535 (2)\",\"cross-references\":\"(9.10.14 (5)+)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,36r[6] (1914--1010) (NB)\",\"ger\":\"Oft macht man eine Bemerkung und sieht erst spter <span class='underline_single'>wie</span> wahr sie ist.<br>\",\"eng\":\"Often one makes a remark and only later sees <span class='underline_single'>how</span> true it is.<br>\",\"date\":\"1914-10-10\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,37r[1] (1914--1011) (NB)\",\"ger\":\"Unsere Schwierigkeit liegt jetzt darin da in der Sprache allem Anscheine nach die Analysierbarkeit oder das Gegenteil nicht wiedergespiegelt wird. Das heit: wir knnen, wie es scheint aus der Sprache allein <span class='underline_single'>nicht</span> entnehmen ob es z.B. wirkliche Subjekt-Prdikat Tatsachen gibt oder nicht. Wie aber <span class='underline_double'>knnten</span> wir diese Tatsache oder ihr Gegenteil <span class='underline_single'>ausdrcken</span>? <span class='underline_single'>Dies </span><span class='underline_single'>mu</span><span class='underline_single'> </span><span class='underline_single'>gezeigt</span> werden!<br>\",\"eng\":\"Our difficulty now lies in the fact that to all appearances analyzability, or its opposite, is not reflected in language. That is to say: we can <span class='underline_single'>not</span>, as it seems, gather from language alone whether there are, for example, real subject-predicate facts or not. But how <span class='underline_double'>could</span> we <span class='underline_single'>express</span> this fact or its opposite? <span class='underline_single'>This must</span> be <span class='underline_single'>shown</span>!<br>\",\"date\":\"1914-10-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,37r[2] et 38r[1] (1914--1011) (NB)\",\"ger\":\"Wie aber, wenn wir uns um die Frage der Zerlegbarkeit gar nicht kmmerten? (Wir wrden dann mit Zeichen arbeiten die nichts bezeichnen, sondern nur, durch ihre logischen Eigenschaften ausdrcken <span class='underline_single'>helfen</span>.) Denn auch der unzerlegte Satz spiegelt ja logische Eigenschaften seiner Bedeutung wieder. Wie also wenn wir sagten: da ein Satz weiter zerlegbar ist / das zeigt sich wenn wir ihn durch Definitionen weiter zerlegen und wir arbeiten mit ihm in jedem Fall gerade so als wre er unanalysierbar.<br>\",\"eng\":\"But suppose we did not bother at all about the question of analyzability? (Then we would work with signs that do not refer to anything, but merely <span class='underline_single'>help</span> to express by their logical properties). For even the unanalysed proposition reflects logical properties of its meaning. Suppose then we said: that a proposition is further analyzable is shown in our further analyzing it by means of definitions, and we work with it in every case just as if it was unanalyzable.<br>\",\"date\":\"1914-10-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,38r[2] (1914--1011) (NB)\",\"ger\":\"Bedenke, da die Stze von den <span class='underline_single'>unendlichen</span> Anzahlen alle mit <span class='underline_single'>endlichen</span> Zeichen dargestellt sind! <br>\",\"eng\":\"Remember that all \\\"theorems about <span class='underline_single'>infinite</span> numbers\\\" are represented using <span class='underline_single'>finite</span> signs.<br>\",\"date\":\"1914-10-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,38r[3] (1914--1011) (NB)\",\"ger\":\"Aber brauchen wir  wenigstens nach Freges Methode  nicht hundert Millionen Zeichen um die Zahl 100.000.000 zu definieren? (Kommt es hier nicht darauf an ob sie auf Klassen oder Dinge angewandt wird?)<br>\",\"eng\":\"But don't we - at least on Frege's method - need a hundred million signs to define the number 100,000,000? (Doesn't this depend on whether it is applied to classes or things?)<br>\",\"date\":\"1914-10-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,38r[4] et 39r[1] (1914--1011) (NB)\",\"ger\":\"Die Stze die von den unendlichen Zahlen handeln knnen wie <span class='underline_single'>alle</span> Stze der Logik dadurch erhalten werden da man die Zeichen selber berechnet (denn es tritt zu den ursprnglichen Urzeichen ja an keiner Stelle ein fremdes Element hinzu), / also mssen auch hier die Zeichen alle logischen Eigenschaften des Dargestellten selber haben.<br>\",\"eng\":\"The propositions dealing with infinite numbers, like <span class='underline_single'>all</span> propositions of logic, can be got by calculating the signs themselves (for at no point does a foreign element get added to the original primitive signs.) So here, too, the signs must themselves have all the logical properties of the representeds.<br>\",\"date\":\"1914-10-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,39r[2] (1914--1012) (NB)\",\"ger\":\"Die triviale Tatsache da ein vollkommen analysierter Satz ebensoviel Namen enthlt als seine Bedeutung Dinge, diese Tatsache ist ein Beispiel der allumfassenden Darstellung der Welt durch die Sprache.<br>\",\"eng\":\"The trivial fact that a completely analyzed proposition contains just as many names as there are things in its reference; this fact is an example of the all-encompassing representation of the world by language.<br>\",\"date\":\"1914-10-12\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,39r[3] (1914--1012) (NB)\",\"ger\":\"Man mte jetzt einmal genauer die Definitionen der Kardinalzahlen untersuchen um den eigentlichen Sinn von Stzen wie dem Axiom of Infinity zu verstehen.<br>\",\"eng\":\"We must now re-examine the definitions of the cardinal numbers more exactly in order to understand the real sense of propositions like the \\\"Axiom of Infinity\\\".<br>\",\"date\":\"1914-10-12\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,39r[4] (1914--1013) (NB)\",\"ger\":\"Die Logik sorgt fr sich selbst; wir mssen ihr nur zusehen wie sie es macht.<br>\",\"eng\":\"Logic takes care of itself; all we have to do is to look and see how it does it. [<em>Cf.</em> 5 .473.]<br>\",\"date\":\"1914-10-13\",\"pt-number\":\" 53062\",\"pt-page\":\"52[4]\",\"tlp-number\":\"5473 (1)\",\"cross-references\":\"22.8.14 (1)  13.10.14 (1)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,39r[5] et 40r[1] (1914--1013) (NB)\",\"ger\":\"Betrachten wir den Satz: Es gibt eine / Klasse mit nur einem Glied. Oder, was auf dasselbe hinauskommt den Satz:<br>Bei (x)x = x konnte man verstehen da er tautologisch sei da er berhaupt nicht hingeschrieben werden knnte wenn er falsch wre, aber hier! <span class='underline_single'>Dieser</span> Satz kann an Stelle des Axiom of Infinity untersucht werden!<br>\",\"eng\":\"Consider the proposition: \\\"There is a class with only one member\\\". Or, what comes to the same thing, the proposition:<br>If we take \\\"(x)x = x\\\" it might be understand to be tautological since it could not be written down at all if it were false, but here! <span class='underline_single'>This</span> proposition can be examined in place of the \\\"Axiom of Infinity\\\"!<br>\",\"date\":\"1914-10-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,40r[2] (1914--1013) (NB)\",\"ger\":\"Ich wei da die folgenden Stze wie sie stehen unsinnig sind: Kann man von den Zahlen reden wenn es nur Dinge gibt? Wenn also z.B. die Welt nur aus einem Dinge bestnde und aus sonst nichts, knnte man sagen es gbe <span class='underline_double'>ein</span> Ding. Russell wrde wahrscheinlich sagen: wenn es ein Ding gibt dann gibt es auch die Funktion (x)  = x. Aber! <br>\",\"eng\":\"I know that the following sentences as they stand are nonsensical: Can one speak of numbers if there are only things? So, for example, if the world consisted of only one thing and of nothing else, could say one that there was <span class='underline_double'>one</span> thing? Russell would probably say: if there is one thing then there is also a function (x)  = x. But! <br>\",\"date\":\"1914-10-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,40r[3] et 41r[1] (1914--1013) (NB)\",\"ger\":\"Wenn es diese Funktion nicht tut dann / kann von der 1 nur die Rede sein wenn es eine materielle Funktion gibt die nur von einem Argument befriedigt wird.<br>\",\"eng\":\"If this function does not do it then we can only talk of 1 if there is a material function which is satisfied by only one argument.<br>\",\"date\":\"1914-10-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,41r[2] (1914--1013) (NB)\",\"ger\":\"Wie verhlt es sich mit Stzen wie: <br>       () . (x) .(x)<br>Ist einer von diesen eine Tautologie? Sind dies Stze einer Wissenschaft, d.h. sind dies berhaupt <span class='underline_single'>Stze</span>?<br>       () . (x) .(x)<br>\",\"eng\":\"       () . (x) .(x)<br>How is it with propositions like: <br>       () . (x) .(x)<br>Is one of these a tautology? Are these propositions of some science, i.e., are they <span class='underline_single'>propositions</span> at all?<br>\",\"date\":\"1914-10-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,41r[3] (1914--1013) (NB)\",\"ger\":\"Erinnern wir uns aber da die <span class='underline_single'>Variable</span> & <span class='underline_single'>nicht</span> die Allgemeinheitsbezeichnung die Logik charakterisieren!<br>\",\"eng\":\"But let us remember that it is the <span class='underline_single'>variables</span> and <span class='underline_single'>not</span> the sign for generality that are characteristic of logic.<br>\",\"date\":\"1914-10-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,41r[4] et 42r[1] (1914--1014) (NB)\",\"ger\":\"Gibt es denn eine Wissenschaft der vollstndig verallgemeinerten Stze? Dies klingt hchst unwahrscheinlich. / <span class='underline_single'>Das ist klar</span>: Wenn es vllig verallgemeinerte <span class='underline_single'>Stze</span> gibt, dann hngt ihr Sinn von keiner willkrlichen Zeichengebung mehr ab! Dann aber kann eine solche Zeichenverbindung die Welt nur durch ihre eigenen logischen Eigenschaften darstellen d.h. sie kann nicht falsch, & nicht wahr sein. Also gibt es keine vollstndig verallgemeinerten <span class='underline_double'>Stze</span>. Aber jetzt die Anwendung!<br>\",\"eng\":\"Is there then such a thing as a science of completely generalized propositions? This sounds highly improbable.   <br><span class='underline_single'>This is clear</span>: If there are completely generalized <span class='underline_single'>propositions</span>, then their sense does not depend on any arbitrary assignment of signs! In that case, such a connection of signs can represent the world only by means of its own logical properties i.e. it cannot be false, and not be true. So there are no completely generalized <span class='underline_double'>propositions</span>. But now the application!<br>\",\"date\":\"1914-10-14\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,42r[2] (1914--1014) (NB)\",\"ger\":\"Nun aber die Stze: (,x) .(x) <br>Welcher von ihnen ist tautologisch welcher kontradiktorisch?<br>\\\"(,x) .(x)\\\"<br>\",\"eng\":\"But now the propositions:<br>\\\"(,x) .(x)\\\"<br>Which of them is tautological, which contradictory?<br>\",\"date\":\"1914-10-14\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,42r[3] et 43r[1] (1914--1014) (NB)\",\"ger\":\"Immer wieder entsteht das Bedrfnis nach einer vergleichenden Zusammenstellung von Stzen die in internen Beziehungen stehen. Man knnte zu diesem Buch geradezu Bildertafeln anlegen. / <br>(Die Tautologie <span class='underline_single'>zeigt</span> was sie zu <span class='underline_single'>sagen</span> scheint, die Kontradiktion zeigt <span class='underline_single'>das Gegenteil</span> von dem was sie zu sagen scheint.)<br>\",\"eng\":\"Again and again the need arises for a comparative compilation of propositions standing in internal relations. This book might well be constructed around such illustrations.<br>(A tautology <span class='underline_single'>shows</span> what it appears to <span class='underline_single'>say</span>, a contradiction shows the <span class='underline_single'>opposite</span> of what it appears to say).<br>\",\"date\":\"1914-10-14\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,43r[2] (1914--1014) (NB)\",\"ger\":\"Es ist klar da wir alle berhaupt mglichen vllig allgemeinen Stze bilden knnen sobald uns nur <span class='underline_single'>eine</span> <span class='underline_single'>Sprache</span> gegeben ist. Und darum ist es doch kaum zu glauben da solche Zeichenverbindungen wirklich etwas ber die Welt aussagen sollten.  Andererseits aber dieser graduelle bergang vom elementaren Satz zum vllig allgemeinen!!<br>\",\"eng\":\"It is clear that we can form all the completely general sentences that are possible at all as soon as we are given just <span class='underline_single'>one</span><span class='underline_single'> language</span>. And that is why it is scarcely credible that such combinations of signs should really state anything about the world.  On the other hand, however, this gradual transition from an elementary proposition to a completely general one!!<br>\",\"date\":\"1914-10-14\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,43r[3] (1914--1014) (NB)\",\"ger\":\"Man kann sagen: die vllig allgemeinen Stze kann man alle <span class='underline_single'>a priori</span> bilden.<br>\",\"eng\":\"One can say: completely general propositions can all be formed <span class='underline_single'><em>a priori</em></span>.<br>\",\"date\":\"1914-10-14\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,43r[4] et 44r[1] (1914--1015) (NB)\",\"ger\":\"Es scheint doch als knnte die bloe Existenz der in (x,).x enthaltenen / Formen die Wahr- oder Falschheit dieses Satzes <span class='underline_single'>allein nicht</span> bestimmen! Es scheint also nicht <span class='underline_single'>undenkbar</span> da, z.B., die Verneinung keines Elementarsatzes wahr sei. Aber wrde diese Aussage nicht schon den <span class='underline_double'>Sinn</span> <span class='underline_single'>der Verneinung</span> betreffen?<br>\",\"eng\":\"Yet it does <span class='underline_single'>not</span> look as if the mere existence of the forms contained in \\\"(x,).x\\\" could <span class='underline_single'>by itself</span> determine the truth or falsity of this proposition! So it does not appear <span class='underline_single'>unthinkable</span> that, e.g., the negation of no elementary proposition should be true. But wouldnt this statement already concern the <span class='underline_double'>sense</span> <span class='underline_single'>of negation</span>?<br>\",\"date\":\"1914-10-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,44r[2] (1914--1015) (NB)\",\"ger\":\"Offenbar knnen wir jeden ganz allgemeinen Satz auffassen als die Bejahung oder Verneinung der Existenz irgend einer Art von Tatsachen. Aber gilt dies nicht von allen Stzen?<br>\",\"eng\":\"Obviously, we can conceive every entirely general proposition as the affirmation or negation of the existence of some kind of facts. But does this not hold of all propositions?<br>\",\"date\":\"1914-10-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,44r[3] (1914--1015) (NB)\",\"ger\":\"Jede Zeichenverbindung die etwas ber ihren eigenen Sinn auszusagen scheint ist ein Scheinsatz (wie alle Stze der Logik).<br>\",\"eng\":\"Every combinations of signs which appears to say something about its own sense is a pseudo-proposition (like all propositions of logic).<br>\",\"date\":\"1914-10-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,44r[4] et 45r[1] (1914--1015) (NB)\",\"ger\":\"Der Satz soll einen Sachverhalt logisch vorbilden. Das kann er aber doch nur dadurch, da seinen Elementen willkrlich Gegenstnde / zugeordnet wurden. Wenn dies nun im ganz allgemeinen Satz nicht der Fall ist so ist nicht einzusehen wie er etwas auerhalb ihm darstellen soll.<br>\",\"eng\":\"A proposition is supposed to logically prefigure a state of things. It can surely only do this because objects have beeen arbitrarily correlated with its elements. Now if this is not the case in the entirely general proposition, then it is difficult to see how it should represent anything outside itself.<br>\",\"date\":\"1914-10-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,45r[2] (1914--1015) (NB)\",\"ger\":\"Im Satze stellen wir  sozusagen  <span class='underline_single'>zur Probe</span> die Dinge zusammen wie sie sich in Wirklichkeit aber <span class='underline_single'>nicht</span> zu verhalten brauchen, wir knnen aber nicht etwas <span class='underline_single'>Unlogisches</span> zusammenstellen denn dazu mten wir in der Sprache aus der Logik heraus knnen.  Wenn aber der ganz allgemeine Satz <span class='underline_single'>nur</span> <span class='underline_single'>logische</span> Konstante enthlt so kann er fr uns nicht mehr sein als  einfach  ein logisches Gebilde und kann nicht mehr tun als uns seine eigenen logischen Eigenschaften zu zeigen.  Wenn es ganz allgemeine Stze gibt,  <span class='underline_single'>was</span> stellen wir in ihnen probeweise zusammen??<br>\",\"eng\":\"In a proposition we  so to speak  <span class='underline_single'>try out</span> putting things together as they do <span class='underline_single'>not</span> have to be in reality; but we cannot make any <span class='underline_single'>unlogical</span> arrangement, for in order to do that we would have to be able to get outside logic within language.  But if the entirely general proposition contains <span class='underline_single'>only</span> \\\"<span class='underline_single'>logical</span> constants\\\", then it cannot be anything more to us than  simply  a logical formation and cannot do anything more than show us its own logical properties.  If there are entirely general propositions  <span class='underline_single'>what</span> do we try out in arranging them? [Cf 4.031 (1) and 3.03.]<br>\",\"date\":\"1914-10-15\",\"pt-number\":\"40711\",\"pt-page\":\"48[2]\",\"tlp-number\":\"4031 (1)\",\"cross-references\":\"29.9.14 (2)**  15.10.14 (5)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,46r[1] (1914--1015) (NB)\",\"ger\":\"Wenn man sich vor der Wahrheit frchtet (wie ich jetzt) so ahnt man nie die <span class='underline_single'>volle</span> Wahrheit.<br>\",\"eng\":\"If one is afraid of the truth (as I am now) then it is never the <span class='underline_single'>whole</span> truth that one suspects.<br>\",\"date\":\"1914-10-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,46r[2] (1914--1015) (NB)\",\"ger\":\"Ich habe hier die Beziehungen der Satz-Elemente zu ihren Bedeutungen gleichsam als Fhler betrachtet durch welche der Satz mit der Auenwelt in Berhrung steht; und das Verallgemeinern eines Satzes gleicht dann dem Einziehen der Fhler; bis endlich der ganz allgemeine Satz ganz isoliert ist. Aber stimmt dieses Bild? (Ziehe ich wirklich einen Fhler ein wenn ich statt (a), (x).(x) sage?)<br>\",\"eng\":\"Here I have regarded the relations of the propositions elements to their meanings as antennae, so to speak, by means of which a proposition is in contact with the outer world. The generalization of a proposition then resembles the retraction of antennae, until finally an entirely general proposition is completely isolated. But is this picture correct? (Do I really retract an antenna if I say (x).(x) instead of (a)?) [<em>Cf </em>2.1515.]<br>\",\"date\":\"1914-10-15\",\"pt-number\":\" 21516\",\"pt-page\":\"14[10]\",\"tlp-number\":\"21515\",\"cross-references\":\"15.10.14 (7)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,46r[3] et 47r[1] (1914--1016) (NB)\",\"ger\":\"Nun scheint es aber als sprchen genau dieselben Grnde die ich anfhrte um zu zeigen da (x,) . (x) nicht falsch sein <span class='underline_single'>k</span><span class='underline_single'></span><span class='underline_single'>nne</span>, als sprchen diese Grnde auch dafr da ~ (x,) . (x) nicht / falsch sein knne; und hier zeigt sich ein grundlegender Fehler. Denn es ist gar nicht einzusehen warum gerade der erste Satz & nicht der zweite eine Tautologie sein soll. Vergi doch nicht da auch die Kontradiktion p  ~p etc. etc. nicht wahr sein kann & doch selbst ein logisches Gebilde ist.<br>\",\"eng\":\"Now, however, it looks as if exactly the same reasons I used to show that \\\"(x,) . (x)\\\" <span class='underline_single'>could</span> not be false, are also reasons that can be used to show that \\\"~ (x,) . (x)\\\" could not be false; and here a fundamental mistake becomes apparent. For it is quite impossible to see why just the first proposition and not the second is supposed to be a tautology. But dont forget that also the contradiction \\\"p  ~p\\\" etc. etc. can't be true and is nevertheless itself a logical formation.<br>\",\"date\":\"1914-10-16\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,47r[2] (1914--1016) (NB)\",\"ger\":\"Angenommen da keine Verneinung eines Elementarsatzes wahr ist hat in diesem Falle Verneinung nicht einen anderen Sinn als im entgegengesetzten Fall?<br>\",\"eng\":\"Supposing that no negation of an elementary proposition is true, doesn't \\\"negation\\\" have a different sense in this case than in the opposite case?<br>\",\"date\":\"1914-10-16\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,47r[3] (1914--1016) (NB)\",\"ger\":\"<span class='underline_single'> (</span><span class='underline_single'></span><span class='underline_single'></span><span class='underline_single'>):(</span><span class='underline_single'>x).</span><span class='underline_single'></span><span class='underline_single'>x</span><span class='underline_single'></span>  von diesem Satz scheint es fast gewi da er weder eine Tautologie noch eine Kontradiktion ist. Hier spitzt sich das Problem unerhrt zu.<br>\",\"eng\":\"<span class='underline_single'>\\\"(</span><span class='underline_single'></span><span class='underline_single'></span><span class='underline_single'>):(</span><span class='underline_single'>x).</span><span class='underline_single'></span><span class='underline_single'>x\\\"</span> - of this proposition it appears almost certain that it is neither a tautology nor a contradiction. Here the problem becomes extremely pointed.<br>\",\"date\":\"1914-10-16\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,47r[4] et 48r[1] (1914--1017) (NB)\",\"ger\":\"Wenn es ganz allgemeine Stze gibt so / scheint es also als wren solche Stze probeweise Zusammenstellungen logischer Konstanten. (!)<br>\",\"eng\":\"If there are entirely general propositions then it looks as if such propositions were trial arrangements of \\\"logical constants\\\". (!)<br>\",\"date\":\"1914-10-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,48r[2] (1914--1017) (NB)\",\"ger\":\"Kann man denn aber nicht die ganze Welt vollstndig mit ganz allgemeinen Stzen beschreiben? (Das Problem zeigt sich von allen Seiten.) Ja, man knnte die Welt vollstndig durch ganz allgemeine Stze beschreiben also ganz ohne irgend einen Namen oder sonst ein bezeichnendes Zeichen zu verwenden. Und um auf die gewhnliche Sprache zu kommen brauchte man Namen etc. nur dadurch einfhren indem man nach einem (x) sagte und dieses x ist A u.s.w.<br>\",\"eng\":\"But can't one describe the whole world completely by means of entirely general propositions? (The problem shows up on all sides.) Yes, one could describe the world completely by entirely general propositions, and hence wholly without using any kind of name or any other referring sign. And in order to arrive at ordinary language one would only need to introduce names etc. by saying after an \\\"(x)\\\", \\\"and that x is A\\\" and so on. [<em>Cf</em>. 5.526.]<br>\",\"date\":\"1914-10-17\",\"pt-number\":\" 5324\",\"pt-page\":\"            63[1]\",\"tlp-number\":\"5526 (2)*\",\"cross-references\":\"17.10.14 (3)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,48r[3] (1914--1017) (NB)\",\"ger\":\"Man kann also ein Bild der Welt entwerfen ohne zu sagen was was darstellt.<br>\",\"eng\":\"Thus one can outline a picture of the world without saying what is a represention of what.<br>\",\"date\":\"1914-10-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,49r[1] (1914--1017) (NB)\",\"ger\":\"Nehmen wir z.B. an die Welt bestnde aus den Dingen A und B und der Eigenschaft F und es wre F(A) der Fall und nicht F(B).<br>Diese Welt knnten wir auch durch die folgenden Stze beschreiben:<br>      ().(). = <br>Und hier braucht man auch Stze von der Art der letzten zwei nur die Gegenstnde identifizieren zu knnen.<br>      ().(). = <br>\",\"eng\":\"      ().(). = <br>Suppose, for example, that the world consisted of the things A and B and the property F, and that F(A) were the case and not F(B).<br>We could also describe this world by means of the following propositions:<br>      ().(). = <br>And here one also needs propositions of the type of the last two just to be able to identify the objects.<br>\",\"date\":\"1914-10-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,49r[2] (1914--1017) (NB)\",\"ger\":\"Aus alledem folgt natrlich da es <span class='underline_single'>ganz allgemeine Stze gibt</span>!<br>\",\"eng\":\"From all this, of course, it follows that <span class='underline_single'>there are </span><span class='underline_single'>entirely </span><span class='underline_single'>general propositions</span>!<br>\",\"date\":\"1914-10-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,49r[3] et 50r[1] (1914--1017) (NB)\",\"ger\":\"Gengt oben nicht der erste Satz (x, y, ) x.~y  x  y?<br>/ Die Schwierigkeit der Identifizierung kann man dadurch wegschaffen indem man die ganze Welt in <span class='underline_single'>einem</span> allgemeinen Satz beschreibt welcher anfngt: (x, y, z  ,  R, S etc.) und nun folgt ein logisches Produkt etc.<br>\",\"eng\":\"Isnt the first proposition above enough: (x, y, ) x.~y  x  y?<br>The difficulty of identification can be done away with by describing the whole world in a single general proposition which starts: \\\"(x, y, z ... ,  ...R, S etc.)\\\" and now follows a logical product, etc.<br>\",\"date\":\"1914-10-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,50r[2] (1914--1017) (NB)\",\"ger\":\"Wenn wir sagen  ist eine Einheitsfunktion und (x).x so heit das soviel wie: es gibt nur ein Ding! (Wir sind hiermit <span class='underline_single'>scheinbar</span> um den Satz (x) . (y) . y = x herumgekommen.)<br>\",\"eng\":\"If we say \\\" is a unit function and (x).x\\\" it means something like \\\"There is only one thing\\\"! (By this means we have <span class='underline_single'>apparently</span> got round the proposition \\\"(x) . (y) . y = x.\\\")<br>\",\"date\":\"1914-10-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,50r[3] (1914--1018) (NB)\",\"ger\":\"Mein Fehler liegt offenbar in einer falschen Auffassung der logischen Abbildung durch den Satz.<br>\",\"eng\":\"My mistake obviously lies in a false conception of logical depiction by a proposition.<br>\",\"date\":\"1914-10-18\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,50r[4] et 51r[1] (1914--1018) (NB)\",\"ger\":\" / \\\\\\tEine Aussage kann nicht den logischen Bau der Welt betreffen, denn damit eine Aussage berhaupt mglich sei, damit ein Satz <span class='underline_double'>Sinn</span> haben / <span class='underline_double'>kann</span>, mu die Welt schon den logischen Bau haben, den sie eben hat. Die Logik der Welt ist aller Wahr- & Falschheit primr.<br><span class='underline_single'>Beilufig</span> gesprochen: bevor irgend ein Satz berhaupt Sinn haben kann mssen die <span class='underline_single'>logischen</span> Konstanten Bedeutung haben.<br>\",\"eng\":\"A statement can't be concerned with the logical construction of the world, for in order for a statement to be possible at all, in order for a proposition to be <span class='underline_double'>capable</span> of making <span class='underline_double'>sense</span>, the world must already have just the logical construction that it has. The logic of the world is prior to all truth & falsity.<br>Roughly speaking: before any proposition can make sense at all, the <span class='underline_single'>logical</span> constants must have meaning. \\t\\t <br>\",\"date\":\"1914-10-18\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,51r[2] (1914--1019) (NB)\",\"ger\":\"Die Beschreibung der Welt durch Stze ist nur dadurch mglich da das Bezeichnete nicht sein eigenes Zeichen ist! Anwendung .<br>\",\"eng\":\"The description of the world by means of propositions is only possible because what is signified is not its own sign! Application -.<br>\",\"date\":\"1914-10-19\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,51r[3] (1914--1019) (NB)\",\"ger\":\"Beleuchtung von Kants Frage wie ist reine Mathematik mglich durch die Theorie der Tautologien!<br>\",\"eng\":\"Light on Kant's question \\\"How is pure mathematics possible?\\\" through the theory of tautologies.<br>\",\"date\":\"1914-10-19\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,51r[4] (1914--1019) (NB)\",\"ger\":\"Es leuchtet ein da man den Bau der Welt ohne irgend welche <span class='underline_single'>Namen</span> zu <span class='underline_single'>nennen</span> beschreiben knnen mu. <br>\",\"eng\":\"It is obvious that we must be able to describe the construction of the world without mentioning any <span class='underline_single'>names</span>. [<em>Cf</em><em>.</em> 5.526 (1).]<br>\",\"date\":\"1914-10-19\",\"pt-number\":\" 5323\",\"pt-page\":\"62[4]\",\"tlp-number\":\"5526 (1)\",\"cross-references\":\"17.10.14 (3)* 19.10.14 (3)**   31.5.15 (1,4)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,52r[1] (1914--1020) (NB)\",\"ger\":\"Aus dem Satz mu man den logischen Bau des Sachverhaltes ersehen der ihn wahr oder falsch macht. (Wie ein Bild zeigen mu in welchen rumlichen Beziehungen die darauf wiedergegebenen Dinge stehen mssen wenn das Bild richtig (wahr) ist.)<br>\",\"eng\":\"A proposition must enable us see the logical construction of the state of things that makes it true or false. (As a picture must show the spatial relations in which the things represented in it must stand if the picture is correct (true).)<br>\",\"date\":\"1914-10-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,52r[2] (1914--1020) (NB)\",\"ger\":\"Die Form eines Bildes knnte man dasjenige nennen worin das Bild mit der Wirklichkeit stimmen <span class='underline_double'>mu</span> (um sie berhaupt abbilden zu knnen).<br>\",\"eng\":\"The form of a picture might be called that in which the picture <span class='underline_double'>must</span> agree with reality (in order to be able to depict it in any way at all). [<em>Cf. </em>2.17 and 2.18.]<br>\",\"date\":\"1914-10-20\",\"pt-number\":\" 218 \",\"pt-page\":\"6[3]\",\"tlp-number\":\"218**\",\"cross-references\":\"20.10.14 (2,4)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,52r[3] (1914--1020) (NB)\",\"ger\":\"Die Theorie der logischen Abbildung durch die Sprache gibt als erste einen Aufschlu ber das Wesen der Wahrheits-Beziehung.<br>\",\"eng\":\"The first thing that the theory of logical depiction by means of language gives us is an insight into the nature of the truth-relation.<br>\",\"date\":\"1914-10-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,52r[4] et 53r[1] (1914--1020) (NB)\",\"ger\":\"Die Theorie der logischen Abbildung durch die / Sprache sagt  ganz allgemein: Damit es mglich ist da ein Satz wahr oder falsch sei  da er mit der Wirklichkeit bereinstimme oder nicht  dazu mu im Satze etwas mit der Wirklichkeit <span class='underline_single'>identisch</span> sein.<br>\",\"eng\":\"The theory of logical depiction by means of language says - entirely generally: In order for it to be possible for a proposition to be true or false - agree reality or not - something in the proposition must be <em>identical</em> with reality. [<em>Cf. </em>2.18.]<br>\",\"date\":\"1914-10-20\",\"pt-number\":\" 218 \",\"pt-page\":\"6[3]\",\"tlp-number\":\"218**\",\"cross-references\":\"20.10.14 (2,4)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,53r[2] (1914--1020) (NB)\",\"ger\":\"Das was in ~p verneint ist nicht das ~ vor dem p sondern dasjenige was allen Zeichen die in dieser Notation mit ~p gleichbedeutend sind gemeinsam ist; also das Gemeinsame von <br>\",\"eng\":\"What negates in \\\"~p\\\" is not the \\\"~\\\" in front of the \\\"p\\\", rather it is done by what all signs that have the same meaning as \\\"~p\\\" in this notation have in common; and so the common factor in\\t\\t <br>\",\"date\":\"1914-10-20\",\"pt-number\":\" 5313\",\"pt-page\":\"61[7]\",\"tlp-number\":\"5512 (2-3)*\",\"cross-references\":\"20.10.14 (5)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,53r[3] (1914--1020) (NB)\",\"ger\":\"Scheinstze sind solche, die, wenn analysiert, das was sie <span class='underline_single'>sagen</span> sollten doch nur wieder <span class='underline_single'>zeigen</span>.<br>\",\"eng\":\"Pseudo-propositions are such as, when analyzed, turn out after all only to <span class='underline_single'>show</span> what they were supposed to <span class='underline_single'>say</span>.<br>\",\"date\":\"1914-10-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,54r[1] (1914--1020) (NB)\",\"ger\":\"Das Gefhl da der Satz einen Komplex auf die Art der Russellschen Beschreibungen beschreibe rechtfertigt sich jetzt: Der Satz beschreibt den Komplex durch seine logischen Eigenschaften.<br>\",\"eng\":\"Here we have a justification for the feeling that the proposition describes a complex in the kind of way Russellian descriptions do: the proposition describes the complex by means of its logical properties.<br>\",\"date\":\"1914-10-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,54r[2] (1914--1020) (NB)\",\"ger\":\"Der Satz konstruiert eine Welt mit Hilfe seines logischen Gerstes und darum kann man am Satz auch sehen wie sich alles Logische verhielte wenn er wahr wre: man kann aus einem falschen Satz <span class='underline_single'>Schlsse</span> <span class='underline_single'>ziehen</span> etc. So kann ich sehen da, wenn (x,). (x) wahr wre, dieser Satz im Widerspruch stnde mit einem Satze (a).)<br>\",\"eng\":\"Propositions construct a world with the help of their logical scaffolding, which is why one can actually see from propositions how all logical matters would stand, if they are true: one can <span class='underline_single'>draw inferences</span> from a false proposition, etc. (In this way I can see that if \\\"(x,). (x)\\\" were true, this proposition would contradict a proposition \\\"(a)\\\"). [<em>Cf</em>. 4.023.]<br>\",\"date\":\"1914-10-20\",\"pt-number\":\" 402322\",\"pt-page\":\"47[8]\",\"tlp-number\":\"4023 (5)**\",\"cross-references\":\"20.10.14 (8)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,54r[3] et 55r[1] (1914--1020) (NB)\",\"ger\":\" Da sich von materiellen Stzen auf ganz allgemeine Stze schlieen lt  da diese zu jenen in <span class='underline_single'>bedeutungs</span>vollen internen Beziehungen stehen knnen  zeigt da die ganz allgemeinen / Stze logische Konstruktionen von Sachverhalten sind.<br>\",\"eng\":\"The  possibility of inferring entirely general propositions from material propositions  the fact that the former can stand in <span class='underline_single'>meaningful</span> internal relations with the latter - shows that entirely general propositions are logical constructions from states of things.<br>\",\"date\":\"1914-10-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,55r[2] (1914--1021) (NB)\",\"ger\":\"Ist die Russellsche Definition der Null nicht unsinnig? Kann man von einer Klasse x (x  x) berhaupt reden?  Kann man denn von einer Klasse x (x = x) reden? Ist denn x  x oder x = x eine Funktion von x??  Mu nicht die Null definiert werden durch die <span class='underline_single'>Hypothese</span> ():(x)~x? Und Analoges wrde von allen anderen Zahlen gelten. Dies nun wirft ein Licht auf die ganze Frage nach der Existenz von Anzahlen von Dingen.<br>\",\"eng\":\"Isn't the Russellian definition of zero nonsensical? Can one speak of a class x (x  x) at all?  Can one speak of a class x (x = x)? Is then x  x or x = x a function of x?? - Must not 0 be defined by means of the <span class='underline_single'>hypothesis</span> ():(x)~x? And something analogous would hold of all other numbers. Now this throws light on the whole question about the existence of numbers of things.<br>\",\"date\":\"1914-10-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,55r[3] (1914--1021) (NB)\",\"ger\":\"0 = {():(x)~x . = u (u)} Def<br>[Das Gleichheitszeichen in der geschweiften Klammer knnte man <span class='underline_single'>vermeiden</span> wenn man schriebe<br>0 = u(u) {() : (x)~x}.]<br>\",\"eng\":\"0 = {():(x)~x . = u (u)} Def<br>[The equals sign in the curly bracket could be avoided if one wrote<br>0 = u(u) {() : (x)~x}.]<br>\",\"date\":\"1914-10-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,56r[1] (1914--1021) (NB)\",\"ger\":\"Der Satz mu die <span class='underline_single'>Mglichkeit seiner Wahrheit enthalten</span> (und so zeigen). Aber nicht mehr als die <span class='underline_single'>Mglichkeit</span>.<br>\",\"eng\":\"The proposition must <span class='underline_single'>contain</span> (and in this way show) the <span class='underline_single'>possibility of its truth</span>. But not more than the <span class='underline_single'>possibility</span>. [Cf. 2.203, 3.02 and 3.13.]<br>\",\"date\":\"1914-10-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,56r[2] (1914--1021) (NB)\",\"ger\":\"Nach meiner Definition der Klassen ist (x).~ x(x) die Aussage da x(x) null ist und die Definition der Null ist dann 0 =  [(x).~] Def.<br>\",\"eng\":\"By my definition of classes, (x).~ x(x) is the statement that x(x) is zero and the definition of 0 is in that case 0 =  [(x).~] Def.<br>\",\"date\":\"1914-10-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,56r[3] (1914--1021) (NB)\",\"ger\":\"Ich dachte, die Mglichkeit der Wahrheit eines Satzes (a) ist an die Tatsache (x,) .x gebunden. Aber es ist nicht einzusehen warum a nur dann mglich sein soll wenn es einen anderen Satz derselben Form gibt. a braucht doch keinen Przedenzfall. (Denn angenommen es gbe nur die beiden Elementarstze a & a und a sei falsch: warum soll dieser Satz nur dann einen Sinn haben wenn a wahr ist?!)<br>\",\"eng\":\"I thought the possibility of the truth of a proposition (a) is tied up with the fact (x,).x. But it is impossible to see why a should only be possible if there is another proposition of the same form. Surely a needs no precedent. (For suppose that there existed only the two elementary propositions \\\"a\\\" & \\\"a\\\" and \\\"a\\\" was false: why should this proposition only make sense if \\\"a\\\" is true?!)<br>\",\"date\":\"1914-10-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,56r[4] et 57r[1] et 58r[1] (1914--1022) (NB)\",\"ger\":\"Im Satz mu etwas mit seiner / Bedeutung identisch sein, der Satz darf aber nicht mit seiner Bedeutung identisch sein, also mu etwas in ihm mit seiner Bedeutung <span class='underline_single'>nicht</span> identisch sein. (Der Satz ist ein Gebilde mit den logischen Zgen des Dargestellten und mit noch anderen Zgen, diese nun werden willkrlich sein und in verschiedenen Zeichensprachen verschieden.) Es mu also verschiedene Gebilde mit denselben logischen Zgen geben; das Dargestellte wird eines von diesen sein und es wird sich bei der Darstellung darum handeln dieses von anderen Gebilden mit denselben logischen Zgen zu unterscheiden (da ja sonst die Darstellung nicht eindeutig wre). Dieser Teil der Darstellung (die Namengebung) mu nun durch willkrliche Bestimmungen geschehen. Es mu darnach also jeder Satz Zge mit willkrlich bestimmten / Bedeutungen enthalten.<br>\",\"eng\":\"In a proposition something must be identical with its meaning, but a proposition cannot be identical with its meaning, and so something in it must <span class='underline_single'>not</span> be identical with its meaning. (A proposition is a formation with the logical features of what it represents and with other features as well, which will be arbitrary and different in different sign-languages). So there must be different formations with the same logical features; what is represented will be one of them, and the representation will need to distinguish it from other formations with the same logical features. (Since otherwise the representation would be ambiguous). Now this part of the representation (the naming) must happen by means of arbitrary assignations. Thus, every proposition must contain features with arbitrarily assigned meanings. [<em>Cf</em>. 3.34 (2).]<br>\",\"date\":\"1914-10-22\",\"pt-number\":\" 323\",\"pt-page\":\"24[10]\",\"tlp-number\":\"334 (2)*\",\"cross-references\":\"22.10.14 (1)+ \",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,58r[2] (1914--1022) (NB)\",\"ger\":\"Versucht man dies auf die ganz allgemeinen Stze anzuwenden so scheint es da darin irgend ein grundlegender Fehler ist.<br>\",\"eng\":\"If one tries to apply this to an entirely general proposition, it appears that there is some fundamental mistake in it.<br>\",\"date\":\"1914-10-22\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,58r[3] (1914--1022) (NB)\",\"ger\":\"Die Allgemeinheit des ganz allgemeinen Satzes ist die zufllige. Er handelt von allen Dingen die es zuflligerweise gibt. Und darum ist er ein materieller Satz.<br>\",\"eng\":\"The generality of the entirely general proposition is an accidental generality. It deals with all things that there chance to be. And that is why it is a material proposition.<br>\",\"date\":\"1914-10-22\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,58r[4] (1914--1023) (NB)\",\"ger\":\"Einerseits scheint meine Theorie der logischen Abbildung die einzig mgliche andererseits scheint in ihr ein unlslicher Widerspruch zu sein!<br>\",\"eng\":\"On the one hand my theory of logical depiction seems to be the only possible one, on the other hand there seems to be an insoluble contradiction in it!<br>\",\"date\":\"1914-10-23\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,58r[5] (1914--1023) (NB)\",\"ger\":\"Wenn der ganz allgemeine Satz nicht ganz entmaterialisiert ist so wird ein Satz durch die Verallgemeinerung wohl berhaupt nicht entmaterialisiert, wie ich glaubte.<br>\",\"eng\":\"If the entirely general proposition is not wholly dematerialized, then a proposition does not get dematerialized at all through generalization, as I used to believe.<br>\",\"date\":\"1914-10-23\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,59r[1] (1914--1023) (NB)\",\"ger\":\" Ob ich von einem bestimmten Ding oder von allen Dingen die es gibt etwas aussage, die Aussage ist gleich materiell.<br>\",\"eng\":\"Whether I assert something about a particular thing or of all things that there are, the assertion is equally material.<br>\",\"date\":\"1914-10-23\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,59r[2] (1914--1023) (NB)\",\"ger\":\"Alle Dinge, das ist sozusagen eine Beschreibung statt a & b & c.<br>\",\"eng\":\"\\\"All things,\\\" that is, so to speak, is a description taking the place of \\\"a and b and c.\\\"<br>\",\"date\":\"1914-10-23\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,59r[3] (1914--1023) (NB)\",\"ger\":\"Wie, wenn unsere Zeichen ebenso unbestimmt wren wie die Welt welche sie spiegeln?<br>\",\"eng\":\"What if our signs were just as indeterminate as the world they mirror?<br>\",\"date\":\"1914-10-23\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,59r[4] (1914--1023) (NB)\",\"ger\":\"Um das Zeichen im Zeichen zu erkennen mu man auf den Gebrauch achten.<br>\",\"eng\":\"To recognize the sign in the sign one must pay attention to its use. [<em>Cf</em>. 3.326.]<br>\",\"date\":\"1914-10-23\",\"pt-number\":\" 3252\",\"pt-page\":\"55[2]\",\"tlp-number\":\"3326**\",\"cross-references\":\"23.10.14 (6)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,59r[5] et 60r[1] (1914--1023) (NB)\",\"ger\":\"Wollten wir dasjenige welches wir durch (x).(x) ausdrcken durch das Vorsetzen eines Index vor (x) ausdrcken etwa so Allg.(x), es wrde nicht gengen (wir wten nicht was verallgemeinert wurde).<br>Wollten wir es durch einen Index am x anzeigen etwa so (xA) es wrde / auch nicht gengen (wir wten auf diese Weise nicht den Bereich der Allgemeinheit.).<br>Wollten wir es durch Einfllen einer Marke in die leeren Argumentstellen versuchen etwa so (A,A).(A,A) es wrde nicht gengen (wir knnten die Identitt der Variablen nicht feststellen). Alle diese Bezeichnungsweisen gengen nicht <span class='underline_single'>weil sie nicht die notwendigen logischen Eigenschaften haben</span>. Alle jene Zeichenverbindungen vermgen den gewnschten Sinn  auf die vorgeschlagene Weise  nicht abzubilden.<br>\",\"eng\":\"If we wanted to express what is expressed by \\\"(x).(x)\\\", say by putting an index in front of \\\"(x)\\\" such as \\\"Gen.(x)\\\", it would not suffice (we would not know what was generalized).<br>If we tried to indicate it by adding an index \\\"x\\\" like this (xA) it still would not suffice (we would not know the scope of the sign of generality in this way.)<br>If we tried to do it by inserting a mark into the empty argument places   such as \\\"(A,A).(A,A)\\\"  it would not suffice (we could not ascertain the identity of the variables). All these modes of signifying are insufficient <span class='underline_single'>because they do not have the necessary logical properties</span>. All those combinations of signs are incapable of depicting the requisite sense - in the proposed way. [<em>Cf</em>. 4. 0411.]<br>\",\"date\":\"1914-10-23\",\"pt-number\":\" 40742\",\"pt-page\":\"76[5]\",\"tlp-number\":\"40411* \",\"cross-references\":\"23.10.14 (7,8,9,10)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,60r[2] (1914--1024) (NB)\",\"ger\":\"Um berhaupt eine Aussage machen zu knnen mssen wir  in einem Sinne  wissen wie es sich verhlt wenn die Aussage wahr ist (und dies bilden wir eben ab).<br>\",\"eng\":\"In order to be able to frame a statement at all, we must - in some sense  know how things stand if the statement is true (and that is just what we depict).  [<em>Cf</em>. 4.024.]<br>\",\"date\":\"1914-10-24\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,60r[3] et 61r[1] (1914--1024) (NB)\",\"ger\":\"Der Satz <span class='underline_single'>drckt aus</span> was ich nicht wei, was ich aber doch wissen mu um ihn / berhaupt aussagen zu knnen das <span class='underline_single'>zeige ich in ihm</span>.<br>\",\"eng\":\"A proposition <span class='underline_single'>expresses</span> what I do not know, but what I must know in order to be able to say it at all, <span class='underline_single'>I show in it</span>.<br>\",\"date\":\"1914-10-24\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,61r[2] (1914--1024) (NB)\",\"ger\":\"Die Definition ist eine Tautologie und zeigt interne Relationen zwischen ihren beiden Gliedern!<br>\",\"eng\":\"A definition is a tautology and shows internal relations between its two terms.<br>\",\"date\":\"1914-10-24\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,61r[3] (1914--1025) (NB)\",\"ger\":\"Warum aber untersuchst Du nie ein einzelnes spezielles Zeichen auf die Art & Weise hin wie es logisch abbildet?<br>\",\"eng\":\"But why do you never investigate an individual particular sign to find out how it is a logical depiction?<br>\",\"date\":\"1914-10-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,61r[4] (1914--1025) (NB)\",\"ger\":\"Der vollkommen analysierte Satz mu seine Bedeutung vorstellen.<br>\",\"eng\":\"The completely analyzed proposition must betoken its meaning.<br>\",\"date\":\"1914-10-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,61r[5] et 62r[1] (1914--1025) (NB)\",\"ger\":\"Man knnte auch sagen, unsere Schwierigkeit luft da hinaus da der ganz allgemeine Satz nicht zusammengesetzt zu sein scheint. .<br>Er scheint nicht wie alle anderen Stze aus willkrlich bezeichnenden Bestandteilen zu bestehen die in einer logischen Form vereinigt sind. Er scheint / keine Form zu <span class='underline_double'>haben</span> sondern selbst eine in sich abgeschlossene Form zu sein.<br>\",\"eng\":\"One might also say that our difficulty arises out of the entirely general propositions not appearing to be composite. .<br>It does not appear, like all other propositions, to consist of arbitrarily signifying constituents which are united in a logical form. It appears not to <span class='underline_double'>have</span> a form but itself to be a self-contained form.<br>\",\"date\":\"1914-10-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,62r[2] (1914--1025) (NB)\",\"ger\":\"Man braucht bei den logischen Konstanten nie nach ihrer Existenz zu fragen, sie knnen ja auch <span class='underline_single'>verschwinden</span>!<br>\",\"eng\":\"With the logical constants one need never ask whether they exist, for they can even <span class='underline_single'>vanish</span>!<br>\",\"date\":\"1914-10-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,62r[3] (1914--1025) (NB)\",\"ger\":\"Warum soll (x) nicht vorstellen wie (x).x ist? Kommt es da nicht <span class='underline_single'>nur</span> darauf an <span class='underline_single'>wie</span>  auf welche Art & Weise  jenes Zeichen etwas vorstellt?<br>\",\"eng\":\"Why should \\\"(x)\\\" not betoken how (x).x is the case? Doesn't it all depend here <span class='underline_single'>only</span> on <span class='underline_single'>how</span> - in what kind of way - that sign betokens something?<br>\",\"date\":\"1914-10-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,62r[4] (1914--1025) (NB)\",\"ger\":\"\\tAngenommen ich wollte vier Paare kmpfender Mnner darstellen knnte ich es nicht so machen da ich nur eines darstelle und sage: so sehen alle viere aus? (Durch diesen Nachsatz bestimme ich die Art & Weise der Darstellung.) (hnlich stelle ich (x).x durch (x) dar.)<br>\",\"eng\":\"Suppose I wanted to represent four pairs of men fighting; could I not do so by representing only one and saying: \\\"That is how all four look\\\"? (By means of this addendum I determine the kind of representation.) (Similarly I represent (x).x by means of \\\"(x)\\\").<br>\",\"date\":\"1914-10-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,62r[5] et 63r[1] (1914--1025) (NB)\",\"ger\":\"Bedenke da es keine hypothetischen internen Beziehungen gibt. Ist / eine Struktur gegeben und eine strukturelle Beziehung zu ihr dann mu es eine andere Struktur geben die jene Beziehung zu der ersten hat. (Dies liegt ja im Wesen der strukturellen Beziehungen.)<br>Und dies spricht fr die Richtigkeit der obigen Bemerkung, sie wird hierdurch zu keiner-Ausflucht.<br>\",\"eng\":\"Remember that there are no hypothetical internal relations. If a structure is given and a structural relation to it then there must be another structure which has that relation to the first one. (This is involved in the nature of structural relations).<br>And this speaks for the correctness of the above remark: it stops it from beingan evasion.<br>\",\"date\":\"1914-10-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,63r[2] (1914--1026) (NB)\",\"ger\":\"Es scheint also als wre nicht die logische <span class='underline_single'>Identitt</span> von Zeichen & Bezeichnetem ntig sondern nur <span class='underline_single'>eine</span> interne, <span class='underline_single'>logische</span>, Relation zwischen beiden. (Das Bestehen einer solchen schliet in gewissem Sinne das Bestehen einer Art grundlegender  interner  Identitt mit ein.)<br>\",\"eng\":\"So it looks as if the logical <span class='underline_single'>identity</span> of sign and what it signifies were not necessary but only <span class='underline_single'>an</span> internal, <span class='underline_single'>logical</span>, relation between the two. (The holding of such a relation incorporates in a certain sense the holding of a kind of fundamental - internal - identity).<br>\",\"date\":\"1914-10-26\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,63r[3] et 64r[1] (1914--1026) (NB)\",\"ger\":\"Es handelt sich ja nur darum da das Logische des Bezeichneten / durch das Logische des Zeichens & der Bezeichnungsweise allein vollstndig bestimmt ist. Man knnte sagen: Zeichen & Bezeichnungsweise <span class='underline_single'>zusammen</span> mssen mit dem Bezeichneten logisch identisch sein.<br>\",\"eng\":\"The point is simply that the logical part of what is signified is completely determined just by the logical part of the sign and the mode of signification. One could say: sign and mode of signification <span class='underline_single'>together</span> must be logically identical with what is signified.<br>\",\"date\":\"1914-10-26\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,64r[2] (1914--1026) (NB)\",\"ger\":\"Der Sinn des Satzes ist das was er vorstellt.<br>\",\"eng\":\"The sense of a proposition is what it betokens. [<em>Cf</em>. 2.221.]<br>\",\"date\":\"1914-10-26\",\"pt-number\":\" 2221 \",\"pt-page\":\"6[9]\",\"tlp-number\":\"2221\",\"cross-references\":\"26.10.14 (3)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,64r[3] (1914--1027) (NB)\",\"ger\":\"x = y ist <span class='underline_single'>keine</span> Satzform. (Folgen)<br>\\\"x = y\\\" is <span class='underline_single'>not</span> a propositional form. (Consequences.)<br>\",\"eng\":\"\",\"date\":\"1914-10-27\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,64r[4] (1914--1027) (NB)\",\"ger\":\"Es ist ja klar da aRa gleichbedeutend wre mit aRb  a = b. Man kann also den Scheinsatz a = b durch eine ganz analysierte Notation zum Verschwinden bringen. Bester Beweis fr die Richtigkeit der obigen Bemerkung.<br>\",\"eng\":\"It is clear that \\\"aRa\\\" would have the same meaning as \\\"aRb  a = b\\\". So one can make the pseudo-proposition \\\"a = b\\\" disappear by means of a completely analyzed notation. The best proof of the correctness of the above remark.<br>\",\"date\":\"1914-10-27\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,64r[5] et 65r[1] (1914--1027) (NB)\",\"ger\":\"Die Schwierigkeit vor meiner Theorie der logischen Abbildung war die, einen Zusammenhang zwischen / den Zeichen auf Papier & einem Sachverhalt drauen in der Welt zu finden.<br>\",\"eng\":\"The difficulty of my theory of logical depiction was that of finding a connection between  the signs on paper and a state of things outside in the world.<br>\",\"date\":\"1914-10-27\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,65r[2] (1914--1027) (NB)\",\"ger\":\"Ich sagte immer die Wahrheit ist eine Beziehung zwischen dem Satz & dem Sachverhalt konnte aber niemals eine solche Beziehung ausfindig machen.<br>\",\"eng\":\"I always said that truth is a relation between a proposition and a state of things, but could never pick out such a relation. \\t\\t <br>\",\"date\":\"1914-10-27\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,65r[3] (1914--1027) (NB)\",\"ger\":\"Die Darstellung der Welt durch ganz allgemeine Stze knnte man die unpersnliche Darstellung der Welt nennen.<br>\",\"eng\":\"The representation of the world by means of entirely general propositions might be called the impersonal representation of the world.<br>\",\"date\":\"1914-10-27\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,65r[4] (1914--1027) (NB)\",\"ger\":\"Wie geschieht die unpersnliche Darstellung der Welt?<br>\",\"eng\":\"How does the impersonal representation of the world take place?<br>\",\"date\":\"1914-10-27\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,65r[5] (1914--1027) (NB)\",\"ger\":\"/ \\\\ \\\\ \\\\  \\tDer Satz ist ein Modell der Wirklichkeit so wie wir sie uns denken.<br>\",\"eng\":\"A proposition is a model of reality as we conceive of it. [<em>See </em>4.01 (2).]<br>\",\"date\":\"1914-10-27\",\"pt-number\":\"212\",\"pt-page\":\"4[5]\",\"tlp-number\":\"401 (1)\",\"cross-references\":\"(27.10.14 (7)+)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,65r[6] et 66r[1] (1914--1028) (NB)\",\"ger\":\"Was der Scheinsatz es gibt n Dinge ausdrcken will zeigt sich in der Sprache durch das Vorhandensein / von n Eigennamen mit verschiedener Bedeutung. (etc.)<br>\",\"eng\":\"What the pseudo-proposition \\\"there are n things\\\" tries to express is shown in language by the presence of n proper names with different meanings. (Etc.)<br>\",\"date\":\"1914-10-28\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,66r[2] (1914--1028) (NB)\",\"ger\":\"Das was die ganz allgemeinen Stze beschreiben, sind allerdings in gewissem Sinne strukturelle Eigenschaften der Welt. Dennoch knnen diese Stze noch immer wahr oder falsch sein. Auch nachdem sie <span class='underline_single'>Sinn haben</span> bleibt der Welt noch immer jener Spielraum.<br>Schlielich verndert ja die Wahr- oder Falschheit <span class='underline_single'>jedes</span> Satzes etwas an der allgemeinen <span class='underline_single'>Struktur</span> der Welt. Und der Spielraum der ihre Struktur durch die <span class='underline_double'>Gesamtheit</span> aller Elementarstze gelassen wird ist eben derjenige welchen die ganz allgemeinen Stze begrenzen.<br>\",\"eng\":\"What entirely general propositions describe are indeed in a certain sense structural properties of the world. Nevertheless, these propositions can still be true or false. According as they <span class='underline_single'>make sense</span> the world still retains that leeway.<br>After all, the truth or falsehood of <span class='underline_single'>every</span> proposition changes something about the general <span class='underline_single'>structure</span> of the world. And the leeway that is left to its structure by the <span class='underline_double'>totality</span> of all elementary propositions is precisely what is delimited by entirely general propositions. [<em>Cf. </em>5.5262.]<br>\",\"date\":\"1914-10-28\",\"pt-number\":\" 5326\",\"pt-page\":\"63[4]\",\"tlp-number\":\"55262**\",\"cross-references\":\"28.10.14 (2,3)* 29.10.14 (1)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,66r[3] et 67r[1] (1914--1029) (NB)\",\"ger\":\"Denn, wenn ein Elementarsatz wahr ist so ist doch jedenfalls / ein Elementarsatz <span class='underline_single'>mehr</span>, wahr, u. u.<br>\",\"eng\":\"For, if an elementary proposition is true, then, at any rate, <em>yet another </em>elementary proposition is true, and conversely. [<em>See </em>5.5262.]<br>\",\"date\":\"1914-10-29\",\"pt-number\":\" 5326\",\"pt-page\":\"63[4]\",\"tlp-number\":\"55262**\",\"cross-references\":\"28.10.14 (2,3)* 29.10.14 (1)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,67r[2] (1914--1029) (NB)\",\"ger\":\"Damit ein Satz wahr sei mu er vor allem wahr sein <span class='underline_single'>knnen</span> und nur das geht die Logik etwas an.<br>\",\"eng\":\"In order for a proposition to be true, it must first and foremost be <span class='underline_single'>capable</span> of truth, and that is all that concerns logic.<br>\",\"date\":\"1914-10-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,67r[3] (1914--1029) (NB)\",\"ger\":\"Der Satz mu zeigen was er sagen will.  Er mu sich zu seiner Bedeutung hnlich verhalten wie eine Beschreibung zu ihrem Gegenstand.<br>Die logische Form des Sachverhaltes aber, lt sich nicht beschreiben. <br>\",\"eng\":\"A proposition must show what it tries to say. - Its relation to its meaning must be like that of a description to its subject.<br>The logical form of a state of things, however, cannot be described. -  [<em>Cf</em>. 4.12 and 4.121.]<br>\",\"date\":\"1914-10-29\",\"pt-number\":\" 4101\",\"pt-page\":\"16[13]\",\"tlp-number\":\"412 (1)*\",\"cross-references\":\"29.10.14 (4)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,67r[4] (1914--1029) (NB)\",\"ger\":\"/ \\\\ \\tDie interne Relation zwischen dem Satz & seiner Bedeutung, die Bezeichnungsweise  ist das System von Koordinaten das den Sachverhalt in den Satz abbildet. Der Satz entspricht den Grundkoordinaten.<br>\",\"eng\":\"The internal relation between a proposition and its meaning, the mode of signifying - is the system of co-ordinates that projects the state of things into the proposition. The proposition corresponds to the fundamental coordinates.<br>\",\"date\":\"1914-10-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,67r[5] et 68r[1] (1914--1029) (NB)\",\"ger\":\"Man knnte zwei Koordinaten ap & bp / als einen Satz auffassen der aussagt der materielle Punkt P befinde sich im Ort (ab). Und damit diese Aussage mglich sei mssen also die Koordinaten a & b wirklich einen Ort bestimmen. Damit eine Aussage mglich ist mssen die logischen Koordinaten wirklich einen logischen Ort bestimmen!<br>\",\"eng\":\"One might construe two coordinates ap and bp as a proposition stating that the material point P is to be found in the place (ab). And for this statement to be possible the co-ordinates a and b must really specify a place. For a statement to be possible the logical co-ordinates must really specify a logical locus!<br>\",\"date\":\"1914-10-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,68r[2] (1914--1029) (NB)\",\"ger\":\" (Der Gegenstand von welchem die allgemeinen Stze handeln ist recht eigentlich die Welt; die in ihnen durch eine logische Beschreibung eintritt.  Und darum kommt die Welt eigentlich doch nicht in ihnen vor so wie ja auch der Gegenstand der Beschreibung nicht in dieser vorkommt.)<br>\",\"eng\":\"(The subject-matter of general propositions is really the world; which makes its appearance in them by means of a logical description. - And that is why the world does not really occur in them, just as the subject of the description does not occur in it either).<br>\",\"date\":\"1914-10-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,68r[3] et 69r[1] (1914--1029) (NB)\",\"ger\":\"Da in gewissem Sinne die logische Form von p vorhanden sein mu auch wenn p nicht der Fall ist das zeigt / sich symbolisch dadurch da p in ~p vorkommt.<br>\",\"eng\":\"That the logical form of p must in a certain sense be present even if p is not the case, is symbolically shown by \\\"p\\\"s occurring in \\\"~p\\\".<br>\",\"date\":\"1914-10-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,69r[2] (1914--1029) (NB)\",\"ger\":\"Die Schwierigkeit ist die: wie kann es die Form von p geben wenn es keinen Sachverhalt dieser Form gibt. Und worin besteht diese Form dann eigentlich?!<br>\",\"eng\":\"This is the difficulty: How can there be such a thing as the form of p if there is no state of things of this form? And in that case, what does this form really consist in?<br>\",\"date\":\"1914-10-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,69r[3] (1914--1029) (NB)\",\"ger\":\"Analytische <span class='underline_single'>Stze</span> gibt es nicht.<br>\",\"eng\":\"There are no such things as analytic <span class='underline_single'>propositions</span>.<br>\",\"date\":\"1914-10-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,69r[4] (1914--1030) (NB)\",\"ger\":\"Knnte man sagen: in ~(x) stellt .(x) vor wie es sich <span class='underline_single'>nicht</span> verhlt?<br>\",\"eng\":\"Could we say: In \\\"~(x)\\\" \\\".(x)\\\" betokens how things are <span class='underline_single'>not</span>?<br>\",\"date\":\"1914-10-30\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,69r[5] (1914--1030) (NB)\",\"ger\":\"Man knnte auch auf einem Bild eine negative Tatsache darstellen indem man darstellt was <span class='underline_single'>nicht</span> der Fall ist.<br>\",\"eng\":\"Even in a picture one could represent a negative fact by representing what is <span class='underline_single'>not</span> the case.<br>\",\"date\":\"1914-10-30\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,69r[6] et 70r[1] (1914--1030) (NB)\",\"ger\":\"Wenn wir aber diese Darstellungsmethoden einrumen, was ist dann eigentlich charakteristisch fr die / Beziehung des <span class='underline_single'>Darstellens</span>?<br>\",\"eng\":\"If, however, we admit these methods of representation, then what is really characteristic of the relation of <span class='underline_single'>representing</span>?<br>\",\"date\":\"1914-10-30\",\"pt-number\":\" 40231\",\"pt-page\":\"47[5]\",\"tlp-number\":\"4023 (1-2)*\",\"cross-references\":\"30.10.14 (3)  31.10.14 (3)*  (14.2.15 (2)+)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,70r[2] (1914--1030) (NB)\",\"ger\":\"Kann man nicht sagen: Es gibt eben verschiedene logische Koordinatensysteme!<br>\",\"eng\":\"Cant one say: Its just that there are different logical coordinate systems!<br>\",\"date\":\"1914-10-30\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,70r[3] (1914--1030) (NB)\",\"ger\":\"Es gibt eben verschiedene Darstellungsweisen, auch durch das Bild, und das Darstellende ist nicht nur das Zeichen oder Bild sondern auch die Methode der Darstellung. <span class='underline_single'>Aller Darstellung ist gemeinsam </span><span class='underline_single'>da</span><span class='underline_single'> sie stimmen oder nicht stimmen, wahr oder falsch sein kann</span>.<br>\",\"eng\":\"There are various different modes of representing, even by means of a picture, and what represents is not merely the sign or picture but also the method of representation. <span class='underline_single'>What a</span><span class='underline_single'>ll representation</span><span class='underline_single'>s</span><span class='underline_single'> ha</span><span class='underline_single'>ve</span><span class='underline_single'> in common that </span><span class='underline_single'>they</span><span class='underline_single'> can be </span><span class='underline_single'>right</span><span class='underline_single'> or </span><span class='underline_single'>wrong</span><span class='underline_single'>, true or false</span>.<br>\",\"date\":\"1914-10-30\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-101,70r[4] (1914--1030) (NB)\",\"ger\":\"Denn, Bild <span class='underline_single'>und Darstellungsweise</span> sind ganz auerhalb des Dargestellten!<br>Beide zusammen sind wahr oder falsch, nmlich <span class='underline_single'>das Bild, auf eine bestimmte Art & Weise</span>. (Dies gilt natrlich auch vom Elementarsatz!)<br>\",\"eng\":\"Thenpicture and mode of representing are entirely outside of what is represented!<br>The two together are true or false, namely <span class='underline_single'>the picture, in a particular way</span>. (Of course this holds for elementary propositions too!)<br>\",\"date\":\"1914-10-30\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,1r[1] (1914--1030) (NB)\",\"ger\":\"<span class='underline_single'>Jeder Satz</span> kann verneint werden. Und dies zeigt da fr alle Stze Wahr & Falsch dasselbe bedeuten. (Dies ist von allerhchster Wichtigkeit.) (Im Gegensatz zu Russell).<br>\",\"eng\":\"<span class='underline_single'>Any</span><span class='underline_single'> </span><span class='underline_single'>proposition</span> can be negated. And this shows that \\\"true\\\" and \\\"false\\\" mean the same for all propositions. (This is of the utmost importance.) (As opposed to Russell).<br>\",\"date\":\"1914-10-30\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,1r[2] (1914--1030) (NB)\",\"ger\":\"Die Bedeutung des Satzes mu durch <span class='underline_single'>ihn und seine Darstellung</span>sweise auf ja oder nein fixiert sein. <br>\",\"eng\":\"The meaning of a proposition must be fixed in terms of yes or no by means of <span class='underline_single'>it and</span><span class='underline_single'> </span><span class='underline_single'>its</span><span class='underline_single'> </span><span class='underline_single'>way</span><span class='underline_single'> of</span> <span class='underline_single'>re</span><span class='underline_single'>present</span><span class='underline_single'>ing</span>.<em> </em>[<em>Cf </em>4.023.]<br>\",\"date\":\"1914-10-30\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,1r[3] (1914--1030) (NB)\",\"ger\":\"In der Logik gibt es kein Nebeneinander, kann es keine Klassifikation geben! <br>\",\"eng\":\"In logic there are no neighbours, nor can there be any classification. [<em>S</em><em>ee </em>5.454.]<br>\",\"date\":\"1914-10-30\",\"pt-number\":\"530222\",\"pt-page\":\"49[6]\",\"tlp-number\":\"5454 (1)\",\"cross-references\":\"30.10.14 (10)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,1r[4] et 2r[1] (1914--1031) (NB)\",\"ger\":\"Ein Satz wie (x,).x ist gerade so gut zusammengesetzt wie ein elementarer; / dies zeigt sich darin da wir in der Klammer  & x <span class='underline_single'>extra</span> erwhnen mssen. Beide stehen  unabhngig  in bezeichnenden Beziehungen zur Welt, gerade wie im Falle eines Elementarsatzes (a).<br>\",\"eng\":\"A proposition like \\\"(x,).x\\\" is just as composite as an elementary one. This shows itself in our needing to mention \\\"\\\" & \\\"x\\\" <span class='underline_single'>ex</span><span class='underline_single'>plicitly</span> in the brackets. Both symbols independently stand in signifying relations to the world, just as in the case of an elementary proposition \\\"(a)\\\". [<em>Cf </em>5.5261.]<br>\",\"date\":\"1914-10-31\",\"pt-number\":\" 5325\",\"pt-page\":\"63[2]\",\"tlp-number\":\"55261 (1)*\",\"cross-references\":\"31.10.14 (1)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,2r[2] (1914--1031) (NB)\",\"ger\":\"Verhlt es sich nicht so: die logischen Konstanten charakterisieren die Darstellungsweise der Elementarformen des Satzes?<br>\",\"eng\":\"Isn't it like this: \\\"the logical constants characterize the way in which the elementary forms of the proposition represent\\\"?<br>\",\"date\":\"1914-10-31\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,2r[3] (1914--1031) (NB)\",\"ger\":\"Die Bedeutung des Satzes mu durch ihn und seine Darstellungsweise auf ja oder nein fixiert sein. Dazu mu sie durch ihn vollstndig beschrieben sein. <br>\",\"eng\":\"The meaning of a proposition must be fixed in terms of yes or no by means of it and its way of representing. To achieve this, the meaning must be completely described by the proposition. [<em>Cf </em>4.023.]<br>\",\"date\":\"1914-10-31\",\"pt-number\":\" 40231\",\"pt-page\":\"47[5]\",\"tlp-number\":\"4023 (1-2)*\",\"cross-references\":\"30.10.14 (3)  31.10.14 (3)*  (14.2.15 (2)+)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,2r[4] et 3r[1] (1914--1031) (NB)\",\"ger\":\"Die Darstellungsweise bildet <span class='underline_single'>nicht</span>  / ab; nur der Satz ist Bild. <br>\",\"eng\":\"The way of representing does not depict; only the proposition is a picture.<br>\",\"date\":\"1914-10-31\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,3r[2] (1914--1031) (NB)\",\"ger\":\"Die Darstellungsweise bestimmt wie die Wirklichkeit mit dem Bild verglichen werden mu.<br>\",\"eng\":\"The way of representing specifies how reality has to be compared with the picture.<br>\",\"date\":\"1914-10-31\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,3r[3] (1914--1031) (NB)\",\"ger\":\"Vor allem mu die Elementarsatzform abbilden, alle Abbildung geschieht durch diese.<br>\",\"eng\":\"First and foremost, the elementary propositional form must depict; all depiction takes place by means of it.<br>\",\"date\":\"1914-10-31\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,3r[4] (1914--1101) (NB)\",\"ger\":\"Sehr nahe liegt die Verwechslung zwischen der darstellenden Beziehung des Satzes zu seiner Bedeutung und der Wahrheitsbeziehung. Jene ist fr verschiedene Stze verschieden, diese ist eine und fr alle Stze die gleiche.<br>\",\"eng\":\"It is very easy to confuse the representational relation which the proposition has to its meaning, and the truth relation. The former is different for different propositions, the latter is one and the same for all propositions.<br>\",\"date\":\"1914-11-01\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,3r[5] et 4r[1] (1914--1101) (NB)\",\"ger\":\"Es scheint als wre (x,).x die Form einer Tatsache a  b  c etc. / (hnlich wre (x).x die Form von (a) wie ich auch wirklich glaubte.) <br>\",\"eng\":\"It looks as if \\\"(x,).x\\\" were the form of a fact a  b  c etc. (Similarly, (x).x would be the form of (a) as I actually believed).<br>\",\"date\":\"1914-11-01\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,4r[2] (1914--1101) (NB)\",\"ger\":\"Und hier mu eben mein Fehler liegen. <br>\",\"eng\":\"And this must be where my mistake is.<br>\",\"date\":\"1914-11-01\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,4r[3] (1914--1101) (NB)\",\"ger\":\"Untersuche doch den Elementarsatz: welches ist denn die Form von a & wie verhlt sie sich zu ~a? <br>\",\"eng\":\"Instead, examine the elementary proposition: What is the form of \\\"a\\\" & how is it related to \\\"~a\\\"?<br>\",\"date\":\"1914-11-01\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,4r[4] (1914--1101) (NB)\",\"ger\":\"Jener Przedenzfall auf den man sich immer berufen mchte mu schon im Zeichen selber liegen. <br>\",\"eng\":\"That precedent to which one would always like to appeal must reside in the sign itself. [<em>Cf. </em>5.525 (3).]<br>\",\"date\":\"1914-11-01\",\"pt-number\":\" 53221\",\"pt-page\":\"76[4]\",\"tlp-number\":\"5525 (3) \",\"cross-references\":\"1.11.14 (5)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,4r[5] (1914--1101) (NB)\",\"ger\":\" Die logische Form des Satzes mu schon durch die Formen seiner Bestandteile gegeben sein. (Und diese haben nur mit dem <span class='underline_single'>Sinn</span> der Stze nicht mit ihrer Wahr- und Falschheit zu tun.) <br>\",\"eng\":\"The logical form of the proposition must already be given by the forms of its constituents. (And these have only to do with the sense of the propositions not with their truth and falsity).<br>\",\"date\":\"1914-11-01\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,5r[1] (1914--1101) (NB)\",\"ger\":\"In der Form des Subjekts & des Prdikats liegt schon die Mglichkeit des S.-P. Satzes etc.; aber  wie billig  nichts ber seine Wahr- oder Falschheit. <br>\",\"eng\":\"In the form of the subject and the predicate there already resides the possibility of the subject-predicate proposition etc.; but  fair enough - nothing about its truth or falsity.<br>\",\"date\":\"1914-11-01\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,5r[2] (1914--1101) (NB)\",\"ger\":\"Das Bild hat die Relation zur Wirklichkeit, die es nun einmal hat. Und es kommt darauf an: wie soll es darstellen. Dasselbe Bild wird mit der Wirklichkeit bereinstimmen oder nicht bereinstimmen jenachdem, wie es darstellen soll.<br>\",\"eng\":\"A picture has whatever relation to reality it does have. And the point is how it is supposed to represent. The same picture will agree or disagree with reality according to how it is supposed to represent.<br>\",\"date\":\"1914-11-01\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,5r[3] et 6r[1] (1914--1101) (NB)\",\"ger\":\"/ \\tAnalogie zwischen Satz & Beschreibung: <span class='underline_single'>Der Komplex welcher</span> mit diesem Zeichen kongruent ist. (genau so in der graphischen Darstellung.) <br>\",\"eng\":\"Analogy between proposition and description: The <span class='underline_single'>complex which</span> is congruent with this sign. (Exactly as in representation in a picture.)<br>\",\"date\":\"1914-11-01\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,6r[2] (1914--1101) (NB)\",\"ger\":\"Nur kann man eben nicht <span class='underline_single'>sagen</span> dieser Komplex ist mit jenem kongruent (oder dergleichen) sondern dies zeigt sich. Und daher nimmt auch die Beschreibung einen anderen Charakter an. <br>\",\"eng\":\"Only one cannot just <span class='underline_single'>say</span> that this complex is congruent with that (or anything like that), rather this is shown. And for this reason, too, the description assumes a different character. [<em>Cf</em>. 4.023.]<br>\",\"date\":\"1914-11-01\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,6r[3] (1914--1101) (NB)\",\"ger\":\"/ \\tEs mu ja die Abbildungsmethode vollkommen bestimmt sein ehe man berhaupt die Wirklichkeit mit dem Satze vergleichen kann um zu sehen ob er wahr oder falsch ist. Die Vergleichsmethode mu mir gegeben sein ehe ich vergleichen kann.<br>\",\"eng\":\"The method of depiction must be completely fixed before one can compare reality with a proposition to see whether it is true or false. The method of comparison must be given me before I can make the comparison.<br>\",\"date\":\"1914-11-01\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,6r[4] et 7r[1] (1914--1101) (NB)\",\"ger\":\"Ob ein Satz wahr oder falsch ist mu sich zeigen. <br>Wir mssen aber im Voraus wissen  / <span class='underline_single'>wie</span> es sich zeigen wird. <br>\",\"eng\":\"Whether a proposition is true or false is something that must be shown. <br>We must however know in advance <span class='underline_single'>how</span> it will be shown.<br>\",\"date\":\"1914-11-01\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,7r[2] (1914--1101) (NB)\",\"ger\":\"Da zwei Leute nicht kmpfen kann man darstellen indem man sie nicht-kmpfend darstellt und auch so indem man sie kmpfend darstellt und sagt das Bild zeige wie es sich <span class='underline_single'>nicht</span> verhlt. Man <span class='underline_single'>knnte</span> mit negativen Tatsachen ebensogut darstellen wie mit positiven . Wir aber wollen blo die Prinzipe der Darstellung <span class='underline_single'>berhaupt</span> untersuchen. <br>\",\"eng\":\"That two people aren't fighting can be represented by representing them as not fighting and also by representing them fighting and saying the picture shows how things are <span class='underline_single'>not</span>. One <span class='underline_single'>could</span> represent by using negative facts just as easily as with positive ones.  However, all we want is to examine the principles of representation <span class='underline_single'>as such</span>.  [<em>Cf</em>. 4.062.]<br>\",\"date\":\"1914-11-01\",\"pt-number\":\" 4092\",\"pt-page\":\"28[5]\",\"tlp-number\":\" 4062*\",\"cross-references\":\"1.11.14 (14)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,7r[3] et 8r[1] (1914--1101) (NB)\",\"ger\":\"Der Satz p ist wahr ist gleichbedeutend mit dem logischen Produkt von p und einem Satz p der den Satz p beschreibt und einer Zuordnung der Bestandteile der beiden  / Stze.  Die internen Beziehungen von Satz & Bedeutung werden durch die internen Beziehungen zwischen p und p abgebildet. (Schlechte Bemerkung) <br>\",\"eng\":\"The proposition \\\"'p' is true\\\" has the same meaning as the logical product of 'p' and a proposition \\\"'p'\\\" describing the proposition 'p', and a correlation of the constituents of the two propositions. - The internal relations between proposition and meaning are depicted by the internal relations between 'p' and \\\"'p'\\\". (Bad remark)  <br>\",\"date\":\"1914-11-01\",\"pt-number\":\" 6004\",\"pt-page\":\"74[6]\",\"tlp-number\":\"5542**\",\"cross-references\":\"AL 191 (4)+   MN 223 (3)+   1.11.14 (15)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,8r[2] (1914--1101) (NB)\",\"ger\":\"Nur sich nicht in Teilfragen verstricken sondern immer dort hinaus flchten wo man freien berblick ber das ganze <span class='underline_single'>eine</span> groe Problem hat wenn auch dieser berblick noch unklar ist! <br>\",\"eng\":\"Dont get entangled in partial questions but always take flight out to where one has an unhindered perspective on the whole <span class='underline_single'>single</span> great problem, even if this perspective is still unclear!<br>\",\"date\":\"1914-11-01\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,8r[3] (1914--1101) (NB)\",\"ger\":\" Ein Sachverhalt ist denkbar (vorstellbar) heit: Wir knnen uns ein Bild von ihm machen. <br>\",\"eng\":\"A state of things is thinkable (imaginable) means: we can make ourselves a picture of it. [<em>See</em> 3.001.]<br>\",\"date\":\"1914-11-01\",\"pt-number\":\"3001\",\"pt-page\":\"42[6]\",\"tlp-number\":\"3001**\",\"cross-references\":\"1.11.14 (17)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,8r[4] et 9r[1] (1914--1101) (NB)\",\"ger\":\"/ \\tDer Satz mu einen logischen Ort bestimmen. <br>Die Existenz dieses logischen  / Orts ist durch die Existenz der Bestandteile allein verbrgt, durch die Existenz des sinnvollen Satzes. <br>Wenn auch kein Komplex in dem logischen Ort ist so ist doch Einer: nicht in dem logischen Ort. <br>\",\"eng\":\"The existence of the propositions constituents  the existence of the proposition with a sense  suffices to guarantee the existence of this logical locus.<br>Even if there is no complex in the logical locus, there still is one, but not in that logical locus. [<em>Cf. </em>3.4.]<br>\",\"date\":\"1914-11-01\",\"pt-number\":\"32101\",\"pt-page\":\"43[3]\",\"tlp-number\":\"34\",\"cross-references\":\"1.11.14 (18, 19)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,9r[2] (1914--1102) (NB)\",\"ger\":\"In der Tautologie heben die Bedingungen der bereinstimmung mit der Welt (die Wahrheitsbedingungen)  die darstellenden Beziehungen  einander auf so da sie in keiner darstellenden Beziehung zur Wirklichkeit steht (nichts sagt).<br>\",\"eng\":\"In a tautology, the conditions of agreement with the world (the truth conditions) - the representing relations - cancel one another out, so that it does not stand in any representing relation to reality (says nothing). [<em>Cf. </em>4.462.]<br>\",\"date\":\"1914-11-02\",\"pt-number\":\" 44483\",\"pt-page\":\"44[7]\",\"tlp-number\":\"4462 (2)\",\"cross-references\":\"2.11.14 (1)*  MN 223 (3)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,9r[3] (1914--1102) (NB)\",\"ger\":\"a = a ist nicht in demselben Sinne eine Tautologie wie pp. <br>\",\"eng\":\"a = a is not a tautology in the same sense as pp.<br>\",\"date\":\"1914-11-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,10r[1] (1914--1102) (NB)\",\"ger\":\" / \\tDa ein Satz wahr ist besteht nicht darin da er eine <span class='underline_single'>bestimmte</span> Beziehung zur Wirklichkeit hat sondern darin da er zu ihr eine bestimmte Beziehung wirklich <span class='underline_single'>hat</span>. <br>\",\"eng\":\"For a proposition to be true does not consist in its having a <span class='underline_single'>particular</span> relation to reality but in its really <span class='underline_single'>having</span> a particular relation.<br>\",\"date\":\"1914-11-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,10r[2] (1914--1102) (NB)\",\"ger\":\"Verhlt es sich nicht so: Der falsche Satz hat wie der wahre und unabhngig von seiner Falsch- oder Wahrheit einen Sinn aber keine Bedeutung? (Ist hier nicht ein besserer Gebrauch des Wortes Bedeutung?) <br>\",\"eng\":\"Isnt it like this: The false proposition makes sense like the true, and independently of its falsity or truth, has a sense but no meaning? (Isn't this a better use of the word \\\"meaning\\\"?)<br>\",\"date\":\"1914-11-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,10r[3] et 11r[1] (1914--1102) (NB)\",\"ger\":\"Knnte man sagen: sobald mir Subjekt und Prdikat gegeben sind so ist mir eine Relation gegeben die zwischen einem S.-P. Satz & seiner Bedeutung  / bestehen oder nicht <span class='underline_single'>bestehen</span> wird. Sobald ich nur Subjekt & Prdikat kenne kann ich auch um jene Relation wissen die ja auch fr den Fall da der S.-P. Satz falsch ist eine unumgngliche Voraussetzung ist. <br>\",\"eng\":\"Could one say: The moment I am given subject and predicate I am given a relation which will obtain or not <span class='underline_single'>obtain</span> between a subject-predicate proposition and its meaning. The moment I know just subject and predicate I can also know about the relation, which is also an indispensable presupposition for the subject-predicate propositions being false.<br>\",\"date\":\"1914-11-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,11r[2] (1914--1103) (NB)\",\"ger\":\"Damit es den negativen Sachverhalt geben kann mu es das Bild des positiven geben. <br>\",\"eng\":\"For for there to be a negative state of things, there must be a picture of the positive state of things. [Cf. 5.5151.]<br>\",\"date\":\"1914-11-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,11r[3] (1914--1103) (NB)\",\"ger\":\"Die Kenntnis der darstellenden Relation <span class='underline_single'>darf</span> sich ja auch nur auf die Kenntnis der Bestandteile des Sachverhalts grnden! <br>\",\"eng\":\"Knowledge of the representing relation <span class='underline_single'>must</span> be based just on knowledge of the constituents of the state of things!<br>\",\"date\":\"1914-11-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,11r[4] et 12r[1] (1914--1103) (NB)\",\"ger\":\"Knnte man also sagen: Die Kenntnis  / des S.-P. Satzes & von Subjekt und Prdikat gibt uns die Kenntnis einer internen Relation etc.? <br>Auch dies ist strenggenommen nicht richtig da wir kein bestimmtes Subjekt oder Prdikat zu kennen brauchen. <br>\",\"eng\":\"Could one then say: Knowledge of the subject-predicate proposition and of subject and predicate gives us knowledge of an internal relation, etc.? <br>Strictly speaking even this is incorrect, since we do not need to know any particular subject or predicate.<br>\",\"date\":\"1914-11-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,12r[2] (1914--1103) (NB)\",\"ger\":\"<span class='underline_single'>Offenbar</span> da wir den Elementarsatz als das Bild eines Sachverhalts empfinden , wie geht das zu? <br>\",\"eng\":\"It is <span class='underline_single'>evident</span> that an elementary proposition strikes us as a picture of a state of things. -- How does that go? [<em>Cf.</em> 4.012.]<br>\",\"date\":\"1914-11-03\",\"pt-number\":\"401121\",\"pt-page\":\"56[2]\",\"tlp-number\":\"4012 a*\",\"cross-references\":\"3.11.14 (5)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,12r[3] (1914--1103) (NB)\",\"ger\":\"Mu nicht die Mglichkeit der darstellenden Beziehung durch den Satz <span class='underline_single'>selbst</span> gegeben sein? <br>\",\"eng\":\"Mustnt the possibility of the representing relation be given by the proposition <span class='underline_single'>itself</span>?<br>\",\"date\":\"1914-11-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,12r[4] et 13r[1] (1914--1103) (NB)\",\"ger\":\"Der Satz <span class='underline_single'>selber</span> scheidet das mit ihm Kongruierende von dem nicht Kongruierenden. / Zum Beispiel: ist also der Satz gegeben und Kongruenz dann ist der Satz wahr wenn der Sachverhalt mit ihm kongruent <span class='underline_single'>ist</span> oder es sind gegeben der Satz und Nicht-Kongruenz, dann ist der Satz wahr wenn der Sachverhalt mit ihm nicht kongruent ist. <br>\",\"eng\":\"The proposition <span class='underline_single'>itself</span> divides what is congruent with it from what is not. For example: if the proposition is given, and congruence, then the proposition is true if the state of things <span class='underline_single'>is</span> congruent with it. Or: if the proposition is given and non-congruence, then the proposition is true if the state of things is not congruent with it.<br>\",\"date\":\"1914-11-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,13r[2] et 14r[1] (1914--1103) (NB)\",\"ger\":\"Wie aber wird uns die Kongruenz oder Nicht-Kongruenz, oder dergl., gegeben. <br>Wie kann mir <span class='underline_single'>mitgeteilt</span> werden <span class='underline_single'>wie</span> der Satz darstellt. Oder kann mir das berhaupt nicht <span class='underline_single'>gesagt</span> werden. Und wenn dem so ist kann ich es <span class='underline_single'>wissen</span>? Wenn es mir gesagt werden sollte so mte dies durch einen Satz geschehen; der knnte es aber  / nur zeigen. <br>\",\"eng\":\"But how is congruence or non-congruence, or suchlike, given to us? <br>How can I be <span class='underline_single'>told how</span> the proposition represents? Or can this not be <span class='underline_single'>said</span> to me at all? And if that is so, how can I \\\"<span class='underline_single'>know</span>\\\" it? If it was supposed to be said to me then this would have to be done by means of a proposition; but the proposition could only show it.<br>\",\"date\":\"1914-11-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,14r[2] (1914--1103) (NB)\",\"ger\":\"Was gesagt werden kann, kann nur durch einen Satz gesagt werden, also kann nichts was zum Verstndnis <span class='underline_single'>aller</span> Stze ntig ist gesagt werden. <br>\",\"eng\":\"What can be said can only be said by means of a proposition, so nothing that is necessary for understanding <span class='underline_single'>all</span> propositions can be said.<br>\",\"date\":\"1914-11-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,14r[3] et 15r[1] (1914--1103) (NB)\",\"ger\":\"Jene willkrliche Zuordnung von Zeichen & Bezeichnetem die die Mglichkeit der Stze bedingt und die ich in den ganz allgemeinen Stzen vermite geschieht dort durch die Allgemeinheitsbezeichnung geradeso wie beim Elementarsatz durch Namen (denn die Allgemeinheitsbezeichnung gehrt nicht zum <span class='underline_single'>Bild</span>). Daher empfand man  / auch immer da die Allgemeinheit ganz wie ein Argument auftritt. <br>\",\"eng\":\"That arbitrary correlation of a sign and what it signifies which is a condition of the possibility of the propositions, and which I found lacking in wholly general propositions, occurs there by means of the sign for generality just as in the elementary proposition it occurs by means of names. (For the sign for generality does not belong to the <span class='underline_single'>picture</span>). Hence, the constant feeling that generality figures just like an argument. [<em>Cf</em>. 5.523.]<br>\",\"date\":\"1914-11-03\",\"pt-number\":\" 5322\",\"pt-page\":\"63[5]\",\"tlp-number\":\"3.11.14 (12)** 2.12.16 (1)+  (Pilch: PT 53221)\",\"cross-references\":\"3.11.14 (12)** 2.12.16 (1)+  (Pilch: PT 53221)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,15r[2] (1914--1103) (NB)\",\"ger\":\"Verneinen kann man nur einen fertigen Satz. (hnliches gilt von allen ab-Funktionen.) <br>\",\"eng\":\"Only a finished proposition can be negated. (Likewise for all ab-functions). [<em>Cf</em>. 4.064 and 4.0641.]<br>\",\"date\":\"1914-11-03\",\"pt-number\":\" 4095\",\"pt-page\":\"45[9]\",\"tlp-number\":\"4064*\",\"cross-references\":\"3.11.14 (15)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,15r[3] (1914--1103) (NB)\",\"ger\":\"Der Satz ist das logische Bild eines Sachverhaltes. <br>\",\"eng\":\"A proposition is a logical picture of a state of things.<br>\",\"date\":\"1914-11-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,15r[4] (1914--1103) (NB)\",\"ger\":\"Die Verneinung bezieht sich auf den <span class='underline_single'>fertigen</span> Sinn des verneinten Satzes und nicht auf dessen Darstellungsweise. <br>\",\"eng\":\"Negation alludes to the <span class='underline_single'>finished</span> sense of the negated proposition, and not to its way of presenting. [<em>Cf</em>. 4.064 and 4.0641.]<br>\",\"date\":\"1914-11-03\",\"pt-number\":\" 4095\",\"pt-page\":\"45[9]\",\"tlp-number\":\"4064*\",\"cross-references\":\"3.11.14 (15)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,15r[5] et 16r[1] (1914--1103) (NB)\",\"ger\":\"Wenn ein Bild auf die vorhin erwhnte Weise darstellt was-nicht-der-Fall-ist so geschieht dies auch nur dadurch da es  / <span class='underline_single'>dasjenige</span> darstellt was nicht der Fall ist. <br>\",\"eng\":\"If a picture represents what-is-not-the-case in the above-mentioned way, this only happens through its also representing <span class='underline_single'>that</span> which <span class='underline_single'>is</span> not the case.<br>\",\"date\":\"1914-11-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,16r[2] (1914--1103) (NB)\",\"ger\":\"Denn das Bild sagt gleichsam: <span class='underline_single'>so</span> ist es <span class='underline_single'>nicht</span> und auf die Frage <span class='underline_single'>wie</span> ist es nicht? ist eben die Antwort der positive Satz. <br>\",\"eng\":\"For the picture says, as it were, \\\"<span class='underline_single'>This</span> is how it is <span class='underline_single'>not</span>\\\" and the answer to the question \\\"<span class='underline_single'>How</span> is it not?\\\" is just the positive proposition.<br>\",\"date\":\"1914-11-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,16r[3] (1914--1103) (NB)\",\"ger\":\"Man knnte sagen: die Verneinung bezieht sich schon auf den logischen Ort den der verneinte Satz bestimmt. <br>\",\"eng\":\"One could say: the negation already alludes to the logical locus traced out by the negated proposition. [<em>See</em> 4.0641 (3).]<br>\",\"date\":\"1914-11-03\",\"pt-number\":\"40952\",\"pt-page\":\"40[5]\",\"tlp-number\":\"40641 (3)*\",\"cross-references\":\"3.11.14 (18, 20, 22)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,16r[4] (1914--1103) (NB)\",\"ger\":\"Nur den festen Grund auf dem man einmal gestanden ist nicht verlieren! <br>\",\"eng\":\"But dont lose the firm ground on which you have just been standing!<br>\",\"date\":\"1914-11-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,16r[5] (1914--1103) (NB)\",\"ger\":\"Der verneinende Satz bestimmt einen <span class='underline_single'>anderen</span> logischen Ort als der verneinte. <br>\",\"eng\":\"The negating proposition traces out a <span class='underline_single'>different</span> logical locus from the negated proposition. [<em>See</em> 4.0641 (3).]<br>\",\"date\":\"1914-11-03\",\"pt-number\":\"40952\",\"pt-page\":\"40[5]\",\"tlp-number\":\"40641 (3)*\",\"cross-references\":\"3.11.14 (18, 20, 22)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,17r[1] (1914--1103) (NB)\",\"ger\":\"Der verneinte Satz zieht nicht nur die Grenzlinie zwischen dem verneinten Gebiet & dem brigen, sondern er deutet auch schon auf das verneinte Gebiet. <br>\",\"eng\":\"The negated proposition not only draws the boundary between the negated domain and the rest, but it also actually points to the negated domain.<br>\",\"date\":\"1914-11-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,17r[2] (1914--1103) (NB)\",\"ger\":\"Der verneinende Satz bestimmt seinen logischen Ort mit Hilfe des logischen Ortes des verneinten Satzes. Indem er jenen als den auerhalb diesem liegenden beschreibt. <br>\",\"eng\":\"The negating proposition traces out its logical locus using the logical locus of the negated proposition by describing it as lying outside the latter. [<em>See</em> 4.0641 (3).]<br>\",\"date\":\"1914-11-03\",\"pt-number\":\" 40952\",\"pt-page\":\"40[5]\",\"tlp-number\":\"40641 (3)*\",\"cross-references\":\"3.11.14 (18, 20, 22)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,17r[3] (1914--1103) (NB)\",\"ger\":\"Der Satz ist wahr, wenn es das gibt was er vorstellt. <br>\",\"eng\":\"A proposition is true if what it betokens exists.<br>\",\"date\":\"1914-11-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,17r[4] (1914--1104) (NB)\",\"ger\":\"Wie bestimmt der Satz den logischen Ort? <br>\",\"eng\":\"How does a proposition trace out a logical locus?<br>\",\"date\":\"1914-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,18r[1] (1914--1104) (NB)\",\"ger\":\"Wie reprsentiert das Bild einen Sachverhalt? <br>\",\"eng\":\"How does a picture represent a state of things?<br>\",\"date\":\"1914-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,18r[2] (1914--1104) (NB)\",\"ger\":\"Selbst ist es doch nicht der Sachverhalt, ja dieser braucht gar nicht der Fall zu sein. <br>\",\"eng\":\"After all, it is not the state of things itselfindeed, that need not be the case at all.<br>\",\"date\":\"1914-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,18r[3] (1914--1104) (NB)\",\"ger\":\"\\\\ \\\\ \\\\ \\tEin Name reprsentiert ein Ding ein anderer ein anderes Ding und selbst sind sie verbunden; so stellt das Ganze  wie ein lebendes Bild  den Sachverhalt vor. <br>\",\"eng\":\"One name represents one thing, another represents another thing, and they themselves are connected, so that the whole, like a <em>tableau vivant</em>, betokens a state of things. [<em>Cf</em>. 4.0311.]<br>\",\"date\":\"1914-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,18r[4] et 19r[1] (1914--1104) (NB)\",\"ger\":\"Die logische Verbindung mu natrlich unter den reprsentierten Dingen mglich sein und dies wird immer der Fall sein wenn die Dinge wirklich reprsentiert sind. Wohlgemerkt jene Verbindung / ist keine Relation sondern nur das <span class='underline_single'>Bestehen</span> einer Relation. <br>\",\"eng\":\"A logical connection must of course be one that is possible for the things that are represented, and this will always be the case if the things really are represented. Of course, that connection is not a relation but only the <span class='underline_single'>obtaining</span> of a relation.<br>\",\"date\":\"1914-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,19r[2] (1914--1105) (NB)\",\"ger\":\"So stellt der Satz den Sachverhalt gleichsam auf eigene Faust dar. <br>\",\"eng\":\"In this way, a proposition represents a state of things on its own terms, as it were.<br>\",\"date\":\"1914-11-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,19r[3] (1914--1105) (NB)\",\"ger\":\"Wenn ich aber sage: Die Verbindung der Satzbestandteile mu fr die reprsentierten Dinge mglich sein: liegt nicht hierin das ganze Problem! Wie kann eine Verbindung zwischen Gegenstnden mglich sein, die nicht ist. <br>\",\"eng\":\"But if I say: The connection of the constituents of the proposition must be possible for the things that are representeddoesnt this contain whole problem? How can a non-existent connection between objects be possible?<br>\",\"date\":\"1914-11-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,19r[4] et 20r[1] (1914--1105) (NB)\",\"ger\":\"Die Verbindung mu mglich sein heit: der Satz & die Bestandteile des Sachverhalts mssen in  / einer bestimmten Relation stehen. <br>\",\"eng\":\"The connection must be possible means: the proposition and the constituents of the state of things must stand in a particular relation.<br>\",\"date\":\"1914-11-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,20r[2] (1914--1105) (NB)\",\"ger\":\"Damit also ein Satz einen Sachverhalt darstelle ist nur ntig da seine Bestandteile die des Sachverhalt reprsentieren und da jene in einer fr diese mglichen Verbindung stehen. <br>\",\"eng\":\"So in order for a proposition to represent a state of things, it is only necessary for its constituents to represent those of the state of things and for the former to stand in a connection which is possible for the latter.<br>\",\"date\":\"1914-11-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,20r[3] (1914--1105) (NB)\",\"ger\":\"Das Satzzeichen verbrgt die Mglichkeit der Tatsache welche es darstellt (nicht da diese Tatsache wirklich der Fall ist) das gilt auch fr die allgemeinen Stze. <br>\",\"eng\":\"A propositional sign guarantees the possibility of the fact it represents (not that this fact is actually the case) - this holds for general propositions too.<br>\",\"date\":\"1914-11-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,20r[4] et 21r[1] (1914--1105) (NB)\",\"ger\":\"Denn wenn die positive Tatsache a gegeben ist dann ist auch die <span class='underline_single'>Mglichkeit</span> fr (x).x, ~(x).x, ~(a) etc. etc. gegeben. (Alle / logischen Konstanten sind bereits im Elementarsatz enthalten.) <br>\",\"eng\":\"For if a positive fact a is given then so is the <span class='underline_single'>possibility</span> of (x).x, ~(x).x, ~(a) etc. etc. (An elementary proposition already contains all logical constants.) [<em>Cf</em>. 5.47 (2).]<br>\",\"date\":\"1914-11-05\",\"pt-number\":\"53031 SchonEnth. 51[6]\",\"pt-page\":\"53031 SchonEnth. 51[6]\",\"tlp-number\":\"547 (2)*\",\"cross-references\":\"5.11.14 (6)**  12.11.14 (5)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,21r[2] (1914--1105) (NB)\",\"ger\":\" / \\\\\\tSo entsteht das Bild.  Um mit dem Bilde einen logischen Ort zu bezeichnen mssen wir zu ihm eine Bezeichnungsweise setzen (die positive, negative, etc.). <br>\",\"eng\":\"That is how the picture is formed. - In order for the picture to signify a logical locus we must add a way of signifying to it (positive, negative, etc.).<br>\",\"date\":\"1914-11-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,21r[3] (1914--1105) (NB)\",\"ger\":\" \\\\ Man knnte z.B. mittelst fechtenden Puppen zeigen wie man <span class='underline_single'>nicht</span> fechten solle. <br>\",\"eng\":\"For example, one could use fencing dolls to show how <span class='underline_single'>not</span> to fence.<br>\",\"date\":\"1914-11-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,21r[4] (1914--1106) (NB)\",\"ger\":\"Und der Fall ist hier ganz der gleiche wie bei ~a obwohl das Bild von dem handelt was nicht geschehen <span class='underline_single'>soll</span> statt von dem was nicht geschieht. <br>\",\"eng\":\"And it is just the same with this case as with ~a, although the picture is about what <span class='underline_single'>should</span>nt happen instead of what doesnt happen.<br>\",\"date\":\"1914-11-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,21r[5] et 22r[1] (1914--1106) (NB)\",\"ger\":\"Da man den verneinten Satz wieder  / verneinen kann zeigt, da das was verneint wird schon ein Satz und nicht erst die Vorbereitung zu einem Satz ist. <br>\",\"eng\":\"That the negated proposition can be negated once more shows that what is negated is already a proposition, and not just something preliminary to a proposition. [<em>See</em> 4.0641 (4).]<br>\",\"date\":\"1914-11-06\",\"pt-number\":\" 40953\",\"pt-page\":\"41[1]\",\"tlp-number\":\"40641 (4)**\",\"cross-references\":\"6.11.14 (2)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,22r[2] (1914--1106) (NB)\",\"ger\":\" / \\\\\\tKnnte man sagen?: Hier ist das Bild, aber ob es stimmt oder nicht kann man nicht sagen ehe man wei was damit gesagt sein soll. <br>\",\"eng\":\"Could one say: \\\"Here is the picture, but one cannot say whether it is right or not before one knows what it is supposed to say\\\".<br>\",\"date\":\"1914-11-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,22r[3] (1914--1106) (NB)\",\"ger\":\"Das Bild mu nun wieder seinen Schatten auf die Welt werfen. <br>\",\"eng\":\"The picture must now in turn cast its shadow on the world.<br>\",\"date\":\"1914-11-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,22r[4] (1914--1107) (NB)\",\"ger\":\"Der rumliche & der logische Ort stimmen darin berein da beide die Mglichkeit einer Existenz sind. <br>\",\"eng\":\"A spatial and a logical locus agree to this extent: that each is the source of somethings existence. [3.411.]<br>\",\"date\":\"1914-11-07\",\"pt-number\":\" 32103\",\"pt-page\":\"43[5]\",\"tlp-number\":\"3411\",\"cross-references\":\"7.11.14\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,23r[1] (1914--1108) (NB)\",\"ger\":\"Was sich in den Stzen ber Wahrscheinlichkeit durch das Experiment besttigen lt kann unmglich Mathematik sein! <br>\",\"eng\":\"What can be confirmed by experiment, in propositions about probability, cannot possibly be mathematics. [<em>Cf</em>. 5.154 (1-2).]<br>\",\"date\":\"1914-11-08\",\"pt-number\":\" 50934\",\"pt-page\":\"78[8]\",\"tlp-number\":\"\",\"cross-references\":\"8.11.14 (1)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,23r[2] (1914--1108) (NB)\",\"ger\":\"Wahrscheinlichkeitsstze sind Auszge naturwissenschaftlicher Gesetze. <br>\",\"eng\":\"\",\"date\":\"1914-11-08\",\"pt-number\":\" 50933\",\"pt-page\":\"78[7]\",\"tlp-number\":\"5156 (5)** \",\"cross-references\":\"8.11.14 (2) +\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,23r[3] (1914--1108) (NB)\",\"ger\":\"Sie sind Verallgemeinerungen und drcken eine unvollstndige Kenntnis jener Gesetze aus. <br>\",\"eng\":\"They are generalizations and express an incomplete knowledge of those laws. [<em>Cf</em>. 5.156 (1).]<br>\",\"date\":\"1914-11-08\",\"pt-number\":\" 5092\",\"pt-page\":\"78[3]\",\"tlp-number\":\"5156 (1) \",\"cross-references\":\"8.11.14 (3)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,23r[4] et 24r[1] (1914--1108) (NB)\",\"ger\":\"Wenn ich z.B. schwarze & weie Ballen aus einer Urne ziehe so kann ich nicht vor einem Zug sagen ob ich einen weien oder schwarzen Ballen ziehen werde da ich hierzu die Naturgesetze nicht genau genug kenne aber  / <span class='underline_single'>das wei ich doch</span> da im Falle gleich viel schwarze & weie Ballen vorhanden sind die Zahlen der gezogenen schwarzen sich der der weien bei fortgesetztem Ziehen nhern wird, so genau kenne ich die Naturgesetze eben <span class='underline_single'>doch</span>. <br>\",\"eng\":\"For example, if I draw black and white balls from an urn, I cannot say before taking one out whether I will draw a white or a black ball because I do not know the laws of nature well enough, but <span class='underline_single'>surely</span><span class='underline_single'> </span><span class='underline_single'>I do</span><span class='underline_single'> </span><span class='underline_single'>know</span> that in the case of equal numbers of black & white balls, the number of black balls drawn will approach the numbers of white balls drawn as the drawing continues; I do know the laws of nature well enough for <span class='underline_single'>that</span>. [<em>Cf</em>. 5.154.]<br>\",\"date\":\"1914-11-08\",\"pt-number\":\" +5154\",\"pt-page\":\"107[1]\",\"tlp-number\":\"5154\",\"cross-references\":\"8.11.14 (4)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,24r[2] (1914--1109) (NB)\",\"ger\":\"Was ich nun in den Wahrscheinlichkeitsstzen kenne, sind gewisse allgemeine Eigenschaften der unverallgemeinerten naturwissenschaftlichen Stze wie z.B. ihre Symmetrie in gewissen Beziehungen ihre Asymmetrie in anderen etc. <br>\",\"eng\":\"Now what I know now in probability statements are certain general properties of ungeneralized scientific propositions such as, for example, their symmetry in certain respects, their asymmetry in others, etc. [<em>Cf</em>. 5.156 (3).]<br>\",\"date\":\"1914-11-09\",\"pt-number\":\"50931\",\"pt-page\":\"78[5]\",\"tlp-number\":\"5156 (3)* \",\"cross-references\":\"9.11.14 (1)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,24r[3] (1914--1109) (NB)\",\"ger\":\" / \\\\\\tVexierbilder & das Sehen von Sachverhalten. <br>\",\"eng\":\"Puzzle pictures and seeing states of things. [<em>Cf</em>. 5. 5423.]<br>\",\"date\":\"1914-11-09\",\"pt-number\":\"60051\",\"pt-page\":\"93[8]\",\"tlp-number\":\"55423 (2-3) \",\"cross-references\":\"9.11.14 (2)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,25r[1] (1914--1109) (NB)\",\"ger\":\"Es war das was ich mein starkes scholastisches Gefhl nennen mchte, was die Ursache meiner besten Entdeckungen war. <br>\",\"eng\":\"The source of my best discoveries has been what I should like to call my strong scholastic feeling.<br>\",\"date\":\"1914-11-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,25r[2] (1914--1109) (NB)\",\"ger\":\"nicht p & p widersprechen einander, beide knnen nicht wahr sein; aber doch kann ich beide aussprechen, <span class='underline_single'>beide Bilder gibt es</span>. Sie liegen nebeneinander. <br>\",\"eng\":\"\\\"Not p\\\" and \\\"p\\\" contradict each other, both can't be true; but still I can articulate both, <span class='underline_single'>both pictures exist</span>. They are next to each other.<br>\",\"date\":\"1914-11-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,25r[3] (1914--1109) (NB)\",\"ger\":\" / \\\\\\tOder vielmehr p & ~p sind wie ein Bild und die unendliche Ebene auerhalb dieses Bildes (logischer Ort). <br>Den unendlichen Raum auerhalb kann ich nur mit Hilfe des Bildes herstellen indem ich ihn durch dieses begrenze. <br>\",\"eng\":\"Or rather \\\"p\\\" & \\\"~p\\\" are like a picture and the infinite plane outside this picture (logical location). <br>I can construct the infinite space outside only by using the picture to bound that space.<br>\",\"date\":\"1914-11-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,26r[1] (1914--1110) (NB)\",\"ger\":\"Wenn ich sage p ist mglich heit das p hat einen Sinn? redet jener Satz von der Sprache so da also fr seinen Sinn die Existenz eines Satzzeichens (p) wesentlich ist? (Dann wre er ganz unwichtig.) Aber will er nicht vielmehr das sagen was p  ~p zeigt? <br>\",\"eng\":\"If I say \\\"p is possible\\\", does that mean that \\\" 'p' makes sense\\\"? Is the former proposition talking about language in such a way that the existence of a propositional sign (\\\"p\\\") is essential for its sense? (Then it would be quite unimportant.) But doesn't it rather try to say what \\\"p  ~p\\\" shows?<br>\",\"date\":\"1914-11-10\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,26r[2] et 27r[1] (1914--1110) (NB)\",\"ger\":\"Entspricht nicht mein Studium der Zeichensprache dem Studium der Denkprozesse, welches die Philosophen fr die Philosophie der Logik immer fr so wesentlich hielten?  Nur verwickelten sie sich immer in unwesentliche psychologische Untersuchungen & eine analoge Gefahr gibt es auch bei / meiner Methode. <br>\",\"eng\":\"Does not my examination of sign-language correspond to the examination of thought-processes, which philosophers always used to consider so essential to the philosophy of logic? Only they always got involved in irrelevant psychological investigations, and there is an analogous danger in following my method. [<em>See</em> 4.1121 (3).]<br>\",\"date\":\"1914-11-10\",\"pt-number\":\" 41001531\",\"pt-page\":\"41[3]\",\"tlp-number\":\"41121 (3)*\",\"cross-references\":\"10.11.14 (2)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,27r[2] (1914--1110) (NB)\",\"ger\":\"Da a = b kein Satz; x = y keine Funktion ist so ist eine Klasse x(x = x) ein Unding und ebenso die sogenannte Nullklasse. (Man hatte brigens immer schon das Gefhl da berall da wo man sich in Satzkonstruktionen mit x = x, a = a, etc. half, da es sich in allen solchen Fllen um ein sich-heraus-schwindeln handelte; so wenn man sagte a existiert heit (x) x = a.) <br><span class='underline_single'>Dies ist falsch: da die Definition der Klassen selbst die Existenz der wirklichen Funktionen verbrgt</span>. <br>\",\"eng\":\"Since \\\"a = b\\\" is not a proposition, nor \\\"x = y\\\" a function, a \\\"class x(x = x)\\\" is an absurdity and so equally the so-called null class. (For that matter, one did always have the feeling that wherever one helped oneself to x = x, a = a, etc. in constructing sentences, that in all such cases it was a matter of fraudulently getting out of trouble; as though one said \\\"a exists\\\" means \\\"(x) x = a\\\"). <br><span class='underline_single'>This is wrong: since the definition of classes itself guarantees the existence of the real functions</span>. <br>\",\"date\":\"1914-11-10\",\"pt-number\":\"53344\",\"pt-page\":\"43[9]\",\"tlp-number\":\"55352*\",\"cross-references\":\"11.11.14 (1)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,28r[1] (1914--1110) (NB)\",\"ger\":\"Wenn ich nun eine Funktion von der Nullklasse auszusagen scheine so sage ich da diese Funktion von allen Funktionen wahr ist welche null sind  und dies kann ich auch dann sagen wenn <span class='underline_single'>keine</span> Funktion null ist. <br>\",\"eng\":\"Now, if I appear to assert a function of the null class, I am saying that this function is true of all functions which are null - and I can say this even if <span class='underline_single'>no</span> function is null.<br>\",\"date\":\"1914-11-10\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,28r[2] (1914--1110) (NB)\",\"ger\":\"Ist x  x .x. x identisch mit <br>\",\"eng\":\"Is x  x .x. x identical with <br>\",\"date\":\"1914-11-10\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,28r[3] (1914--1110) (NB)\",\"ger\":\"Der Satz deutet auf die Mglichkeit, da es sich so & so verhlt. <br>\",\"eng\":\"A proposition points to the possibility that such and such is the case.<br>\",\"date\":\"1914-11-10\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,28r[4] (1914--1112) (NB)\",\"ger\":\"Die Verneinung ist im selben Sinne <span class='underline_single'>eine Beschreibung</span> wie der Elementarsatz selbst. <br>\",\"eng\":\"A negation is <span class='underline_single'>a description</span> in the same sense as the elementary proposition itself.<br>\",\"date\":\"1914-11-12\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,29r[1] (1914--1112) (NB)\",\"ger\":\"Man knnte die Wahrheit eines Satzes mglich, die einer Tautologie gewi und die einer Kontradiktion unmglich nennen. Hier tritt schon das Anzeichen einer Gradation auf die wir in der Wahrscheinlichkeitsrechnung brauchen. <br>\",\"eng\":\"One might call the truth of a proposition possible, that of a tautology certain, and that of a contradiction impossible. Here we already get a hint of the graduation needed in probability theory.<br>\",\"date\":\"1914-11-12\",\"pt-number\":\" 444861\",\"pt-page\":\"42[3]\",\"tlp-number\":\"4464 (2)*\",\"cross-references\":\"12.11.14 (2)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,29r[2] (1914--1112) (NB)\",\"ger\":\"In der Tautologie bildet der Elementarsatz  selbstverstndlich  noch immer ab aber er ist mit der Wirklichkeit so lose verbunden da dieser unbeschrnkte Freiheit hat. Die Kontradiktion wieder setzt solche Schranken da keine Wirklichkeit in ihnen existieren kann. <br>\",\"eng\":\"Of course in a tautology an elementary proposition still depicts, but it is so loosely connected with reality that reality has unlimited<em> </em>freedom. The constraints set by a contradiction in its turn are such that no reality can exist under them.<br>\",\"date\":\"1914-11-12\",\"pt-number\":\" 44484\",\"pt-page\":\"42[1]\",\"tlp-number\":\"\",\"cross-references\":\"12.11.14 (3)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,30r[1] (1914--1112) (NB)\",\"ger\":\"\\\\\\tEs ist als projizierten die logischen Konstanten das Bild des Elementarsatzes auf die Wirklichkeit  die dann mit dieser Projektion stimmen oder nicht-stimmen kann. <br>Obwohl im einfachen Satz bereits alle logischen Konstanten vorkommen so <span class='underline_single'>mu</span> in ihm doch auch sein eigenes Urbild ganz & unzerlegt vorkommen! <br>\",\"eng\":\"It is as if the logical constants project the image of the elementary proposition onto reality - which then can agree or disagree with this projection. <br>Although all logical constants already occur in a simple proposition, nevertheless, its own prototype <span class='underline_single'>must</span> also occur in it complete and undivided.<br>\",\"date\":\"1914-11-12\",\"pt-number\":\"53031 SchonEnth. 51[6]\",\"pt-page\":\"53031 SchonEnth. 51[6]\",\"tlp-number\":\"547 (2)*\",\"cross-references\":\"5.11.14 (6)**  12.11.14 (5)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,30r[2] (1914--1112) (NB)\",\"ger\":\"Ist also etwa nicht der einfache Satz das Bild sondern vielmehr sein Urbild welches in ihm vorkommen mu. <br>\",\"eng\":\"Then is the picture perhaps not the simple proposition but rather its prototype which must occur in it?<br>\",\"date\":\"1914-11-12\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,30r[3] et 31r[1] (1914--1112) (NB)\",\"ger\":\" Dieses Urbild ist dann wirklich  / kein Satz (hat aber die Gestalt eines Satzes) und <span class='underline_single'>es</span> knnte der Fregeschen Annahme entsprechen. <br>\",\"eng\":\"Then this prototype is not actually a proposition (though it has the appearance of a proposition) and it might correspond to Frege's \\\"assumption\\\".<br>\",\"date\":\"1914-11-12\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,31r[2] (1914--1112) (NB)\",\"ger\":\" Der Satz bestnde dann aus Ur<span class='underline_single'>bildern</span>, die auf die Welt projiziert wren. <br>\",\"eng\":\"In that case, a proposition would consist of proto<span class='underline_single'>types</span>, which were projected onto the world.<br>\",\"date\":\"1914-11-12\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,31r[3] (1914--1113) (NB) \",\"ger\":\"Bei dieser Arbeit lohnt es sich mehr als bei jeder anderen Fragen die man fr gelst hlt immer wieder von neuen Seiten als ungelst zu betrachten. <br>\",\"eng\":\"In this work, more than any other, it is worthwhile to keep on looking at questions one considers answered from other perspectives, as though they were unanswered.<br>\",\"date\":\"1914-11-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,31r[4] et 32r[1] (1914--1113) (NB)\",\"ger\":\"Denke an die Darstellung <span class='underline_single'>negativer</span> Tatsachen durch Modelle. Etwa: So & so drfen  / zwei Eisenbahnzge nicht auf den Gleisen stehen. Der Satz, das Bild, das Modell sind  im negativen Sinn  wie ein fester Krper der die Bewegungsfreiheit der anderen beschrnkt, im positiven Sinne wie der von fester Substanz begrenzte Raum worin ein Krper Platz hat.<br>Diese Vorstellung ist <span class='underline_single'>sehr</span> deutlich und mte zur Lsung fhren. <br>\",\"eng\":\"Think of the representation of <span class='underline_single'>negative</span> facts by means of models. For example: Two railway trains must not stand on the tracks in such and such a way. A proposition, a picture, or a model is, in the negative sense, like a solid body restricting the freedom of movement of another; in the positive sense, like a space bounded by solid substance in which there is room for a body. [<em>Cf. </em>4.463  (2).]<br>This idea is <span class='underline_single'>very</span> clear and should lead to the solution. <br>\",\"date\":\"1914-11-13\",\"pt-number\":\" 44322\",\"pt-page\":\"41[4]\",\"tlp-number\":\"4463 (2)*\",\"cross-references\":\"14.11.14 (1) \",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,32r[2] (1914--1115) (NB)\",\"ger\":\"Projektion des Bildes auf die Wirklichkeit <br>(Maxwells Methode der mechanischen Modelle) <br>\",\"eng\":\"Projection of picture onto reality<br>(Maxwell's method of mechanical models.)<br>\",\"date\":\"1914-11-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,33r[1] (1914--1115) (NB)\",\"ger\":\"Nur sich nicht um das kmmern was man einmal geschrieben hat! Nur immer von frischem anfangen zu denken als ob noch gar nichts geschehen wre! <br>\",\"eng\":\"Dont worry about what you have already written. Just keep on starting to think afresh as if nothing at all had happened yet.<br>\",\"date\":\"1914-11-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,33r[2] (1914--1115) (NB)\",\"ger\":\"Jener Schatten welchen das Bild gleichsam auf die Welt wirft: Wie soll ich ihn exakt fassen? <br>     Hier ist ein tiefes Geheimnis. <br>\",\"eng\":\"That shadow which the picture casts on the world, as it were: How am I to get a precise grasp on it? <br>     Here is a deep mystery.<br>\",\"date\":\"1914-11-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,33r[3] (1914--1115) (NB)\",\"ger\":\" Es ist das Geheimnis der Negation: Es verhlt sich nicht so, und doch knnen wir sagen <span class='underline_single'>wie</span> es sich <span class='underline_single'>nicht</span> verhlt.  <br>\",\"eng\":\"It is the mystery of negation: This is not how things are, and yet we can say <span class='underline_single'>how</span> things are <span class='underline_single'>not</span>. - <br>\",\"date\":\"1914-11-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,33r[4] et 34r[1] (1914--1115) (NB)\",\"ger\":\"Der Satz ist eben nur die <span class='underline_single'>Beschreibung</span> eines Sachverhalts. (Aber das ist alles noch an der Oberflche.) / <span class='underline_single'>Eine</span> Einsicht am Ursprung ist mehr wert als noch so viele irgendwo in der Mitte. <br>\",\"eng\":\"A proposition just is a <span class='underline_single'>description</span> of a state of things. (But that is all still on the surface.) [<em>Cf</em>. 4.023.]<br><span class='underline_single'>One</span> insight at the very beginning is more valuable than ever so many somewhere in the middle. <br>\",\"date\":\"1914-11-15\",\"pt-number\":\" 40232\",\"pt-page\":\"47[6]\",\"tlp-number\":\"4023 (3)\",\"cross-references\":\"15.11.14(6)**  16.1.15 (3)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,34r[2] (1914--1116) (NB)\",\"ger\":\"Einfhrung des Zeichens 0 um die Dezimalnotation mglich zu machen: Die logische Bedeutung dieses Vorgehens. <br>\",\"eng\":\"The introduction of the sign \\\"0\\\" as making decimal notation possible: The logical meaning of this procedure.<br>\",\"date\":\"1914-11-16\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,34r[3] (1914--1117) (NB)\",\"ger\":\"Angenommen (a) ist wahr: Was heit es zu sagen ~a ist mglich? <br>(a ist selber gleichbedeutend mit ~(~a).) <br>\",\"eng\":\"Suppose \\\"(a)\\\" is true: what does it mean to say ~a is possible? <br>(a itself means the same as ~(~a).)<br>\",\"date\":\"1914-11-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,34r[4] (1914--1118) (NB)\",\"ger\":\"Es handelt sich da immer nur um die Existenz des logischen Orts. <br>Was  zum Teufel  ist aber dieser logische Ort!? <br>\",\"eng\":\"It is all simply a matter of the existence of the logical location. <br>But what hang it all  is this \\\"logical location\\\"!?<br>// But what the hell is this \\\"logical location\\\"!?//<br>\",\"date\":\"1914-11-18\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,34r[5] et 35r[1] (1914--1119) (NB)\",\"ger\":\"/ Der Satz & die logischen Koordinaten: das ist der logische Ort. <br>\",\"eng\":\"A proposition with its logical coordinates: this gives us a logical location. [<em>Cf. </em>3.41.]<br>//A sentence plus its logical coordinates: this gives us a logical location. [<em>Cf. </em>3.41.]//<br>\",\"date\":\"1914-11-19\",\"pt-number\":\" 32102\",\"pt-page\":\"43[4]\",\"tlp-number\":\"341\",\"cross-references\":\"19.11.14\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,35r[2] (1914--1120) (NB)\",\"ger\":\"+ 43[2]\\t\\t\\t<span class='underline_single'>20.11.14 (1)</span><br>Die Realitt die dem Sinne des Satzes entspricht kann doch nichts anderes sein als seine Bestandteile da wir doch <span class='underline_single'>alles</span> andere nicht <span class='underline_single'>wissen</span>. <br>\",\"eng\":\"The reality that corresponds to the sense of a proposition can surely be nothing but its constituent parts; since we are, surely, <span class='underline_single'>ignorant</span> of <span class='underline_single'>everything</span> else.<br>\",\"date\":\"1914-11-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,35r[3] (1914--1120) (NB)\",\"ger\":\"Wenn die Realitt in noch etwas anderem besteht so kann dies jedenfalls weder bezeichnet noch ausgedrckt werden, denn im ersten Fall wre es noch ein Bestandteil im zweiten wre der Ausdruck ein Satz fr den wieder dasselbe Problem bestnde wie fr den ursprnglichen. <br>\",\"eng\":\"If reality consists in anything else as well, this can in any case neither be referred to nor expressed, for in the first case it would be a further constituent, in the second case the expression would be a proposition for which the same problem would arise in turn as for the original one.<br>\",\"date\":\"1914-11-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,35r[4] et 36r[1] (1914--1121) (NB)\",\"ger\":\"/ Was wei ich eigentlich wenn ich den Sinn von a verstehe aber nicht wei ob es wahr oder falsch ist? Dann wei ich doch nicht mehr als a  ~a; und das heit ich <span class='underline_single'>wei</span><span class='underline_single'></span> nichts. <br>\",\"eng\":\"What do I really know if I understand the sense of \\\"a\\\" but dont know whether it is true or false? In that case, I surely know no more than a  ~a; and that means I <span class='underline_single'>know</span> nothing.<br>\",\"date\":\"1914-11-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,36r[2] (1914--1121) (NB)\",\"ger\":\"Da die Realitten die dem Sinn des Satzes entsprechen nur seine Bestandteile sind so knnen sich auch die logischen Koordinaten nur auf jene beziehen. <br>\",\"eng\":\"As the realities corresponding to the sense of the proposition are only its constituents, the logical coordinates too can only refer to these.<br>\",\"date\":\"1914-11-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,36r[3] (1914--1122) (NB)\",\"ger\":\"An dieser Stelle versuche ich wieder etwas auszudrcken was sich nicht ausdrcken lt. <br>\",\"eng\":\"At this point I am again trying to express something that cannot be expressed.<br>\",\"date\":\"1914-11-22\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,36r[4] et 37r[1] (1914--1123) (NB)\",\"ger\":\"Obwohl der Satz nur auf einen Ort des logischen Raumes deuten darf  / so mu doch durch ihn <span class='underline_single'>schon</span> der ganze logische Raum gegeben sein.  Sonst wrden durch Verneinung, Disjunktion etc. immer <span class='underline_single'>neue</span> Elemente  und zwar in Koordination  eingefhrt was natrlich nicht geschehen darf. <br>\",\"eng\":\"Although a proposition may specify only one location in logical space, still the entire logical space must <span class='underline_single'>already</span> be given by it. - Otherwise negation, disjunction etc. would introduce more and more <span class='underline_single'>new</span> elements - and in coordination  which, of course, must not happen. [<em>Cf</em>. 3.42.]<br>\",\"date\":\"1914-11-23\",\"pt-number\":\" 32104\",\"pt-page\":\"43[6]\",\"tlp-number\":\"342 (1-2)\",\"cross-references\":\"23.11.14\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,37r[2] (1914--1124) (NB)\",\"ger\":\"Satz und Sachverhalt verhalten sich zu einander wie der Meterstab zu der zu messenden Lnge. <br>\",\"eng\":\"Proposition and state of things are related to one another like a yardstick and a length to be measured. [<em>Cf</em>. 2.1512.]<br>\",\"date\":\"1914-11-24\",\"pt-number\":\" 21513\",\"pt-page\":\"14[3]\",\"tlp-number\":\"\",\"cross-references\":\"24.11.14 (1,4)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,37r[3] et 38r[1] (1914--1124) (NB)\",\"ger\":\"Da man aus dem <span class='underline_single'>Satz</span> (x)x auf den <span class='underline_single'>Satz</span> a schlieen kann das zeigt wie die Allgemeinheit auch im <span class='underline_single'>Zeichen</span> (x)x vorhanden ist. <br>Und das gleiche gilt natrlich fr die Allgemeinheitsbezeichnung  / berhaupt. <br>\",\"eng\":\"The possibility of inferring the <span class='underline_single'>proposition</span> \\\"a\\\" from the <span class='underline_single'>proposition</span> \\\"(x)x\\\" shows how generality is present even in the <span class='underline_single'>sign</span> \\\"(x)x\\\". <br>And of course the same holds of any sign for generality. [<em>Cf</em>. 5.1311 (2).]<br>\",\"date\":\"1914-11-24\",\"pt-number\":\" 504113\",\"pt-page\":\"52[3]\",\"tlp-number\":\"51311 (2)**\",\"cross-references\":\"24.11.14 (2)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,38r[2] (1914--1124) (NB)\",\"ger\":\"Im Satze legen wir ein Urbild an die Wirklichkeit an. <br>In a proposition we place a prototype against reality. [<em>Cf</em>. 2.1512.]<br>\",\"eng\":\"\",\"date\":\"1914-11-24\",\"pt-number\":\" 21513\",\"pt-page\":\"14[3]\",\"tlp-number\":\"\",\"cross-references\":\"24.11.14 (1,4)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,38r[3] (1914--1124) (NB)\",\"ger\":\"(Immer wieder ist es einem bei der Untersuchung der negativen Tatsachen als ob sie die Existenz des Satzzeichens voraussetzten.)<br>\",\"eng\":\"(When investigating negative facts one keeps on feeling as though they presuppose the existence of the propositional sign).<br>\",\"date\":\"1914-11-24\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,38r[4] et 39r[1] (1914--1124) (NB)\",\"ger\":\"<span class='underline_single'>Mu</span> das Zeichen des negativen Satzes mit dem Zeichen des positiven gebildet werden? (Ich glaube, ja!) <br>     Warum sollte man den negativen nicht durch eine negative Tatsache ausdrcken knnen?! Es ist wie wenn man statt des Meterstabes den Raum auerhalb des Meterstabes als  / Vergleichsobjekt nhme. <br>\",\"eng\":\"<span class='underline_single'>Must</span> the sign for a negative proposition be constructed by means of that for the positive proposition? (I believe so.) <br>     Why shouldnt it be possible to express a negative proposition by means of a negative fact?! It is as if one were to take the space outside the yardstick as the object of comparison object instead of the yardstick. [<em>Cf</em>. 5.5151.]<br>\",\"date\":\"1914-11-24\",\"pt-number\":\" 53101\",\"pt-page\":\"50[2]\",\"tlp-number\":\"55151 (1)**\",\"cross-references\":\"24.11.14 (6,7)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,39r[2] (1914--1124) (NB)\",\"ger\":\"Wie widerspricht eigentlich der <span class='underline_single'>Satz</span> ~p dem <span class='underline_single'>Satze</span> p? Die internen Relationen der beiden Zeichen mssen Widerspruch bedeuten. <br>\",\"eng\":\"How does the <span class='underline_single'>proposition</span> \\\"~p\\\" really contradict the <span class='underline_single'>proposition</span> \\\"p\\\"? The internal relations of the two signs must mean contradiction.<br>\",\"date\":\"1914-11-24\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,39r[3] (1914--1124) (NB)\",\"ger\":\"Freilich mu nach jedem negativen Satz gefragt werden knnen: <span class='underline_single'>Wie</span> verhlt es sich <span class='underline_single'>nicht</span>; aber die Antwort hierauf ist ja nur wieder ein Satz. (Diese Bemerkung unvollstndig.)<br>\",\"eng\":\"Of course, it must be possible to ask about any negative proposition: <span class='underline_single'>What</span> is it that is <span class='underline_single'>not</span> the case? But the answer to this is, of course, in its turn only a proposition. (This remark incomplete.)<br>\",\"date\":\"1914-11-24\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,39r[4] (1914--1125) (NB)\",\"ger\":\"Jener negative Tatbestand der als Zeichen dient kann doch wohl bestehen ohne einen Satz der ihn wiederum ausdrckt. <br>\",\"eng\":\"That negative matter of fact that functions as a sign can, of course, perfectly well obtain without a proposition that in turn expresses it.<br>\",\"date\":\"1914-11-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,39r[5] et 40r[1] (1914--1125) (NB)\",\"ger\":\" Immer wieder ist es bei der Untersuchung  / dieser Probleme als wren sie schon gelst und diese Tuschung kommt daher da die Probleme oft ganz unseren Blicken entschwinden. <br>\",\"eng\":\"Time and again when investigating these problems, its as if they had already been solved, and this illusion is due to the fact that the problems often completely vanish from our view.<br>\",\"date\":\"1914-11-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,40r[2] (1914--1125) (NB)\",\"ger\":\"Da ~a der Fall ist kann ich durch die Beobachtung von x & a allein ersehen. <br>\",\"eng\":\"I can see that ~a is the case just by observing x & a.<br>\",\"date\":\"1914-11-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,40r[3] et 41r[1] (1914--1125) (NB)\",\"ger\":\"Die Frage ist hier: Ist die positive Tatsache primr die negative sekundr, oder sind sie gleichberechtigt. Und wenn so, wie ist es dann mit den Tatsachen p  q, p  q etc. sind diese nicht mit ~p gleichberechtigt? Aber <span class='underline_single'>m</span><span class='underline_single'></span><span class='underline_single'>ssen</span> denn nicht <span class='underline_single'>alle Tatsachen</span> gleichberechtigt sein. Die Frage ist eigentlich die: / Gibt es Tatsachen auer den positiven. (Es ist nmlich schwer das was nicht der Fall ist nicht zu verwechseln mit dem was stattdessen der Fall <span class='underline_single'>ist</span>.) <br>\",\"eng\":\"The question here is: Is the positive fact primary, the negative secondary, or are they on an equal footing? And if so, what about the facts p  q, p  q etc.? Arent they on an equal footing with ~p? But then <span class='underline_single'>must</span> not <span class='underline_single'>all facts</span> be on an equal footing? The question is really this:  Are there facts other than the positive ones? (Because it is hard not to confuse what is not the case with what <em>is</em> the case in its place).<br>\",\"date\":\"1914-11-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,41r[2] (1914--1125) (NB)\",\"ger\":\" Es ist ja klar da alle die ab-Funktionen nur so viele verschiedene Memethoden der Wirklichkeit sind.  Und gewi haben die Memethoden durch p und ~p etwas Besonderes allen anderen voraus.  <br>\",\"eng\":\"It is clear that all the ab-functions are only so many different methods for measuring reality. - And certainly the methods of measuring by means of p and ~p have some special advantage over all others. - <br>\",\"date\":\"1914-11-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,41r[3] et 42r[1] (1914--1125) (NB)\",\"ger\":\"Es ist der <span class='underline_single'>Dualismus</span>, positive & negative Tatsachen, der mich nicht zur Ruhe kommen lt. So einen Dualismus kann es  / ja nicht geben. Aber wie ihm entgehen? <br>\",\"eng\":\"It is the <span class='underline_single'>dualism</span> of positive and negative facts that keeps me on my toes. There can be no such dualism. But how to get away from it?<br>\",\"date\":\"1914-11-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,42r[2] (1914--1125) (NB)\",\"ger\":\"Alles das wrde sich von selbst lsen durch ein Verstndnis des Wesens des Satzes! <br>\",\"eng\":\"All this would resolve itself if we understood the nature of the proposition.<br>\",\"date\":\"1914-11-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,42r[3] (1914--1126) (NB)\",\"ger\":\"Wenn von einem Dinge alle positiven Aussagen gemacht sind, sind doch nicht schon alle negativen auch gemacht! Und darauf kommt alles an! <br>\",\"eng\":\"If all the positive statements about a thing are made, arent all the negative ones already made too? And that is the whole point.<br>\",\"date\":\"1914-11-26\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,42r[4] (1914--1126) (NB)\",\"ger\":\"Der gefrchtete Dualismus von positiv & negativ besteht nicht denn (x).x etc., etc., sind weder positiv noch negativ. <br>\",\"eng\":\"The dreaded dualism of positive and negative does not exist because (x).x etc., etc., are neither positive nor negative.<br>\",\"date\":\"1914-11-26\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,42r[5] et 43r[1] (1914--1126) (NB)\",\"ger\":\"Wenn schon der positive Satz nicht im negativen vorkommen  / <span class='underline_single'>mu</span>, mu nicht in jedem Fall das Urbild des positiven Satzes im negativen vorkommen. <br>\",\"eng\":\"Indeed, if the positive proposition doesnt <span class='underline_single'>have</span> to occur in the negative, mustnt the prototype of the positive proposition occur in the negative one in any case?<br>\",\"date\":\"1914-11-26\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,43r[2] (1914--1126) (NB)\",\"ger\":\" Indem wir  und zwar in jeder mglichen Notation  zwischen ~aRb & ~bRa unterscheiden setzen wir in einer jeden eine bestimmte Zuordnung von Argument & Argumentstelle im negativen Satze voraus; die ja das Urbild des verneinten positiven Satzes ausmacht. <br>\",\"eng\":\"By distinguishing  as we do in any possible notation  between ~aRb & ~bRa we presuppose in any notation a particular correlation of argument and argument place in the negative proposition; the correlation amounts to the prototype of the negated positive proposition.<br>\",\"date\":\"1914-11-26\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,43r[3] (1914--1126) (NB)\",\"ger\":\"Ist also nicht jene Zuordnung der Bestandteile des Satzes mit welcher noch nichts <span class='underline_single'>gesagt</span> ist das eigentliche Bild im Satze? <br>\",\"eng\":\"Then isnt the real picture in the proposition that correlation of the propositions constituents by means of which nothing is yet <span class='underline_single'>said</span>?<br>\",\"date\":\"1914-11-26\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,44r[1] (1914--1126) (NB)\",\"ger\":\"Ob nicht meine Unklarheit auf dem Unverstndnis des Wesens der Relationen beruht? <br>\",\"eng\":\"Isnt my unclarity due to a lack of understanding of the nature of relations?<br>\",\"date\":\"1914-11-26\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,44r[2] (1914--1126) (NB)\",\"ger\":\"Kann man denn ein <span class='underline_single'>Bild</span> verneinen? Nein. Und darin liegt der Unterschied zwischen Bild & Satz. Das Bild kann als Satz dienen. Dann tritt aber etwas zu ihm hinzu was macht da es nun etwas <span class='underline_single'>sagt</span>. Kurz: Ich kann nur verneinen da das Bild stimmt, aber das <span class='underline_single'>Bild</span> kann ich nicht verneinen. <br>\",\"eng\":\"Is it possible to negate a <span class='underline_single'>picture</span>? No. And therein lies the difference between picture and proposition. The picture can serve as a proposition. But then something is added to it which now makes it <span class='underline_single'>say</span> something. In short: I can only deny that the picture is right, but I cannot deny the <span class='underline_single'>picture</span>.<br>\",\"date\":\"1914-11-26\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,44r[3] et 45r[1] (1914--1126) (NB)\",\"ger\":\"Dadurch da ich den Bestandteilen des Bildes Gegenstnde zuordne, <span class='underline_single'>dadurch</span> stellt es nun einen Sachverhalt dar und stimmt nun entweder  / oder stimmt nicht. (Z.B. stellt ein Bild das Innere eines Zimmers dar etc.) <br>\",\"eng\":\"<span class='underline_single'>As a result of</span> my correlating the constituents of the picture with objects, it thus represents a state of affairs and is either right or wrong. (E.g. a picture represents the inside of a room, etc.)<br>\",\"date\":\"1914-11-26\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,45r[2] et 46r[1] (1914--1127) (NB)\",\"ger\":\"~p ist wahr wenn p falsch ist. Also, in dem wahren Satz ~p ist der Teil ein falscher Satz. Wie kann ihn nun der Haken ~ mit der Wirklichkeit zum Stimmen bringen? Wir haben freilich schon gesagt da es nicht der Haken ~ allein ist sondern alles was den verschiedenen Verneinungszeichen gemeinsam ist. Und was diesen allen gemeinsam ist mu offenbar aus der Bedeutung der Verneinung selbst hervorgehen. Und so mu sich also in dem Negationszeichen  / doch seine eigene Bedeutung spiegeln. <br>\",\"eng\":\"\\\"~p\\\" is true if p is false. Therefore, part of the proposition \\\"~p\\\", when true, is false. How then can the hook \\\"~\\\" make it agree with reality? Of course, we have already said that it is not the hook \\\"~\\\" alone but what all the different negation signs have in common. And what is common to all of them must obviously follow from the meaning of negation itself. And so the negation sign must surely mirror its own meaning. [<em>Cf </em>5.512.]<br>\",\"date\":\"1914-11-27\",\"pt-number\":\" 5312\",\"pt-page\":\"61[6]\",\"tlp-number\":\"5512**\",\"cross-references\":\"27.11.14\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,46r[2] (1914--1128) (NB)\",\"ger\":\"Die Negation vereinigt sich mit den ab-Funktionen des elementaren Satzes. Und die logischen Funktionen des Elementarsatzes mssen ebenso wie alle anderen ihre Bedeutung wiederspiegeln. <br>\",\"eng\":\"Negation unites with the ab-functions of the elementary proposition. And the logical functions of the elementary proposition must reflect their meaning just as much as all the others.<br>\",\"date\":\"1914-11-28\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,46r[3] (1914--1129) (NB)\",\"ger\":\"Die ab-Funktion bleibt nicht <span class='underline_single'>vor</span> dem Elementarsatz stehen sondern sie durchdringt ihn. <br>\",\"eng\":\"The ab-function does not stop short of the elementary proposition but penetrates it.<br>\",\"date\":\"1914-11-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,46r[4] (1914--1129) (NB)\",\"ger\":\"Was gezeigt werden <span class='underline_single'>kann</span> kann nicht gesagt werden. <br>\",\"eng\":\"What <span class='underline_single'>can</span> be shown cannot be said.<br>\",\"date\":\"1914-11-29\",\"pt-number\":\" 41031\",\"pt-page\":\"41[2]\",\"tlp-number\":\"41212*\",\"cross-references\":\"29.11.14 (2)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,46r[5] et 47r[1] (1914--1129) (NB)\",\"ger\":\"Ich glaube man knnte das Gleichheitszeichen ganz aus  / unserer Notation entfernen und die Gleichheit immer nur durch die Gleichheit der Zeichen (u.u.) andeuten. Es wre dann freilich (a,a) kein spezieller Fall von (x, y).(x, y) und a keiner von (x,y).x.y. Dann aber knnte man statt x.y x, y x = y einfach schreiben ~(x, y).x.y. <br>\",\"eng\":\"I believe one could completely eliminate the identity sign from our notation and always indicate identity just by the identity of the signs (and vice versa). Of course, then (a,a) would not be a special case of (x, y).(x, y), and a would not be a special case of (x,y).x.y. But then, instead of x.y x, y x = y, one could simply write ~(x, y).x.y. [<em>Cf. </em>5.53 and 5.533.]<br>\",\"date\":\"1914-11-29\",\"pt-number\":\" 532\",\"pt-page\":\"18[10]\",\"tlp-number\":\"553\",\"cross-references\":\"29.11.14 (3)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,47r[2] (1914--1129) (NB)\",\"ger\":\"Durch diese Notation verlren auch der Scheinsatz (x)x = a oder hnliche allen Schein von Berechtigung. <br>\",\"eng\":\"Also, this notation would remove any semblance of legitimacy from a pseudo-proposition such as (x)x = a. <br>\",\"date\":\"1914-11-29\",\"pt-number\":\" 5334\",\"pt-page\":\"19[2]\",\"tlp-number\":\"5534\",\"cross-references\":\"29.11.14 (4)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,47r[3] et 48r[1] (1914--1130) (NB)\",\"ger\":\"Der Satz sagt gleichsam: Dieses Bild kann auf diese Weise keinen (oder kann einen) Sachverhalt  / darstellen. <br>\",\"eng\":\"The proposition says as it were: This picture cannot (or can) represent a state of things in this way. <br>\",\"date\":\"1914-11-30\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,48r[2] (1914--1201) (NB)\",\"ger\":\"Es kommt eben darauf an das festzusetzen was den Satz vom bloen Bild unterscheidet. <br>\",\"eng\":\"The issue here is just what distinguishes a proposition from a mere picture.<br>\",\"date\":\"1914-12-01\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,48r[3] (1914--1204) (NB)\",\"ger\":\"Sehen wir uns z.B. die Gleichung ~ ~p = p an: diese bestimmt mit anderen das Zeichen fr p da sie besagt da es etwas sei was p & ~~p gemein haben. Dadurch erhlt jenes Zeichen Eigenschaften die wiederspiegeln da die doppelte Verneinung eine Bejahung ist. <br>\",\"eng\":\"For example, let's look at the identity ~ ~p = p: this, together with others, determines the sign for p since it says that there is something that \\\"p\\\" and \\\"~~p\\\" have in common. As a result, that sign acquires properties which reflect the fact that double negation is an affirmation.<br>\",\"date\":\"1914-12-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,48r[4] (1914--1205) (NB)\",\"ger\":\"\",\"eng\":\"How does \\\"p~p\\\" say nothing?<br>\",\"date\":\"1914-12-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,48r[5] et 49r[1] et 50r[1] et 51r[1] et 52r[1] et 53r[1] (1914--1206) (NB)\",\"ger\":\"Die Newtonsche Mechanik bringt die Weltbeschreibung / auf eine einheitliche Form. <br>Denken wir uns eine weie Flche auf der unregelmige schwarze Flecken wren. Wir sagen nun: Was immer fr ein Bild hierdurch entsteht immer werde ich seiner Beschreibung beliebig nahe kommen knnen indem ich die Flche mit einem entsprechend feinen quadratischen Netzwerk bedecke und nun von jedem Quadrat sage da es wei oder schwarz ist. Ich werde auf diese Weise die Beschreibung dieser Flche auf eine einheitliche Form gebracht haben. Diese Form ist beliebig denn ich htte mit dem  / gleichen Erfolge ein dreieckiges oder sechseckiges Netz verwenden knnen. Es kann sein da die Beschreibung mit Hilfe eines dreieckigen Netzes einfacher geworden wre d.h. da wir die Flche mit einem grberen Dreiecksnetz genauer beschreiben knnten als mit einem feineren quadratischen (oder umgekehrt) etc. Den verschiedenen Netzen entsprechen verschiedene Systeme der Weltbeschreibung. <br>Die Mechanik bestimmt die Form der Weltbeschreibung indem sie sagt: Alle Stze der Weltbeschreibung  / mssen aus einer Anzahl gegebener Stze  den mechanischen Axiomen  auf eine gegebene Art & Weise erhalten werden knnen. Hierdurch liefert sie die Bausteine zum Bau des wissenschaftlichen Gebudes und sagt: Welches Gebude Du immer auffhren willst jedes mut Du irgendwie mit diesen & nur diesen Bausteinen zusammenbringen. <br>     Wie man mit dem Zahlensystem jede beliebige Anzahl mu hinschreiben knnen so mu man mit dem System der Mechanik jeden beliebigen Satz der Physik / hinschreiben knnen. <br>Und hier sehen wir nun die gegenseitige Stellung von Logik & Mechanik. <br>(Man knnte das Netz auch aus verschiedenartigen Figuren bestehen lassen.) <br>Da sich ein Bild wie das vorhin erwhnte durch ein Netz von gegebener Form beschreiben lt, sagt ber das Bild nichts aus (denn dies gilt fr jedes solche Bild). Das aber charakterisiert das Bild da es sich durch ein bestimmtes Netz, von <span class='underline_single'>bestimmter</span> Feinheit, beschreiben lt. So auch sagt es nichts ber die Welt aus da sie sich durch die Newtonsche Mechanik  / beschreiben lt; aber wohl da sie sich so durch jene beschreiben lt wie dies eben der Fall ist. (Dies habe ich schon seit <span class='underline_single'>langer</span> Zeit gefhlt.)  Auch das sagt etwas von der Welt da sie sich durch die eine Mechanik einfacher beschreiben lt als durch die andere. <br>Die Mechanik ist <span class='underline_single'>ein</span> Versuch alle Stze welche wir zur Weltbeschreibung bentigen nach <span class='underline_single'>einem</span> Plan zu konstruieren. (Die unsichtbaren Massen Hertz's.) <br>Die unsichtbaren Massen Hertz's sind <span class='underline_single'>eingestandenermaen</span> Scheingegenstnde.<br>\",\"eng\":\"Newtonian mechanics introduces uniformity into world description. <br>Imagine a white surface with irregular black spots. We then say: whatever kind of picture develops from these, I could always get as near as I like to its description, by covering the surface with a sufficiently fine square mesh and going on to say of every square that it is white or black. In this way I will have managed to introduce uniformity into my description of the surface. The form is arbitrary, because I could have just as well applied a triangular or hexagonal net. It may be that the description using a triangular net would have been simpler, that is, we might be able to describe the surface more accurately with a coarser triangular mesh than with a finer square mesh or vice versa, etc. Different systems of describing the world correspond to different nets. <br>Mechanics specifies a form of world description by saying: all propositions used in a description of the world must be obtainable in a given way from a number of given propositions - the mechanical axioms. In this way it supplies the building blocks for constructing the edifice of science, and says: Whatever building you want to erect, it must somehow be assembled from these, and only these, building blocks.<br>Just as I must be able to write down any arbitrary number by means of the number system, so I must be able to write down any arbitrary proposition of physics by means of the system of mechanics. [<em>See</em>. 6.341.]<br>And now we can see the position in which logic and mechanics stand to each other.<br>(One might also arrange for the net to consist of different kinds of mesh.) <br>That a picture of the above-mentioned kind can be described by a net of a given form tells us nothing<em> </em>about the picture (for this holds of every such picture.) But what does characterize a picture is that it can be described by a specific net of a <span class='underline_single'>specific</span><em> </em>fineness. Likewise, that the world can be described by Newtonian mechanics tells us nothing about the world; but what does tell us something about it is that the world can be described in precisely this way. (I have felt this for a <span class='underline_single'>long</span> time.)  We are also told something about the world by the fact that it can be described more simply by means of one system of mechanics than by means of another. [<em>Cf</em>. 6.342.]<br>Mechanics is <span class='underline_single'>one</span> attempt to construct according to a <span class='underline_single'>single</span> plan all propositions we need for a description of the world.  Hertzs invisible masses.) [<em>Cf</em>. 6.343.]<br>Hertzs invisible masses are admittedly pseudo-objects.<br>\",\"date\":\"1914-12-06\",\"pt-number\":\"6341\",\"pt-page\":\"73[2]\",\"tlp-number\":\"6343\",\"cross-references\":\"6.12.14 (6)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,53r[2] et 54r[1] (1914--1207) (NB)\",\"ger\":\"Die logischen Konstanten des Satzes sind die Bedingungen seiner  / Wahrheit. <br>\",\"eng\":\"A propositions logical constants are its truth conditions.<br>\",\"date\":\"1914-12-07\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,54r[2] (1914--1208) (NB)\",\"ger\":\"Hinter unseren Gedanken, wahren & falschen, liegt immer wieder ein dunkler Grund, den wir erst spter in's Licht ziehen, & als einen Gedanken aussprechen knnen. <br>\",\"eng\":\"Behind our thoughts, true and false, there is always a dark background, which we can only later bring into the light and express as a thought.<br>\",\"date\":\"1914-12-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,54r[3] (1914--1212) (NB)\",\"ger\":\"p . taut. = p d.h. taut. sagt nichts! <br>\",\"eng\":\"p . Taut = p,  i.e. Taut. says nothing. [<em>Cf. </em>4.465.]<br>\",\"date\":\"1914-12-12\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,54r[4] (1914--1213) (NB)\",\"ger\":\"Erschpft es das Wesen der Negation da sie eine Operation ist die sich selbst aufhebt? Dann mte  die Negation bedeuten wenn p = p vorausgesetzt da p  p. <br>\",\"eng\":\"Does it exhaust the essence of negation that it is an operation that cancels itself? Then  would have to mean negation if p = p, assuming that p  p.<br>\",\"date\":\"1914-12-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,54r[5] et 55r[1] (1914--1213) (NB)\",\"ger\":\"Das ist einmal sicher da nach diesen beiden Gleichungen  nicht mehr die Bejahung ausdrcken  / kann! <br>     Und zeigt nicht die Fhigkeit des Verschwindens dieser Operationen da sie logische sind? <br>\",\"eng\":\"To begin with, its certain that according to these two equations  can no longer express affirmation.<br>     And doesnt these operations ability to vanish show that they are logical?<br>\",\"date\":\"1914-12-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,55r[2] (1914--1214? --1215?) (NB)\",\"ger\":\"Es ist offenbar: wir knnen als Schriftzeichen der ab-Funktionen einfhren welche wir wollen das eigentliche Zeichen wird sich automatisch bilden. Und welche Eigenschaften werden sich hierbei von selbst herausbilden? <br>\",\"eng\":\"Its obvious that we can introduce whatever we like as characters for the ab-functions, and that the real sign will provide itself automatically. And what properties will evolve on their own while doing so?<br>\",\"date\":\"1914-12-14\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,55r[3] (1914--1215) (NB)\",\"ger\":\"Das logische Gerst um das Bild (des Satzes) herum bestimmt den logischen Raum. <br>The logical scaffolding enclosing a picture (a proposition) specifies logical space. [<em>Cf</em>. 3.42.]<br>\",\"eng\":\"\",\"date\":\"1914-12-15\",\"pt-number\":\"32141\",\"pt-page\":\"43[7]\",\"tlp-number\":\"342 (3a)*\",\"cross-references\":\"15.12.14 (2)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,55r[4] (1914--1216) (NB)\",\"ger\":\"Der Satz mu den ganzen logischen Raum durchgreifen. <br>\",\"eng\":\"Propositions must probe the whole of logical space. [<em>Cf</em>. 3.42.]<br>\",\"date\":\"1914-12-16\",\"pt-number\":\"32142\",\"pt-page\":\"43[8]\",\"tlp-number\":\"342 (3b)*\",\"cross-references\":\"16.12.14*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,56r[1] (1914--1217) (NB)\",\"ger\":\"Die ab-Funktionszeichen sind nicht materiell sonst knnten sie nicht verschwinden. <br>\",\"eng\":\"The ab-function signs are not material, otherwise they could not disappear. [<em>Cf. </em>5.44 and 5.441.]<br>\",\"date\":\"1914-12-17\",\"pt-number\":\"523\",\"pt-page\":\"38[6]\",\"tlp-number\":\"544 (1)*\",\"cross-references\":\"17.12.14**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,56r[2] (1914--1218) (NB)\",\"ger\":\"Am eigentlichen Satzzeichen mu geradesoviel zu unterscheiden sein, als am Sachverhalt zu unterscheiden ist. Darin besteht ihre Identitt.         <br>\",\"eng\":\"In a proper propositional sign there must be exactly as many distinguishable features as can be distinguished in the state of things. That is what their identity consists in.    [<em>Cf</em>. 4.04.]<br>\",\"date\":\"1914-12-18\",\"pt-number\":\"4073\",\"pt-page\":\"48[6]\",\"tlp-number\":\"404 (1)\",\"cross-references\":\"18.12.14**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,56r[3] (1914--1220) (NB)\",\"ger\":\"In p ist nicht mehr & nicht weniger zu erkennen als in ~p. <br>\",\"eng\":\"In \\\"p\\\" neither more nor less can be recognised than in \\\"~p\\\".<br>\",\"date\":\"1914-12-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,56r[4] (1914--1220) (NB)\",\"ger\":\"Wie kann ein Sachverhalt mit p bereinstimmen und mit ~p nicht bereinstimmen. <br>\",\"eng\":\"How can a state of things agree with \\\"p\\\" and not agree with \\\"~p\\\"?<br>\",\"date\":\"1914-12-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,56r[5] et 57r[1] (1914--1220) (NB)\",\"ger\":\" Man knnte auch so fragen: Wenn ich zum Zweck der Verstndigung mit einem Anderen  / <span class='underline_single'>Die Sprache</span> erfinden wollte was fr Regeln mte ich mit ihm ber unseren Ausdruck vereinbaren? <br>\",\"eng\":\"One could also ask: If I wanted to invent <span class='underline_single'>Language</span> for the purpose of communicating with another, what kind of rules would I have to agree on with him about our mode of expression?<br>\",\"date\":\"1914-12-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,57r[2] (1914--1223) (NB)\",\"ger\":\"Charakteristisches Beispiel zu meiner Theorie der Bedeutung der physikalischen Naturbeschreibung: die beiden Wrmetheorien; einmal die Wrme als ein Stoff ein andermal als eine Bewegung aufgefat. <br>\",\"eng\":\"Characteristic example of my theory of the significance of description in physics: The two theories of heat; heat conceived of as a substance at one time, at another time as a movement.<br>\",\"date\":\"1914-12-23\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,57r[3] et 58r[1] (1914--1225) (NB)\",\"ger\":\"Der Satz sagt etwas, ist identisch mit: Er hat ein bestimmtes Verhltnis zur Wirklichkeit, w<span class='underline_single'>as immer diese sein mag</span>. Und, wenn <span class='underline_single'>sie</span> gegeben ist und jenes Verhltnis so ist der Sinn des Satzes bekannt. p  q hat  / ein anderes Verhltnis zur Wirklichkeit als p.q, etc. <br>\",\"eng\":\"The proposition says something, is identical with: It has a specific relation to reality, <span class='underline_single'>whatever </span><span class='underline_single'>this</span><span class='underline_single'> may be</span>. And, if this reality is given and so is that relation, then the sense of the proposition is known. \\\"p  q\\\" has a different relation to reality than \\\"p.q\\\", etc.<br>\",\"date\":\"1914-12-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,58r[2] (1914--1225) (NB)\",\"ger\":\" Die Mglichkeit des Satzes basiert natrlich auf dem Prinzip der <span class='underline_double'>Vertretung</span> von Gegenstnden durch Zeichen. <br>\",\"eng\":\"The possibility of propositions is, of course, based on the principle that signs function as <span class='underline_double'>representatives</span> for objects. [<em>Cf</em>. 4.0312 (1).]<br>\",\"date\":\"1914-12-25\",\"pt-number\":\"40102\",\"pt-page\":\"41[5]\",\"tlp-number\":\"40312 (1)*\",\"cross-references\":\"25.12.14 (2)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,58r[3] (1914--1225) (NB)\",\"ger\":\"Im Satz haben wir also die Vertretung von etwas durch <span class='underline_single'>etwas anderes</span>. <br>Aber auch das <span class='underline_single'>gemeinsame</span> Bindemittel. <br>\",\"eng\":\"So in a proposition, something represents <span class='underline_single'>something else</span>. <br>But there is also the <span class='underline_single'>shared</span> cement.<br>\",\"date\":\"1914-12-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,58r[4] (1914--1225) (NB)\",\"ger\":\"Mein Grundgedanke ist da die logischen Konstanten nicht vertreten. Da sich die <span class='underline_single'>Logik</span> der Tatsache nicht vertreten <span class='underline_single'>lt</span>. <br>\",\"eng\":\"\",\"date\":\"1914-12-25\",\"pt-number\":\"40103\",\"pt-page\":\"41[6]\",\"tlp-number\":\"40312 (2)\",\"cross-references\":\"25.12.14 (5)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,58r[5] et 59r[1] (1914--1229) (NB)\",\"ger\":\"Im Satze vertritt den Gegenstand  / der Name. <br>\",\"eng\":\"In a proposition, a name stands in for an object. [<em>See</em> 3.22.]<br>\",\"date\":\"1914-12-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,59r[2] (1915--0111) (NB)\",\"ger\":\"Ein Meterstab sagt nicht da ein zu messendes Objekt einen Meter lang sei. <br>Auch dann nicht wenn wir wissen da er zum Messen <span class='underline_single'>eines</span> || dieses <span class='underline_single'>bestimmten</span> Objektes dienen soll. <br>\",\"eng\":\"A yardstick does not say that an object being measured is one yard long. <br>Not even if we know that it is supposed to serve for measuring this <span class='underline_single'>particular</span> object.<br>\",\"date\":\"1915-01-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,59r[3] (1915--0111) (NB)\",\"ger\":\"Knnte man nicht fragen?: was mu zu jenem Meterstab dazukommen damit er etwas ber die Lnge des Objektes <span class='underline_single'>aussagt</span>? <br>\",\"eng\":\"Couldnt one ask: what must be added to that yardstick so that it <span class='underline_single'>asserts</span> something about the length of the object?<br>\",\"date\":\"1915-01-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,59r[4] (1915--0111) (NB)\",\"ger\":\"(Der Meterstab ohne diesen Zusatz wre die Annahme.) <br>\",\"eng\":\"(The yardstick without this addition would be the \\\"assumption\\\").<br>\",\"date\":\"1915-01-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,59r[5] et 60r[1] (1915--0114) (NB)\",\"ger\":\"Das Satzzeichen p  q stimmt  / wenn p der Fall ist, wenn q der Fall ist und wenn beide der Fall sind anderenfalls stimmt es nicht: dies scheint unendlich einfach zu sein; und <span class='underline_single'>so</span> einfach wird die Lsung sein. <br>\",\"eng\":\"The propositional sign \\\"p  q\\\" is right if p is the case, if q is the case, and if both are the case, otherwise it is wrong. This seems to be immensely simple; and the solution will be <span class='underline_single'>as</span> simple as this.<br>\",\"date\":\"1915-01-14\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,60r[2] (1915--0116) (NB)\",\"ger\":\"Der Satz ist einem hypothetischen Sachverhalt zugeordnet. <br>\",\"eng\":\"A proposition is correlated with a hypothetical state of things.<br>\",\"date\":\"1915-01-16\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,60r[3] (1915--0116) (NB)\",\"ger\":\"Dieser Sachverhalt ist durch seine Beschreibung gegeben. <br>\",\"eng\":\"This state of things is given by its description.<br>\",\"date\":\"1915-01-16\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,60r[4] (1915--0116) (NB)\",\"ger\":\"Der Satz ist die Beschreibung eines Sachverhalts. <br>\",\"eng\":\"A proposition is a description of a state of things.  [<em>See</em> 4.023 (3).]<br>\",\"date\":\"1915-01-16\",\"pt-number\":\"40232\",\"pt-page\":\"47[6]\",\"tlp-number\":\"4023 (3)\",\"cross-references\":\"15.11.14(6)**  16.1.15 (3)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,60r[5] et 61r[1] (1915--0116) (NB)\",\"ger\":\"Wie die Beschreibung eines Gegenstandes nach seinen externen Eigenschaften, so beschreibt der  / Satz die Tatsache nach ihren internen Eigenschaften. <br>\",\"eng\":\"Just as a description describes an object in accordance with its external properties, so a proposition describes a fact in accordance with its internal properties.  [<em>See</em> 4.023 (4).]<br>\",\"date\":\"1915-01-16\",\"pt-number\":\"402321\",\"pt-page\":\"47[7]\",\"tlp-number\":\"4023 (4)*\",\"cross-references\":\"16.1.15 (4)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,61r[2] (1915--0116) (NB)\",\"ger\":\"Die Beschreibung stimmt, wenn der Gegenstand die besagten Eigenschaften hat: Der Satz stimmt, wenn der Sachverhalt die, durch den Satz aufgegebenen, internen Eigenschaften hat. <br>\",\"eng\":\"A description is right if the object has the asserted property. A proposition is right if the state of things has the internal properties assigned by the proposition.<br>\",\"date\":\"1915-01-16\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,61r[3] (1915--0117) (NB)\",\"ger\":\"Der Sachverhalt p.q <span class='underline_single'>fllt unter</span> den Satz p  q. <br>\",\"eng\":\"The state of things p.q <span class='underline_single'>comes within</span> the domain of the proposition \\\"p  q\\\".<br>\",\"date\":\"1915-01-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,61r[4] et 62r[1] (1915--0117) (NB)\",\"ger\":\"Zu dem Netz-Gleichnis der Physik: Obwohl die Flecke geometrische Figuren sind so kann uns doch selbstverstndlich die Geometrie gar nichts ber ihre Form & Lage sagen. Das Netz aber ist <span class='underline_single'>rein</span> geometrisch alle  / seine Eigenschaften knnen a priori angegeben werden. <br>\",\"eng\":\"On the network analogy for physics: Although the spots are geometrical figures, geometry can obviously tell us nothing about their form and position. But the network is <span class='underline_single'>purely</span> geometrical; all its properties can be specified <em>a priori</em>. [<em>See</em> 6.35 (1).]<br>\",\"date\":\"1915-01-17\",\"pt-number\":\"635\",\"pt-page\":\"74[1]\",\"tlp-number\":\"635 (1)\",\"cross-references\":\"17.1.15 (2)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,62r[2] (1915--0118) (NB)\",\"ger\":\"Der Vergleich zwischen Satz & Beschreibung ist rein logisch und <span class='underline_single'>mu</span> daher weiter gefhrt werden.<br>\",\"eng\":\"The comparison between proposition and description is purely logical and for that reason <span class='underline_single'>must</span> be pursued.<br>\",\"date\":\"1915-01-18\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,62r[3] (1915--0120) (NB)\",\"ger\":\"Wieso ist <span class='underline_single'>Alle</span> ein logischer Begriff? <br>\",\"eng\":\"How is it that <span class='underline_single'>all</span> is a logical concept?<br>\",\"date\":\"1915-01-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,62r[4] (1915--0120) (NB)\",\"ger\":\"Wieso ist <span class='underline_single'>Alle</span> ein Begriff der Form?? <br>\",\"eng\":\"How is it that <span class='underline_single'>all</span> is a concept of form??<br>\",\"date\":\"1915-01-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,62r[5] (1915--0120) (NB)\",\"ger\":\"Wie kommt es da <span class='underline_single'>Alle</span> in jedem Satz vorkommen kann? <br>Denn dies ist das Charakteristikum des Formbegriffs! <br>\",\"eng\":\"How does it come about that <span class='underline_single'>all</span> can occur in any proposition? <br>For that is characteristic of the concept of form.<br>\",\"date\":\"1915-01-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,62r[6] et 63r[1] (1915--0120) (NB)\",\"ger\":\"<span class='underline_single'>Alle</span> <span class='underline_double'>scheint</span> dem Inhalt des Satzes nher zu stehen als der Form. / Alle: Dinge, Alle: Funktionen, Alle: Beziehungen: Es ist als ob Alle ein Binde<span class='underline_single'>glied</span> zwischen dem Begriff des Dinges, der Funktion etc. und dem einzelnen Ding der einzelnen Funktion sei. <br>\",\"eng\":\"<span class='underline_single'>All</span> <span class='underline_double'>appears</span> to be closer to the propositions content than to its form. All: things, All: functions, All: relations: It is as if All were a connecting <span class='underline_single'>link</span> between the concept of thing, function, etc., and the individual thing, the individual functions.<br>\",\"date\":\"1915-01-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,63r[2] (1915--0120) (NB)\",\"ger\":\"Die Allgemeinheit ist wesentlich mit der Elementar-<span class='underline_double'>Form</span> verbunden. <br>\",\"eng\":\"Generality is essentially connected with the elementary <span class='underline_double'>form</span>.<br>\",\"date\":\"1915-01-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,63r[3] (1915--0120) (NB)\",\"ger\":\"\",\"eng\":\"\",\"date\":\"1915-01-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,63r[4] (1915--0121) (NB)\",\"ger\":\"Der bergang von der allgemeinen Betrachtung der Satzform: <span class='underline_single'>Unendlich schwierig, fabelhaft</span>. <br>\",\"eng\":\"Moving on from general consideration of propositional form: immensely difficult, fabulous.<br>\",\"date\":\"1915-01-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,63r[5] et 64r[1] (1915--0122) (NB)\",\"ger\":\"Meine <span class='underline_single'>ganze</span> Aufgabe besteht darin, das Wesen des Satzes zu erklren. / Das heit, das Wesen aller Tatsachen anzugeben, deren Bild der Satz <span class='underline_single'>ist</span>. <br>\",\"eng\":\"My <span class='underline_single'>whole</span> task consists in explaining the nature of the proposition. That is to say, in giving the nature of all facts, whose picture the proposition <span class='underline_single'>is</span>.<br>\",\"date\":\"1915-01-22\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,64r[2] (1915--0122) (NB)\",\"ger\":\"Das Wesen alles Seins angeben. <br>\",\"eng\":\"In giving the nature of all being.<br>\",\"date\":\"1915-01-22\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,64r[3] (1915--0122) (NB)\",\"ger\":\"(Und hier bedeutet Sein nicht existieren  dann wre es unsinnig.) <br>\",\"eng\":\"(And here being does not mean existingif so, it would be nonsensical.)<br>\",\"date\":\"1915-01-22\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,64r[4] (1915--0123) (NB)\",\"ger\":\"Die Verneinung ist eine Operation. <br>\",\"eng\":\"\",\"date\":\"1915-01-23\",\"pt-number\":\"50012\",\"pt-page\":\"63[6]\",\"tlp-number\":\"52341 (2)**\",\"cross-references\":\"23.1.15 (1)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,64r[5] (1915--0123) (NB)\",\"ger\":\"\",\"eng\":\"An operation refers to an operation.<br>\",\"date\":\"1915-01-23\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,64r[6] (1915--0123) (NB)\",\"ger\":\"Das Wort ist eine Sonde, manches reicht tief; manches nur wenig tief. <br>\",\"eng\":\"Words are probes: some reach deep, some only a little way.<br>\",\"date\":\"1915-01-23\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,64r[7] et 65r[1] (1915--0123) (NB)\",\"ger\":\"Eine Operation sagt natrlich nichts aus, nur ihr Resultat, und dies hngt von ihrem  / Gegenstand ab. <br>Die logischen Scheinfunktionen <span class='underline_single'>sind</span> Operationen. <br>\",\"eng\":\"Indeed, an operation says nothing, only its result does; and this depends on its object. [<em>Cf</em>. 5.25 (2).]<br>\",\"date\":\"1915-01-23\",\"pt-number\":\"50021\",\"pt-page\":\"64[1]\",\"tlp-number\":\"525 (2)** \",\"cross-references\":\"23.1.15 (4)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,65r[2] (1915--0124) (NB)\",\"ger\":\"\",\"eng\":\"\",\"date\":\"1915-01-24\",\"pt-number\":\" 50022\",\"pt-page\":\"64[2]\",\"tlp-number\":\"   5254*\",\"cross-references\":\"24.1.15 (2)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,65r[3] (1915--0124) (NB)\",\"ger\":\"Der negative Satz schliet die Wirklichkeit aus. <br>Negative propositions exclude reality.<br>\",\"eng\":\"\",\"date\":\"1915-01-24\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,65r[4] (1915--0124) (NB)\",\"ger\":\"Wie kann die allumfassende, weltspiegelnde Logik so spezielle Haken & Manipulationen gebrauchen?! Nur indem sich alle diese zusammen zu einem <span class='underline_single'>unendlich</span> feinen Netzwerk, zu dem groen Spiegel verknpfen! <br>\",\"eng\":\"How can an all-embracing, world-reflecting logic use such contrived hooks and manipulations? Only by knitting them all together in an <span class='underline_single'>infinitely</span> fine network, the great mirror. [<em>See </em>5.511.]<br>\",\"date\":\"1915-01-24\",\"pt-number\":\" 5311\",\"pt-page\":\"61[5]\",\"tlp-number\":\"5511\",\"cross-references\":\"24.1.15 (4)*  (6.3.15+)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,65r[5] (1915--0125) (NB)\",\"ger\":\"Man kann auch sagen; ~p ist falsch, wenn p wahr ist. <br>\",\"eng\":\"One can also say: if p is true, ~p is false.<br>\",\"date\":\"1915-01-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,65r[6] et 66r[1] (1915--0129) (NB)\",\"ger\":\"/ Die Sprache ist artikuliert. <br>\",\"eng\":\"\",\"date\":\"1915-01-29\",\"pt-number\":\" 31603\",\"pt-page\":\"38[5]\",\"tlp-number\":\"3141 (2)\",\"cross-references\":\"29.1.15+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,66r[2] (1915--0207) (NB)\",\"ger\":\"Die musikalischen Themen sind in gewissem Sinne Stze. Die Kenntnis des Wesens der Logik wird deshalb zur Kenntnis des Wesens der Musik fhren. <br>\",\"eng\":\"Musical themes are in a certain sense propositions. So knowledge of the nature of logic will lead to knowledge of the nature of music. [<em>Cf. </em>3.141 (1).]<br>\",\"date\":\"1915-02-07\",\"pt-number\":\" 31602\",\"pt-page\":\"38[4]\",\"tlp-number\":\"3141 (1)**\",\"cross-references\":\"7.2.15+  5.4.15   11.4.15\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,66r[3] (1915--0214) (NB)\",\"ger\":\"Gbe es mathematische Gegenstnde  logische Konstante  so wre der Satz ich esse 5 Pflaumen ein Satz der Mathematik. Und er ist auch kein Satz der angewandten Mathematik. <br>\",\"eng\":\"If there were mathematical objects  logical constants  the proposition \\\"I am eating five plums\\\" would be a proposition of mathematics. And it is not even a proposition of applied mathematics.<br>\",\"date\":\"1915-02-14\",\"pt-number\":\" 40231\",\"pt-page\":\"47[5]\",\"tlp-number\":\"4023 (1-2)*\",\"cross-references\":\"30.10.14 (3)  31.10.14 (3)*  (14.2.15 (2)+)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,66r[4] (1915--0214) (NB)\",\"ger\":\"Der Satz mu seine Bedeutung <span class='underline_single'>vollstndig</span> beschreiben.    <br>A proposition must describe its meaning <span class='underline_single'>completely</span><em>. </em>[<em>Cf. </em>4.023.]     <br>\",\"eng\":\"\",\"date\":\"1915-02-14\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,66r[5] et 67r[1] (1915--0218)\",\"ger\":\"\",\"eng\":\"\",\"date\":\"1915-02-18\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,67r[2] (1915--0304) (NB)\",\"ger\":\"Die Melodie ist eine Art Tautologie, sie ist in sich selbst abgeschlossen; sie befriedigt sich selbst. <br>\",\"eng\":\"A tune is a kind of tautology. It is self-contained; it satisfies itself.<br>\",\"date\":\"1915-03-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,67r[3] (1915--0305) (NB)\",\"ger\":\"Die Menschheit hat immer geahnt, da es ein Gebiet von Fragen geben mu worin die Antworten  a priori  symmetrisch, und zu einem abgeschlossenen regelmigen Gebilde vereint  liegen. <br>\",\"eng\":\"People have always had an inkling that there must be a realm in which the answers to questions combine symmetrically - <em>a priori - </em>into a self-contained regular formation. [<em>See </em>5.4541 (2-3).]<br>\",\"date\":\"1915-03-05\",\"pt-number\":\" 530225\",\"pt-page\":\"76[3]\",\"tlp-number\":\"54541 (2-3)* \",\"cross-references\":\"5.3.15 (1)  19.9.16 (1)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,67r[4] (1915--0305) (NB)\",\"ger\":\"(Je lter ein Wort ist desto tiefer reicht es.) <br>\",\"eng\":\"(The older a word, the deeper it reaches.)<br>\",\"date\":\"1915-03-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,67r[5] et 68r[1] (1915--0306) (NB)\",\"ger\":\"Die Probleme der Verneinung, der Disjunktion, von Wahr & Falsch  sind nur Spiegelbilder des einen, groen Problems, in  / den verschieden gestellten groen und kleinen Spiegeln der Philosophie. <br>\",\"eng\":\"The problems of negation, of disjunction, of true and false, are only reflections of the one great problem in the variously placed great and small mirrors of philosophy. [<em>Cf</em>. 5.511.]<br>\",\"date\":\"1915-03-06\",\"pt-number\":\" 5311\",\"pt-page\":\"61[5]\",\"tlp-number\":\"5511\",\"cross-references\":\"24.1.15 (4)*  (6.3.15+)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,68r[2] (1915--0307) (NB)\",\"ger\":\"Wie ~, ~ .  . ~ etc. dieselbe Funktion ist so ist auch ~  ,  etc. dieselbe  nmlich die tautologische  Funktion. Wie die anderen so kann auch sie  und vielleicht mit Vorteil  untersucht werden. <br>\",\"eng\":\"Just as ~, ~ .  . ~ etc. are the same function, so too are ~  , <em>, </em>etc. the same  that is, the tautological  function. Like the others, it can be investigated  and perhaps advantageously.<br>\",\"date\":\"1915-03-07\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,68r[3] (1915--0308) (NB)\",\"ger\":\"Meine Schwierigkeit ist nur eine  enorme  Schwierigkeit des Ausdrucks. <br>\",\"eng\":\"My difficulty is only an  enormous  difficulty of expression.<br>\",\"date\":\"1915-03-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,68r[4] (1915--0318) (NB)\",\"ger\":\"Es ist klar da die genaueste Untersuchung des Satzzeichens nicht ergeben kann was es aussagt  wohl aber was es aussagen <span class='underline_single'>kann</span>. <br>\",\"eng\":\"lt is clear that the closest examination of the propositional sign cannot yield what it asserts  but what it can yield is what it is <span class='underline_single'>capable</span><em> </em>of asserting.<br>\",\"date\":\"1915-03-18\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,69r[1] (1915--0327) (NB)\",\"ger\":\"Das Bild kann eine Beschreibung ersetzen. <br>A picture can replace a description.<br>\",\"eng\":\"\",\"date\":\"1915-03-27\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,69r[2] (1915--0329) (NB)\",\"ger\":\"Das Kausalittsgesetz ist kein Gesetz sondern die Form <span class='underline_single'>eines</span> Gesetzes. <br>\",\"eng\":\"The law of causality is not a law but the form of <span class='underline_single'>a</span> law. [<em>See</em> 6.32.]<br>\",\"date\":\"1915-03-29\",\"pt-number\":\" 63\",\"pt-page\":\"71[5]\",\"tlp-number\":\"632\",\"cross-references\":\"29.3.15 (1)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,69r[3] (1915--0329) (NB)\",\"ger\":\"Kausalittsgesetz das ist ein Gattungsname. Und wie es in der Mechanik  sagen wir  Minimumgesetze gibt  etwa der kleinsten Wirkung  so gibt es in der Physik <span class='underline_double'>ein</span> Kausalittsgesetz, ein Gesetz von der Kausalittsform. <br>\",\"eng\":\"Law of causality  is a generic name. And just as in mechanics there are, for instance, minimum-laws, such as that of least action, so too in physics there is <span class='underline_double'>a</span><em> </em>law of causality, a law of the form of causality. [<em>Cf.</em> 6.321.]<br>\",\"date\":\"1915-03-29\",\"pt-number\":\" 631\",\"pt-page\":\"71[6]\",\"tlp-number\":\"6321**\",\"cross-references\":\"29.3.15 (2)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,69r[4] et 70r[1] (1915--0329) (NB)\",\"ger\":\"Wie die Menschen ja auch eine Ahnung davon gehabt haben da es <span class='underline_single'>ein</span> Gesetz  / der kleinsten Wirkung geben msse ehe sie genau wuten wie es lautete. <br>     (Hier wie so oft stellt sich das Aprioristische als etwas rein Logisches heraus.) <br>\",\"eng\":\"Just as people also had a notion that there must be <span class='underline_single'>a</span><em> </em>law of least action before they knew exactly how it was to be spelled out. <br>(Here, as so often, what is <em>a priori </em>turns out to be something purely logical.) [<em>Cf.</em> 6.3211.]<br>\",\"date\":\"1915-03-29\",\"pt-number\":\" 6311\",\"pt-page\":\"71[7]\",\"tlp-number\":\"63211*\",\"cross-references\":\"29.3.15 (3,4)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,70r[2] (1915--0403) (NB)\",\"ger\":\"Der Satz ist ein Ma der Welt. <br>\",\"eng\":\"The proposition is a measure of the world.<br>\",\"date\":\"1915-04-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,70r[3] (1915--0403) (NB)\",\"ger\":\"Dies ist das Bild eines Vorgangs und stimmt nicht. Wie kann es dann noch immer das Bild jenes Vorgangs sein? <br>\",\"eng\":\"This is the picture of a process and is wrong. How, then, can it still be a picture of that process?<br>\",\"date\":\"1915-04-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,70r[4] et 71r[1] (1915--0403) (NB)\",\"ger\":\"Da a a vertreten <span class='underline_single'>kann</span> & b b vertreten <span class='underline_single'>kann</span> wenn a in der Relation R zu b steht, darin eben besteht  / jene gesuchte <span class='underline_double'>potentielle</span> interne  Relation. <br>\",\"eng\":\"That \\\"a\\\" <span class='underline_single'>can</span> represent a and \\\"b\\\" <span class='underline_single'>can</span> represent b if \\\"a\\\" stands in relation \\\"R\\\" to \\\"b\\\": this is what that <span class='underline_double'>potential</span> internal relation we are seeking consists in.<br>\",\"date\":\"1915-04-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,71r[2] (1915--0405) (NB)\",\"ger\":\"Der Satz ist kein Wrtergemisch. <br>\",\"eng\":\"\",\"date\":\"1915-04-05\",\"pt-number\":\" 31602\",\"pt-page\":\"38[4]\",\"tlp-number\":\"3141 (1)**\",\"cross-references\":\"7.2.15+  5.4.15   11.4.15\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,71r[3] (1915--0410) (NB)\",\"ger\":\"Auch die Melodie ist kein Tongemisch, wie alle Unmusikalischen glauben. <br>\",\"eng\":\"Nor is a tune a mixture of notes, as all unmusical people think. [<em>Cf.</em> 3.141.]<br>\",\"date\":\"1915-04-10\",\"pt-number\":\" 31602\",\"pt-page\":\"38[4]\",\"tlp-number\":\"3141 (1)**\",\"cross-references\":\"7.2.15+  5.4.15   11.4.15\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,71r[4] (1915--0412) (NB)\",\"ger\":\"Ich <span class='underline_single'>kann</span> von dem Wesen des Satzes <span class='underline_single'>nicht</span> auf die einzelnen logischen Operationen kommen!!! <br>\",\"eng\":\"I <span class='underline_single'>cannot</span> get from the nature of the proposition to the individual logical operations!!!<br>\",\"date\":\"1915-04-12\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,71r[5] et 72r[1] (1915--0415) (NB)\",\"ger\":\"Ich kann eben nicht herausbringen inwiefern der Satz das <span class='underline_single'>Bild</span> des Sachverhaltes ist! <br>      Beinahe bin ich bereit  / alle Bemhungen aufzugeben.   <br>\",\"eng\":\"I just can't bring out how a proposition is a <span class='underline_single'>picture</span> of a state of things! <br>      I am almost willing to give up all my efforts.  <br>\",\"date\":\"1915-04-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,72r[2] (1915--0416) (NB)\",\"ger\":\"Die Beschreibung ist auch sozusagen eine Operation deren Basis ihre Hilfsmittel und deren Resultat der beschriebene Gegenstand ist. <br>\",\"eng\":\"A description is also, as it were, an operation that takes its means of description as its basis and its described object as its result. <br>\",\"date\":\"1915-04-16\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,72r[3] (1915--0416) (NB)\",\"ger\":\"Das Zeichen Nicht ist die Klasse aller verneinender Zeichen. <br>\",\"eng\":\"The sign \\\"not\\\" is the class of all negating signs.<br>\",\"date\":\"1915-04-16\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,72r[4] (1915--0417) (NB)\",\"ger\":\"\",\"eng\":\"Das subjektive Universum. <br>The subjective universe.<br>\",\"date\":\"1915-04-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,72r[5] et 73r[1] (1915--0417) (NB)\",\"ger\":\"Statt die logischen Operationen im Satz an dessen Teilstzen zu vollziehen, knnen wir diesen auch <span class='underline_single'>Marken</span> zuordnen und mit ihnen  / operieren. Dann ist <span class='underline_single'>einem</span> Satzbild ein mit ihm in kompliziertester Weise zusammenhngendes Markensternbild zugeordnet. <br>\",\"eng\":\"Instead of performing a propositions logical operations on its component propositions, we can also correlate <span class='underline_single'>marks</span> with them and operate on them.  Then a single sentence picture is correlated with a constellation of marks connected with it in a most complicated way.<br>\",\"date\":\"1915-04-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,73r[2] (1915--0418) (NB)\",\"ger\":\"Fr die Operation der Verneinung ist der bergang von p auf ~p <span class='underline_single'>nicht</span> charakteristisch. (Der <span class='underline_single'>beste Beweis</span>: sie fhrt auch von ~p zu p.) -----------------<br>\",\"eng\":\"The transition from p to ~p is <span class='underline_single'>not</span> what is characteristic of the operation of negation. (The <span class='underline_single'>best proof</span> of this: negation also leads from ~p to p.) -----------------<br>\",\"date\":\"1915-04-18\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,73r[3] (1915--0419) (NB)\",\"ger\":\"Was sich in der Sprache spiegelt, kann ich nicht mit ihr ausdrcken. <br>\",\"eng\":\"Whatever is mirrored in language I cannot use language to express. [<em>Cf</em>. 4.121 (2).]<br>\",\"date\":\"1915-04-19\",\"pt-number\":\" 41021\",\"pt-page\":\"17[8]\",\"tlp-number\":\"4121 (2)\",\"cross-references\":\"19.4.15**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,73r[4] et 74r[1] (1915--0423) (NB)\",\"ger\":\"Wir glauben nicht a priori an ein Erhaltungsgesetz  / sondern wir <span class='underline_single'>wissen</span> a priori die Mglichkeit seiner logischen Form. <br>\",\"eng\":\"We do not believe <em>a priori </em>in a law of conservation, rather we <span class='underline_single'>know</span><em> a priori </em>the possibility of its logical form. [<em>See</em> 6.33.]<br>\",\"date\":\"1915-04-23\",\"pt-number\":\"632\",\"pt-page\":\"71[8]\",\"tlp-number\":\"633*\",\"cross-references\":\"23.4.15 (1)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,74r[2] (1915--0423) (NB)\",\"ger\":\"Alle jene a priori gewissen Stze, wie der Satz vom Grunde von der Kontinuitt in der Natur etc. etc., alle diese sind aprioristische Einsichten bezglich der mglichen Formgebung der Stze der Wissenschaft. <br>\",\"eng\":\"All such <em>a priori</em> certain propositions, including the principle of sufficient reason, the laws of continuity in nature etc. etc. - all these are <em>a priori </em>insights about possible formulations of scientific propositions. [<em>Cf.</em> 6.34.]<br>\",\"date\":\"1915-04-23\",\"pt-number\":\"633\",\"pt-page\":\"71[9]\",\"tlp-number\":\"634*\",\"cross-references\":\"23.4.15 (2)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,74r[3] et 75r[1] (1915--0423) (NB)\",\"ger\":\"Ockhams Devise ist <span class='underline_single'>natrlich</span> keine willkrliche oder durch ihren praktischen Erfolg gerechtfertigte Regel. Sie besagt da unntige Zeichen-Einheiten nichts be / deuten. <br>\",\"eng\":\"<span class='underline_single'>Of course</span>, Occam's razor is no arbitrary rule, nor one that is justified by its practical success. Its point is that unnecessary<em> </em>sign-units mean nothing. [<em>See </em>5.47321 (1).]<br>\",\"date\":\"1915-04-23\",\"pt-number\":\"530633\",\"pt-page\":\"60[4]\",\"tlp-number\":\"547321 (1)\",\"cross-references\":\"23.4.15 (3)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,75r[2] (1915--0423) (NB)\",\"ger\":\"Es ist klar da Zeichen, die denselben Zweck erfllen logisch identisch sind. Das rein Logische <span class='underline_single'>ist</span> eben das was <span class='underline_single'>alle</span> diese leisten knnen. <br>\",\"eng\":\"It is clear that signs that serve the same<em> </em>purpose are logically identical. What <span class='underline_single'>all</span> of these are able to accomplish just <span class='underline_single'>is</span> strictly logical. [<em>Cf. </em>5.47321 (2).]<br>\",\"date\":\"1915-04-23\",\"pt-number\":\" 530634\",\"pt-page\":\"60[5]\",\"tlp-number\":\"547321 (2)\",\"cross-references\":\"23.4.15 (4)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,75r[3] (1915--0424) (NB)\",\"ger\":\"In der Logik (Mathematik) sind Proze & Resultat gleichwertig. (Darum keine berraschungen.) <br>\",\"eng\":\"In logic (mathematics) process and result are equivalent. (Hence, no surprises.) [<em>See </em>6.1261.]<br>\",\"date\":\"1915-04-24\",\"pt-number\":\" 611343\",\"pt-page\":\"70[5]\",\"tlp-number\":\"61261                   \",\"cross-references\":\"24.4.15*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,75r[4] et 76r[1] (1915--0425) (NB)\",\"ger\":\"Da die Sprache in <span class='underline_single'>internen</span> Relationen zur Welt steht, so bestimmt <span class='underline_single'>sie</span> und diese Relationen die logische Mglichkeit der Tatsachen. Haben wir ein bedeutungsvolles Zeichen so mu es in einer bestimmten  / internen Relation zu einem Gebilde stehen. Zeichen & Relation bestimmen eindeutig die logische Form des Bezeichneten. <br>\",\"eng\":\"Since language stands in <span class='underline_single'>internal</span> relations to the world, <span class='underline_single'>it</span> and these relations decide the logical possibility of facts. If we have a meaningful sign, it must stand in a particular internal relation to a structure. Sign and relation unambiguously decide the logical form of that which it signifies.<br>\",\"date\":\"1915-04-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,76r[2] (1915--0425) (NB)\",\"ger\":\"Aber kann nicht irgendein sogenanntes Ding mit irgend einem solchen auf ein und dieselbe Weise zugeordnet werden? <br>     Es ist z.B. ganz klar da wir die Wrter der Sprache als miteinander logisch quivalente Einheiten  empfinden und  gebrauchen. <br>\",\"eng\":\"But can't any so-called thing be correlated in one and the same way with any other such thing? <br>     For example, it is quite clear that we useand experiencethe words of language as logically equivalent units.<br>\",\"date\":\"1915-04-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,76r[3] (1915--0426) (NB)\",\"ger\":\"Es scheint immer als ob es etwas gbe was man <span class='underline_single'>als Ding betrachten knne, andererseits</span> wirkliche einfache Dinge. <br>\",\"eng\":\"It always seems as if there were on the one hand, something that one <span class='underline_single'>could regard as a thing</span>, and <span class='underline_single'>on the other</span><span class='underline_single'> hand</span>, real simple things.<br>\",\"date\":\"1915-04-26\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,77r[1] (1915--0426) (NB)\",\"ger\":\"Es ist klar: Weder ein Bleistiftstrich noch ein Dampfschiff sind einfach. Besteht zwischen diesen beiden wirklich eine logische quivalenz? <br>\",\"eng\":\"It is clear that neither a pencil stroke nor a steamship is simple. Is there really a logical equivalence between these two?<br>\",\"date\":\"1915-04-26\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,77r[2] (1915--0426) (NB)\",\"ger\":\"Gesetze wie der Satz vom Grunde etc. handeln vom Netz, nicht von dem was das Netz beschreibt. <br>\",\"eng\":\"Laws like the principle of sufficient reason, etc. are about the net and not about what the net describes.<br>\",\"date\":\"1915-04-26\",\"pt-number\":\" 636\",\"pt-page\":\"74[2]\",\"tlp-number\":\"635 (2)\",\"cross-references\":\"25.4.15 (6)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,77r[3] (1915--0426) (NB)\",\"ger\":\"Durch die Allgemeinheit mssen die gebruchlichen Stze ihr einfaches Geprge kriegen. <br>\",\"eng\":\"Ordinary propositions must get their imprint of simplicity by means of generality.<br>\",\"date\":\"1915-04-26\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,77r[4] (1915--0426) (NB)\",\"ger\":\"Wir mssen erkennen, <span class='underline_single'>wie</span> die Sprache fr sich selbst sorgt. <br>\",\"eng\":\"\",\"date\":\"1915-04-26\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,77r[5] et 78r[1] (1915--0426) (NB)\",\"ger\":\"Der Satz welcher vom Komplex handelt steht in interner Beziehung zum Satze welcher  / von dessen Bestandteil handelt. <br>\",\"eng\":\"A proposition about a \\\"complex\\\" stands in a internal relation to a proposition about its constituents. [<em>See</em> 3.24 (1).]<br>\",\"date\":\"1915-04-26\",\"pt-number\":\" 320104\",\"pt-page\":\"41[7]\",\"tlp-number\":\"324 (1)\",\"cross-references\":\"26.4.15 (3)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,78r[2] (1915--0427) (NB)\",\"ger\":\"Die Willensfreiheit besteht darin da zuknftige Ereignisse jetzt nicht <span class='underline_double'>gewut</span> werden <span class='underline_single'>knnen</span>. Nur dann knnten wir sie wissen, wenn die Kausalitt eine <span class='underline_double'>innere</span> Notwendigkeit wre  wie etwa die des logischen Schlusses.  Der Zusammenhang von Wissen & Gewutem ist <span class='underline_single'>der</span> der logischen Notwendigkeit. <br>\",\"eng\":\"Freedom of the will consists in the <span class='underline_single'>impossibility</span> of our <span class='underline_double'>knowing</span> future events now. We could know them only if causality were an <span class='underline_double'>inner</span> necessity like, say, that of logical inference. - The connection between knowing and the known is that of logical necessity.<br>\",\"date\":\"1915-04-27\",\"pt-number\":\"50444\",\"pt-page\":\"41[8]\",\"tlp-number\":\"51362 (1)\",\"cross-references\":\"27.4.15 (1)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,78r[3] (1915--0427) (NB)\",\"ger\":\"Ich darf mich nicht um die Sprache kmmern brauchen. <br>\",\"eng\":\"I cannot need to worry about language.<br>\",\"date\":\"1915-04-27\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,78r[4] et 79r[1] (1915--0427? --0428?) (NB)\",\"ger\":\"Das Nicht-Stimmen ist hnlich wie die Nicht-Identitt. /<br>\",\"eng\":\"Non-truth is like non-identity.<br>\",\"date\":\"1915-04-27\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,79r[2] (1915--0428) (NB)\",\"ger\":\"Die Operation des Verneinens besteht nicht etwa im Vorsetzen von ~ sondern in der Klasse aller verneinender Operationen. <br>\",\"eng\":\"The operation of negation does not consist in, say, prefixing a ~, but in the class of all negating operations.<br>\",\"date\":\"1915-04-28\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,79r[3] (1915--0428) (NB)\",\"ger\":\"Was fr Eigenschaften hat aber dann eigentlich diese ideale verneinende Operation? <br>\",\"eng\":\"But in that case, what really are the properties of this ideal negating operation?<br>\",\"date\":\"1915-04-28\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,79r[4] (1915--0428) (NB)\",\"ger\":\"Wie zeigt es sich wenn sich zwei Aussagen miteinander vertragen? <br>Wenn man in p  q statt q p setzt so wird die Aussage zu p! <br>\",\"eng\":\"If two statements are compatible, how is that made clear? <br>If one puts p instead of q in p  q, the statement turns into p.<br>\",\"date\":\"1915-04-28\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,79r[5] et 80r[1] (1915--0428) (NB)\",\"ger\":\"Gehrt das Zeichen p.q auch  / unter diejenigen welche p bejahen?  Ist p eins von den Zeichen fr p  q? <br>\",\"eng\":\"Does the sign p.q also belong among those which affirm p? - Is p one of the signs for p  q?<br>\",\"date\":\"1915-04-28\",\"pt-number\":\" 504103\",\"pt-page\":\"61[2]\",\"tlp-number\":\"5124\",\"cross-references\":\"28.4.15 (5)+   30.4.15 (2)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,80r[2] (1915--0428? --0429?) (NB)\",\"ger\":\"Kann man so sagen?: Alle Zeichen welche p <span class='underline_single'>nicht</span> bejahen, <span class='underline_single'>nicht</span> von p bejaht werden und p <span class='underline_single'>nicht</span> als Tautologie oder Kontradiktion enthalten alle diese Zeichen verneinen p.          <br>\",\"eng\":\"Can one say the following?: All signs that do <span class='underline_single'>not</span> affirm p, are <span class='underline_single'>not</span> affirmed by p, and do not contain p as a tautology or contradiction doesall these signs negate p.     <br>\",\"date\":\"1915-04-28\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,80r[3] (1915--0429) (NB)\",\"ger\":\"Das heit: alle Zeichen die von p abhngig sind & die weder p bejahen noch von p bejaht werden.<br>\",\"eng\":\"That is to say: all signs that depend on p and that neither affirm p nor are affirmed by p.  <br>\",\"date\":\"1915-04-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,80r[4] et 81r[1] (1915--0430) (NB)\",\"ger\":\"Das Vorkommen einer <span class='underline_single'>Operation</span> kann <span class='underline_single'>natrlich</span> allein  / nichts besagen! <br>\",\"eng\":\"The occurrence of an <span class='underline_single'>operation</span> cannot, of course, have any significance in isolation.<br>\",\"date\":\"1915-04-30\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,81r[2] (1915--0430) (NB)\",\"ger\":\"p wird von allen Stzen bejaht aus denen es folgt. <br>     Jeder Satz der p widerspricht verneint p. <br>\",\"eng\":\"p is affirmed by all propositions from which it follows. [<em>See</em><em> </em>5.124.]<br>\",\"date\":\"1915-04-30\",\"pt-number\":\"504105\",\"pt-page\":\"61[4]\",\"tlp-number\":\"51241 (3)\",\"cross-references\":\"30.4.15 (3)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,81r[3] (1915--0501) (NB)\",\"ger\":\"Da p.~p eine Kontradiktion ist zeigt da ~p p widerspricht. <br>\",\"eng\":\"That p.~p is a contradiction shows that ~p contradicts p. [<em>Cf</em><em>.</em><em> </em>6.1201.]<br>\",\"date\":\"1915-05-01\",\"pt-number\":\" 61201\",\"pt-page\":\"116[7]\",\"tlp-number\":\"61201 \",\"cross-references\":\"1.5.15 (1)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,81r[4] (1915--0501) (NB)\",\"ger\":\"Skeptizismus ist <span class='underline_single'>nicht</span> unwiderleglich sondern <span class='underline_single'>offenbar unsinnig</span> wenn er bezweifeln will wo nicht gefragt werden kann. <br>\",\"eng\":\"Scepticism is <span class='underline_single'>not</span> irrefutable, but <span class='underline_single'>obviously nonsensical</span>, if it tries to raise doubts where no questions can be asked. [<em>See</em> 6.51 (1).]<br>\",\"date\":\"1915-05-01\",\"pt-number\":\"651\",\"pt-page\":\"50[1]\",\"tlp-number\":\"\",\"cross-references\":\"1.5.15 (2,3)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,81r[5] et 82r[1] (1915--0501) (NB)\",\"ger\":\"Denn Zweifel kann nur bestehen wo eine Frage besteht; eine Frage kann nur bestehen wo eine Antwort besteht, und diese  / nur wo etwas <span class='underline_single'>gesagt</span> werden <span class='underline_single'>kann</span>. <br>\",\"eng\":\"For doubt can only exist where there is a question, a question can only exist where there is an answer, and an answer only where something <span class='underline_single'>can</span> be <span class='underline_single'>said</span>. [<em>See</em> 6.51 (2).]<br>\",\"date\":\"1915-05-01\",\"pt-number\":\" 651\",\"pt-page\":\"50[1]\",\"tlp-number\":\"651\",\"cross-references\":\"1.5.15 (2,3)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,82r[2] (1915--0501) (NB)\",\"ger\":\"Alle Theorien die besagen: Es <span class='underline_single'>mu</span> sich doch so verhalten, sonst knnten wir ja nicht philosophieren oder sonst knnten wir doch nicht leben etc. etc., mssen natrlich verschwinden. <br>\",\"eng\":\"All theories that say: \\\"This is how it <span class='underline_single'>must</span> be, otherwise we could not philosophize\\\" or \\\"otherwise we surely could not live\\\" etc. etc., must of course disappear.<br>\",\"date\":\"1915-05-01\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,82r[3] (1915--0501) (NB)\",\"ger\":\"Meine Methode ist es nicht das Harte vom Weichen zu, sondern die Hrte des Weichen zu sehen. <br>\",\"eng\":\"My method is not to separate the hard from the soft, but to see the hardness of the soft.<br>\",\"date\":\"1915-05-01\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,82r[4] (1915--0501) (NB)\",\"ger\":\"Es ist eine Hauptkunst des Philosophen sich nicht mit Fragen zu beschftigen, die ihn nichts angehen. <br>\",\"eng\":\"It is one of the chief skills of  the philosopher not to occupy himself with questions that do not concern him.<br>\",\"date\":\"1915-05-01\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,82r[5] et 83r[1] (1915--0501) (NB)\",\"ger\":\"Russells Methode in seiner Scientific Method / in Philosophy ist geradezu ein Rckschritt von der Methode der Physik.<br>\",\"eng\":\"Russell's method in his \\\"Scientific method in philosophy\\\" is simply a step back from the method of physics.<br>\",\"date\":\"1915-05-01\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,83r[2] (1915--0502) (NB)\",\"ger\":\"Die Klasse aller Zeichen die sowohl p als auch q bejahen ist das Zeichen fr p.q. Die Klasse aller Zeichen die entweder p oder q bejahen ist der Satz p  q. <br>\",\"eng\":\"The class of all signs that affirm both p and q is the class of signs for p.q. The class of all signs that affirm either p or q is the proposition \\\"p  q\\\". [<em>Cf </em>5.513 (1).]<br>\",\"date\":\"1915-05-02\",\"pt-number\":\"53131\",\"pt-page\":\"61[9]\",\"tlp-number\":\"5513 (1)\",\"cross-references\":\"2.5.15+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,83r[3] (1915--0503) (NB)\",\"ger\":\"Man kann nicht sagen da sowohl Tautologien als Kontradiktionen <span class='underline_single'>nichts</span> sagen in dem Sinne da sie etwa beide Nullpunkte in der Skala der Stze wren. Denn zum Mindesten sind sie <span class='underline_single'>entgegenge</span>setzte Pole. <br>\",\"eng\":\"One cannot say that both tautology and contradiction say <span class='underline_single'>nothing</span> in the sense that they are both, say, zero points on a scale of propositions. For at least they are <span class='underline_single'>opposite</span> poles.<br>\",\"date\":\"1915-05-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,83r[4] et 84r[1] (1915--0503) (NB)\",\"ger\":\"Kann man sagen: Zwei Stze sind einander entgegengesetzt wenn  / es kein Zeichen gibt das sie beide bejaht  was eigentlich heit: wenn sie kein gemeinsames Glied haben. <br>\",\"eng\":\"Can one say: two propositions are opposites of one another if there is no sign that affirms them both - which really means: if they have no common term? [<em>Cf.</em><em> </em>5.1241 (2).]<br>\",\"date\":\"1915-05-03\",\"pt-number\":\"504104\",\"pt-page\":\"61[3]\",\"tlp-number\":\"51241 (2)\",\"cross-references\":\"3.5.15 (2)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,84r[2] (1915--0503) (NB)\",\"ger\":\" Man stellt sich also die Stze als Klassen von Zeichen vor  die Stze p und q haben das Glied p.q gemeinsam  und zwei Stze sind einander entgegengesetzt wenn sie ganz auerhalb einander liegen. <br>\",\"eng\":\"So one imagines propositions as classes of signs - the propositions \\\"p\\\" and \\\"q\\\" have the term \\\"p.q\\\" in common - and two propositions are opposites if they lie entirely outside one another. [<em>Cf.</em><em> </em>5.513 (2).]<br>\",\"date\":\"1915-05-03\",\"pt-number\":\"53132\",\"pt-page\":\"62[1]\",\"tlp-number\":\"5513 (2)\",\"cross-references\":\"3.5.15 (3)+   6.6.15 (13)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,84r[3] (1915--0504) (NB)\",\"ger\":\"Das sogenannte Gesetz der Induktion kann jedenfalls kein logisches Gesetz sein, denn es ist offenbar ein Satz. <br>\",\"eng\":\"At any rate, what has been styled the law of induction cannot be a law of logic, for it is obviously a proposition. [<em>See</em> 6.31.]<br>\",\"date\":\"1915-05-04\",\"pt-number\":\" 612112\",\"pt-page\":\"71[4]\",\"tlp-number\":\"631\",\"cross-references\":\"4.5.15 (1)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,84r[4] et 85r[1] (1915--0504) (NB)\",\"ger\":\"Die Klasse aller Stze von der  / Form F(x) ist der Satz (x) x. <br>\",\"eng\":\"The class of all propositions of the form F(x) is the proposition (x) x.<br>\",\"date\":\"1915-05-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,85r[2] (1915--0505) (NB)\",\"ger\":\"Gibt es die allgemeine Satzform? <br>Ja, wenn darunter die eine logische Konstante verstanden ist! <br>\",\"eng\":\"Does the general propositional form exist? <br>Yes, if by that is understood the sole \\\"logical constant\\\".  [<em>Cf.</em><em> </em>5.47 (4-5).]<br>\",\"date\":\"1915-05-05\",\"pt-number\":\" 5305\",\"pt-page\":\"47[1]\",\"tlp-number\":\"547 (5)\",\"cross-references\":\"(5.5.15+)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,85r[3] (1915--0505) (NB)  \",\"ger\":\"Immer wieder scheint die Frage einen Sinn zu haben: Gibt es einfache Dinge? Und doch mu diese Frage unsinnig sein!  <br>\",\"eng\":\"It keeps on looking as if the question \\\"Are there simple things?\\\" makes sense. Yet surely this question must be nonsense! --<br>\",\"date\":\"1915-05-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,85r[4] (1915--0506) (NB)\",\"ger\":\"Man wrde sich vergeblich bemhen den Scheinsatz gibt es einfache Dinge? in Zeichen der Begriffsschrift auszudrcken. [<em>Cf.</em> 5.534]<br>\",\"eng\":\"One would try in vain to express the pseudo-proposition \\\"Are there simple things?\\\" in conceptual notation.<br>\",\"date\":\"1915-05-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,86r[1] (1915--0506) (NB)\",\"ger\":\"Es ist doch klar da ich einen Begriff vom Ding, von der einfachen Zuordnung vor mir habe wenn ich ber diese Sache denke. <br>     Wie stelle ich mir aber das Einfache vor? Da kann ich immer nur sagen x hat Bedeutung.  Hier ist ein groes Rtsel! <br>\",\"eng\":\"Yet its clear that when I think about this issue I have a concept of a thing, of a simple correlation.<br>But how am I imagining a simple? There all I can say is always \\\"'x' has meaning\\\". Here is a huge riddle!<br>\",\"date\":\"1915-05-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,86r[2] (1915--0506) (NB)\",\"ger\":\"Als Beispiele des Einfachen denke ich immer an Punkte des Gesichtsbildes. (Wie mir als typisch zusammengesetzte Gegenstnde immer Teile des Gesichtsbildes vorschweben.) <br>\",\"eng\":\"I always think of points in the visual field as examples of simples. (Just as parts of the visual field always come to mind as typical composite objects).<br>\",\"date\":\"1915-05-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,86r[3] (1915--0507) (NB)\",\"ger\":\"Ist rumliche Zusammengesetztheit auch logische Zusammengesetztheit? Es scheint doch, ja! <br>\",\"eng\":\"Is spatial complexity also logical complexity? It surely seems to be.<br>\",\"date\":\"1915-05-07\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,87r[1] (1915--0507) (NB)\",\"ger\":\"Aus was besteht aber z.B. ein gleichfrmig gefrbter Teil meines Gesichtsbildes? Aus minimum sensibile? Wie sollte man denn den Ort eines jeden solchen bestimmen? <br>\",\"eng\":\"But what is a uniformly coloured part of my visual field, for example, made up of? Of minima sensibilia? How would one specify the location of each of them?<br>\",\"date\":\"1915-05-07\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,87r[2] (1915--0507) (NB)\",\"ger\":\"Auch wenn die von uns gebrauchten Stze alle Verallgemeinerungen enthalten, so mssen in ihnen doch die Urbilder der Bestandteile ihrer Spezialflle vorkommen. Also bleibt die Frage bestehen wie wir zu jenen kommen. <br>\",\"eng\":\"Even if the sentences which we ordinarily use all contain generalizations, the prototypes of the constituents of their special cases must surely occur in them. So the question remains how we arrive at those.<br>\",\"date\":\"1915-05-07\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,87r[3] et 88r[1] (1915--0508) (NB)\",\"ger\":\"Da es keine Zeichen eines bestimmten Urbilds gibt zeigt nicht da jenes Urbild nicht vorhanden ist. Die zeichensprachliche Abbildung geschieht  / nicht so da ein <span class='underline_single'>Zeichen</span> eines Urbilds einen <span class='underline_single'>Gegenstand</span> desselben Urbilds vertritt. Das Zeichen und die interne Relation zum Bezeichneten bestimmen das Urbild dieses; wie Grundkoordinaten und Ordinaten die Punkte einer Figur bestimmen. <br>\",\"eng\":\"The fact that there is no sign for a particular prototype does not show that this prototype does not exist. Depiction by means of sign language does not happen in such a way that a <span class='underline_single'>sign</span> of a prototype stands for an <span class='underline_single'>object</span> of that prototype. The sign and the internal relation to what it signifies prescribe the prototype of the latter; as basic co-ordinates together with the axes prescribe the points of a graph.<br>\",\"date\":\"1915-05-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,88r[2] (1915--0509) (NB)\",\"ger\":\"Eine Frage: Knnen wir ohne einfache Gegenstnde in der <span class='underline_double'>Logik</span> auskommen? <br>\",\"eng\":\"A question: can we get by without simple objects in <span class='underline_double'>logic</span>?<br>\",\"date\":\"1915-05-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,88r[3] et 89r[1] (1915--0509) (NB)\",\"ger\":\"<span class='underline_single'>Offenbar</span> sind Stze mglich welche keine einfachen Zeichen enthalten d.h. keine Zeichen welche unmittelbar eine Bedeutung haben. Und diese sind wirklich <span class='underline_single'>Stze</span> die einen Sinn haben und die Definitionen ihrer Bestandteile  / brauchen auch nicht bei ihnen zu stehen. <br>\",\"eng\":\"<span class='underline_single'>Obviously</span> propositions are possible which contain no simple signs, i.e. no signs which have an immediate meaning. And these really are <span class='underline_single'>propositions</span> that make sense, and the definitions of their constituents do not need to accompany them.<br>\",\"date\":\"1915-05-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,89r[2] (1915--0509) (NB)\",\"ger\":\"Es ist doch klar da Bestandteile unserer Stze durch Definitionen zerlegt werden knnen, und mssen, wenn wir uns der eigentlichen Struktur des Satzes nhern wollen. <span class='underline_single'>Jedenfalls gibt es also einen </span><span class='underline_single'>Proze</span><span class='underline_single'> der Analyse.</span> Und kann nun nicht gefragt werden ob dieser Proze einmal zu einem Ende kommt? Und wenn, ja: Was wird das Ende sein?? <br>\",\"eng\":\"But it is clear that constituents of our propositions can be broken down by means of definitions, and must be, if we want to approach the real structure of the proposition. <span class='underline_single'>However</span><span class='underline_single'> that may be</span><span class='underline_single'>, there is a process of analysis.</span> And can it not now be asked whether this process will come to an end? And if so: What will the end be?<br>\",\"date\":\"1915-05-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,89r[3] et 90r[1] (1915--0509) (NB)\",\"ger\":\"Wenn es wahr ist da jedes definierte Zeichen via seine Definitionen bezeichnet dann mu wohl die Kette der Definitionen  / einmal ein Ende haben. <br>\",\"eng\":\"If it is true that every defined sign signifies <em>via</em> its definitions then presumably the chain of definitions must end at some point. [<em>Cf.</em> 3.261.]<br>\",\"date\":\"1915-05-09\",\"pt-number\":\" 320211\",\"pt-page\":\"51[3]\",\"tlp-number\":\"3261*\",\"cross-references\":\"9.5.15 (4)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,90r[2] (1915--0509) (NB)\",\"ger\":\"Der zerlegte Satz redet von mehr als der unzerlegte. <br>\",\"eng\":\"The analysed proposition mentions more than the unanalysed.<br>\",\"date\":\"1915-05-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,90r[3] (1915--0509) (NB)\",\"ger\":\"Zerlegung macht den Satz komplizierter als er war aber kann & darf ihn nicht komplizierter machen als seine Bedeutung von Haus aus war. <br>\",\"eng\":\"Analysis makes a proposition more complicated than it was, but cannot and should not make it more complicated than its meaning actually was.<br>\",\"date\":\"1915-05-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,90r[4] (1915--0509) (NB)\",\"ger\":\" Wenn der Satz gerade so komplex ist wie seine Bedeutung, dann ist er <span class='underline_single'>ganz</span> zerlegt. <br>\",\"eng\":\"When a proposition is just as complex as its meaning, then it is <span class='underline_single'>completely</span> analysed.<br>\",\"date\":\"1915-05-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,90r[5] (1915--0509) (NB)\",\"ger\":\"Die Bedeutung unserer Stze aber ist nicht unendlich kompliziert. <br>\",\"eng\":\"But the meaning of our propositions is not infinitely complicated.<br>\",\"date\":\"1915-05-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,91r[1] (1915--0509) (NB)\",\"ger\":\" Der Satz ist das Bild der Tatsachen. Ich kann von einer Tatsache verschiedene Bilder entwerfen. (Dazu dienen mir die logischen Operationen.) Aber das fr die <span class='underline_single'>Tatsache</span> Charakteristische in diesen Bildern wird in allen dasselbe sein und von mir nicht abhngen. <br>\",\"eng\":\"A proposition is a picture of the facts. I can outline different pictures of a fact. (The logical operations serve this purpose.) But what is characteristic of the <span class='underline_single'>fact</span> will be the same in all of these pictures and will not depend on me.<br>\",\"date\":\"1915-05-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,91r[2] (1915--0509) (NB)\",\"ger\":\" Mit der Zeichenklasse des Satzes p ist bereits die Klasse ~p etc. etc. gegeben. Wie es auch sein mu. <br>\",\"eng\":\"With the class of signs for a proposition \\\"p\\\" the class \\\"~p\\\" etc. etc. is already given. As it must be.<br>\",\"date\":\"1915-05-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,91r[3] et 92r[1] (1915--0509) (NB)\",\"ger\":\"<span class='underline_single'>Aber</span>, setzt das nicht schon voraus da uns die Klasse aller Stze gegeben ist? Und wie kommen wir zu <span class='underline_single'>ihr</span>? /  <br>\",\"eng\":\"<span class='underline_single'>But</span> doesnt this already presuppose that the class of all propositions is given to us? And how do we arrive at <span class='underline_single'>it</span>?<br>\",\"date\":\"1915-05-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,92r[2] (1915--0511) (NB)\",\"ger\":\"Ist die logische Summe zweier Tautologien eine Tautologie im ersten Sinne? Gibt es wirklich die Dualitt: Tautologie  Kontradiktion? <br>\",\"eng\":\"Is the logical sum of two tautologies a tautology in the first sense? Is there really such a thing as the duality: tautology - contradiction?<br>\",\"date\":\"1915-05-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,92r[3] (1915--0511) (NB)\",\"ger\":\"Unser Einfaches <span class='underline_double'>ist</span>: das Einfachste was wir kennen.  Das Einfachste zu dem unsere Analyse vordringen kann  es braucht nur als Urbild, als Variable in unseren Stzen zu erscheinen  <span class='underline_single'>dies</span> ist das Einfache welches wir meinen und suchen. <br>\",\"eng\":\"Our simple <span class='underline_double'>is</span>: the simplest we know. - The simplest our analysis can reach - it need only appear as a prototype, as a variable in our propositions - <span class='underline_single'>this</span> is the simple that we mean and hunt for.<br>\",\"date\":\"1915-05-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,93r[1] (1915--0512) (NB)\",\"ger\":\"Der allgemeine Begriff der Abbildung und <span class='underline_single'>der</span> der Koordinaten. <br>\",\"eng\":\"The general concept of depiction, and of co-ordinates.<br>\",\"date\":\"1915-05-12\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,93r[2] (1915--0512) (NB)\",\"ger\":\" Angenommen der Ausdruck ~(x) x = x wre ein Satz nmlich etwa der: Es gibt keine Dinge dann mte es sehr wundernehmen da wir, um diesen Satz in Symbolen auszudrcken eine Relation ( = ) bentzen mssen, von der in ihm eigentlich gar nicht die Rede ist. <br>\",\"eng\":\"Suppose that the expression \\\"~(x)x = x\\\" were a proposition, namely (say), this one: \\\"There are no things.\\\" It would be absolutely astonishing to have to use a relation (=) thats not mentioned in the proposition to express this proposition in symbols.<br>\",\"date\":\"1915-05-12\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,93r[3] (1915--0513) (NB)\",\"ger\":\"Eine eigentmliche logische Manipulation, die <span class='underline_single'>Personifizierung</span> der <span class='underline_single'>Zeit</span>! <br>\",\"eng\":\"\",\"date\":\"1915-05-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,93r[4] et 94r[1] (1915--0513) (NB)\",\"ger\":\"Nur nicht den Knoten zusammenziehen  / bevor man sicher ist da man das rechte Ende erwischt hat. <br>\",\"eng\":\"Just don't pull the knot tight before youre sure youve got the right end.<br>\",\"date\":\"1915-05-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,94r[2] (1915--0513) (NB)\",\"ger\":\"Drfen wir einen Teil des Raumes als Ding betrachten. Dies tun wir offenbar in gewissem Sinne immer, wo wir von den rumlichen Dingen reden. <br>\",\"eng\":\"Can we regard a part of space as a thing? In a certain sense we manifestly do this whenever we talk about spatial things.<br>\",\"date\":\"1915-05-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,94r[3] et 95r[1] (1915--0513) (NB)\",\"ger\":\"Es scheint nmlich  zum mindesten soweit ich jetzt <span class='underline_single'>sehen</span> kann  mit dem Wegschaffen von Namen durch Definitionen nicht getan zu sein: die komplexen rumlichen Gegenstnde, zum Beispiel, scheinen mir in irgendeinem Sinn wesentlich Dinge zu  / sein  ich sehe sie, sozusagen, als Dinge  und ihre Bezeichnung vermittelst Namen scheint mehr zu sein als ein blo sprachlicher Trick. Die rumlichen zusammengesetzten Gegenstnde  z.B.  erscheinen  wie es scheint  wirklich als Dinge. <br>\",\"eng\":\"For it seemsat least as far as I can <span class='underline_single'>see</span> now - that it cant be a matter of getting rid of names by means of definitions: complex spatial objects, for example, seem to me in some sense to be essentially thingsI see them, so to speak, as things.And their designation by means of names seems to be more than a mere linguistic gimmick. Composite spatial objectsfor examplereally, as it seems, do appear as things.<br>\",\"date\":\"1915-05-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,95r[2] (1915--0513) (NB)\",\"ger\":\"Aber was bedeutet das alles? <br>\",\"eng\":\"But what does all this mean?<br>\",\"date\":\"1915-05-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,95r[3] (1915--0513) (NB)\",\"ger\":\"Schon da wir so ganz instinktiv jene Gegenstnde durch Namen bezeichnen.  <br>\",\"eng\":\"That we already completely instinctively refer to those objects by using names.<br>\",\"date\":\"1915-05-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,95r[4] (1915--0514) (NB)\",\"ger\":\"Die Sprache ist ein Teil unseres Organismus, und nicht weniger kompliziert als dieser. <br>\",\"eng\":\"Language is a part of our organism and no less complicated than it. [<em>Cf. </em>4.002.]<br>\",\"date\":\"1915-05-14\",\"pt-number\":\"40012\",\"pt-page\":\"36[7]\",\"tlp-number\":\"4002 (2)\",\"cross-references\":\"14.5.15 (1)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,96r[1] (1915--0514)\",\"ger\":\"\",\"eng\":\"[drawing/diagram above the line at the top of the page.]<br>\",\"date\":\"1915-05-14\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,96r[2] (1915--0514) (NB)\",\"ger\":\"Das alte Problem von Komplex und Tatsache! <br>\",\"eng\":\"The old problem of complex and fact!<br>\",\"date\":\"1915-05-14\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,96r[3] et 97r[1] (1915--0515) (NB)\",\"ger\":\"Die Komplex-Theorie drckt sich in Stzen aus wie dieser: Wenn ein Satz wahr ist dann existiert etwas; es scheint ein Unterschied zu sein zwischen der Tatsache welche der Satz ausdrckt: a steht in der Relation R zu b, und dem Komplex: <span class='underline_single'>a in der Relation R zu b</span> welche eben dasjenige ist welches existiert wenn jener Satz wahr ist. Es scheint als knnten wir dieses Etwas <span class='underline_single'>bezeichnen</span>, und zwar mit einem eigentlichen zusammengesetzten Zeichen.  Die Gefhle die sich in diesen Stzen ausdrcken  / sind ganz natrlich und ungeknstelt; es mu ihnen also eine Wahrheit zu Grunde liegen. Aber welche? <br>\",\"eng\":\"A theory of the complex is expressed in such propositions as: \\\"If a proposition is true then something exists\\\". There seems to be a difference between the fact expressed by the proposition: a stands in relation R to b, and the complex: <span class='underline_single'>a in relation R to b</span>, which is that very something that \\\"exists\\\" if that proposition is true. It seems as if we could <span class='underline_single'>refer</span> to this something, and what's more with an actual \\\"composite sign\\\".The feelings expressed in these sentences are entirely natural and genuine, so there must be some truth underlying them. But which one?<br>\",\"date\":\"1915-05-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,97r[2] (1915--0515)\",\"ger\":\"Was liegt an meinem Leben? <br>\",\"eng\":\"What matters about my life?<br>\",\"date\":\"1915-05-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,97r[3] (1915--0515) (NB)\",\"ger\":\"Soviel ist klar, da ein Komplex nur durch seine Beschreibung gegeben sein kann; und diese stimmen oder nicht stimmen wird. <br>\",\"eng\":\"So much is clear, that a complex can be given only by its description; which either will fit or not fit. [<em>See</em> 3.24.]<br>\",\"date\":\"1915-05-15\",\"pt-number\":\"320105\",\"pt-page\":\"58[7]\",\"tlp-number\":\"324 (2)\",\"cross-references\":\"15.5.15 (3-4)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,97r[4] (1915--0515) (NB)\",\"ger\":\"Der Satz in welchem von einem Komplex die Rede ist, wird, wenn dieser nicht existiert, nicht unsinnig, sondern einfach falsch sein! <br>\",\"eng\":\"A proposition that mentions a complex that does not exist will not be nonsensical, but just false. [<em>See</em> 3.24.]<br>\",\"date\":\"1915-05-15\",\"pt-number\":\"320105\",\"pt-page\":\"58[7]\",\"tlp-number\":\"324 (2)\",\"cross-references\":\"15.5.15 (3-4)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,97r[5] et 98r[1] (1915--0516) (NB)\",\"ger\":\"Wenn ich den Raum sehe, sehe  / ich alle seine Punkte? <br>\",\"eng\":\"\",\"date\":\"1915-05-16\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,98r[2] (1915--0516) (NB)\",\"ger\":\"Etwas der Logik Widersprechendes in der Sprache darstellen kann man ebensowenig, wie in der Geometrie eine den Gesetzen des Raumes widersprechende Figur durch ihre Koordinaten darzustellen, oder etwa die Koordinaten eines Punktes zu geben welcher nicht existiert. <br>\",\"eng\":\"It is as impossible to represent something that contradicts logic in language as it is to represent by its co-ordinates a figure that contradicts the laws of space, or, say, to give the co-ordinates of a point that does not exist. [<em>See </em>3.032.]<br>\",\"date\":\"1915-05-16\",\"pt-number\":\"3032\",\"pt-page\":\"42[8]\",\"tlp-number\":\"3032*\",\"cross-references\":\"16.5.15 (2)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,98r[3] et 99r[1] (1915--0516) (NB)\",\"ger\":\"Gbe es Stze welche die Existenz von Urbildern besagten dann wren diese unik und eine Art logische Stze und die Anzahl dieser Stze wrde der Logik eine  / unmgliche Realitt geben. Es gbe Koordination in der Logik. <br>\",\"eng\":\"If there were propositions asserting the existence of prototypes they would be unique and would be a kind of \\\"logical propositions\\\" and the set of these propositions would give logic an impossible reality. There would be co-ordination in logic.<br>\",\"date\":\"1915-05-16\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,99r[2] (1915--0517? --0518?) (NB)\",\"ger\":\"Die Mglichkeit aller Gleichnisse, der ganzen Bildhaftigkeit unserer Ausdrucksweise, ruht in der Logik der Abbildung. <br>\",\"eng\":\"The possibility of all similes, of all the pictoriality of our language, reposes in the logic of depiction. [4.015.]<br>\",\"date\":\"1915-05-17\",\"pt-number\":\"40101\",\"pt-page\":\"42[5]\",\"tlp-number\":\"4015\",\"cross-references\":\"18.5.15 (1)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,99r[3] et 100r[1] (1915--0519) (NB)\",\"ger\":\"Wir knnen sogar einen in Bewegung begriffenen Krper,<span class='underline_single'> und zwar mit seiner Bewegung zusammen</span> als Ding auffassen. So bewegt sich, der um die Erde sich drehende Mond, um die Sonne. Hier scheint es nun klar da in dieser Verdinglichung nichts als eine logische Manipulation  / vorliegt  deren Mglichkeit brigens hchst bedeutungsvoll sein mag. <br>Oder betrachten wir Verdinglichungen wie: eine Melodie, ein gesprochener Satz.  <br>Or let us consider reifications like: a tune, a spoken sentence.<br>\",\"eng\":\"We can even conceive a body apprehended as in movement, and indeed together with its movement, as a thing. Thus the moon, rotating around the earth, moves around the sun. Now here it seems clear that this reification is nothing but a logical manipulationthough the possibility of this may be extremely significant.<br>\",\"date\":\"1915-05-19\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,100r[2] (1915--0519) (NB)\",\"ger\":\"Wenn ich sage x hat Bedeutung empfinde ich da: es ist unmglich da x etwa dieses Messer oder diesen Brief bedeute? Durchaus nicht. Im Gegenteil. <br>\",\"eng\":\"When I say \\\"'x' has meaning\\\" do I have the feeling: \\\"it is impossible that 'x' means this knife or this letter\\\"? Not at all. On the contrary.<br>\",\"date\":\"1915-05-19\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,100r[3] (1915--0520) (NB)\",\"ger\":\"Ein Komplex ist eben ein Ding! <br>\",\"eng\":\"A complex just is a thing!<br>\",\"date\":\"1915-05-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,100r[4] et 101r[1] (1915--0521) (NB)\",\"ger\":\"Wohl knnen wir einen Tatbestand rumlich darstellen welcher den Gesetzen der  / Physik, aber keinen der den Gesetzen der Geometrie zuwiderliefe. <br>\",\"eng\":\"While we are able to give a spatial representation of a matter of fact running foul of the laws of physics, we cannot give such a representation of one that would run counter to the laws of geometry. [<em>See</em> 3.0321.]<br>\",\"date\":\"1915-05-21\",\"pt-number\":\" 30321\",\"pt-page\":\"43[1]\",\"tlp-number\":\"30321\",\"cross-references\":\"21.5.15*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,101r[2] (1915--0522) (NB)\",\"ger\":\"Die mathematische Notation der unendlichen Reihen wie  1 + x/1! + x2/2! +..... <span class='underline_single'>mit den Pnktchen</span> ist ein Beispiel jener erweiterten Allgemeinheit. Ein Gesetz ist gegeben und die hingeschriebenen Glieder dienen als Illustration. <br>\",\"eng\":\"The mathematical notation for infinite series like  1 + x/1! + x2/2! +..... <span class='underline_single'>together with the dots</span> is an example of that extended generality. A law is given and the terms that are written down serve as an illustration.<br>In this way instead of (x) fx one might write \\\"f(x).f(y). .....\\\".<br>\",\"date\":\"1915-05-22\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,101r[3] (1915--0522) (NB)\",\"ger\":\"Rumliche & <span class='underline_single'>zeitliche</span> Komplexe. <br>\",\"eng\":\"Spatial and <span class='underline_single'>temporal</span> complexes.<br>\",\"date\":\"1915-05-22\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,101r[4] (1915--0523) (NB)\",\"ger\":\"<span class='underline_single'>Die Grenzen meiner Sprache</span> bedeuten die Grenzen meiner Welt. <br>\",\"eng\":\"<span class='underline_single'>The limits of my language</span> mean the limits of my world. [5.6]<br>\",\"date\":\"1915-05-23\",\"pt-number\":\"5335\",\"pt-page\":\"59[6]\",\"tlp-number\":\"56\",\"cross-references\":\"23.5.15 (1)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,101r[5] et 102r[1] (1915--0523) (NB)\",\"ger\":\"Es gibt wirklich nur eine  / Weltseele, welche ich vorzglich <span class='underline_single'>meine</span> Seele nenne, und als welche allein ich das erfasse, was ich die Seelen anderer nenne. <br>\",\"eng\":\"There really is only one world soul, which I call <span class='underline_single'>my</span> soul in the first place, and as which alone I conceive what I call the souls of others.<br>\",\"date\":\"1915-05-23\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,102r[2] (1915--0523) (NB)\",\"ger\":\"Die vorige Bemerkung gibt den Schlssel zur Entscheidung inwieweit der Solipsismus eine Wahrheit ist. <br>\",\"eng\":\"The previous remark provides the key to deciding how much truth there is in solipsism. [<em>See</em> 5.62 (1).]<br>\",\"date\":\"1915-05-23\",\"pt-number\":\" 53351\",\"pt-page\":\"59[7]\",\"tlp-number\":\"562 (1)*\",\"cross-references\":\"23.5.15 (3)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,102r[3] (1915--0523) (NB)\",\"ger\":\"Schon lange war es mir bewut da ich ein Buch schreiben knnte Was fr eine Welt ich vorfand.. <br>\",\"eng\":\"I have long been aware that I could write a book: \\\"The sort of world I found\\\". [Cf. 5.631.]<br>\",\"date\":\"1915-05-23\",\"pt-number\":\" 533541\",\"pt-page\":\"76[2]\",\"tlp-number\":\"5631 (2)* \",\"cross-references\":\"23.5.15 (4,11)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,102r[4] et 103r[1] (1915--0523) (NB)\",\"ger\":\"Haben wir nicht eben das Gefhl von der einfachen Relation, welches uns immer als Hauptgrund fr die Existenz || Annahme der einfachen Gegenstnde vorschwebt, haben wir nicht dieses selbe Gefhl wenn wir an die Relation  / zwischen Namen & komplexem Gegenstand denken? <br>\",\"eng\":\"The feeling of a simple relation which we always have in mind as the main reason for the assumption of \\\"simple objects\\\"don't we have the very same feeling when we think of the relation between name and complex object?<br>\",\"date\":\"1915-05-23\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,103r[2] (1915--0523) (NB)\",\"ger\":\"Nehmen wir an der komplexe Gegenstand sei dies Buch; es heie A. Dann zeigt doch das Vorkommen des A im Satz das Vorkommen des Buches in der Tatsache an. <span class='underline_single'>Es lst sich eben auch bei der Analyse nicht willkrlich auf, so </span><span class='underline_single'>da</span><span class='underline_single'> etwa seine Auflsung in jedem Satzgefge eine gnzlich verschiedene wre.</span>  <br>\",\"eng\":\"Suppose the complex object is this book. Let it be called \\\"A\\\". Then surely the occurrence of \\\"A\\\" in the proposition indicates the occurrence of the book in the fact. <span class='underline_single'>Even giving an analysis does not yield an arbitrary resolution: for instance, \\\"A\\\" would not have an entirely different resolution in every composite proposition</span>.<br>\",\"date\":\"1915-05-23\",\"pt-number\":\" 32531\",\"pt-page\":\"59[1]\",\"tlp-number\":\"33442\",\"cross-references\":\"23.5.15 (6)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,103r[3] et 104r[1] (1915--0523) (NB)\",\"ger\":\"Und so wie das Vorkommen eines Ding-Namens in verschiedenen Stzen so zeigt das Vorkommen des Namens zusammengesetzter Gegenstnde die  / Gemeinsamkeit einer Form und eines Inhalts. <br>\",\"eng\":\"And like the occurrence of of a name-thing in different propositions, the occurrence of the name of composite objects shows there is a form and a content in common.<br>\",\"date\":\"1915-05-23\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,104r[2] (1915--0523) (NB)\",\"ger\":\"Trotzdem scheint nun der <span class='underline_single'>unendlich</span> komplexe Sachverhalt ein Unding zu sein! <br>\",\"eng\":\"Nevertheless, an <span class='underline_single'>infinitely</span> complex state of things now looks preposterous.<br>\",\"date\":\"1915-05-23\",\"pt-number\":\"54103\",\"pt-page\":\"80[8]\",\"tlp-number\":\"42211** \",\"cross-references\":\"23.5.15 (8)+   17.6.15 (8)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,104r[3] (1915--0523) (NB)\",\"ger\":\"Aber auch das scheint sicher, da wir die Existenz einfacher Gegenstnde nicht aus der Existenz bestimmter einfacher Gegenstnde schlieen, sondern sie vielmehr als Endresultat einer Analyse sozusagen durch die Beschreibung durch einen zu ihnen fhrenden Proze, kennen. <br>\",\"eng\":\"But it also seems certain that we do not infer the existence of simple objects from the existence of particular simple objects, but rather know them through a process leading to them, as the end result of an analysisby description, as it were.<br>\",\"date\":\"1915-05-23\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,104r[4] et 105r[1] (1915--0523) (NB)\",\"ger\":\"Deswegen, weil eine Redewendung unsinnig  / ist, kann man sie noch immer gebrauchen  siehe die letzte Bemerkung. <br>\",\"eng\":\"That is why one can still go on using a nonsensical idiom  see the last remark.<br>\",\"date\":\"1915-05-23\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,105r[2] (1915--0523) (NB)\",\"ger\":\"In dem Buch Die Welt welche ich vorfand wre auch ber meinen Leib zu berichten und zu sagen welche Glieder meinem Willen unterstehen etc. Dies ist nmlich eine Methode das Subjekt zu isolieren oder vielmehr zu zeigen da es in einem wichtigen Sinne kein Subjekt gibt: Von ihm allein nmlich knnte in diesem Buche <span class='underline_single'>nicht</span> die Rede sein.  <br>\",\"eng\":\"The book called <em>The World I Found</em> would also have to report on my body and say which parts are subject to my will, etc. For this is a method of isolating the subject, or rather of showing that in an important sense there is no subject; for it alone could <span class='underline_single'>not</span><em> </em>be mentioned in that book. <br>\",\"date\":\"1915-05-23\",\"pt-number\":\" 533541\",\"pt-page\":\"76[2]\",\"tlp-number\":\"5631 (2)* \",\"cross-references\":\"23.5.15 (4,11)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,105r[3] et 106r[1] (1915--0524) (NB)\",\"ger\":\"Wenn wir auch die einfachen Gegenstnde nicht aus der Anschauung kennen; die komplexen Gegenstnde <span class='underline_single'>kennen</span> wir aus der Anschauung, wir wissen aus  / der Anschauung da sie komplex sind.  Und da sie zuletzt aus einfachen Dingen bestehen mssen? <br>     Wir nehmen zum Beispiel aus unserem Gesichtsfeld einen Teil heraus, wir sehen da er noch immer komplex ist, da ein Teil von ihm noch immer komplex aber schon einfacher ist, u.s.w. <br>\",\"eng\":\"Even though we have no acquaintance with simple objects we <span class='underline_single'>do know</span> complex objects by acquaintance, we know by acquaintance that they are complex. And that in the end they must consist of simple things?<br>     For example, we single out a part of our field of vision, we see that it is still complex, that a part of it is still complex but already simpler, and so on....<br>\",\"date\":\"1915-05-24\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,106r[2] (1915--0524) (NB)\",\"ger\":\"Ist es denkbar da wir  z.B.  <span class='underline_single'>sehen</span>, da <span class='underline_single'>alle Punkte einer Flche gelb sind</span>, ohne irgend <span class='underline_single'>einen</span> Punkt dieser Flche zu sehen. Fast scheint es so. <br>\",\"eng\":\"Is it conceivable that we - e.g. - <span class='underline_single'>see </span>that <span class='underline_single'>all points </span><span class='underline_single'>of</span><span class='underline_single'> a surface are yellow</span>, without seeing <span class='underline_single'>any</span><span class='underline_single'> single</span> point of this surface. It almost seems so.<br>\",\"date\":\"1915-05-24\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,106r[3] (1915--0524) (NB)\",\"ger\":\"Der Entstehung der Probleme: die drckende Spannung die sich einmal in eine Frage zusammenballt, und sich objektiviert. <br>\",\"eng\":\"\",\"date\":\"1915-05-24\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,107r[1] (1915--0524) (NB)\",\"ger\":\"Wie wrden wir, z.B., eine gleichmig mit Blau bedeckte Flche beschreiben? <br>\",\"eng\":\"How would we describe, for example, a surface uniformly covered with blue?<br>\",\"date\":\"1915-05-24\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,107r[2] (1915--0525) (NB)\",\"ger\":\"Erscheint uns das Gesichtsbild eines minimum visibile wirklich als unteilbar? Was Ausdehnung hat ist teilbar. Gibt es Teile in unserem Gesichtsbild die <span class='underline_single'>keine</span> Ausdehnung haben? Etwa die der Fixsterne?  <br>\",\"eng\":\"Does the visual image of a <em>minimum </em><em>visibile</em> really strike us as indivisible? What has extension is divisible. Are there parts of our visual field that have <span class='underline_single'>no</span> extension? For instance, images of the fixed stars?<br>\",\"date\":\"1915-05-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,107r[3] et 108r[1] (1915--0525) (NB)\",\"ger\":\"Der Trieb zum Mystischen kommt von der Unbefriedigtheit unserer Wnsche durch die Wissenschaft. Wir <span class='underline_single'>fhlen</span> da selbst, wenn alle <span class='underline_single'>mglichen</span> wissenschaftlichen Fragen beantwortet sind <span class='underline_single'>unser Problem noch gar </span><span class='underline_single'>nicht  /</span><span class='underline_single'> berhrt ist</span>. Freilich bleibt dann eben keine Frage mehr; und eben dies ist die Antwort.<br>\",\"eng\":\"The drive towards what is mystical arises out of the frustration of our desires by science. We <span class='underline_single'>feel</span> that even if all <span class='underline_single'>possible</span><em> </em>scientific questions were answered, <span class='underline_single'>our</span><span class='underline_single'> problem would still not have been touched at all</span>. To be sure, there would then be no question left, and just this is the answer. [<em>Cf.</em> 6.52.]<br>\",\"date\":\"1915-05-25\",\"pt-number\":\" 652\",\"pt-page\":\"76[1]\",\"tlp-number\":\"652\",\"cross-references\":\"25.5.15 (2)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,108r[2] (1915--0525) (NB)\",\"ger\":\"Die Tautologie wird von <span class='underline_single'>jedem</span> Satze bejaht; die Kontradiktion von jedem verneint. (Man knnte ja an jeden Satz, ohne seinen Sinn zu ndern irgend <span class='underline_single'>eine</span> Tautologie mit und anhngen und ebenso die Verneinung einer Kontradiktion.) <br>Und ohne seinen Sinn zu ndern heit: ohne das <span class='underline_single'>Wesentliche</span> am Zeichen selbst zu ndern. Denn; man kann das <span class='underline_single'>Zeichen</span> nicht ndern ohne seinen Sinn zu ndern. [<em>Cf</em>. 4.465.]<br>\",\"eng\":\"A tautology is affirmed, a contradiction denied, by <span class='underline_single'>every</span> proposition. (One could add and and any tautology to any proposition, without altering its sense, and in like manner the negation of a contradiction). <br>And \\\"without altering its sense\\\" means: without altering what is essential about the sign itself. For a sign cannot be altered without altering its sense. [<em>Cf.</em> 4.465.]<br>\",\"date\":\"1915-05-25\",\"pt-number\":\" 4449\",\"pt-page\":\"45[6]\",\"tlp-number\":\"4465**\",\"cross-references\":\"3.10.14 (4)  25.5.15 (4)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,109r[1] (1915--0525) (NB)\",\"ger\":\"aRa <span class='underline_single'>mu</span> Sinn haben wenn aRb Sinn hat. <br>\",\"eng\":\"\",\"date\":\"1915-05-25\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,109r[2] (1915--0526) (NB)\",\"ger\":\"Wie aber soll ich jetzt das allgemeine Wesen des <span class='underline_single'>Satzes</span> erklren? Wir knnen wohl sagen: alles, was der Fall ist (oder nicht ist) kann durch einen Satz abgebildet werden. Aber hier haben wir den Ausdruck <span class='underline_single'>der Fall sein</span>! Er ist ebenso problematisch. <br>\",\"eng\":\"But how am I to explain the general nature of the proposition now? We can surely say: everything that is (or is not) the case can be pictured by means of a proposition. But here we have the expression \\\"<span class='underline_single'>to be the case</span>\\\"! It is just as problematic.<br>\",\"date\":\"1915-05-26\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,109r[3] (1915--0526) (NB)\",\"ger\":\"Das Gegenstck zum Satze bilden die Gegenstnde. <br>Objects make up a propositions complement.<br>\",\"eng\":\"\",\"date\":\"1915-05-26\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,109r[4] (1915--0526) (NB)\",\"ger\":\"\\\\\\tDie Gegenstnde kann ich nur <span class='underline_single'>nennen</span>. Zeichen vertreten sie. <br>\",\"eng\":\"I can only <span class='underline_single'>name</span> objects. Signs stand in for them.<br>\",\"date\":\"1915-05-26\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,110r[1] (1915--0527) (NB)\",\"ger\":\"Ich kann nur <span class='underline_single'>von</span> ihnen sprechen, sie aussprechen kann ich nicht. <br>\",\"eng\":\"I can only speak <span class='underline_single'>of</span> them, I cannot give voice to them. [<em>See</em> 3.221.]<br>\",\"date\":\"1915-05-27\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,110r[2] (1915--0527) (NB)\",\"ger\":\"Aber knnte es nicht etwas geben was durch einen <span class='underline_single'>Satz</span> sich nicht ausdrcken lt (und auch kein Gegenstand ist)?. Das liee sich eben dann durch die <span class='underline_single'>Sprache</span> nicht ausdrcken; und wir knnen auch nicht darnach <span class='underline_single'>fragen</span>. <br>\",\"eng\":\"\\\"But couldnt there be something that cannot be expressed by a <span class='underline_single'>proposition</span> (and which is also not an object)?\\\" Then that simply could not be expressed by <span class='underline_single'>language</span>; and it is also impossible for us to <span class='underline_single'>ask</span> about it.<br>\",\"date\":\"1915-05-27\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,110r[3] et 111r[1] (1915--0527) (NB)\",\"ger\":\"Wie wenn es etwas auerhalb den <span class='underline_single'>Tatsachen</span> gibt? Was unsere Stze nicht auszudrcken vermgen? Aber da haben wir ja z.B. die <span class='underline_single'>Dinge, und wir fhlen gar kein </span><span class='underline_single'>Verlangen</span>  / sie in Stzen auszudrcken. Was sich nicht ausdrcken lt das drcken wir nicht aus. Und wie wollen wir <span class='underline_single'>fragen</span> ob sich <span class='underline_double'>das</span> ausdrcken lt, was sich nicht <span class='underline_double'>ausdrcken</span> lt? <br>\",\"eng\":\"What if there is something outside the <span class='underline_single'>facts</span>? Which our propositions are incapable of expressing? But here we do have <span class='underline_single'>things</span>, for instance, <span class='underline_single'>and we feel no </span><span class='underline_single'>demand</span><span class='underline_single'> </span><span class='underline_single'>at all</span> to express them in propositions. What cannot be expressed we do not express. And how do we want to ask whether <span class='underline_double'>that</span> can be expressed which cannot be <span class='underline_double'>expressed</span>?<br>\",\"date\":\"1915-05-27\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,111r[2] (1915--0527) (NB)\",\"ger\":\"<span class='underline_single'>Gibt</span><span class='underline_single'> es keinen Bereich </span><span class='underline_single'>auerhalb den Tatsachen</span>? <br>\",\"eng\":\"<span class='underline_single'>Is there no realm outside the facts</span>?<br>\",\"date\":\"1915-05-27\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,111r[3] (1915--0528) (NB)\",\"ger\":\"Zusammengesetztes Zeichen und Satz sind <span class='underline_single'>gleichbedeutend</span>. <br>\",\"eng\":\"\\\"Composite sign\\\" and \\\"sentence\\\" have the <span class='underline_single'>same meaning</span>.<br>\",\"date\":\"1915-05-28\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,111r[4] (1915--0528) (NB)\",\"ger\":\"Ist es eine Tautologie zu sagen: <span class='underline_single'>die Sprache</span> besteht aus <span class='underline_single'>Stzen</span>? <br>     Es scheint, <span class='underline_single'>ja</span>. <br>\",\"eng\":\"Is it a tautology to say: <span class='underline_single'>Language</span> consists of <span class='underline_single'>sentences</span>?<br>\",\"date\":\"1915-05-28\",\"pt-number\":\"4001\",\"pt-page\":\"17[7]\",\"tlp-number\":\"\",\"cross-references\":\"28.5.15 (2,3)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,111r[5] et 112r[1] (1915--0529) (NB)\",\"ger\":\"Aber ist die <span class='underline_single'>Sprache</span>, die <span class='underline_single'>einzige</span>  / Sprache? <br>     Warum soll es nicht eine Ausdrucksweise geben mit der ich <span class='underline_single'>ber</span> die Sprache reden kann, so da diese mir in Koordination mit etwas Anderem erscheinen kann? <br>\",\"eng\":\"But is <span class='underline_single'>language</span> the <span class='underline_single'>only</span> language? <br>     Why shouldnt there be a form of expression in which I can speak <span class='underline_single'>about</span> language in such a way that it can appear to me in coordination with something else?<br>\",\"date\":\"1915-05-29\",\"pt-number\":\" 53353\",\"pt-page\":\"60[2]\",\"tlp-number\":\"562 (3)*\",\"cross-references\":\"29.5.15 (1, 5)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,112r[2] (1915--0529) (NB)\",\"ger\":\"Nehmen wir an die Musik wre eine solche Ausdrucksweise: Dann ist jedenfalls charakteristisch fr die <span class='underline_single'>Wissenschaft</span>, da in ihr <span class='underline_single'>keine</span> musikalischen Themen vorkommen. <br>\",\"eng\":\"Suppose that music were such a mode of expression: In that case, it is at any rate characteristic of <span class='underline_single'>science</span> that <span class='underline_single'>no</span> musical themes occur in it.<br>\",\"date\":\"1915-05-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,112r[3] (1915--0529) (NB)\",\"ger\":\"Ich selbst schreibe hier nur <span class='underline_single'>Stze</span> hin. Und warum? <br>I myself only write <span class='underline_single'>sentences</span> here. And why?<br>\",\"eng\":\"\",\"date\":\"1915-05-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,112r[4] (1915--0529) (NB)\",\"ger\":\"<span class='underline_single'>Wie</span> ist die Sprache unik? <br><span class='underline_single'>How</span> is language unique?<br>\",\"eng\":\"\",\"date\":\"1915-05-29\",\"pt-number\":\"53353\",\"pt-page\":\"60[2]\",\"tlp-number\":\"562 (3)*\",\"cross-references\":\"29.5.15 (1, 5)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,112r[5] et 113r[1] (1915--0530) (NB)\",\"ger\":\"Die Worte sind wie die Haut  / auf einem tiefen Wasser. <br>Es ist klar da es auf dasselbe hinauskommt zu fragen, was ist ein Satz, wie zu fragen was ist eine Tatsache  oder ein Komplex.<br>\",\"eng\":\"Words are like the surface of deep water. <br>It is clear that it comes to the same thing to ask what a proposition is as to ask what a fact is - or a complex.<br>\",\"date\":\"1915-05-30\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,113r[2] (1915--0530) (NB)\",\"ger\":\"Und warum soll man nicht sagen: Es gibt Komplexe; man kann sie mit Namen benennen oder durch Stze abbilden? <br>\",\"eng\":\"And why not say: \\\"There are complexes; one can label them with names or depict them in propositions\\\"?<br>\",\"date\":\"1915-05-30\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,113r[3] (1915--0530) (NB)\",\"ger\":\"Der Name eines Komplexes fungiert im Satz wie der Name eines Gegenstandes welchen ich nur durch eine <span class='underline_single'>Beschreibung</span> kenne.  Als Beschreibung fungiert der ihn abbildende Satz. <br>\",\"eng\":\"The name of a complex functions in a proposition like the name of an object that I know only by <span class='underline_single'>description</span>. The proposition depicting it functions as a description.<br>\",\"date\":\"1915-05-30\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,114r[1] (1915--0530) (NB)\",\"ger\":\"Aber wenn es nun einfache Gegenstnde gibt, ist es richtig ihre Zeichen und jene anderen Namen zu nennen? <br>\",\"eng\":\"But if there are simple objects, is it correct to call both the signs for them and those other signs \\\"names\\\"?<br>\",\"date\":\"1915-05-30\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,114r[2] (1915--0530) (NB)\",\"ger\":\"Oder ist Name sozusagen ein <span class='underline_single'>logischer</span> Begriff? <br>Er kennzeichnet die Gemeinsamkeit einer Form und eines Inhalts. <br>Je nach der Verschiedenheit der Struktur des Komplexes bezeichnet sein Name in anderer Art & Weise und unterliegt anderen syntaktischen Gesetzen. <br>\",\"eng\":\"\\\"It characterizes a form and a content in common.\\\"  <br>In accordance with the difference in the structure of the complex, the name of the complex refers in a different way and is subject to different syntactic laws.<br>\",\"date\":\"1915-05-30\",\"pt-number\":\" 3253\",\"pt-page\":\"58[8]\",\"tlp-number\":\"3327**  30.5.15 (7,13)**\",\"cross-references\":\"3327**  30.5.15 (7,13)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,114r[3] et 115r[1] (1915--0530) (NB)\",\"ger\":\"Der Fehler in dieser Auffassung mu darin liegen, da sie einerseits komplexe  / und einfache Gegenstnde einander entgegenstellt andererseits aber sie als verwandt behandelt. <br>     Und doch: <span class='underline_single'>Bestandteile</span> und <span class='underline_single'>Komplex</span> scheinen einander verwandt, <span class='underline_single'>und</span> entgegengesetzt zu sein! <br>     (Wie der Plan einer Stadt und die Karte eines Landes die vor uns in gleicher Gre, und verschiedenen Mastben liegen.) <br>\",\"eng\":\"The mistake in this conception must lie in its on the one hand contrasting complexes and simple objects, but on the other hand treating them as related. <br>     And yet: <span class='underline_single'>constituents</span> and <span class='underline_single'>complex</span> seem to be related <span class='underline_single'>and</span> to be opposed! <br>     (Like the plan of a city and the map of a country that are in front of us, the same size, and at different scales).<br>\",\"date\":\"1915-05-30\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,115r[2] et 116r[1] (1915--0530) (NB)\",\"ger\":\"Woher dies Gefhl!: Allem was ich sehe, dieser Landschaft, dem Fliegen der Samen in der Luft, all diesem kann ich einen Namen zuordnen; ja, was, wenn nicht dieses, / sollten mir Namen benennen?! <br>\",\"eng\":\"\\\"I can assign a name to all that I see, to this landscape, to the dust in the wind, to all this; indeed, what should I call a name if not this.\\\" Where does this feeling come from?!<br>\",\"date\":\"1915-05-30\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,116r[2] (1915--0530) (NB)\",\"ger\":\"Namen kennzeichnen die Gemeinsamkeit <span class='underline_single'>einer</span> Form und <span class='underline_single'>eines</span> Inhalts.  Sie kennzeichnen erst mit ihrer syntaktischen Verwendung zusammen <span class='underline_single'>eine bestimmte</span> logische Form. <br>\",\"eng\":\"Names characterize what one form and one content have in common.  They characterize one particular logical form only in tandem with their syntactical employment.  [Cf. 331 (4), 3.327.]<br>\",\"date\":\"1915-05-30\",\"pt-number\":\" 3253\",\"pt-page\":\"58[8]\",\"tlp-number\":\"3327**  30.5.15 (7,13)**\",\"cross-references\":\"3327**  30.5.15 (7,13)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,116r[3] (1915--0531) (NB)\",\"ger\":\"Mit der Weltbeschreibung durch Namen kann man nicht mehr leisten als mit der allgemeinen Weltbeschreibung!!! <br>\",\"eng\":\"Using names in a description of the world one cannot achieve more than one can with a general world description!!!<br>\",\"date\":\"1915-05-31\",\"pt-number\":\"5323\",\"pt-page\":\"62[4]\",\"tlp-number\":\"5526 (1)\",\"cross-references\":\"17.10.14 (3)* 19.10.14 (3)**   31.5.15 (1,4)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,116r[4] (1915--0531) (NB)\",\"ger\":\"Knnte man also ohne Namen auskommen?? Doch wohl nicht. <br>\",\"eng\":\"So could one do without names?? Not at all.<br>\",\"date\":\"1915-05-31\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,117r[1] (1915--0531) (NB)\",\"ger\":\"Die Namen sind notwendig zu einer Aussage, da <span class='underline_single'>dieses</span> Ding <span class='underline_single'>jene</span> Eigenschaft besitzt u.s.f. <br>     Sie verknpfen die Satzform mit ganz bestimmten Gegenstnden. <br>     Und wenn die allgemeine Weltbeschreibung wie eine Schablone der Welt ist, so nageln sie die Namen so an die Welt da sie sich berall mit ihr deckt. <br>\",\"eng\":\"Names are necessary for a statement that <span class='underline_single'>this</span> thing possesses <span class='underline_single'>that</span> property and so on. <br>     They link a propositional form to quite specific objects. <br>     And if a general description of the world is like a mask for the world, names attach it to the world so that the world is completely covered by it.<br>\",\"date\":\"1915-05-31\",\"pt-number\":\" 5323\",\"pt-page\":\"62[4]\",\"tlp-number\":\"5526 (1)\",\"cross-references\":\"17.10.14 (3)* 19.10.14 (3)**   31.5.15 (1,4)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,117r[2] (1915--0601) (NB)\",\"ger\":\"Das groe Problem um welches sich alles dreht, was ich schreibe, ist: Ist, a priori, eine Ordnung in der Welt, und wenn, ja, worin besteht sie? <br>\",\"eng\":\"The great problem around which everything I write turns is: Is there an order in the world <em>a priori</em>, and if so, what does it consist in?<br>\",\"date\":\"1915-06-01\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,117r[3] et 118r[1] (1915--0601) (NB)\",\"ger\":\"Du siehst in die Nebelwolke  / und kannst dir daher einreden das Ziel sei schon nahe. <br>Aber der Nebel zerrinnt und das Ziel ist noch nicht in Sicht! <br>\",\"eng\":\"You are looking into a foggy mist and so can talk yourself into believing the goal is already nearby. <br>But the fog melts away and the goal is not yet in sight!<br>\",\"date\":\"1915-06-01\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,118r[2] (1915--0602) (NB)\",\"ger\":\"Ich sagte: Eine Tautologie wird von <span class='underline_single'>jedem</span> Satze bejaht; damit ist aber noch nicht gesagt, warum sie kein <span class='underline_single'>Satz</span> ist. Ist denn damit schon gesagt <span class='underline_single'>warum</span> ein Satz nicht von p <span class='underline_single'>und</span> von ~p bejaht werden kann?! <br>\",\"eng\":\"I said: \\\"A tautology is affirmed by <span class='underline_single'>every</span> proposition\\\"; but that doesnt yet say enough to tell us why it isnt a <span class='underline_single'>proposition</span>. For does that already tell us <span class='underline_single'>why</span> a proposition cant be affirmed by p <span class='underline_single'>and</span> ~p?!<br>\",\"date\":\"1915-06-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,118r[3] (1915--0602) (NB)\",\"ger\":\"Meine Theorie bringt nmlich eigentlich nicht heraus da der Satz zwei Pole haben <span class='underline_single'>mu</span>. <br>\",\"eng\":\"That is to say my theory does not really bring it out that a proposition <span class='underline_single'>must</span> have two poles.<br>\",\"date\":\"1915-06-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,119r[1] (1915--0602) (NB)\",\"ger\":\"Ich mte nmlich jetzt in der Redeweise dieser Theorie einen Ausdruck dafr finden, <span class='underline_double'>wieviel</span> <span class='underline_single'>ein Satz sagt</span>. Und es mte sich dann eben ergeben da Tautologien <span class='underline_double'>nichts</span> sagen. <br>\",\"eng\":\"For what I should now have to do is to find an expression in the idiom of this theory for <span class='underline_double'>how much</span> <span class='underline_single'>a proposition says</span>. And it would have to yield the result that tautologies say <span class='underline_double'>nothing</span>.<br>\",\"date\":\"1915-06-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,119r[2] (1915--0602) (NB)\",\"ger\":\"Aber wie ist dies Ma Vielsagendheit zu finden? <br>\",\"eng\":\"But how is this measure of how-much-is-said to be found?<br>\",\"date\":\"1915-06-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,119r[3] (1915--0602) (NB)\",\"ger\":\"Es ist jedenfalls vorhanden; und unsere Theorie <span class='underline_single'>mu</span> es zum Ausdruck bringen knnen. <br>\",\"eng\":\"However that may be, it is there; and our theory <span class='underline_single'>must</span> be able to give it expression.<br>\",\"date\":\"1915-06-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,119r[4] (1915--0603) (NB)\",\"ger\":\"Man knnte wohl sagen: <span class='underline_single'>Der</span> Satz sagt am meisten, aus welchem am meisten folgt. <br>\",\"eng\":\"One could surely say: <span class='underline_single'>Th</span><span class='underline_single'>at</span> proposition from which the most follows says the most. [<em>Cf</em>. 5.14.]<br>\",\"date\":\"1915-06-03\",\"pt-number\":\" 506\",\"pt-page\":\"12[8]\",\"tlp-number\":\"514\",\"cross-references\":\"3.6.15 (1)+  11.6.15 (4,5)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,119r[5] et 120r[1] (1915--0603) (NB)\",\"ger\":\"Knnte man sagen: aus welchem die  / meisten, von einander unabhngigen, Stze folgen? <br>\",\"eng\":\"Could one say: \\\"From which the most mutually independent propositions follow\\\"?<br>\",\"date\":\"1915-06-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,120r[2] (1915--0603) (NB)\",\"ger\":\"Aber geht es nicht so?: Wenn p aus q folgt, aber nicht q aus p, dann sagt q mehr als p. <br>     Nun aber folgt aus einer Tautologie gar nichts. Sie aber folgt aus jedem Satz. <br>     Analoges gilt von ihrem Gegenteil. <br>\",\"eng\":\"But doesn't it work this way: If p follows from q, but not q from p, then q says more than p? <br>     Now nothing at all follows from a tautology. But it follows from every proposition. [<em>Cf</em>. 5.142.]<br>     The analogous point applies to its opposite. [<em>Cf</em>. 5.143 (1).]<br>\",\"date\":\"1915-06-03\",\"pt-number\":\"508\",\"pt-page\":\"37[8]\",\"tlp-number\":\"5143 (1)\",\"cross-references\":\"5.6.15 (6)+  3.6.15 (7)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,120r[3] et 121r[1] (1915--0603) (NB)\",\"ger\":\"Aber wie! Wre da die Kontradiktion nicht der vielsagendste Satz? Aus p.~p folgt ja nicht nur p sondern auch ~p! Aus ihnen folgt jeder Satz und sie folgen aus keinem!? Aber ich kann doch aus  / einer Kontradiktion nichts schlieen, eben <span class='underline_single'>weil</span> sie eine Kontradiktion ist! <br>     Aber wenn die Kontradiktion die Klasse <span class='underline_single'>aller Stze</span> ist, so wird die Tautologie das Gemeinsame aller Klassen von Stzen welche nichts Gemeinsames haben, und verschwindet gnzlich. p  ~p wre also nur scheinbar ein Zeichen. In Wirklichkeit aber die Auflsung des Satzes. <br>\",\"eng\":\"But how would that work? Won't contradiction be the proposition that says the most then? Its not only \\\"p\\\" that follows from \\\"p.~p\\\", but also \\\"~p\\\". Every proposition follows from it and it follows from none!? But I surely cant infer anything from a contradiction, precisely <span class='underline_single'>because</span> it is a contradiction!<br>     But if contradiction is the class of <span class='underline_single'>all propositions</span>, then tautology becomes that shared feature of any classes of propositions that have nothing in common, and vanishes altogether. \\\"p  ~p\\\" would then only appear to be a sign. But in reality, the disintegration of the proposition. [<em>Cf</em>. 5.143 (1-2); 4.466 (4).]<br>\",\"date\":\"1915-06-03\",\"pt-number\":\"44492\",\"pt-page\":\"58[6]\",\"tlp-number\":\"4466 (4)**\",\"cross-references\":\"3.6.15 (8)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,121r[2] et 122r[1] (1915--0603) (NB)\",\"ger\":\"Die Tautologie verschwindet sozusagen innerhalb allen Stzen die Kontradiktion  / auerhalb allen Stzen. <br>\",\"eng\":\"Tautology vanishes so to speak inside all propositions, contradiction outside them. [<em>See</em> 5.143 (2).]<br>\",\"date\":\"1915-06-03\",\"pt-number\":\" 5081\",\"pt-page\":\"37[9]\",\"tlp-number\":\"5143 (2)\",\"cross-references\":\"3.6.15 (9)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,122r[2] (1915--0603) (NB)\",\"ger\":\" Bei diesen Betrachtungen scheine ich brigens immer unbewut vom Elementarsatz auszugehen.  <br>\",\"eng\":\"- Incidentally, in these observations I always seem to be unconsciously starting from the elementary proposition. <br>\",\"date\":\"1915-06-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,122r[3] (1915--0603) (NB)\",\"ger\":\"Die Kontradiktion ist die uere Grenze der Stze; kein Satz bejaht sie. Die Tautologie ist ihr substanzloser Mittelpunkt. (Man kann den Mittelpunkt einer Kreisflche als deren innere Begrenzung auffassen.) <br>\",\"eng\":\"Contradiction is the outer limit of propositions; no proposition affirms it. Tautology is their substanceless centre.  (One can regard the center of a circular area as its inner limit). [<em>Cf</em>. 5.143 (3).]<br>\",\"date\":\"1915-06-03\",\"pt-number\":\"5082\",\"pt-page\":\"37[10]\",\"tlp-number\":\"5143 (3)*\",\"cross-references\":\"3.6.15 (11)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,122r[4] (1915--0603) (NB)\",\"ger\":\"(Das erlsende Wort ist brigens hier noch nicht gesprochen.) <br>\",\"eng\":\"(In fact the redeeming word still hasnt been uttered here).<br>\",\"date\":\"1915-06-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,122r[5] et 123r[1] (1915--0603) (NB)\",\"ger\":\"Es ist hier nmlich sehr leicht die logische Addition und das  / logische Produkt miteinander zu verwechseln. <br>\",\"eng\":\"The thing is that here it is very easy to confuse logical sum and logical product.<br>\",\"date\":\"1915-06-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,123r[2] (1915--0603) (NB)\",\"ger\":\"Wir kommen nmlich zu dem scheinbar merkwrdigen Resultat, da zwei Stze etwas gemeinsam haben mssen um von einem Satz bejaht werden zu knnen. <br>\",\"eng\":\"For we get to the seemingly strange result that two propositions must have something in common to be capable of being affirmed by one proposition.<br>\",\"date\":\"1915-06-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,123r[3] (1915--0603) (NB)\",\"ger\":\"(Die Gehrigkeit zu <span class='underline_single'>einer</span> Klasse ist aber auch etwas, was Stze <span class='underline_single'>gemeinsam</span> haben knnen!) <br>\",\"eng\":\"(Belonging to a single class, however, is also something that propositions can have in <span class='underline_single'>common</span>!)<br>\",\"date\":\"1915-06-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,123r[4] (1915--0603) (NB)\",\"ger\":\"(Hier liegt noch eine entschiedene und entscheidende Unklarheit in meiner Theorie. Daher ein gewisses Gefhl der Unbefriedigung!) <br>\",\"eng\":\"(Here there is still a pronounced and crucial lack of clarity in my theory. Hence a certain feeling of uneasiness!)<br>\",\"date\":\"1915-06-03\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,123r[5] et 124r[1] (1915--0604) (NB)\",\"ger\":\"\",\"eng\":\"\\\"p.q\\\" only makes sense if \\\"p  q\\\" makes sense.<br>\",\"date\":\"1915-06-04\",\"pt-number\":\"5315\",\"pt-page\":\"62[3]\",\"tlp-number\":\"5515**\",\"cross-references\":\"5.6.15 (7)+   4.6.15   \",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,124r[2] (1915--0605) (NB)\",\"ger\":\"p.q bejaht p und q. Das heit aber doch nicht da p.q der gemeinsame Bestandteil von p und q ist sondern im Gegenteil da sowohl p als auch q in p.q enthalten sind. <br>\",\"eng\":\"\\\"p.q\\\" affirms \\\"p\\\" and \\\"q.\\\" But that surely does not mean that \\\"p.q\\\" is the common constituent of \\\"p\\\" and \\\"q\\\", but on the contrary that both \\\"p\\\" and \\\"q\\\" are contained in \\\"p.q\\\".<br>\",\"date\":\"1915-06-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,124r[3] (1915--0605) (NB)\",\"ger\":\" \\tIn diesem Sinne htten p und ~p sogar etwas gemein zum Beispiel Stze wie ~p  q und p  q. Das heit: es gibt allerdings Stze welche sowohl von p als auch von ~p bejaht werden  z.B. die obigen ; es gibt aber keine die sowohl p als auch ~p bejahen. <br>\",\"eng\":\"In this sense, p and ~p would actually have something in common, for example propositions such as ~p  q and p  q. That is: there are propositions which are affirmed by both \\\"p\\\" and \\\"~p\\\" the above ones, for instance but there are none that affirm p as well as also affirming ~p.<br>\",\"date\":\"1915-06-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,124r[4] et 125r[1] (1915--0605) (NB)\",\"ger\":\"Damit ein Satz wahr sein kann  / mu er auch falsch sein knnen. <br>\",\"eng\":\"For a proposition to be capable of being true it must also be capable of being false.<br>\",\"date\":\"1915-06-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,125r[2] (1915--0605) (NB)\",\"ger\":\" \\tWarum sagt die Tautologie nichts? Weil in ihr von vornherein jede Mglichkeit zugegeben wird; weil  <br>\",\"eng\":\"Why does a tautology say nothing? Because every possibility is admitted in it from the start; because ...<br>\",\"date\":\"1915-06-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,125r[3] (1915--0605) (NB)\",\"ger\":\" Es mu sich <span class='underline_single'>im Satz selbst</span> zeigen da er <span class='underline_single'>etwas</span> sagt und an der Tautologie da sie nichts sagt. <br>\",\"eng\":\"The proposition itself must show that it says <span class='underline_single'>something</span>, and the tautology that it says nothing.<br>\",\"date\":\"1915-06-05\",\"pt-number\":\"44462\",\"pt-page\":\"45[1]\",\"tlp-number\":\"4461 (1)\",\"cross-references\":\"5.6.15 (5)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,125r[4] (1915--0605) (NB)\",\"ger\":\"p.~ p ist dasjenige  etwa das <span class='underline_single'>Nichts</span>  welches p und ~p gemeinsam haben. <br>\",\"eng\":\"p.~ p is the one thingsay that <span class='underline_single'>nothing</span>that p and ~p have in common.<br>\",\"date\":\"1915-06-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,125r[5] et 126r[1] (1915--0605) (NB)\",\"ger\":\"\\tIn dem <span class='underline_single'>eigentlichen</span> Zeichen fr p liegt wirklich schon das  / Zeichen p  q. (Denn es ist dann mglich dieses Zeichen <span class='underline_double'>ohne Weiteres</span> zu bilden.) <br>\",\"eng\":\"The sign \\\"p  q\\\" is already contained in the <span class='underline_single'>proper</span> sign for p. (For it is then possible to form this sign <span class='underline_double'>automatically</span>).<br>\",\"date\":\"1915-06-05\",\"pt-number\":\"5315\",\"pt-page\":\"62[3]\",\"tlp-number\":\"5515**\",\"cross-references\":\"5.6.15 (7)+   4.6.15   \",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,126r[2] (1915--0606) (NB)\",\"ger\":\"(Diese Theorie behandelt die Stze exklusiv, sozusagen als eine eigene Welt und nicht in Verbindung mit dem was sie darstellen.) <br>\",\"eng\":\"(This theory deals solely with propositions, in a manner of speaking as a world apart, and not in connection with what they represent).<br>\",\"date\":\"1915-06-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,126r[3] (1915--0606) (NB)\",\"ger\":\"Die Verbindung der Bild-Theorie mit der Klassen-Theorie wird erst spter ganz einleuchtend werden. <br>\",\"eng\":\"The connection of the picture-theory with the class-theory will only become quite obvious later.<br>\",\"date\":\"1915-06-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,126r[4] (1915--0606) (NB)\",\"ger\":\"Man kann von einer Tautologie nicht sagen da sie wahr ist, denn sie ist <span class='underline_single'>wahr gemacht</span>. <br>\",\"eng\":\"One cannot say of a tautology that it is true, for it is <span class='underline_single'>made to be true</span>.<br>\",\"date\":\"1915-06-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,126r[5] et 127r[1] (1915--0606) (NB)\",\"ger\":\"Sie ist kein Bild der Wirklichkeit insofern als sie nichts <span class='underline_double'>darstellt</span>. / Sie ist das, was alle <span class='underline_single'>Bilder</span>  einander widersprechende  gemeinsam haben. <br>\",\"eng\":\"It is not a picture of reality in that it <span class='underline_double'>represents</span> nothing. It is what allmutually contradictory<span class='underline_single'>pictures</span> have in common.<br>\",\"date\":\"1915-06-06\",\"pt-number\":\" 44482\",\"pt-page\":\"45[5]\",\"tlp-number\":\"4462 (1)\",\"cross-references\":\"3.10.14 (4)  6.6.15 (4)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,127r[2] (1915--0606) (NB)\",\"ger\":\" In der Klassen-Theorie ist noch nicht ersichtlich warum der Satz seinen Gegensatz <span class='underline_single'>bedarf</span>. Warum er ein von dem brigen Teil des logischen Raumes <span class='underline_single'>abgetrennter</span> Teil ist. <br>\",\"eng\":\"In the class-theory it is not yet evident why a proposition <span class='underline_single'>requires</span> its contradiction. Why it is a part of logical space which is <span class='underline_single'>separated</span> from the other part of logical space.<br>\",\"date\":\"1915-06-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,127r[3] (1915--0606) (NB)\",\"ger\":\" Der Satz sagt, es ist: <span class='underline_single'>so</span>, und nicht: <span class='underline_single'>so</span>. Er stellt eine Mglichkeit dar und bildet doch schon <span class='underline_single'>ersichtlich</span> den Teil eines Ganzen  dessen Zge er trgt  und von welchem er sich abhebt. <br>\",\"eng\":\"A proposition says: it is <span class='underline_single'>this way</span>, and not: <span class='underline_single'>that way</span>. It represents a possibility and yet already <span class='underline_single'>evident</span><span class='underline_single'>ly</span> forms one part of a whole,whose features it bearsand from which it stands out.<br>\",\"date\":\"1915-06-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,127r[4] et 128r[1] (1915--0606) (NB)\",\"ger\":\" \\tp.  .q.  .~p ist auch ein Tautologie. / Es gibt wohl Stze die sowohl p als auch ~p <span class='underline_single'>zulassen</span> aber <span class='underline_single'>keinen</span> den sowohl p als auch ~p <span class='underline_single'>bejaht</span>. <br>\",\"eng\":\"p.  .q.  .~p is also a tautology.There are probably propositions that //<span class='underline_single'>allow</span> both p and ~p but <span class='underline_single'>none</span> that <span class='underline_single'>affirm</span> both p and ~p.  //<span class='underline_single'> allow</span> p as well as ~p but <span class='underline_single'>none</span> that <span class='underline_single'>affirm</span> p as well as ~p.//<br>\",\"date\":\"1915-06-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,128r[2] (1915--0606) (NB)\",\"ger\":\"      Die Mglichkeit von p  q wenn p gegeben ist, ist eine Mglichkeit nach einer anderen Dimension als die Unmglichkeit von ~p. <br>\",\"eng\":\"  The possibility of \\\"p  q\\\" when \\\"p\\\" is given, is a possibility in a different dimension from the impossibility of \\\"~p\\\".<br>\",\"date\":\"1915-06-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,128r[3] (1915--0606) (NB)\",\"ger\":\"p  ~p ist ein <span class='underline_double'>ganz spezieller Fall</span> von p  q. <br>\",\"eng\":\"\",\"date\":\"1915-06-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,128r[4] (1915--0606) (NB)\",\"ger\":\"p hat nichts mit ~p  q gemein. <br>\",\"eng\":\"\\\"p\\\" has nothing in common with \\\"~p  q\\\".<br>\",\"date\":\"1915-06-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,128r[5] (1915--0606) (NB)\",\"ger\":\" Dadurch da ich an p das ~ hnge, tritt der Satz in eine andere Satzklasse. <br>\",\"eng\":\"As a result of my appending a \\\"~\\\" to \\\"p\\\", the proposition enters a different class of propositions.<br>\",\"date\":\"1915-06-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,129r[1] (1915--0606) (NB)\",\"ger\":\" \\tJeder Satz hat nur ein Negativ;  Es gibt nur einen Satz der ganz auerhalb von p liegt. <br>\",\"eng\":\"Every proposition has only one negative; ... There is only one proposition that lies entirely outside \\\"p\\\".<br>\",\"date\":\"1915-06-06\",\"pt-number\":\"53132\",\"pt-page\":\"62[1]\",\"tlp-number\":\"5513 (2)\",\"cross-references\":\"3.5.15 (3)+   6.6.15 (13)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,129r[2] (1915--0606) (NB)\",\"ger\":\"Man knnte auch so sagen: Der Satz welcher p und ~p bejaht, wird von allen Stzen verneint; der Satz welcher p oder ~p bejaht wird von allen Stzen bejaht. <br>\",\"eng\":\"One could also say: the proposition which affirms p and ~p is negated by all propositions; the proposition which affirms p or ~p is affirmed by all propositions.<br>\",\"date\":\"1915-06-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,129r[3] (1915--0606) (NB)\",\"ger\":\" \\tMein Fehler mu darin liegen da ich dasjenige was aus dem Wesen der Verneinung u.a. folgt zu ihrer Definition gebrauchen will.  Die Gemeinsamkeit der Grenze von p & ~p kommt in der von mir versuchten Erklrung der Verneinung gar nicht vor. <br>\",\"eng\":\"My mistake must lie in my wanting to use what follows from the nature of negation, etc., in its definition. That \\\"p\\\" & \\\"~p\\\" share a boundary is no part of the explanation of negation that I am working towards.<br>\",\"date\":\"1915-06-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,130r[1] (1915--0607) (NB)\",\"ger\":\"Wenn man z.B. sagen knnte: alle Stze die p nicht bejahen, bejahen ~p so htte man damit eine gengende Beschreibung.  Aber so geht es nicht. <br>\",\"eng\":\"For example, if one could say: all propositions that do not affirm p affirm ~p, then one would have an adequate description.But that doesn't work.<br>\",\"date\":\"1915-06-07\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,130r[2] (1915--0607) (NB)\",\"ger\":\" \\tKann man aber nicht sagen ~p ist dasjenige was nur solche Stze gemeinsam haben welche p nicht bejahen?  Und hieraus folgt ja schon die Unmglichkeit von p.~p. <br>     (All dies setzt natrlich schon die Existenz der gesamten <span class='underline_single'>Satzwelt</span> voraus, mit Recht?) <br>\",\"eng\":\"But cant we say \\\"~p\\\" is that which only those propositions that do not affirm \\\"p\\\" have in common? And from this the impossibility of \\\"p.~p\\\" already follows. <br>     (All this, of course, already presupposes the existence of the entire <span class='underline_single'>world of propositions</span>. With good reason?)<br>\",\"date\":\"1915-06-07\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,130r[3] et 131r[1] (1915--0607) (NB)\",\"ger\":\"<span class='underline_double'>Es gengt nicht</span> darauf hinzuweisen da ~p auerhalb p liegt! Nur dann wird man  / alle Eigenschaften von ~p ableiten knnen wenn ~p <span class='underline_single'>wesentlich als das Negativ von p</span> eingefhrt wird!! <br>\",\"eng\":\"<span class='underline_double'>It is not enough</span> to point to ~ps lying outside p! One will only be able to derive all the properties of \\\"~p\\\" if \\\"~p\\\" is introduced <span class='underline_single'>essentially as the negative of p</span>!!! <br>\",\"date\":\"1915-06-07\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,131r[2] (1915--0607) (NB)\",\"ger\":\"     Oder verhlt es sich so, da wir den Satz ~p berhaupt nicht einfhren knnen, sondern, er tritt uns als vollendete Tatsache entgegen und wir knnen nur auf seine einzelnen formellen Eigenschaften hinweisen, wie z.B. da er nichts mit p gemeinsam hat, da kein Satz ihn und p enthlt etc. etc.? <br>\",\"eng\":\"Or is it like this: we cannot \\\"introduce\\\" the proposition ~p at all, but we encounter it as an accomplished fact // fait accompli// and we can only point to its individual formal properties, such as that it has nothing in common with p, that no proposition contains it and p, etc., etc.?<br>\",\"date\":\"1915-06-07\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,131r[3] et 132r[1] (1915--0608) (NB)\",\"ger\":\"Jeder mathematische Satz ist ein in Zeichen dargestellter  / Modus ponens. (Und es ist klar, da man den Modus ponens nicht in einem Satz ausdrcken kann.) <br>\",\"eng\":\"Every \\\"mathematical proposition\\\" is a <em>modus ponens</em> set out in signs. (And clearly <em>modus ponens</em> cannot be expressed in a proposition). [<em>Cf</em>. 6.1264 (2).]<br>\",\"date\":\"1915-06-08\",\"pt-number\":\"61214\",\"pt-page\":\"66[3]\",\"tlp-number\":\"61264 (2)*                 8.6.15 (1)**\",\"cross-references\":\"61264 (2)*                 8.6.15 (1)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,132r[2] (1915--0608) (NB)\",\"ger\":\"Die Gemeinsamkeit der Grenze von p und ~p drckt sich dadurch aus, da das Negativ eines Satzes nur mit Hilfe eben dieses bestimmt wird. Wir sagen ja eben: das Negativ eines Satzes ist der Satz welcher  und nun folgt die Beziehung von ~p zu p.  <br>\",\"eng\":\"That p and ~p have a common boundary is expressed by the fact that the negative of a proposition is only specified by means of this very proposition. We say yes, precisely: the negative of a proposition is the proposition which ... and now the relation of ~p to p follows.<br>\",\"date\":\"1915-06-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,132r[3] (1915--0609) (NB)\",\"ger\":\"Man knnte natrlich einfach so sagen: Die Verneinung von p ist der Satz welcher keinen Satz mit p gemeinsam hat. <br>\",\"eng\":\"Of course, one could simply say: the negation of p is the proposition which has no proposition in common with p.<br>\",\"date\":\"1915-06-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,133r[1] (1915--0609) (NB)\",\"ger\":\" \\tDer Ausdruck tertium non datur ist eigentlich ein Unsinn. (Von einem Dritten ist eben in p  ~p nicht die Rede!) <br>\",\"eng\":\"The expression \\\"<em>tertium non </em><em>datur</em>\\\" really is nonsense. (For no third thing is in question in p  ~p).<br>\",\"date\":\"1915-06-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,133r[2] (1915--0609) (NB)\",\"ger\":\" \\tSollten wir das nicht auf unsere Erklrung des Negatives eines Satzes anwenden knnen? <br>\",\"eng\":\"Shouldn't we be able to use this in our explanation of the negative of a proposition?<br>\",\"date\":\"1915-06-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,133r[3] (1915--0609) (NB)\",\"ger\":\"Knnen wir nicht sagen: Unter allen Stzen welche nur von p abhngig sind, gibt es nur solche, welche p bejahen und solche, welche es verneinen. <br>\",\"eng\":\"Cant we say: Among all the propositions which are dependent on p alone, there are only such as assert p and such as deny it?<br>\",\"date\":\"1915-06-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,133r[4] et 134r[1] (1915--0609) (NB)\",\"ger\":\"Ich kann also sagen das Negativ von p ist die Klasse aller Stze welche nur von p abhngig sind und  /<span class='underline_single'>p nicht bejahen</span>. <br>\",\"eng\":\"So I can say the negative of p is the class of all propositions which are dependent on \\\"p\\\" alone and <span class='underline_single'>do not affirm \\\"p\\\"</span>.<br>\",\"date\":\"1915-06-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,134r[2] (1915--0610) (NB)\",\"ger\":\"<span class='underline_single'>p  q </span><span class='underline_single'></span><span class='underline_single'> ~q</span><span class='underline_single'></span><span class='underline_single'> ist von </span><span class='underline_single'></span><span class='underline_single'>q</span><span class='underline_single'></span><span class='underline_single'> </span><span class='underline_double'>nicht</span><span class='underline_single'> abh</span><span class='underline_single'></span><span class='underline_single'>ngig!! </span><br><span class='underline_single'>\\\"p  q </span><span class='underline_single'></span><span class='underline_single'> ~q\\\" is </span><span class='underline_double'>not</span><span class='underline_single'> dependent on \\\"q\\\"!!</span><br>\",\"eng\":\"\",\"date\":\"1915-06-10\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,134r[3] (1915--0610) (NB)\",\"ger\":\"<span class='underline_single'>Ganze Stze</span>, verschwinden! <br>Whole propositions disappear!<br>\",\"eng\":\"\",\"date\":\"1915-06-10\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,134r[4] (1915--0610) (NB)\",\"ger\":\" Schon das, da p  q  ~q von q unabhngig ist obwohl es das Schriftzeichen q offenbar enthlt, zeigt uns wie Zeichen von der Form   ~ scheinbar, aber doch nur <span class='underline_single'>scheinbar</span> existieren knnen. <br>\",\"eng\":\"The very fact that \\\"p  q  ~q\\\" is independent of \\\"q\\\", although it obviously contains the character \\\"q\\\" shows us how signs of the form   ~ can apparently, but still only <span class='underline_single'>apparently</span>, exist.<br>\",\"date\":\"1915-06-10\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,134r[5] (1915--0610) (NB)\",\"ger\":\" Dies kommt natrlich daher, da diese Zusammenstellung p  ~p zwar uerlich mglich ist, aber nicht den Bedingungen gengt unter welchen ein solcher Komplex <span class='underline_single'>etwas sagt</span> also ein Satz ist. <br>\",\"eng\":\"Naturally, this is because this arrangement\\\"p  ~p\\\"is externally possible, to be sure, but doesnt satisfy the conditions for such a complex to <span class='underline_single'>say something</span>, and so be a proposition.<br>\",\"date\":\"1915-06-10\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,135r[1] (1915--0610) (NB)\",\"ger\":\"p  q  ~q sagt dasselbe wie p  r  ~r  was immer q und r besagen mag : Alle Tautologien besagen dasselbe. (Nmlich nichts.) [Die beiden Beispiele sind untereinander zu schreiben.] <br>\",\"eng\":\"\\\"p  q  ~q\\\" says the same as <br>whatever q and r may say: All tautologies say the same thing. (Namely nothing.) [<em>Cf</em>. 5.43.]<br>\",\"date\":\"1915-06-10\",\"pt-number\":\" 5224\",\"pt-page\":\"37[4]\",\"tlp-number\":\"543 (2)\",\"cross-references\":\"10.6.15 (5)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,135r[2] (1915--0610) (NB)\",\"ger\":\"Aus der letzten Erklrung der Verneinung folgt da alle von p allein abhngigen Stze welche p nicht bejahen  und nur solche , p verneinen. Also sind p  ~p und p  ~p keine Stze, denn, das erste Zeichen bejaht weder noch verneint es p und das zweite mte beide bejahen. <br>\",\"eng\":\"From the last explanation of negation it follows that all propositions dependent on p alone which do not affirm pand only thesenegate p. So \\\"p  ~p\\\" and \\\"p  ~p\\\" are not propositions, because the first sign neither affirms nor negates p and the second would have to affirm both.<br>\",\"date\":\"1915-06-10\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,135r[3] et 136r[1] (1915--0610) (NB)\",\"ger\":\"Da ich nun aber doch p  ~p und p.~p hinschreiben kann, zumal in Verbindung mit anderen  / Stzen so mu klar gestellt werden welche Rolle diese Scheinstze nun, besonders in jenen Verbindungen, spielen. Denn sie sind natrlich nicht als ein vllig bedeutungsloses Anhngsel  wie etwa ein bedeutungsloser Name  zu behandeln. Sie gehren vielmehr mit in den Symbolismus  wie die 0 in der Arithmetik. [<em>Cf</em>. 4.4611.]<br>\",\"eng\":\"But since I can still write down p  ~p and p.~p, particularly in connection with other sentences, it must be made clear what role these pseudo-propositions now play, especially in such connections. For they are not, of course, to be treated as a completely meaningless appendagelike a meaningless name, for instance. Rather, they belong to the symbolismlike \\\"0\\\" in arithmetic.<br>\",\"date\":\"1915-06-10\",\"pt-number\":\" 44481\",\"pt-page\":\"38[1]\",\"tlp-number\":\"44611**\",\"cross-references\":\"10.6.15 (7)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,136r[2] (1915--0610) (NB)\",\"ger\":\" Da ist es klar, da p  ~p die Rolle eines wahren Satzes spielt, der aber <span class='underline_single'>Zero</span> sagt. <br>\",\"eng\":\"Here it is clear that p  ~p plays the role of a true proposition, which however says <span class='underline_single'>nought</span>.<br>\",\"date\":\"1915-06-10\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,136r[3] (1915--0610) (NB)\",\"ger\":\"Wir sind also wieder bei der Quantitt des Sagens: <br>\",\"eng\":\"So we have returned again to the quantity of what is said:<br>\",\"date\":\"1915-06-10\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,137r[1] (1915--0611) (NB)\",\"ger\":\"Aus allen Stzen folgt das Gegenteil von p.~p, heit das soviel da p.~p nichts sagt?  Nach meiner frheren Regel mte die Kontradiktion ja mehr sagen als alle anderen Stze. <br>\",\"eng\":\"The opposite of \\\"p.~p\\\" follows from all propositions; is that tantamount to saying that \\\"p.~p\\\" says nothing? According to my earlier rule, the contradiction would have to say more than all other propositions.<br>\",\"date\":\"1915-06-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,137r[2] (1915--0611) (NB)\",\"ger\":\"Kontradiktion || Tautologie <br>\",\"eng\":\"\",\"date\":\"1915-06-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,137r[3] (1915--0611) (NB)\",\"ger\":\"Wenn ein vielsagender Satz auch falsch ist, so sollte eben das interessant sein, da er falsch ist. Es ist befremdend da das Negativ eines vielsagenden Satzes gnzlich nichtssagend sein soll. <br>\",\"eng\":\"If a proposition that says a great deal is also false, it ought to be interesting that it is false. It is strange that the negative of a proposition that says a great deal should say nothing at all.<br>\",\"date\":\"1915-06-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,137r[4] et 138r[1] (1915--0611) (NB)\",\"ger\":\"Wir sagten: Wenn p aus q folgt aber  / nicht q aus p so sagt q mehr als p. Wenn nun aber aus p folgt da q falsch ist nicht aber aus q da p falsch ist, was dann? <br>     Aus p folgt ~q; aus q nicht ~p ? <br>\",\"eng\":\"We said: if p follows from q but not q from p, then q says more than p. However, if it now follows from p that q is false, but not from q that p is false, what then? <br>\",\"date\":\"1915-06-11\",\"pt-number\":\" 506\",\"pt-page\":\"12[8]\",\"tlp-number\":\"514\",\"cross-references\":\"3.6.15 (1)+  11.6.15 (4,5)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,138r[2] (1915--0612) (NB)\",\"ger\":\"Man knnte eigentlich bei jedem Satz fragen: Was hat es zu bedeuten, wenn er wahr ist, was hat es zu bedeuten wenn er falsch ist. <br>     Nun ist p.~p seiner Annahme nach immer nur falsch, und hat also nichts zu bedeuten; und wieviel es bedeutet wenn er wahr ist kann man ja gar nicht fragen. <br>\",\"eng\":\"Considering any proposition, one could by rights ask: What does it come to if it is true? What does it come to if it is false?<br>     Now the \\\"assumption\\\" in p.~p is never anything but false, and so doesnt come to anything; and as for what it would come to if it were true, of course, one cannot ask at all.<br>\",\"date\":\"1915-06-12\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,138r[3] et 139r[1] (1915--0613) (NB)\",\"ger\":\"Wenn p.~p wahr sein <span class='underline_double'>knnte</span>, so wrde es allerdings <span class='underline_single'>sehr</span>  / viel besagen. Aber <span class='underline_single'>die Annahme</span> da es wahr ist kommt eben bei ihm nicht in Betracht da es seiner Annahme nach immer falsch ist. <br>\",\"eng\":\"If \\\"p.~p\\\" <span class='underline_double'>could</span> be true, it would indeed say a <span class='underline_single'>very</span> great deal. But the <span class='underline_single'>assumption</span> that it is true does not come in question in connection with it, as the \\\"assumption\\\" in it is always false.<br>\",\"date\":\"1915-06-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,139r[2] (1915--0613) (NB)\",\"ger\":\"Eigentmlich: Die Wrter Wahr und Falsch beziehen sich auf die Beziehung des Satzes zur Welt; da diese Wrter in ihm selbst zur Darstellung verwendet werden knnen! <br>\",\"eng\":\"Strange: The words \\\"true\\\" and \\\"false\\\" concern the relation of a proposition to the world; that these words can be used to represent in a proposition itself!<br>\",\"date\":\"1915-06-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,139r[3] et 140r[1] (1915--0613) (NB)\",\"ger\":\" Wir sagten: Wenn ein Satz nur von p abhngig ist und wenn er p bejaht dann verneint er es nicht, und umgekehrt.: <span class='underline_single'>Ist dies das Bild jener gegenseitigen Ausschlieung von p und ~p?</span> Der Tatsache, da  / ~p <span class='underline_single'>das</span> ist, was <span class='underline_single'>auerhalb</span> p liegt? <br>\",\"eng\":\"We said: if a proposition depends only on p, and if it affirms \\\"p\\\" then it does not deny it, and vice versa: <span class='underline_single'>Is this the picture of that mutual exclusion of p and ~p?</span> Of the fact that ~p is <span class='underline_single'>what</span> lies <span class='underline_single'>outside</span> p?<br>\",\"date\":\"1915-06-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,140r[2] (1915--0613) (NB)\",\"ger\":\"<span class='underline_single'>Es scheint doch so!</span> Der Satz ~p ist in demselben Sinne das was auerhalb p liegt.  (Vergi auch nicht da das Bild sehr komplizierte Koordinaten zur Welt haben kann.) <br>\",\"eng\":\"<span class='underline_single'>It does seem so!</span> The proposition \\\"~p\\\" is in the same sense what lies outside \\\"p\\\"..(Don't forget that a picture may have very complicated coordinates to the world as well).<br>\",\"date\":\"1915-06-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,140r[3] (1915--0613) (NB)\",\"ger\":\"Man knnte brigens einfach sagen: p.~p sagt im eigentlichen Sinne des Wortes nichts. Weil im vornherein keine Mglichkeit gelassen ist die er <span class='underline_single'>richtig</span> darstellen kann. <br>\",\"eng\":\"Moreover, one could simply say: \\\"p.~p\\\" says nothing in the strict sense of the word.For from the outset there is no possibility left which it can <span class='underline_single'>correctly</span> represent.<br>\",\"date\":\"1915-06-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,140r[4] et 141r[1] (1915--0613) (NB)\",\"ger\":\"Wenn, beilufig gesprochen, p folgt aus q heit, wenn p wahr ist so mu q wahr sein dann kann man berhaupt nicht sagen  / da irgend etwas aus p.~p folgt, da es die Hypothese da p.~p wahr sei nicht gibt!! <br>\",\"eng\":\"If, roughly speaking, \\\"p follows from q\\\" means: If p is true then q must be true, then one cannot say at all that anything follows from \\\"p.~p\\\", since there is no such thing as the hypothesis that \\\"p.~p\\\" is true!!<br>\",\"date\":\"1915-06-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,141r[2] (1915--0614) (NB)\",\"ger\":\"Wir sind uns also darber klar geworden da Namen fr die verschiedensten Formen stehen, und stehen drfen, und da nun erst die syntaktische Anwendung die darzustellende Form charakterisiert. <br>     Was ist nun die syntaktische Anwendung von Namen einfacher Gegenstnde? <br>\",\"eng\":\"We have thus become clear that names may and do stand for the greatest variety of forms, and that it is only the syntactic application that characterizes the form to be represented. <br>     Now what is the syntactic application of names of simple objects?<br>\",\"date\":\"1915-06-14\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,141r[3] et 142r[1] et 143r[1] (1915--0614) (NB)\",\"ger\":\"Was ist mein Grundgedanke wenn ich von den einfachen  / Gegenstnden rede: Gengen nicht am Ende die zusammengesetzten Gegenstnde gerade den Anforderungen, die ich scheinbar an jene stelle? Gebe ich diesem Buch einen Namen N und rede nun von N, ist nicht das Verhltnis von N zu jenem zusammengesetzten Gegenstand, zu jenen Formen und Inhalten <span class='underline_single'>wesentlich</span> dasselbe welches ich mir zwischen Namen und einfachem Gegenstand dachte? <br>     Denn wohlgemerkt: wenn auch der Name N bei weiterer Analyse verschwindet so deutet er doch ein <span class='underline_single'>Gemeinsames</span>  / an. <br>\",\"eng\":\"What is my basic idea when I talk about simple objects: Don't \\\"composite objects\\\" in the end satisfy precisely the requirements which I seem to make of the simple ones? If I give this book a name \\\"N\\\" and now talk of N, isnt the relation of N to that \\\"composite object\\\", to those forms and contents, <span class='underline_single'>essentially</span> the same as I that which I imagined between name and simple object? <br>     For mind you: even if the name \\\"N\\\" drops out on further analysis, it still indicates a <span class='underline_single'>single </span><span class='underline_single'>common</span> thing. <br>\",\"date\":\"1915-06-14\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,143r[2] (1915--0614) (NB)\",\"ger\":\"     Wie steht es aber mit der Bedeutung der Namen auerhalb des Satzzusammenhanges? <br>\",\"eng\":\"     But what about the meaning of names outside the context of a proposition?  [<em>Cf.</em> 3.3.]<br>\",\"date\":\"1915-06-14\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,143r[3] et 144r[1] (1915--0614) (NB)\",\"ger\":\" Man knnte aber die Frage auch so vorbringen: Es scheint da die Idee des <span class='underline_double'>Einfachen</span> in der des Komplexen und in der Idee der Analyse bereits enthalten liegt, so zwar da, wir ganz absehend von irgendwelchen Beispielen einfacher Gegenstnde, oder von Stzen in welchen von solchen die Rede ist; zu dieser Idee kommen und die Existenz  / der einfachen Gegenstnde als eine logische Notwendigkeit  a priori  einsehen. <br>Es hat also den Anschein, da sich die Existenz der einfachen Gegenstnde zu der der komplexen so verhlt wie der Sinn von ~p zum Sinn von p: Der <span class='underline_single'>einfache</span> Gegenstand sei im komplexen <span class='underline_single'>prjudiziert</span>. <br>\",\"eng\":\"But one could also put the question like this: It seems that the idea of the <span class='underline_double'>simple</span> is already contained in that of the complex and in the idea of analysis, so that, quite apart from any examples of simple objects, or of propositions which mention them, we come to this idea and accept the existence of simple objects<em>a priori</em>as a logical necessity.<br>So it looks as if the existence of simple objects is related to the existence of complex objects in the same way as the sense of ~p to the sense of p: The <span class='underline_single'>simple</span> object is <span class='underline_single'>pre</span><span class='underline_single'>judg</span><span class='underline_single'>ed</span> in the complex one. <br>\",\"date\":\"1915-06-14\",\"pt-number\":\"54101\",\"pt-page\":\"81[1]\",\"tlp-number\":\"4221 (1) \",\"cross-references\":\"14.6.15 (6)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,144r[2] (1915--0615) (NB)\",\"ger\":\"(Dies ist <span class='underline_double'>ja</span> nicht zu verwechseln mit der <span class='underline_single'>Tatsache</span>, da der <span class='underline_single'>Bestandteil</span> im Komplex prjudiziert ist.) <br>\",\"eng\":\"(This is certainly <span class='underline_double'>not</span> to be confused with the <span class='underline_single'>fact</span> that its <span class='underline_single'>constituent</span> is prejudged in the complex).<br>\",\"date\":\"1915-06-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,144r[3] (1915--0615) (NB)\",\"ger\":\"(Eine der schwersten Aufgaben des Philosophen ist es zu finden wo ihn der Schuh drckt.) <br>\",\"eng\":\"(One of the philosophers most difficult tasks is to find where the shoe pinches.)<br>\",\"date\":\"1915-06-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,145r[1] (1915--0615) (NB)\",\"ger\":\"Ich empfinde die Mglichkeit dieser Uhr wie sie vor mir liegt einen Namen einfach zuzuordnen. Ich empfinde da dieser Name auch auerhalb eines Satzes seine Bedeutung haben wird insoweit ich dies <span class='underline_single'>berhaupt</span> <span class='underline_double'>je</span> empfinde. Und ich empfinde da jener Name in einem Satze allen Anforderungen an den Namen des einfachen Gegenstandes entsprechen wird. <br>\",\"eng\":\"I feel the possibility of simply assigning a name to this watch just as it lies here in front of me. I feel that this name will also have its meaning outside of a proposition inasmuch as I <span class='underline_double'>ever</span> feel this <span class='underline_single'>at all</span>. And I feel that this name in a proposition will correspond to all of the requirements for a \\\"name of a simple object\\\".<br>\",\"date\":\"1915-06-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,145r[2] et 146r[1] (1915--0615) (NB)\",\"ger\":\"Es ist ganz klar da ich tatschlich dieser Uhr wie sie hier vor mir liegt und geht einen Namen zuordnen kann und da dieser Name auerhalb jedes Satzes Bedeutung haben  / wird in demselben Sinne des Wortes wie ich es berhaupt jemals gemeint habe, und  <br>\",\"eng\":\"It is quite clear that I can actually assign a name to this watch just as it lies here ticking in front of me, and that this name will have meaning outside of any proposition in the same sense of the word as I have always intended, and.<br>\",\"date\":\"1915-06-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,146r[2] (1915--0616) (NB)\",\"ger\":\"Wir wollen jetzt einmal sehen, ob diese Uhr tatschlich allen Bedingungen entspricht um ein einfacher Gegenstand zu sein.  <br>\",\"eng\":\"Now let's see whether this watch actually meets all the conditions for being a \\\"simple object.\\\".<br>\",\"date\":\"1915-06-16\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,146r[3] (1915--0615) (NB)\",\"ger\":\"Die Frage ist eigentlich die: Mu ich, um die syntaktische Behandlungsweise eines Namens zu kennen, die Zusammensetzung seiner Bedeutung kennen?, wenn ja so drckt sich die ganze Zusammensetzung auch schon im unanalysierten Satze aus.   <br>\",\"eng\":\"The question is really this: Do I have to know the composition of a names reference if I am to know its syntactic regime? If so, then the whole composition is already expressed even in the unanalyzed proposition. <br>\",\"date\":\"1915-06-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,147r[1] (1915--0615) (NB)\",\"ger\":\"(Man versucht oft, zu groe Gedankenklfte zu berspringen und fllt dann mitten hinein.) <br>\",\"eng\":\"(One often tries to jump over too wide chasms of thought and then falls in).<br>\",\"date\":\"1915-06-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,147r[2] (1915--0615) (NB)\",\"ger\":\"Das was uns a priori gegeben scheint ist der Begriff: <span class='underline_single'>Dieses</span>.  Identisch mit dem Begriff des <span class='underline_single'>Gegenstands</span>. <br>\",\"eng\":\"What seems to be given to us <em>a priori</em> is the concept: <span class='underline_single'>This</span>.Identical with the concept of the <span class='underline_single'>object</span>.<br>\",\"date\":\"1915-06-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,147r[3] (1915--0615) (NB)\",\"ger\":\"Auch Relation und Eigenschaften etc. sind <span class='underline_single'>Gegenstnde</span>. <br>\",\"eng\":\"Relations and properties etc. are <span class='underline_single'>objects</span> too.<br>\",\"date\":\"1915-06-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,147r[4] et 148r[1] et 149r[1] (1915--0615) (NB)\",\"ger\":\" Meine Schwierigkeit besteht doch darin: In allen mir vorkommenden Stzen kommen Namen vor welche aber bei weiterer Analyse wieder verschwinden mssen. Ich  / wei da eine solche weitere Analyse mglich ist bin aber nicht im Stande sie vollstndig durchzufhren. Trotzdem nun wei ich allem Anscheine nach da wenn die Analyse vollstndig durchgefhrt wre, ihr Resultat ein Satz sein mte der wieder Namen Relationen etc. enthielte. Kurz es scheint als wte ich auf diese Weise nur eine Form von welcher ich kein einziges Beispiel kenne. <br>      Ich sehe: die Analyse kann weitergefhrt werden und kann mir nun sozusagen nicht vorstellen, da  / sie zu etwas Anderem fhrt als zu den mir bekannten Satzgattungen. <br>\",\"eng\":\"My difficulty surely consists in this: In all the propositions that occur to me names are present which, however, must disappear again on further analysis. I know that such a further analysis is possible, but I am not able to carry it out completely. Nevertheless, I certainly seem to know that if the analysis were completely carried out, its result would have to be a proposition which once more would contain names, relations etc.. In short, it looks as if in this way I knew a form without being acquainted with any single example of it.<br>      I see that the analysis can be continued and now I cant imagine, so to speak, its leading to anything other than the kinds of propositions Im used to. <br>\",\"date\":\"1915-06-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,149r[2] (1915--0615) (NB)\",\"ger\":\"Wenn ich sage diese Uhr ist glnzend und das was ich mit diese Uhr meine ndert seine Zusammensetzung im geringsten so ndert sich damit nicht nur der Sinn des Satzes dem Inhalt nach sondern die <span class='underline_single'>Aussage ber diese Uhr</span> ndert sofort <span class='underline_single'>auch</span> ihren Sinn. Die ganze Form des Satzes ndert sich. <br>\",\"eng\":\"If I say this watch is shiny and what I mean by this watch changes its composition in the slightest, then not only the sense of the proposition changes in its content, but <span class='underline_single'>what I am saying</span><span class='underline_single'> about this watch</span> immediately changes its sense <span class='underline_single'>as well</span>. The whole form of the proposition changes.<br>\",\"date\":\"1915-06-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,149r[3] et 150r[1] (1915--0615) (NB)\",\"ger\":\" Das heit die syntaktische Verwendung der Namen charakterisiert vollstndig die / Form der zusammengesetzten Gegenstnde welche sie bezeichnen. <br>\",\"eng\":\"In other words, the syntactic use of names completely characterizes the form of the composite objects they denote.<br>\",\"date\":\"1915-06-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,150r[2] (1915--0615) (NB)\",\"ger\":\"Jeder Satz der einen Sinn hat hat einen <span class='underline_double'>kompletten</span> Sinn, und er ist ein Bild der Wirklichkeit so da, was in ihm noch nicht gesagt ist einfach nicht zu seinem Sinn gehren kann. <br>     Wenn der Satz diese Uhr glnzt einen Sinn hat so mu es erklrbar sein, <span class='underline_double'>wie dieser</span> Satz <span class='underline_double'>diesen</span> Sinn hat. <br>\",\"eng\":\"Every proposition that has a sense has a <span class='underline_double'>complete</span> sense, and it is a picture of reality in such a way that what is not yet said in it simply cannot belong to its sense. <br>     If the proposition \\\"this watch is shiny\\\" has a sense, it must be explicable <span class='underline_double'>how this</span> proposition has <span class='underline_double'>this</span> sense.<br>\",\"date\":\"1915-06-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,150r[3] et 151r[1] (1915--0615) (NB)\",\"ger\":\" Wenn ein Satz uns etwas sagt so mu er wie er da steht ein Bild  / der Wirklichkeit sein und zwar ein vollstndiges.  Es wird natrlich auch etwas geben was er <span class='underline_single'>nicht</span> sagt  aber <span class='underline_single'>was</span> er sagt sagt er vollstndig und es mu sich <span class='underline_double'>scharf</span> begrenzen lassen. <br>\",\"eng\":\"If a proposition tells us something, it must be a picture of reality just as it is, and a complete picture, to be sure. Of course there will be also something that it does <span class='underline_single'>not</span> saybut <span class='underline_single'>what</span> it does says it says completely and it must let itself be <span class='underline_double'>sharp</span><span class='underline_double'>ly</span> defined.<br>\",\"date\":\"1915-06-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,151r[2] (1915--0615) (NB)\",\"ger\":\"Ein Satz mag also zwar ein unvollstndiges Bild einer gewissen Tatsache sein, aber er ist <span class='underline_double'>immer</span> <span class='underline_single'>ein vollstndiges Bild</span>. <br>\",\"eng\":\"So a proposition may well be an incomplete picture of a certain fact, but it is <span class='underline_double'>always</span> <span class='underline_single'>a complete picture</span>. [<em>Cf</em>. 5.156 (4).]<br>\",\"date\":\"1915-06-15\",\"pt-number\":\"509311\",\"pt-page\":\"94[4]\",\"tlp-number\":\"5156 (4)* \",\"cross-references\":\"16.6.15 (13)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,151r[3] et 152r[1] (1915--0615) (NB)\",\"ger\":\"Daraus schiene es nun als ob in gewissem Sinne alle Namen <span class='underline_single'>echte Namen</span> wren. Oder wie ich auch sagen knnte als ob alle Gegenstnde in gewissem  / Sinne einfache Gegenstnde wren. <br>\",\"eng\":\"From this it would now seem as if in a certain sense all names were <span class='underline_single'>genuine names</span>. Or, as I might also say, as if all objects were in a certain sense simple objects.<br>\",\"date\":\"1915-06-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,152r[2] (1915--0617) (NB)\",\"ger\":\"Nehmen wir an jeder rumliche Gegenstand bestehe aus unendlich vielen Punkten, dann ist es klar da ich diese nicht alle namentlich anfhren kann wenn ich von jenem Gegenstand spreche. Hier wre also ein Fall wo ich zur vollstndigen Analyse im alten Sinne gar nicht kommen <span class='underline_single'>kann</span>; und vielleicht ist gerade dieser der gewhnliche Fall. <br>\",\"eng\":\"Let us assume that every spatial object consists of an infinite number of points, then it is clear that I cannot mention them all by name when I speak of that object. So here would be a case where I <span class='underline_single'>cannot</span> get to the complete analysis in the old sense at all; and perhaps just this is the usual case.<br>\",\"date\":\"1915-06-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,152r[3] et 153r[1] (1915--0617) (NB)\",\"ger\":\"Das ist doch klar da die Stze die die Menschheit ausschlielich bentzt da diese so wie sie stehen einen Sinn  / haben werden und nicht erst auf eine zuknftige Analyse warten um einen Sinn zu erhalten. <br>\",\"eng\":\"Surely it is clear that the propositions which are the only ones that humankind uses will have a sense just as they are and do not wait for a future analysis to receive a sense.<br>\",\"date\":\"1915-06-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,153r[2] et 154r[1] (1915--0617) (NB)\",\"ger\":\"Nun scheint es aber doch eine legitime Frage: sind  z.B.  rumliche Gegenstnde aus einfachen Teilen zusammengesetzt, kommt man bei ihrer Zerlegung auf Teile die nicht mehr zerlegbar sind, oder ist dies nicht der Fall? <br>      Was fr eine Art Frage ist aber dies?  <br>     <span class='underline_single'>Ist es, </span><span class='underline_double'>a priori</span><span class='underline_single'>, klar </span><span class='underline_single'>da</span><span class='underline_single'> wir bei der Zerlegung auf einfache Bestandteile kommen mssen  liegt dies etwa schon im Begriff der Zerlegung </span>, oder  / ist eine Zerlegbarkeit ad infinitum mglich?  Oder am Ende gar ein Drittes? <br>\",\"eng\":\"But now it seems to be a legitimate question: Aree.g.spatial objects composed of simple parts, does their decomposition lead to parts that are not further decomposable, or is this not the case? <br>But what kind of question is this?<br>     <span class='underline_single'>Is it, </span><span class='underline_double'><em>a priori</em></span><span class='underline_single'>, clear that </span><span class='underline_single'>in decomposi</span><span class='underline_single'>ng</span><span class='underline_single'> </span><span class='underline_single'>we must </span><span class='underline_single'>get</span><span class='underline_single'> to simple constituents</span><span class='underline_single'></span><span class='underline_single'>is this </span><span class='underline_single'>perhaps</span><span class='underline_single'> </span><span class='underline_single'>contained in</span><span class='underline_single'> the concept of decompositio</span><span class='underline_single'>n</span>, or is decomposability <em>ad infinitum</em> possible? Or is there even a third possibility in the end?<br>\",\"date\":\"1915-06-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,154r[2] (1915--0617) (NB)\",\"ger\":\"Jene Frage ist eine logische und die Zusammengesetztheit der rumlichen Gegenstnde ist eine logische denn zu sagen, da ein Ding ein Teil eines anderen sei ist immer eine Tautologie. <br>\",\"eng\":\"This question is a logical one and the compositeness of spatial objects is a logical compositeness, for to say that one thing is a part of another is always a tautology.<br>\",\"date\":\"1915-06-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,154r[3] (1915--0617) (NB)\",\"ger\":\"Wie aber, wenn ich etwa sagen wollte da <span class='underline_double'>ein</span> Bestandteil einer Tatsache eine bestimmte Eigenschaft habe? Dann mte ich sie namentlich anfhren und eine logische Summe verwenden. <br>\",\"eng\":\"But suppose I wanted to say that <span class='underline_double'>one</span> constituent of a fact has a particular property? Then I would have to mention it by name and use a logical sum.<br>\",\"date\":\"1915-06-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,154r[4] et 154r[1] (1915--0617) (NB)\",\"ger\":\"Gegen eine unendliche Zerlegbarkeit scheint auch nichts  / zu sprechen. <br>\",\"eng\":\"And nothing seems to speak against infinite decomposability.<br>\",\"date\":\"1915-06-17\",\"pt-number\":\" 54103\",\"pt-page\":\"80[8]\",\"tlp-number\":\"42211** \",\"cross-references\":\"23.5.15 (8)+   17.6.15 (8)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,155r[2] (1915--0617) (NB)\",\"ger\":\"<span class='underline_single'>Und immer wieder</span> drngt es sich uns auf da es etwas einfaches Unzerlegbares gibt, ein Element des Seins kurz ein Ding. <br>\",\"eng\":\"<span class='underline_single'>And </span><span class='underline_single'>time</span><span class='underline_single'> and again</span> it forces itself on us that there is some simple undecomposable, an element of being, in short, a thing.<br>\",\"date\":\"1915-06-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,155r[3] et 156r[1] (1915--0617) (NB)\",\"ger\":\" Es geht zwar nicht gegen unser Gefhl da <span class='underline_single'>wir</span> <span class='underline_double'>Stze</span> nicht soweit zerlegen knnen um die Elemente namentlich anzufhren aber wir fhlen da die <span class='underline_double'>Welt</span> aus Elementen bestehen mu. Und es scheint als sei das identisch mit dem Satz die Welt msse eben sein was sie ist, sie msse bestimmt sein. Oder mit anderen Worten  / was schwankt sind unsere Bestimmungen nicht die Welt. Es scheint als hiee die Dinge leugnen soviel als zu sagen: Die Welt knne sozusagen unbestimmt sein in dem Sinne etwa in welchem unser Wissen unsicher und unbestimmt ist. <br>\",\"eng\":\"It does not go against our feeling, that <span class='underline_single'>we</span> cannot break down <span class='underline_double'>propositions</span> until we can invoke the elements by name, but we feel that the <span class='underline_double'>world</span> must consist of elements. And it appears as if that were identical with the proposition that the world must be just what it is, it must be definite. Or, in other words, what fluctuates are our determinations, not the world. It looks as if to deny things were as much as to say: The world can be, so to speak, indefinite in a sense, like the sense in which our knowledge is uncertain and indefinite. <br>Possible rearrangement of first sentence, easier to follow but loses some of the tone of the German:<br>That <span class='underline_single'>we</span> cannot break down <span class='underline_double'>propositions</span> until we can invoke the elements by name does not go against our feeling, for we feel that the <span class='underline_double'>world</span> must consist of elements.<br>\",\"date\":\"1915-06-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,156r[2] (1915--0617) (NB)\",\"ger\":\"Die Welt hat eine feste Struktur. <br>\",\"eng\":\"The world has a stable structure.<br>\",\"date\":\"1915-06-17\",\"pt-number\":\"2026\",\"pt-page\":\"27[11]\",\"tlp-number\":\"\",\"cross-references\":\"17.6.15 (11)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,156r[3] (1915--0617) (NB)\",\"ger\":\"Ob nicht die Darstellung durch unzerlegbare Namen <span class='underline_single'>nur ein System</span> ist? <br>\",\"eng\":\"Isnt the representation using undecomposable names <span class='underline_single'>only one system</span>?<br>\",\"date\":\"1915-06-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,156r[4] et 157r[1] et 158r[1] et 159r[1] et 160r[1] (1915--0617) (NB)\",\"ger\":\" Alles was ich will ist ja nur vollstndige Zerlegtheit  / <span class='underline_single'>meines Sinnes!!</span> <br>     Mit anderen Worten der Satz mu vollkommen artikuliert sein. Alles was sein Sinn mit einem anderen Sinn gemeinsam hat mu im Satz separat enthalten sein. Kommen Verallgemeinerungen vor so mssen die Formen der besonderen Flle ersichtlich sein.  Und es ist klar da diese Forderung berechtigt ist sonst kann der Satz berhaupt kein Bild von <span class='underline_single'>irgend</span> <span class='underline_double'>etwas</span> sein. [<em>Cf. </em>3.251.]<br>     Denn wenn im Satze Mglichkeiten <span class='underline_single'>offen gelassen werden</span> so mu <span class='underline_single'>eben das bestimmt</span> sein: <span class='underline_single'>was</span> offen gelassen wird. Die Verallgemeinerungen  / der Form  z.B.  mssen bestimmt sein. Was ich nicht wei das wei ich nicht, aber der Satz mu mir zeigen <span class='underline_double'>was</span> ich wei. Und ist dann nicht dies <span class='underline_single'>Bestimmte</span> zu dem ich kommen <span class='underline_single'>mu</span> gerade einfach in dem Sinn der mir immer vorgeschwebt hat? Es ist sozusagen das Harte. <br>     Zusammengesetzte Gegenstnde gibt es nicht heit dann also fr uns: Im Satz mu klar sein wie der Gegenstand zusammengesetzt ist soweit wir berhaupt von seiner Zusammengesetztheit reden  / knnen.  Der Sinn des Satzes mu im Satze in seine <span class='underline_single'>einfachen</span> Bestandteile zerlegt erscheinen . Und diese Teile sind dann wirklich unzerlegbar, denn weiter zerlegte wren eben nicht <span class='underline_double'>diese</span>. Mit anderen Worten der Satz lt sich eben dann nicht mehr durch einen <span class='underline_single'>ersetzen</span> welcher mehr Bestandteile hat sondern jeder der mehr Bestandteile hat hat auch nicht <span class='underline_single'>diesen</span> Sinn. <br>     Immer wenn der Sinn des Satzes vollkommen in ihm selbst ausgedrckt ist, ist der Satz in seine einfachen Bestandteile  / zerlegt  eine weitere Zerlegung ist unmglich und eine scheinbare berflssig und diese sind Gegenstnde im ursprnglichen Sinne. <br>\",\"eng\":\"All I want is surely only a complete breakdown of <span class='underline_single'>my sense</span>!! <br>     In other words the proposition must be completely articulated. Everything that its sense has in common with another sense must be contained separately in the proposition. If generalizations occur, the forms of the special cases must be evident. - And it is clear that this postulate is justified, otherwise the proposition cannot be a picture at all, of <span class='underline_single'>any</span><span class='underline_double'>thing</span>. [Cf. 3.251. [Not in PT.]]<br>     For if possibilities <span class='underline_single'>are left open</span> in a proposition, then <span class='underline_single'>just th</span><span class='underline_single'>is </span><span class='underline_single'>must be de</span><span class='underline_single'>finite</span>: <span class='underline_single'>what</span> is left open. The generalizations of the form - e.g. - must be definite. What I dont know I dont know, but the proposition must show me <span class='underline_double'>what</span> I know. And isn't then this <span class='underline_single'>de</span><span class='underline_single'>finite</span> to which I <span class='underline_single'>must</span> arrive precisely simple in the sense I have always had in mind? It is, so to speak, that which is hard. <br>     In that case, then, what we mean by \\\"there are no composite objects\\\" is: It must be clear in the proposition how the object is composed in so far as we can speak of its complexity at all. The sense of the proposition must appear in the proposition as broken down into its <span class='underline_single'>simple</span> constituents. And these parts are then really undecomposable, for further decomposed they just would not be <span class='underline_double'>these</span>. In other words, the proposition can then no longer be <span class='underline_single'>replaced</span> by one that has more constituents, but any one that has more constituents also doesnt have <span class='underline_single'>this</span> sense. <br>   Whenever the sense of a proposition is completely expressed in the proposition itself, the proposition is broken down into its simple constituentsno further breakdown is possible and an apparent one is superfluousand these are objects in the original sense. <br>\",\"date\":\"1915-06-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,160r[2] (1915--0618) (NB)\",\"ger\":\"Ist die Zusammengesetztheit eines Gegenstandes fr den Sinn eines Satzes bestimmend, dann mu sie soweit im Satze abgebildet sein als sie seinen Sinn bestimmt. Und soweit die Zusammensetzung fr <span class='underline_single'>diesen</span> Sinn <span class='underline_single'>nicht</span> bestimmend ist, soweit sind die Gegenstnde dieses Satzes <span class='underline_single'>einfach</span>. <span class='underline_double'>Sie</span> <span class='underline_single'>knnen</span> nicht weiter zerlegt werden.  <br>\",\"eng\":\"If the complexity of an object is definitive of the sense of a proposition, then it must be depicted in a proposition to the extent that it does decide its sense. And to the extent that its composition is <span class='underline_single'>not</span> definitive of <span class='underline_single'>this</span> sense, to this extent the objects of this proposition are <span class='underline_single'>simple</span>. <span class='underline_double'>They</span> <span class='underline_single'>cannot</span> be further decomposed. <br>\",\"date\":\"1915-06-18\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,161r[1] (1915--0618) (NB)\",\"ger\":\"Die Forderung der einfachen Dinge <span class='underline_single'>ist</span> die Forderung der Bestimmtheit des Sinnes. <br>\",\"eng\":\"To postulate simple things <span class='underline_single'>is</span> to postulate that sense is determinate. [<em>Cf</em>. 3.23.]<br>\",\"date\":\"1915-06-18\",\"pt-number\":\" 320101\",\"pt-page\":\"44[4]\",\"tlp-number\":\"323**\",\"cross-references\":\"18.6.15 (2)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,161r[2] (1915--0618) (NB)\",\"ger\":\" Denn, rede ich etwa von dieser Uhr und meine damit etwas Komplexes und es kommt auf die Zusammensetzung nicht an so wird im Satz eine Verallgemeinerung auftreten und ihre Grundformen werden, <span class='underline_single'>soweit sie berhaupt gegeben sind</span>, vollkommen bestimmt sein. <br>\",\"eng\":\"For if I am talking about, for instance, this watch and mean something complex by that and nothing turns on how it is composed, then a generalization will occur in the proposition and the basic forms of the generalization will be completely specific, <span class='underline_single'>so</span><span class='underline_single'> far as they are given at all</span>.<br>\",\"date\":\"1915-06-18\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,161r[3] (1915--0618) (NB)\",\"ger\":\"Wenn es einen endlichen Sinn gibt und einen Satz der diesen vollstndig ausdrckt dann gibt es auch Namen fr einfache Gegenstnde. <br>\",\"eng\":\"If there is a final sense and a proposition expressing it completely then there are also names for simple objects.<br>\",\"date\":\"1915-06-18\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,162r[1] (1915--0618) (NB)\",\"ger\":\"(Das ist die richtige Designation.) <br>\",\"eng\":\"(That is the correct designation).<br>\",\"date\":\"1915-06-18\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,162r[2] et 163r[1] (1915--0618) (NB)\",\"ger\":\"Wenn nun aber ein einfacher Name einen unendlichen komplexen Gegenstand bezeichnet? Wir sagen zum Beispiel etwas von einem Fleck unseres Gesichtsbilds aus etwa da er rechts von einer Linie liege und wir nehmen an da jeder Fleck unseres Gesichtsbilds unendlich komplex ist. Sagen wir dann von einem Punkt in jenem Fleck da er rechts von der Linie liege dann folgt dieser Satz aus dem frheren und wenn unendlich viele Punkte in dem Flecken liegen <span class='underline_single'>dann </span><span class='underline_single'>folgen</span>  / <span class='underline_single'>unendlich viele Stze verschiedenen Inhalts </span><span class='underline_double'>logisch</span><span class='underline_single'> aus jenem ersten</span>! Und dies zeigt schon da er tatschlich selbst unendlich komplex war. Nmlich nicht das Satzzeichen allein wohl aber <span class='underline_single'>mit seiner syntaktischen Verwendung</span>. <br>\",\"eng\":\"But what about a simple name that refers to an infinitely complex object? For example, perhaps we say of a spot in our visual field that it is to the right of a line, and we assume that every spot in our visual field is infinitely complex. Then if we say of a point in that spot that it is to the right of the line, this proposition follows from the previous one, and if there are infinitely many points in the spot <span class='underline_single'>then infinitely many propositions of different content follow </span><span class='underline_double'>logically</span><span class='underline_single'> from that first one</span>! And this alone shows that the proposition itself was as a matter of fact infinitely complex. That is, not the propositional sign on its own, but <span class='underline_single'>together with</span><span class='underline_single'> its syntactic use</span>. <br>\",\"date\":\"1915-06-18\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,163r[2] et 164r[1] (1915--0618) (NB)\",\"ger\":\"Nun ist es aber natrlich <span class='underline_single'>sehr</span> leicht mglich da in Wirklichkeit <span class='underline_single'>nicht</span> unendlich viele verschiedene Stze aus einem solchen Satz folgen weil unser Gesichtsbild vielleicht  oder wahrscheinlich  <span class='underline_single'>nicht</span> aus unendlichen vielen Teilen besteht  sondern jener kontinuierliche  / Gesichtsraum erst eine nachtrgliche Konstruktion ist ; und dann folgt eben nur eine endliche Zahl Stze aus dem bewuten und er selbst ist in jedem Sinne <span class='underline_single'>endlich</span>. <br>\",\"eng\":\"Now, of course, it is also <span class='underline_single'>very</span> possible that in reality infinitely many different propositions do <span class='underline_single'>not</span> follow from such a proposition because our visual field perhapsor probablydoes not consist of infinitely many parts - but continuous visual space is only a subsequent construction; and in that case only a finite number of propositions follows from the one known and it itself is <span class='underline_single'>finite</span> in every sense. <br>\",\"date\":\"1915-06-18\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,164r[2] (1915--0618) (NB)\",\"ger\":\"Aber beeintrchtigt nun diese <span class='underline_single'>mgliche</span> unendliche Zusammengesetztheit des Sinnes, dessen Bestimmtheit? <br>\",\"eng\":\"But now, does this <span class='underline_single'>possible</span> infinite complexity of the sense compromise its definiteness?<br>\",\"date\":\"1915-06-18\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,164r[3] et 165r[1] (1915--0618) (NB)\",\"ger\":\"Man knnte die Bestimmtheit auch so fordern!: Wenn ein Satz Sinn haben soll so mu vorerst die syntaktische Verwendung jedes seiner Teile  / festgelegt sein.  Man kann z.B. nicht <span class='underline_single'>erst nachtrglich draufkommen</span> da ein Satz aus ihm folgt. Sondern z.B. welche Stze aus einem Satz folgen mu vollkommen feststehen ehe dieser Satz einen Sinn haben kann! <br>\",\"eng\":\"One could also postulate definiteness in this way: If a proposition is to have sense, then the syntactic use of each of its parts must be laid down in advance. - One cannot, for example, <span class='underline_single'>only </span><span class='underline_single'>later</span><span class='underline_single'> come to</span> the conclusion that a proposition follows from it. But, e.g., which propositions follow from a proposition must be completely fixed before that proposition can have a sense!<br>\",\"date\":\"1915-06-18\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,165r[2] et 166r[1] (1915--0618) (NB)\",\"ger\":\"Es scheint mir durchaus mglich da Flchen in unserem Gesichtsbild einfache Gegenstnde sind indem wir nmlich keinen einzigen Punkt dieser Flche separat wahrnehmen, Gesichtsbilder von Sternen scheinen es sogar sicher zu sein. Wenn ich nmlich z.B. sage diese Uhr / liegt nicht in der Lade so braucht daraus durchaus nicht <span class='underline_double'>logisch folgen</span> da ein Rad welches in der Uhr ist nicht in der Lade liegt denn <span class='underline_single'>ich </span><span class='underline_single'>wute</span> vielleicht <span class='underline_single'>gar nicht</span> da das Rad in der Uhr war habe daher auch nicht mit diese Uhr einen Komplex meinen knnen in welchem das Rad vorkommt. Und es ist gewi da ich  beilufig gesprochen  nicht alle Teile meines <span class='underline_single'>theoretischen</span> Gesichtsbildes sehe. Wer wei <span class='underline_single'>ob</span> ich unendlich viele Punkte sehe! <br>\",\"eng\":\"It seems to me perfectly possible that areas in our visual field are simple objects, since we dont perceive any single point in this area separately; visual images of stars even seem certainly to be so. If I say, for example, this watch is not in the drawer, it need not <span class='underline_double'>follow logically</span> that a wheel which is in the watch is not in the drawer, for I may <span class='underline_single'>not have known </span><span class='underline_single'>at all</span> that the wheel was in the watch, and so I couldnt have meant by \\\"this watch\\\" a complex in which the wheel is located. And it is certain -roughly speaking - that I dont see every part of my <span class='underline_single'>theoretical</span> visual field. Who knows <span class='underline_single'>whether</span> I see infinitely many points?<br>\",\"date\":\"1915-06-18\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,167r[1] (1915--0618) (NB)\",\"ger\":\"Nehmen wir nun an wir shen einen kreisfrmigen Fleck: ist die Kreisform seine <span class='underline_single'>Eigenschaft</span>? Gewi nicht. Sie scheint eine strukturelle Eigenschaft zu sein. Und wenn ich bemerke da ein Fleck kreisrund ist, bemerke ich da nicht eine unendlich komplexe strukturelle Eigenschaft? Oder ich bemerke nur da der Fleck eine endliche Ausdehnung hat, und auch das schon scheint eine unendlich komplexe Struktur <span class='underline_single'>vorauszusetzen</span>. <br>\",\"eng\":\"Now suppose we were to see a circular spot: is the circular shape its <span class='underline_single'>property</span>? Certainly not. It seems to be a structural \\\"property\\\". And if I notice that a spot is circular, am I not noticing an infinitely complex structural property? Or I notice only that the spot has a finite extension, and even this seems to <span class='underline_single'>presuppose</span> an infinitely complex structure.<br>\",\"date\":\"1915-06-18\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,167r[2] (1915--0618)\",\"ger\":\"\",\"eng\":\"\",\"date\":\"1915-06-18\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,168r[1] (1915--0618) (NB)\",\"ger\":\" \\tNicht: ein Satz folgt aus einem anderen, sondern die Wahrheit des einen folgt aus der Wahrheit des anderen. (Darum <span class='underline_single'>folgt</span> aus Alle Menschen sind sterblich, Wenn Sokrates ein Mensch ist, so ist er sterblich.) <br>\",\"eng\":\"Not: One proposition follows from another, but the truth of one follows from the truth of the other. (That is why it <span class='underline_single'>follows</span> from \\\"All men are mortal\\\" that \\\"If Socrates is a man, then he is mortal.\\\")<br>\",\"date\":\"1915-06-18\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,168r[2] (1915--0618) (NB)\",\"ger\":\"     Es kann aber wohl ein Satz von unendlich vielen Punkten handeln ohne in einem gewissen Sinne unendlich komplex zu sein. <br>\",\"eng\":\"     However, a proposition can well be about infinitely many points without being infinitely complex in a certain sense.<br>\",\"date\":\"1915-06-18\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,168r[3] (1915--0619) (NB)\",\"ger\":\"Wenn wir sehen da unser Gesichtsbild komplex ist so sehen wir aber auch da es aus <span class='underline_single'>einfacheren</span> Teilen besteht. <br>\",\"eng\":\"When we see that our visual field is complex, we also see that it consists of <span class='underline_single'>simpler</span> parts.<br>\",\"date\":\"1915-06-19\",\"pt-number\":\" 6005\",\"pt-page\":\"93[7]\",\"tlp-number\":\"55423 (1) \",\"cross-references\":\"19.6.15 (1)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,168r[4] et 169r[1] (1915--0619) (NB)\",\"ger\":\"Wir knnen, ohne eine bestimmte Anwendung im Auge  / zu haben, von Funktionen der und jener Art reden. <br>\",\"eng\":\"We can talk about functions of this and that kind without an eye to any specific application.<br>\",\"date\":\"1915-06-19\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,169r[2] (1915--0619) (NB)\",\"ger\":\"Es schwebt uns nmlich kein Beispiel vor wenn wir Fx und alle anderen variablen Formzeichen benutzen.<br>\",\"eng\":\"For examples arent on our minds when we use Fx and all the other variable form-signs. <br>\",\"date\":\"1915-06-19\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,169r[3] (1915--0619) (NB)\",\"ger\":\"Kurz: Wenn wir die Urbilder nur bei Namen anwenden wrden so wre die Mglichkeit da wir die Existenz der Urbilder aus der Existenz ihrer einzelnen Flle erkennen wrden. Nun aber wenden wir <span class='underline_single'>Variable</span> an das heit wir reden sozusagen von den Urbildern allein ganz abgesehen von irgend welchen einzelnen Fllen. <br>\",\"eng\":\"In short: If we were to apply the prototypes only in the case of names, then there would be the possibility that we would recognize the existence of the prototypes from the existence of their special cases. Now, however, we employ <span class='underline_single'>variables</span>, which means we talk, so to speak, of the prototypes by themselves, quite apart from any individual cases.<br>\",\"date\":\"1915-06-19\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,170r[1] (1915--0619) (NB)\",\"ger\":\"Wir bilden das Ding, die Relation, die Eigenschaft vermittelst Variablen ab und zeigen so da wir diese Ideen nicht aus gewissen uns vorkommenden Fllen ableiten sondern sie irgendwie a priori besitzen. <br>\",\"eng\":\"We depict a thing, a relation, a property, by means of variables and thus show that we do not derive these ideas from certain cases that occur to us, but possess them somehow <em>a priori.</em><br>\",\"date\":\"1915-06-19\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,170r[2] (1915--0619) (NB)\",\"ger\":\"Es fragt sich nmlich: Wenn die einzelnen Formen mir sozusagen in der Erfahrung gegeben sind, dann darf ich doch in der Logik von ihnen nicht Gebrauch machen dann darf ich eigentlich kein x und kein y schreiben. Aber das kann ich doch gar nicht vermeiden. <br>\",\"eng\":\"For the question arises: If the individual forms are, so to speak, given to me in experience, then surely I cant make use of them in logic; in that case I cant really write down an x or a y. But surely I cant avoid this at all.<br>\",\"date\":\"1915-06-19\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,171r[1] (1915--0619) (NB)\",\"ger\":\"Beilufig gefragt: handelt die Logik von gewissen Gattungen von Funktionen u. dergl.? Und wenn nicht, was bedeuten dann Fx z <span class='underline_single'>u.s.w</span><span class='underline_single'>.</span> in der Logik? <br>     <span class='underline_single'>Dies mssen dann Zeichen allgemeinerer Bedeutung sein! </span><br>\",\"eng\":\"Roughly speaking: Does logic deal with certain kinds of functions and the like? And if not, what then do Fx, z, <span class='underline_single'>and so on</span> signify in logic? <br>     <span class='underline_single'>The</span><span class='underline_single'>n the</span><span class='underline_single'>se must be signs of more general </span><span class='underline_single'>sigificance</span><span class='underline_single'>!</span><br>\",\"date\":\"1915-06-19\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,171r[2] (1915--0619) (NB)\",\"ger\":\"Das Aufstellen einer Art logischen Inventars wie ich mir das frher vorstellte scheint es doch wohl nicht zu geben. <br>\",\"eng\":\"There doesn't after all seem to be any setting up of a kind of logical inventory as I previously imagined it.<br>\",\"date\":\"1915-06-19\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,171r[3] (1915--0619) (NB)\",\"ger\":\" Die Bestandteile des Satzes mssen einfach sein = Der Satz mu vollkommen artikuliert sein.<br>\",\"eng\":\"The constituents of a proposition must be simple = A proposition must be completely articulate.  <br>\",\"date\":\"1915-06-19\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,172r[1] (1915--0619) (NB)\",\"ger\":\"Nun <span class='underline_double'>scheint</span> dies aber den Tatsachen zu widersprechen?  <br>\",\"eng\":\"But now does this <span class='underline_double'>seem</span> to contradict the facts? <br>\",\"date\":\"1915-06-19\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,172r[2] (1915--0619) (NB)\",\"ger\":\"In der Logik nmlich wollen wir scheinbar Idealbilder artikulierter Stze vorfhren. Aber wie ist das mglich? <br>\",\"eng\":\"For in logic we are ostensibly trying to present idealised models of articulated propositions. But how is that possible?<br>\",\"date\":\"1915-06-19\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,172r[3] (1915--0619) (NB)\",\"ger\":\"Oder knnen wir einen Satz wie die Uhr liegt auf dem Tisch ohne weiteres nach den Regeln der Logik behandeln. Nein; da sagen wir z.B. da die Zeitangabe in dem Satze verschwiegen ist da er nur scheinbar  etc. etc. <br>Also ehe wir ihn behandeln knnen mssen wir ihn wie es scheint auf eine gewisse Art und Weise umgestalten. <br>\",\"eng\":\"Or can we treat a proposition like \\\"the watch is on the table\\\" without further ado according to the rules of logic? No, here we say, for example, that the propositions date is omitted, that the proposition only seems to be... etc. etc. <br>So it seems we have to transform it in a specific way before we can deal with it.<br>\",\"date\":\"1915-06-19\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,173r[1] (1915--0619) (NB)\",\"ger\":\"Aber dies ist vielleicht nicht magebend, denn knnten wir nicht ebensogut unsere gewohnte <span class='underline_single'>logische</span> Schreibweise dem speziellen Satz anpassen? <br>\",\"eng\":\"But perhaps this is not decisive, for couldnt we just as well adapt our usual <span class='underline_single'>logical</span> notation to the special proposition?<br>\",\"date\":\"1915-06-19\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,173r[2] (1915--0620) (NB)\",\"ger\":\"      Ja, darum handelt es sich: Knnen wir mit Recht die Logik wie sie etwa in den Principia Mathematica steht ohne weiteres auf die <span class='underline_single'>gebruchlichen Stze</span> anwenden?<br>\",\"eng\":\"Yes, this is the question: Can we legitimately apply logic as written down, say in <em>Principia Mathematica</em>, to <span class='underline_single'>ordin</span><span class='underline_single'>a</span><span class='underline_single'>r</span><span class='underline_single'>y propositions</span> without further ado?<br>\",\"date\":\"1915-06-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,173r[3] (1915--0620) (NB)\",\"ger\":\"<span class='underline_single'>Natrlich</span> drfen wir nicht auer acht lassen was in unseren Stzen durch Endungen, Vorsilben Umlaute etc. etc. <span class='underline_single'>ausgedrckt</span> ist. <br>\",\"eng\":\"Of <span class='underline_single'>course</span>, we shouldnt disregard what is <span class='underline_single'>expressed</span> in our propositions by means of endings, prefixes, suffixes, etc., etc.<br>\",\"date\":\"1915-06-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,174r[1] (1915--0620) (NB)\",\"ger\":\"<span class='underline_single'>Aber wir wenden ja die Mathematik, und zwar </span><span class='underline_single'>mit bestem Erfolge</span><span class='underline_single'>, auf die gewhnlichen Stze nmlich auf die der Physik an!! </span><br>\",\"eng\":\"<span class='underline_single'>But we </span><span class='underline_single'>do </span><span class='underline_single'>apply mathematics, and </span><span class='underline_single'>moreover with</span><span class='underline_single'> the </span><span class='underline_single'>utmost</span><span class='underline_single'> </span><span class='underline_single'>effectiveness</span><span class='underline_single'>, to ordinary propositions, namely to those of physics</span><span class='underline_single'>.</span><br>\",\"date\":\"1915-06-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,174r[2] (1915--0620) (NB)\",\"ger\":\"Aber wie merkwrdig: in den bekannten Lehrstzen der mathematischen Physik erscheinen weder Dinge noch Funktionen noch Relationen noch sonst logische Gegenstandsformen!! Statt der Dinge haben wir da Zahlen und die Funktionen & Relationen sind durchweg rein mathematisch!! <br>\",\"eng\":\"But it is remarkable: in the well-known theorems of mathematical physics there appear neither things nor functions nor relations nor any other logical forms of object! Instead of things what we have here are numbers, and the functions and relations are purely mathematical throughout!<br>\",\"date\":\"1915-06-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,174r[3] (1915--0620) (NB)\",\"ger\":\"Aber es ist doch Tatsache da diese Stze auf die solide Wirklichkeit angewandt werden. <br>\",\"eng\":\"But surely it is a fact that these propositions are applied to solid reality.<br>\",\"date\":\"1915-06-20\",\"pt-number\":\" 20126\",\"pt-page\":\"87[6]\",\"tlp-number\":\"20124\",\"cross-references\":\"20.6.15 (5, 10)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,175r[1] (1915--0620) (NB)\",\"ger\":\"Die Variablen in jenen Lehrstzen stehen durchaus nicht  wie man hufig sagt  fr <span class='underline_single'>Lngen, Gewichte</span>, Zeitrume etc. sondern sie stehen einfach fr Zahlen und weiter nichts. <br>\",\"eng\":\"The variables in those theorems definitely do notas it is often saidstand for <span class='underline_single'>lengths, weights</span>, periods of time etc. Rather, they simply stand for numbers and nothing else.<br>\",\"date\":\"1915-06-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,175r[2] (1915--0620) (NB)\",\"ger\":\"Wenn ich nun aber die Zahlen anwenden will dann komme ich zu den Relationen den Dingen etc. etc. Ich sage z.B.: diese Lnge ist 5 Meter und spreche da von Relationen und Dingen, und zwar in dem <span class='underline_single'>ganz gewhnlichen</span> Sinne. <br>\",\"eng\":\"However, if I now want to apply numbers then I come to relations, things etc. etc.. I say, for instance This length is 5 meters, and here I am talking of relations and things, and in the <span class='underline_single'>completely ordinary</span> sense at that.<br>\",\"date\":\"1915-06-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,175r[3] (1915--0620) (NB)\",\"ger\":\"Wir kommen hier zur Frage nach der Bedeutung der Variablen in den physikalischen Stzen. Diese sind ja keine Tautologien. <br>\",\"eng\":\"Here we come to the question about the meaning of variables in propositions of physics. These are, after all, no tautologies.<br>\",\"date\":\"1915-06-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,176r[1] (1915--0620) (NB)\",\"ger\":\"Der physikalische Satz ohne Angabe seiner Anwendung ist offenbar sinnlos. Was htte es fr einen Sinn zu sagen: k = m  p? <br>     Also handelt der vervollstndigte physikalische Satz doch von den Dingen Relationen u.s.w. (Was eigentlich zu erwarten war.) <br>\",\"eng\":\"A proposition of physics is obviously senseless if its application is not specified. What sort of sense would it have to say: \\\"k = m  p\\\"? <br>     So the complete physical proposition does deal with things, relations, and so on, after all. (Which was to be expected, for that matter.)<br>\",\"date\":\"1915-06-20\",\"pt-number\":\" 20126\",\"pt-page\":\"87[6]\",\"tlp-number\":\"20124\",\"cross-references\":\"20.6.15 (5, 10)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,176r[2] (1915--0620) (NB)\",\"ger\":\"Es liegt nun alles darin da ich die Zahlen auf die gewhnlichen Dinge etc. anwende, was wieder nicht mehr sagt als da in unseren ganz gewhnlichen Stzen Zahlen vorkommen. <br>\",\"eng\":\"Now everything turns on my applying numbers to ordinary things etc., which again says no more than that numbers occur in our quite ordinary sentences.<br>\",\"date\":\"1915-06-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,176r[3] et 177r[1] (1915--0620) (NB)\",\"ger\":\"Die Schwierigkeit ist eigentlich die: da wenn wir auch einen <span class='underline_single'>ganz bestimmten</span> Sinn ausdrcken wollen die Mglichkeit / besteht da wir dieses Ziel verfehlen. Es scheint also sozusagen da wir keine Garantie haben da unser Satz wirklich ein Bild der Wirklichkeit ist. <br>\",\"eng\":\"Actually, the difficulty is this: even if we want to express a <span class='underline_single'>completely</span><span class='underline_single'> definite</span> sense, we may miss this goal. So it seems, so to speak, that we have no guarantee that our proposition is really a picture of reality.<br>\",\"date\":\"1915-06-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,177r[2] (1915--0620) (NB)\",\"ger\":\"Die Zerlegung der Krper in <span class='underline_single'>materielle Punkte</span> wie wir sie in der Physik haben ist weiter nichts als die Analyse in <span class='underline_single'>einfache Bestandteile</span>. <br>\",\"eng\":\"The decomposition of bodies into <span class='underline_single'>material points</span>, as we have it in physics, is nothing more than an  analysis into <span class='underline_single'>simple constituents</span>.<br>\",\"date\":\"1915-06-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,177r[3] et 178r[1] (1915--0620) (NB)\",\"ger\":\"Aber sollte es mglich sein da die von uns gewhnlich gebrauchten Stze gleichsam nur einen unvollkommenen Sinn haben (ganz abgesehen von ihrer Wahr- oder Falschheit) und die physikalischen Stze sich sozusagen  / dem Stadium nhern wo ein Satz wirklich einen vollkommenen Sinn hat?? <br>\",\"eng\":\"But could it be possible that sentences in ordinary use have, as it were, only an incomplete sense (not to speak of their truth or falsity) and the propositions of physics are getting closer, so to speak, to the state where a proposition really has a complete sense??<br>\",\"date\":\"1915-06-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,178r[2] (1915--0620) (NB)\",\"ger\":\"Wenn ich sage das Buch liegt auf dem Tisch hat dies wirklich einen vollkommen klaren Sinn? (Eine <span class='underline_double'>hchst</span> bedeutungsvolle Frage!) <br>Der Sinn mu doch klar sein denn <span class='underline_single'>etwas</span> meinen wir doch mit dem Satz und soviel als wir <span class='underline_single'>sicher</span> meinen mu doch klar sein. <br>\",\"eng\":\"When I say \\\"The book is lying on the table\\\" does this really have a completely clear sense? (An <span class='underline_double'>extremely</span> important question!) <br>The sense must surely be clear, for we surely mean <span class='underline_single'>something</span> by the proposition and as much as we <span class='underline_single'>certainly</span> mean must surely be clear.<br>\",\"date\":\"1915-06-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,178r[3] et 179r[1] (1915--0620) (NB)\",\"ger\":\"Wenn der Satz das Buch liegt auf dem Tisch einen klaren Sinn hat, dann mu ich, was immer auch <span class='underline_single'>der Fall ist</span>, sagen knnen ob der Satz wahr oder falsch ist. Es knnten aber sehr wohl <span class='underline_single'>Flle</span> eintreten in welchen ich nicht ohne  / Weiteres sagen knnte ob das Buch noch auf dem Tisch liegend zu nennen ist. Also? <br>\",\"eng\":\"If the proposition \\\"The book is on the table\\\" has a clear sense, then I must, whatever<span class='underline_single'> is the case</span>, be able to say whether the proposition is true or false. However, there could very well be <span class='underline_single'>cases</span> in which I couldnt say without further ado whether the book is still to be called \\\"lying on the table\\\". Well?<br>\",\"date\":\"1915-06-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,179r[2] (1915--0620) (NB)\",\"ger\":\"Ist also etwa der Fall der da ich zwar genau wei was ich sagen will aber dann im Ausdrucke Fehler mache? <br>\",\"eng\":\"So is this a case in which I know exactly what I want to say, but then express it mistakenly?<br>\",\"date\":\"1915-06-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,179r[3] (1915--0620) (NB)\",\"ger\":\"Oder kann diese Unsicherheit <span class='underline_double'>auch</span> noch in den Satz eingeschlossen werden? <br>\",\"eng\":\"Or can this uncertainty be included in the proposition <span class='underline_single'>as </span><span class='underline_single'>well</span>?<br>\",\"date\":\"1915-06-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,179r[4] et 180r[1] (1915--0620) (NB)\",\"ger\":\"Aber es kann auch sein da der Satz das Buch liegt auf dem Tisch meinen Sinn zwar vollkommen darstellt da ich aber die Worte z.B. darauf-liegen hier in einer <span class='underline_single'>speziellen</span> Bedeutung gebrauche  / und es anderswo eine andere Bedeutung hat. Ich meine mit dem Verbum etwa die ganz spezielle Relation die das Buch jetzt wirklich zu dem Tisch hat. <br>\",\"eng\":\"But it could also be that the proposition \\\"The book is lying on the table\\\" represents my sense perfectly, but I use the words, e.g., lying on with a <span class='underline_single'>special</span> meaning here, and that they have another meaning elsewhere. What I mean by the verb is, say, a quite special relation which the book now actually has to the table.<br>\",\"date\":\"1915-06-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,180r[2] (1915--0620) (NB)\",\"ger\":\"Sind also im Grunde die Stze der Physik und die Stze des gewhnlichen Lebens gleich scharf und besteht der Unterschied nur in der konsequenteren Anwendung der Zeichen in der Sprache der Wissenschaft?? <br>\",\"eng\":\"Then are the propositions of physics and the propositions of ordinary life in principle equally sharp, and does the difference consist only in the more consistent application of signs in the language of science??<br>\",\"date\":\"1915-06-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,180r[3] (1915--0620) (NB)\",\"ger\":\"     Kann man davon reden oder nicht da ein Satz einen mehr oder weniger scharfen Sinn hat?? <br>\",\"eng\":\"     Is it or isnt it possible to talk of a proposition's having a more or less sharp sense??<br>\",\"date\":\"1915-06-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,181r[1] (1915--0620) (NB)\",\"ger\":\"Es scheint klar da das was wir <span class='underline_double'>meinen</span> immer <span class='underline_single'>scharf</span> sein mu. <br>     Unser Ausdruck dessen was wir meinen kann wieder nur richtig oder falsch sein. Und nun knnen noch die Worte konsequent oder inkonsequent angewendet sein. Eine andere Mglichkeit scheint es nicht zu geben. <br>\",\"eng\":\"It seems clear that what we <span class='underline_double'>mean</span> must always be \\\"<span class='underline_single'>sharp</span>\\\". <br>     Once more, our expression of what we mean can only be right or wrong. And now the words can, in addition be applied consistently or inconsistently. There doesnt seem to be any other possibility.<br>\",\"date\":\"1915-06-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,181r[2] (1915--0620) (NB)\",\"ger\":\"Wenn ich z.B. sage der Tisch ist einen Meter lang so ist es hchst fraglich was ich damit meine. Aber ich meine wohl der Abstand <span class='underline_double'>dieser</span> zwei Punkte ist ein Meter und die Punkte gehren zum Tisch. <br>\",\"eng\":\"If I say, for example, \\\"the table is one meter long,\\\" it is highly debatable what I mean by that. But I presumably mean the distance between <span class='underline_double'>these</span> two points is one meter and that the points belong to the table.<br>\",\"date\":\"1915-06-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,182r[1] (1915--0620) (NB)\",\"ger\":\"Wir sagten die Mathematik wrde ja schon mit Erfolg auf gewhnliche Stze angewandt aber die Stze der Physik handeln durchwegs von anderen Gegenstnden als denen unserer gewhnlichen Sprache! Mssen unsere Stze <span class='underline_single'>so</span> prpariert werden um mathematisch behandelt werden zu knnen? Offenbar ja! Wenn Quantitten in Frage kommen so wrde z.B. ein Ausdruck wie die Lnge dieses Tisches nicht gengen. Diese Lnge mte definiert werden etwa als Abstand zweier Flchen etc. etc. <br>\",\"eng\":\"We said that mathematics has already been applied with success to ordinary propositions, but propositions in physics consistently deal with objects other than those of our ordinary language. Must our propositions undergo <span class='underline_single'>such</span> preparation so that they can be handled  mathematically? Yes, clearly! When quantities are in question then an expression like, e.g., \\\"the length of this table\\\" would not be enough. This length would have to be defined, say, as the distance between two surfaces etc. etc. <br>\",\"date\":\"1915-06-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,182r[2] et 183r[1] (1915--0620) (NB)\",\"ger\":\"Ja, die mathematischen Wissenschaften  / unterscheiden sich von den nicht mathematischen dadurch da jene von Dingen handeln von welchen die gewhnliche Sprache nicht spricht whrend diese von den allgemein bekannten Dingen redet.  <br>\",\"eng\":\"Yes, the mathematical sciences differ from the non-mathematical ones in that the former treat of things of which ordinary language does not speak, while the latter talk of things that are generally familiar.   \\t\\t <br>\",\"date\":\"1915-06-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,183r[2] (1915--0621) (NB)\",\"ger\":\"Unsere Schwierigkeit war doch die da wir immer von einfachen Gegenstnden sprachen und nicht einen einzigen anzufhren wuten. <br>\",\"eng\":\"Our difficulty was that we were always speaking of simple objects and didnt know of a single instance.<br>\",\"date\":\"1915-06-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,183r[3] (1915--0621) (NB)\",\"ger\":\"Wenn der Punkt im Raume nicht existiert dann existieren auch seine Koordinaten nicht und wenn die Koordinaten existieren dann existiert auch der Punkt.So ist es in der Logik. <br>\",\"eng\":\"If a point in space doesnt exist, then its co-ordinates dont exist either, and if the coordinates exist then the point exists too. That's how it is in logic.<br>\",\"date\":\"1915-06-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,184r[1] (1915--0621) (NB)\",\"ger\":\"Das einfache Zeichen ist <span class='underline_single'>wesentlich einfach</span>. <br>     Es fungiert als einfacher Gegenstand. (Was heit das?) <br>     <span class='underline_single'>Seine Zusammensetzung</span> wird vollkommen <span class='underline_single'>gleichgltig</span>. Sie verschwindet uns aus den Augen. <br>A simple sign is <span class='underline_single'>essentially simple</span>. <br>\",\"eng\":\"     It functions as a simple object. (What does that mean?) <br>     <span class='underline_single'>Its composition</span> becomes completely <span class='underline_single'>indifferent</span>. It disappears from our sight.<br>\",\"date\":\"1915-06-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,184r[2] (1915--0621) (NB)\",\"ger\":\"Es scheint immer so, als ob es komplexe Gegenstnde gbe die als einfache fungieren, und dann auch <span class='underline_single'>wirklich</span> einfache, wie die materiellen Punkte der Physik, etc. <br>\",\"eng\":\"It always looks as if there were complex objects that function as simples, and then also <span class='underline_single'>really</span> simple ones, such as the material points of physics, etc.<br>\",\"date\":\"1915-06-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,184r[3] et 185r[1] (1915--0621) (NB)\",\"ger\":\"Da ein Name einen komplexen Gegenstand bezeichnet sieht man aus einer Unbestimmtheit in den Stzen in welchen er vorkommt, die  / eben von der Allgemeinheit solcher Stze herrhrt. Wir <span class='underline_single'>wissen</span> durch diesen Satz ist noch nicht alles bestimmt. Die Allgemeinheitsbezeichnung <span class='underline_single'>enthlt</span> ja ein Urbild. <br>\",\"eng\":\"When a name signifies a complex, this can be seen in an indeterminateness in the propositions in which it occurs. That is due to the generality of such propositions. We <span class='underline_single'>know</span><em> </em>that not everything is already specified by this proposition. After all, the sign for generality <span class='underline_single'>contains</span><em> </em>a prototype. [<em>Cf</em>. 3.24 (3).]<br>\",\"date\":\"1915-06-21\",\"pt-number\":\"320106\",\"pt-page\":\"58[9]\",\"tlp-number\":\"324 (3)*\",\"cross-references\":\"21.6.15 (7,12)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,185r[2] (1915--0621) (NB)\",\"ger\":\"Alle unsichtbaren Massen etc. etc. mssen unter die Allgemeinheitsbezeichnung kommen.<br>\",\"eng\":\"\",\"date\":\"1915-06-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,185r[3] (1915--0621) (NB)\",\"ger\":\"Wie ist das wenn sich Stze der Wahrheit nhern? <br>\",\"eng\":\"What is for propositions to get closer to the truth?<br>\",\"date\":\"1915-06-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,185r[4] et 186r[1] (1915--0621) (NB)\",\"ger\":\"Aber die Logik wie sie etwa in den Principia Mathematica steht lt sich ganz gut auf unsere gewhnlichen Stze anwenden z.B. aus  / Alle Menschen sind sterblich und Sokrates ist ein Mensch folgt nach dieser Logik Sokrates ist sterblich was offenbar richtig ist obwohl ich, ebenso offenbar, nicht wei welche Struktur das Ding Sokrates oder die Eigenschaft der Sterblichkeit hat. Diese fungieren eben hier als einfache Gegenstnde. <br>\",\"eng\":\"But logic as it stands in <em>Principia Mathematica</em><em>, </em>say, can quite well be applied to our ordinary propositions. For instance, according to this logic, from \\\"All men are mortal\\\" and \\\"Socrates is a man\\\", \\\"Socrates is mortal\\\" follows.  This is obviously correct although I, equally obviously, do not know what structure is possessed by the thing Socrates or the property of mortality. Here they just function as simple objects.<br>\",\"date\":\"1915-06-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,186r[2] (1915--0621) (NB)\",\"ger\":\"Offenbar garantiert schon der Umstand der es mglich macht da gewisse Formen durch eine Definition in einen Namen projiziert werden; dafr da dieser Name dann auch wie ein wirklicher behandelt werden kann. <br>\",\"eng\":\"Obviously the circumstance that makes it possible for certain forms to be projected by means of a definition into a name guarantees of itself that this name can then also be treated like a real one.<br>\",\"date\":\"1915-06-21\",\"pt-number\":\" 320107\",\"pt-page\":\"59[2]\",\"tlp-number\":\"324 (4)\",\"cross-references\":\"21.6.15 (11)+22.6.15 (14)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,187r[1] (1915--0621) (NB)\",\"ger\":\"Es ist ja dem klar Sehenden offenbar da ein Satz wie Die Uhr liegt auf dem Tisch eine Menge Unbestimmtheit enthlt trotzdem seine Form uerlich vollkommen klar und einfach erscheint. Wir sehen also da diese Einfachheit nur konstruiert ist. <br>\",\"eng\":\"To anyone that sees clearly, it is obvious that a proposition like \\\"The watch is lying on the table\\\" contains a multitude of indeterminateness in spite of its form outwardly appearing to be perfectly clear and simple. So we see that this simplicity is only a construal.<br>\",\"date\":\"1915-06-21\",\"pt-number\":\"320106\",\"pt-page\":\"58[9]\",\"tlp-number\":\"324 (3)*\",\"cross-references\":\"21.6.15 (7,12)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,187r[2] (1915--0622) (NB)\",\"ger\":\"Es ist also auch <span class='underline_single'>dem</span> <span class='underline_double'>unbefangenen</span> <span class='underline_single'>Geist</span> klar da der Sinn des Satzes die Uhr liegt auf dem Tisch komplizierter ist als der Satz selbst. <br>\",\"eng\":\"Then it is also clear to <span class='underline_single'>the</span> <span class='underline_double'>un</span><span class='underline_double'>preju</span><span class='underline_double'>d</span><span class='underline_double'>iced</span> <span class='underline_single'>mind</span> that the sense of the proposition \\\"The watch is lying on the table\\\" is more complicated than the proposition itself.<br>\",\"date\":\"1915-06-22\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,187r[3] et 188r[1] (1915--0622) (NB)\",\"ger\":\"Die Abmachungen unserer Sprache sind auerordentlich kompliziert. Es wird enorm viel zu jedem Satz dazugedacht was  / nicht gesagt wird. (Diese Abmachungen sind ganz wie die Conventions Whiteheads. Sie sind wohl Definitionen mit <span class='underline_single'>einer gewissen Allgemeinheit der Form</span>.) <br>\",\"eng\":\"The conventions of our language are extraordinarily complicated. There is a great deal added in thought to each proposition that is not said. (These arrangements are quite like Whitehead's \\\"Conventions\\\". They are surely definitions <span class='underline_single'>with </span><span class='underline_single'>a certain</span><span class='underline_single'> generality of form</span>).<br>\",\"date\":\"1915-06-22\",\"pt-number\":\" 3201412\",\"pt-page\":\"95[4]\",\"tlp-number\":\"4002 (5)** \",\"cross-references\":\"22.6.15 (2)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,188r[2] (1915--0622) (NB)\",\"ger\":\"Ich will nur die Vagheit der gewhnlichen Stze rechtfertigen, denn sie <span class='underline_single'>lt</span> sich rechtfertigen. <br>\",\"eng\":\"I want only to justify the vagueness of ordinary sentences, for it <span class='underline_single'>can</span> be justified.<br>\",\"date\":\"1915-06-22\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,188r[3] et 188v[1] (1915--0622) (NB)\",\"ger\":\"Es ist klar: <span class='underline_single'>Ich wei</span> was ich mit dem vagen Satz <span class='underline_single'>meine</span>. Nun versteht es aber ein Anderer nicht und sagt: ja aber wenn du das meinst, httest du  das und das  dazu setzen mssen; und nun wird es noch einer nicht verstehen und den Satz noch ausfhrlicher verlangen. Ich werde dann antworten: Ja <span class='underline_double'>das</span> versteht <span class='underline_single'>sich doch von</span> <span class='underline_double'>selbst</span>.<br>     Sage ich jemand die Uhr liegt auf dem Tisch und nun sagt er ja aber wenn die Uhr so lge wrdest Du da  / auch noch sagen sie liegt auf dem Tisch. Und ich wrde unsicher. Das zeigt, da ich nicht wte was ich mit liegen <span class='underline_single'>im </span><span class='underline_single'>allgemeinen</span> meinte. Wenn man mich so in die Enge triebe um mir zu zeigen da ich nicht wisse was ich meine, wrde ich sagen: <span class='underline_single'>Ich wei</span> was ich meine; ich meine eben <span class='underline_double'>das</span> und wrde dabei etwa auf den betreffenden Komplex mit dem Finger zeigen. Und in diesem Komplex habe ich nun tatschlich die zwei Gegenstnde in einer Relation.  Das heit aber <span class='underline_single'>wirklich</span> nur: Die Tatsache lt sich <span class='underline_double'>irgendwie</span> auch durch diese Form abbilden. <br>\",\"eng\":\"Its clear: <span class='underline_single'>I know</span> what I <span class='underline_single'>mean</span> by a vague proposition. But now someone else doesnt understand it and says: \\\"Yes, but if you mean that, you should have added such and such\\\"; and now another person wont understand it and will demand a yet more detailed proposition. I shall then reply: Now <span class='underline_double'>that</span> <span class='underline_single'>obviously</span> goes without saying. <br>    I tell someone \\\"The watch is lying on the table\\\" and now he says \\\"Yes, but if the watch were lying like that, would you still say it is lying on the table?\\\" And I would become uncertain. This shows that I didnt know what I meant by \\\"lying\\\" <span class='underline_single'>in general</span>. If someone cornered me in this way to show me that I didnt know what I meant, I would say: \\\"<span class='underline_single'>I know</span> what I mean; I mean just <span class='underline_double'>th</span><span class='underline_double'>is</span>\\\" and would point to the complex in question with my finger. And in this complex I do actually have the two objects in a relation.  But all this <span class='underline_single'>really</span> means is: The fact can <span class='underline_double'>somehow</span> be depicted by using this form too. <br>\",\"date\":\"1915-06-22\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"verso\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,188v[2] (1915--0622) (NB)\",\"ger\":\"Wenn ich dies nun tue und die Gegenstnde mit <span class='underline_single'>Namen</span> bezeichne, werden sie dadurch einfach? <br>     Aber doch ist dieser Satz ein Bild jenes Komplexes. <br>\",\"eng\":\"Now if I do this and refer to the objects by means of <span class='underline_single'>names</span>, does that make them simple? <br>     Of course this proposition is still a picture of that complex.<br>\",\"date\":\"1915-06-22\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"verso\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,188v[3] (1915--0622) (NB)\",\"ger\":\"Dieser Gegenstand ist fr <span class='underline_single'>mich einfach</span>! <br>\",\"eng\":\"This object is <span class='underline_single'>simple</span> for <span class='underline_single'>me</span>!<br>\",\"date\":\"1915-06-22\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"verso\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,189r[1] (1915--0622) (NB)\",\"ger\":\"Nenne ich z.B. irgend einen Stab A eine Kugel B so kann ich von A sagen es lehnt an der Wand aber nicht von B. Hier macht sich die interne Natur von A und B bemerkbar. <br>\",\"eng\":\"If, for instance, I call some rod \\\"A\\\", and a ball \\\"B\\\", then I can say that A is leaning against the wall, but not B. Here the internal nature of A and B makes itself felt.<br>\",\"date\":\"1915-06-22\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,189r[2] (1915--0622) (NB)\",\"ger\":\"Wenn ein Name einen Gegenstand bezeichnet so steht er damit in einer Beziehung zu ihm die ganz von der logischen Art des Gegenstandes bedingt ist und diese wieder charakterisiert. <br>\",\"eng\":\"If a name refers to an object then it stands in a relationship to it which is completely determined by the logical kind of the object and which characterizes that logical kind.<br>\",\"date\":\"1915-06-22\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,189r[3] (1915--0622) (NB)\",\"ger\":\"Und das ist klar da der Gegenstand eine bestimmte logische Art haben mu er ist so zusammengesetzt oder so einfach als er eben ist. <br>\",\"eng\":\"And it is clear that the object must be of a particular logical kind,  it is just as complex, or as simple, as it is.<br>\",\"date\":\"1915-06-22\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,189r[4] (1915--0622) (NB)\",\"ger\":\"Die Uhr <span class='underline_single'>sitzt</span> auf dem Tisch ist sinnlos! <br>\",\"eng\":\"\\\"The watch <span class='underline_single'>is sit</span><span class='underline_single'>ting</span> on the table\\\" is senseless!<br>\",\"date\":\"1915-06-22\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,189r[5] et 189v[1] (1915--0622) (NB)\",\"ger\":\"Nur der zusammengesetzte Teil des Satzes kann wahr oder falsch  / sein. <br>\",\"eng\":\"Only the composite part of the proposition can be true or false.<br>\",\"date\":\"1915-06-22\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"verso\"},{\"type\":\"recto\",\"manuscript\":\"Ms-102,189v[2] (1915--0622) (NB)\",\"ger\":\" Der Name fat seine ganze komplexe Bedeutung in Eins zusammen. <br>\",\"eng\":\"The name condenses its whole complex meaning into one.<br>\",\"date\":\"1915-06-22\",\"pt-number\":\"320107\",\"pt-page\":\"59[2]\",\"tlp-number\":\"324 (4)\",\"cross-references\":\"21.6.15 (11)+22.6.15 (14)+\",\"original-type\":\"verso\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,1r[1] (1916--0415) (NB)\",\"ger\":\"Nur was wir selbst konstruieren, knnen wir voraussehen! <br>\",\"eng\":\"We can anticipate only what we ourselves construct. [<em>See</em> 5.556.]<br>\",\"date\":\"1916-04-15\",\"pt-number\":\"5412\",\"pt-page\":\"81[4]\",\"tlp-number\":\"5556 b 1\",\"cross-references\":\"15.4.16 (1)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,1r[2] (1916--0415) (NB)\",\"ger\":\"Aber wo bleibt da der Begriff des einfachen Gegenstandes? <br>\",\"eng\":\"But then where does that leave the concept of a simple object?<br>\",\"date\":\"1916-04-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,1r[3] (1916--0415) (NB)\",\"ger\":\"Dieser Begriff kommt hier berhaupt noch nicht in Betracht. <br>\",\"eng\":\"This concept has not so far been taken into consideration here at all.<br>\",\"date\":\"1916-04-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,1r[4] (1916--0415) (NB)\",\"ger\":\"Wir mssen die einfachen Funktionen darum konstruieren knnen weil wir jedem Zeichen eine Bedeutung geben knnen mssen. <br>\",\"eng\":\"We must be able to construct simple functions because we must be able to give each sign a meaning.<br>\",\"date\":\"1916-04-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,1r[5] (1916--0415) (NB)\",\"ger\":\" Denn das einzige Zeichen welches fr seine Bedeutung brgt ist Funktion und Argument. <br>\",\"eng\":\"For the only sign which guarantees its meaning is function and argument.<br>\",\"date\":\"1916-04-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,2r[1] (1916--0416)\",\"ger\":\"x  y <br>\",\"eng\":\"x  y <br>\",\"date\":\"1916-04-16\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,2r[2] (1916--0416) (NB)\",\"ger\":\"<span class='underline_single'>Jeder</span> einfache Satz lt sich auf die Form x bringen. <br>\",\"eng\":\"<span class='underline_single'>Any</span> simple proposition can be brought into the form x.<br>\",\"date\":\"1916-04-16\",\"pt-number\":\"443012\",\"pt-page\":\"78[11]\",\"tlp-number\":\"45 (3a) \",\"cross-references\":\"16.4.16 (1)+   21.11.16 (1)+   ???\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,2r[3] (1916--0416) (NB)\",\"ger\":\"Darum darf man aus dieser Form alle einfachen Stze zusammenstellen. <br>\",\"eng\":\"Thats why one may compose all simple propositions from this form.<br>\",\"date\":\"1916-04-16\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,2r[4] (1916--0416) (NB)\",\"ger\":\" / \\\\\\tAngenommen mir wren <span class='underline_single'>alle</span> einfachen Stze gegeben: Dann lt sich einfach fragen welche Stze kann ich aus ihnen bilden. Und das sind <span class='underline_single'>alle</span> Stze und <span class='underline_single'>so</span> sind sie <span class='underline_single'>begrenzt</span>. <br>\",\"eng\":\"Suppose I was given <span class='underline_single'>all</span><em> </em>simple propositions. Then I can simply ask what propositions I can construct out of them. And these are <span class='underline_single'>all</span><em> </em>the propositions and <span class='underline_single'>this</span><em> </em>is how they are <span class='underline_single'>delimited</span>. [<em>See</em> 4.51.]<br>\",\"date\":\"1916-04-16\",\"pt-number\":\"443013\",\"pt-page\":\"81[5]\",\"tlp-number\":\"451* \",\"cross-references\":\"16.4.16 (3)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,2r[5] et 3r[1] (1916--0416) (NB)\",\"ger\":\"/ F (x(x) . = .     F <br> .. [F (x (x)) =   x xFx] = <br>\",\"eng\":\"/ F (x(x) . = .     F <br> .. [F (x (x)) =   x xFx] = <br>\",\"date\":\"1916-04-16\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,3r[2] (1916--0417) (NB)\",\"ger\":\"Die obige Definition kann in ihrer Allgemeinheit nur eine Schriftzeichenregel sein die mit dem Sinne der Zeichen nichts zu tun hat. <br>     Aber kann es eine solche Regel geben? <br>\",\"eng\":\"The above definition can in its generality only be a rule for a written notation which has nothing to do with the sense of the signs. <br>     But can there be such a rule?<br>\",\"date\":\"1916-04-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,3r[3] (1916--0417) (NB)\",\"ger\":\"Nur dann ist die Definition mglich wenn sie selbst kein Satz ist. <br>     Dann kann ein Satz nicht von allen Stzen handeln, wohl aber eine Definition. <br>\",\"eng\":\"The definition is only possible if it is itself not a proposition.<br>In that case a proposition cannot be about all propositions, while a definition can.<br>\",\"date\":\"1916-04-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,4r[1] (1916--0423) (NB)\",\"ger\":\"Die obige Definition handelt aber gar nicht von allen Stzen denn sie enthlt wesentlich wirkliche Variable. Sie ist ganz analog einer Operation als deren Basis auch ihr eigenes Resultat genommen werden kann. <br>\",\"eng\":\"However the above definition just does not deal with all propositions, for it essentially contains real variables. It is quite analogous to an operation whose own result can be taken as its basis.<br>\",\"date\":\"1916-04-23\",\"pt-number\":\" 500161\",\"pt-page\":\"102[5]\",\"tlp-number\":\"5251* \",\"cross-references\":\"23.4.16+  ???\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,4r[2] (1916--0426) (NB)\",\"ger\":\"So und nur so ist das Fortschreiten von einer Type zur anderen mglich. <br>\",\"eng\":\"In this way, and only in this way, is advancing from one type to another possible. [<em>Cf</em>. 5.252.]<br>\",\"date\":\"1916-04-26\",\"pt-number\":\"500162\",\"pt-page\":\"81[6]\",\"tlp-number\":\"5252 a+ \",\"cross-references\":\"26.4.16 (1,2)**   17.8.16(1)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,4r[3] (1916--0426) (NB)\",\"ger\":\" / \\\\\\tUnd man kann sagen alle Typen stehen in Hierarchien. <br>\",\"eng\":\"And one can say all types belong to hierarchies.<br>\",\"date\":\"1916-04-26\",\"pt-number\":\"500162\",\"pt-page\":\"81[6]\",\"tlp-number\":\"5252 a+ \",\"cross-references\":\"26.4.16 (1,2)**   17.8.16(1)+  ???\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,4r[4] et 5r[1] (1916--0426) (NB)\",\"ger\":\" / \\\\\\tUnd die Hierarchie ist nur mglich durch den Aufbau durch die  / Operationen. <br>\",\"eng\":\"And hierarchies are only possible only by being constructed by means of operations.<br>\",\"date\":\"1916-04-26\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,5r[2] (1916--0426) (NB)\",\"ger\":\"/ \\\\\\tDie empirische Realitt ist begrenzt durch die Zahl der Gegenstnde. <br>Die Grenze zeigt sich wieder in der Gesamtheit der einfachen Stze. <br>\",\"eng\":\"Empirical reality is delimited by the number of objects. <br>Here too, the limit shows itself in the totality of simple propositions. [<em>See</em> 5.5561.]<br>\",\"date\":\"1916-04-26\",\"pt-number\":\"5413\",\"pt-page\":\"81[7]\",\"tlp-number\":\"55561 \",\"cross-references\":\"26.4.16 (4,5,6)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,5r[3] (1916--0426) (NB)\",\"ger\":\" / \\\\\\tDie Hierarchien sind und mssen unabhngig sein von der Realitt. <br>     Die Bedeutungen ihrer Glieder werden erst durch Zuordnung der Gegenstnde zu den Namen bestimmt. <br>\",\"eng\":\"Hierarchies are and must be independent of reality. [<em>See</em> 5.5561.]<br>     The meanings of their terms are only determined by correlating objects and names.<br>\",\"date\":\"1916-04-26\",\"pt-number\":\"5413\",\"pt-page\":\"81[7]\",\"tlp-number\":\"55561 \",\"cross-references\":\"26.4.16 (4,5,6)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,5r[4] et 6r[1] (1916--0427) (NB)\",\"ger\":\"     x . y <br>Sagen wir ich wollte eine Funktion von 3 unter einander unauswechselbaren Argumenten  / darstellen. <br>\",\"eng\":\"     x . y <br>Suppose I wanted to represent a function of 3 non-interchangeable arguments.<br>\",\"date\":\"1916-04-27\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,6r[2] (1916--0427) (NB)\",\"ger\":\"(x) : \\t( ),\\t x <br>\",\"eng\":\"(x) : \\t( ),\\t x <br>\",\"date\":\"1916-04-27\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,6r[3] (1916--0427) (NB)\",\"ger\":\"Soll nun aber in der Logik von unvertauschbaren Argumenten die Rede sein? Wenn ja, so setzt dies doch etwas ber die Beschaffenheit der Realitt voraus. <br>\",\"eng\":\"But should there be any mention of non-interchangeable arguments in logic? If so, this surely presupposes something about the nature of reality.<br>\",\"date\":\"1916-04-27\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,6r[4] (1916--0427)\",\"ger\":\"~(x).x. z .. ~(x) x <br>\",\"eng\":\"~(x).x. z .. ~(x) x <br>\",\"date\":\"1916-04-27\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,6r[5] et 7r[1] (1916--0506) (NB)\",\"ger\":\"/ Der ganzen Weltanschauung der Modernen liegt diese Tuschung zu Grunde, da die sogenannten Naturgesetze die Erklrungen der Naturerscheinungen seien.<br>\",\"eng\":\"The whole modern world view is based on the illusion that the so-called laws of nature explain natural phenomena. [<em>See</em> 6.371.]<br>\",\"date\":\"1916-05-06\",\"pt-number\":\"6371\",\"pt-page\":\"81[8]\",\"tlp-number\":\"6371 \",\"cross-references\":\"6.5.16 (1)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,7r[2] (1916--0506) (NB)\",\"ger\":\" / \\\\\\tSo bleiben sie bei den Naturgesetzen als bei etwas <span class='underline_single'>Unantastbarem</span> stehen wie die lteren bei Gott und dem Schicksal. <br>\",\"eng\":\"So moderns stop at the laws of nature, treating them as <span class='underline_single'>sacrosanct</span>, which is how the ancients treated God and Fate. [<em>See</em> 6.372.]<br>\",\"date\":\"1916-05-06\",\"pt-number\":\"6372\",\"pt-page\":\"82[1]\",\"tlp-number\":\"6372 \",\"cross-references\":\"6.5.16 (2,3)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,7r[3] (1916--0506) (NB)\",\"ger\":\" / \\\\\\tUnd sie haben ja beide recht und unrecht. Die Alten sind allerdings insofern klarer als sie einen klaren Abschlu anerkannten whrend es bei dem neuen System scheinen soll als sei <span class='underline_single'>alles</span> begrndet. <br>\",\"eng\":\"And actually they are both right, and both wrong.  But the ancients were more clear-sighted in that they recognised a distinct terminus, whereas according to the new dispensation things are supposed to look as if <span class='underline_single'>everything</span><em> </em>were explained. [<em>See</em> 6.372.]<br>\",\"date\":\"1916-05-06\",\"pt-number\":\"6372\",\"pt-page\":\"82[1]\",\"tlp-number\":\"6372 \",\"cross-references\":\"6.5.16 (2,3)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,7r[4] et 8r[1] (1916--0511) (NB)\",\"ger\":\"Es gibt eben auch Operationen  / mit zwei Basen. Und die   -Operation ist von dieser Art. <br>\",\"eng\":\"There are also operations with two bases. And the '  '-operation is of this kind.<br>\",\"date\":\"1916-05-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,8r[2] (1916--0511) (NB)\",\"ger\":\" (,)  ist ein beliebiges Glied der Reihe der Operationsresultate. <br>\",\"eng\":\" (,) ... is an arbitrary term of the series of results of as operation.<br>\",\"date\":\"1916-05-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,8r[3] (1916--0511) (NB)\",\"ger\":\"Ist denn (x) etc. wirklich eine Operation? <br>\",\"eng\":\"Then is (x) etc. really an operation?<br>\",\"date\":\"1916-05-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,8r[4] (1916--0511) (NB)\",\"ger\":\"\",\"eng\":\"Was wre aber ihre Basis? <br>But what would be its base?<br>\",\"date\":\"1916-05-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,8r[5] (1916--0521)\",\"ger\":\"\",\"eng\":\"\",\"date\":\"1916-05-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,8r[6] (1916--0524)\",\"ger\":\"\",\"eng\":\"\",\"date\":\"1916-05-24\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,8r[7] et 9r[1] et 10r[1] (1916--0525? --0611?) (NB)\",\"ger\":\"Was wei ich ber Gott und  / den Zweck des Lebens? <br>     Ich wei da diese Welt ist. <br>     Da ich in ihr stehe wie mein Auge in seinem Gesichtsfeld. <br>     Da etwas an ihr problematisch ist was wir ihren Sinn nennen. <br>     Da dieser Sinn nicht in ihr liegt sondern auer ihr. <br>     Da das Leben die Welt ist. <br>     Da also Gut und Bse mit dem Sinn der Welt  / irgendwie zusammenhngt. <br>     Den Sinn des Lebens, d.i. den Sinn der Welt, knnen wir Gott nennen. <br>     Und das Gleichnis von Gott als einem Vater daran knpfen. <br>     Das Gebet ist der Gedanke an den Sinn des Lebens. <br>     Ich kann die Geschehnisse der Welt nicht nach meinem Willen lenken sondern bin vollkommen machtlos. <br>     Nur so kann ich mich unabhngig von der Welt machen  und sie also doch in gewissem Sinne beherrschen  indem ich auf einen Einflu auf die Geschehnisse verzichte. <br>\",\"eng\":\"What do I know about God and the purpose of life? <br>     I know that this world exists. <br>     That I am in it like my eye in its field of vision. <br>     That something about it is problematic, which we call its meaning.<br>     That this meaning does not reside in it but outside it. [<em>Cf</em>. 6.41.]<br>     That life is the world. [<em>Cf</em>. 5.621.]<br>     That my will pervades the world. <br>     That my will is good or evil.  <br>     That good and evil are thus somehow connected with the meaning of the world.<br>     The meaning of life, i.e. the meaning of the world, we can call God. <br>     And connect this with the comparison of God to a father.<br>     Praying is thinking about the meaning of life. <br>     I cannot control the worlds events with my will: on the contrary, I am completely powerless. <br>     Only in this way can I make myself independent of the world - and thus still control it in a certain sense - by renouncing any influence on events. <br>\",\"date\":\"1916-05-25\",\"pt-number\":\"533531\",\"pt-page\":\"83[8]\",\"tlp-number\":\"5621 \",\"cross-references\":\"11.6.16 (6)+   24.7.16 (1)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,11r[1] (1916--0705) (NB)\",\"ger\":\"Die Welt ist unabhngig von meinem Willen. <br>\",\"eng\":\"The world is independent of my will. [6.373.]<br>\",\"date\":\"1916-07-05\",\"pt-number\":\"6373\",\"pt-page\":\"82[2]\",\"tlp-number\":\"6373 \",\"cross-references\":\"5.7.16 (1)   8.7.16 (4)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,11r[2] (1916--0705) (NB)\",\"ger\":\" / \\\\\\tAuch wenn alles was wir wnschen geschhe so wre dies doch nur sozusagen eine Gnade des Schicksals denn es ist kein logischer Zusammenhang zwischen Willen und Welt der dies verbrgte und den angenommenen physikalischen konnten wir doch nicht wieder wollen. <br>\",\"eng\":\"Even if all we wish for were to happen, still this would only be so by the grace of fate, so to say, for there is no logical<em> </em>connection between the will and the world that would guarantee it, and the supposed physical connection in its turn is surely not something we could will. [<em>See</em> 6.374.]<br>\",\"date\":\"1916-07-05\",\"pt-number\":\"6374\",\"pt-page\":\"82[3]\",\"tlp-number\":\"6374* \",\"cross-references\":\"5.7.16 (2)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,11r[3] et 12r[1] (1916--0705) (NB)\",\"ger\":\" / \\\\\\tWenn das gute oder bse Wollen eine Wirkung auf die Welt hat so kann es sie nur auf die Grenzen der Welt haben, / nicht auf die Tatsachen, auf das was durch die Sprache nicht abgebildet sondern nur in der Sprache gezeigt werden kann. <br>\",\"eng\":\"If good or bad willing has an effect on the world, it can only have an effect on the limits of the world, on what cannot be depicted by language but can only can be shown in language, not on the facts. [<em>Cf</em>. 6.43 (1).]<br>\",\"date\":\"1916-07-05\",\"pt-number\":\"644\",\"pt-page\":\"82[4]\",\"tlp-number\":\"643 (1)** \",\"cross-references\":\"5.7.16 (3)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,12r[2] (1916--0705) (NB)\",\"ger\":\" / \\\\\\tKurz die <span class='underline_single'>Welt</span> mu dann dadurch berhaupt eine andere werden. <br>\",\"eng\":\"In short, the <span class='underline_single'>world</span> will in this way have to become entirely different in kind. [<em>See</em> 6.43 (2).]<br>\",\"date\":\"1916-07-05\",\"pt-number\":\"6441\",\"pt-page\":\"82[5]\",\"tlp-number\":\"643 (2) \",\"cross-references\":\"5.7.16 (4,5)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,12r[3] (1916--0705) (NB)\",\"ger\":\" / \\\\\\tSie mu sozusagen als Ganzes zunehmen oder abnehmen. Wie durch Dazukommen oder Wegfallen eines Sinnes. <br>\",\"eng\":\"It must, so to speak, wax or wane as a whole. As if by adding or losing meaning.<br>\",\"date\":\"1916-07-05\",\"pt-number\":\"6441\",\"pt-page\":\"82[5]\",\"tlp-number\":\"643 (2) \",\"cross-references\":\"5.7.16 (4,5)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,12r[4] (1916--0705) (NB)\",\"ger\":\" / \\\\\\tWie auch beim Tode die Welt sich nicht ndert, sondern aufhrt zu sein. <br>\",\"eng\":\"Similarly, in death the world does not change, but ceases to exist. [<em>See </em>6.431.]<br>\",\"date\":\"1916-07-05\",\"pt-number\":\"6442\",\"pt-page\":\"83[1]\",\"tlp-number\":\"6431 \",\"cross-references\":\"5.7.16 (6)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,13r[1] (1916--0706) (NB)\",\"ger\":\"Und insofern hat wohl auch Dostojewski recht wenn er sagt da der welcher glcklich ist den Zweck des Daseins erfllt.<br>\",\"eng\":\"And in this respect Dostoevsky is surely right when he says that he who is happy is fulfilling the purpose of existence.<br>\",\"date\":\"1916-07-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,13r[2] (1916--0706) (NB)\",\"ger\":\"Oder man knnte auch so sagen der erfllt den Zweck des Daseins der keinen Zweck auer dem Leben mehr braucht. Das heit nmlich der befriedigt ist. <br>\",\"eng\":\"Or one could also say that he who fulfills the purpose of existence does not need any purpose beyond life. That is to say, the one who is satisfied.<br>\",\"date\":\"1916-07-06\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,13r[3] (1916--0706) (NB)\",\"ger\":\"\",\"eng\":\"The solution of the problem of life is felt once this problem is disappearing. [6.521 (1).]<br>\",\"date\":\"1916-07-06\",\"pt-number\":\"6521\",\"pt-page\":\"83[2]\",\"tlp-number\":\"6521 (1) \",\"cross-references\":\"6.7.16 (3)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,13r[4] et 14r[1] (1916--0706) (NB)\",\"ger\":\"Kann man aber so leben da das Leben aufhrt problematisch zu sein? Da / man im Ewigen <span class='underline_single'>lebt</span> und nicht in der Zeit? <br>\",\"eng\":\"But can one live in such a way that life ceases to be problematic? That one <span class='underline_single'>lives</span> in eternity and not in time?<br>\",\"date\":\"1916-07-06\",\"pt-number\":\" 64422\",\"pt-page\":\"83[5]\",\"tlp-number\":\"64311 (2) \",\"cross-references\":\"6.7.16 (4)+   8.7.16 (16)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,14r[2] (1916--0707) (NB)\",\"ger\":\"Ist nicht dies der Grund warum Menschen denen der Sinn des Lebens nach langen Zweifeln klar wurde warum diese dann nicht sagen konnten worin dieser Sinn bestand. <br>\",\"eng\":\"Isnt this why those to whom, after prolonged doubts, the meaning of life became clear have then been unable to say what that meaning amounted to? [<em>See</em> 6.521 (2).]<br>\",\"date\":\"1916-07-07\",\"pt-number\":\"65211\",\"pt-page\":\"83[3]\",\"tlp-number\":\"6521 (2)* \",\"cross-references\":\"(11.6.16 (10)+)   7.7.16 (1)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,14r[3] (1916--0707) (NB)\",\"ger\":\"Wenn ich mir eine <span class='underline_single'>Art</span> von Gegenstnden denken kann ohne zu wissen ob es solche Gegenstnde gibt so mu ich mir ihr Urbild konstruiert haben. <br>\",\"eng\":\"If I can imagine a \\\"<span class='underline_single'>kind</span> of object\\\" without knowing whether such objects exist, then I must have constructed their prototype for myself.<br>\",\"date\":\"1916-07-07\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,14r[4] (1916--0707) (NB)\",\"ger\":\"Beruht hierauf nicht die Methode der Mechanik? <br>\",\"eng\":\"Isn't the method of mechanics based on this?<br>\",\"date\":\"1916-07-07\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,14r[5] et 15r[1] (1916--0708) (NB)\",\"ger\":\"An einen Gott glauben heit die Frage nach  / dem Sinne des Lebens verstehen. <br>\",\"eng\":\"To believe in a God means to understand the question of the meaning of life.<br>\",\"date\":\"1916-07-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,15r[2] (1916--0708) (NB)\",\"ger\":\"An einen Gott glauben heit sehen da es mit den Tatsachen der Welt noch nicht abgetan ist. <br>\",\"eng\":\"To believe in a God means to see that the facts of the world are not the end of the matter.<br>\",\"date\":\"1916-07-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,15r[3] (1916--0708) (NB)\",\"ger\":\"An Gott glauben heit sehen da das Leben einen Sinn hat. <br>\",\"eng\":\"To believe in God means to see that life has a meaning.<br>\",\"date\":\"1916-07-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,15r[4] (1916--0708) (NB)\",\"ger\":\"Die Welt ist mir <span class='underline_single'>gegeben</span>, d.h. mein Wille tritt an die Welt ganz von auen als an etwas Fertiges heran. <br>\",\"eng\":\"The world is <span class='underline_single'>given</span> to me, i.e. my will enters the world completely from outside as into something that is already complete.<br>\",\"date\":\"1916-07-08\",\"pt-number\":\" 6373\",\"pt-page\":\"82[2]\",\"tlp-number\":\"6373 \",\"cross-references\":\"5.7.16 (1)   8.7.16 (4)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,15r[5] (1916--0708) (NB)\",\"ger\":\"(Was mein Wille ist das wei ich noch nicht.) <br>\",\"eng\":\"(What my will is I dont yet know.)<br>\",\"date\":\"1916-07-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,15r[6] et 17r[1] (1916--0708) (NB)\",\"ger\":\"Daher haben wir das Gefhl  / da wir von einem fremden Willen abhngig sind. <br>\",\"eng\":\"That is why we have the feeling of being dependent on an alien will.<br>\",\"date\":\"1916-07-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,17r[2] (1916--0708) (NB)\",\"ger\":\"<span class='underline_single'>Wie dem auch sei</span>, jedenfalls <span class='underline_single'>sind</span> wir in einem gewissen Sinne abhngig, und das wovon wir abhngig sind knnen wir Gott nennen. <br>\",\"eng\":\"<span class='underline_single'>Be that as it may</span>, at any rate we <span class='underline_single'>are</span> dependent in a certain sense, and what we are dependent on we can call God.<br>\",\"date\":\"1916-07-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,17r[3] (1916--0708) (NB)\",\"ger\":\"Gott wre in diesem Sinne einfach das Schicksal oder, was dasselbe ist: die  von unserem Willen unabhngige  Welt. <br>\",\"eng\":\"In this sense God would simply be fate, or, what is the same thing: the world, independent of our will.<br>\",\"date\":\"1916-07-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,17r[4] (1916--0708) (NB)\",\"ger\":\"Vom Schicksal kann ich mich unabhngig machen. <br>\",\"eng\":\"\",\"date\":\"1916-07-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,17r[5] (1916--0708) (NB)\",\"ger\":\"Es gibt zwei Gottheiten die Welt und mein unabhngiges Ich. <br>\",\"eng\":\"There are two deities: the world and my independent I.<br>\",\"date\":\"1916-07-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,18r[1] (1916--0708) (NB)\",\"ger\":\"Ich bin entweder glcklich oder unglcklich, das ist alles. Man kann sagen: gut oder bse gibt es nicht. <br>\",\"eng\":\"I am either happy or unhappy, that's all. One can say: good or evil dont exist. <br>\",\"date\":\"1916-07-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,18r[2] (1916--0708) (NB)\",\"ger\":\"Wer glcklich ist der darf keine Furcht haben. Auch nicht vor dem Tode. <br>\",\"eng\":\"He who is happy must have no fear. Not even of death.<br>\",\"date\":\"1916-07-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,18r[3] (1916--0708) (NB)\",\"ger\":\"Nur wer nicht in der Zeit sondern in der Gegenwart lebt ist glcklich. <br>\",\"eng\":\"Only he who lives not in time but in the present is happy.<br>\",\"date\":\"1916-07-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,18r[4] (1916--0708) (NB)\",\"ger\":\"Fr das Leben in der Gegenwart gibt es keinen Tod. <br>\",\"eng\":\"For one who lives in the present, there is no death.<br>\",\"date\":\"1916-07-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,18r[5] (1916--0708) (NB)\",\"ger\":\" / \\\\\\tDer Tod ist kein Ereignis des Lebens. Er ist keine Tatsache der Welt. <br>\",\"eng\":\"Death is not an event in life. It is not a fact in the world. [Cf. 6.4311 (la).]<br>\",\"date\":\"1916-07-08\",\"pt-number\":\"64421\",\"pt-page\":\"83[4]\",\"tlp-number\":\"64311 (la) \",\"cross-references\":\"8.7.16 (15)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,18r[6] et 19r[1] (1916--0708) (NB)\",\"ger\":\" / \\\\\\tWenn man unter Ewigkeit  / nicht unendliche Zeitdauer sondern Unzeitlichkeit versteht, dann kann man sagen da der ewig lebt der in der Gegenwart lebt. <br>\",\"eng\":\"If we mean by eternity not infinite temporal duration but timelessness, then we can say that he who lives in the present lives eternally. [<em>See</em> 6.4311 (2).]<br>\",\"date\":\"1916-07-08\",\"pt-number\":\"64422\",\"pt-page\":\"83[5]\",\"tlp-number\":\"64311 (2) \",\"cross-references\":\"6.7.16 (4)+   8.7.16 (16)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,19r[2] (1916--0708) (NB)\",\"ger\":\"Um glcklich zu leben mu ich in bereinstimmung sein mit der Welt. Und dies heit ja glcklich sein. <br>\",\"eng\":\"In order to live happily, I must be in agreement with the world. And this is what \\\"being happy\\\" means.<br>\",\"date\":\"1916-07-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,19r[3] (1916--0708) (NB)\",\"ger\":\"Ich bin dann sozusagen in bereinstimmung mit jenem fremden Willen von dem ich abhngig erscheine. Das heit: ich tue den Willen Gottes. <br>\",\"eng\":\"I am then, so to speak, in agreement with that alien will on which I appear dependent. In other words: \\\"I do the will of God\\\".<br>\",\"date\":\"1916-07-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,19r[4] (1916--0708) (NB)\",\"ger\":\"Die Furcht vor dem Tode ist das beste Zeichen eines falschen d.h. schlechten Lebens. <br>\",\"eng\":\"Fear of death is the best sign of a false, i.e. bad, life.<br>\",\"date\":\"1916-07-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,20r[1] (1916--0708) (NB)\",\"ger\":\"Wenn mein Gewissen mich aus dem Gleichgewicht bringt, so bin ich nicht in bereinstimmung mit Etwas. Aber was ist dies? Ist es <span class='underline_single'>die Welt</span>? <br>\",\"eng\":\"When my conscience upsets my equilibrium, I am not in agreement with something. But what is this? Is it <span class='underline_single'>the world</span>?<br>\",\"date\":\"1916-07-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,20r[2] (1916--0708) (NB)\",\"ger\":\"Gewi ist es richtig zu sagen: Das Gewissen ist die Stimme Gottes. <br>\",\"eng\":\"Certainly it is correct to say: Conscience is the voice of God.<br>\",\"date\":\"1916-07-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,20r[3] (1916--0708) (NB)\",\"ger\":\"Zum Beispiel: es macht mich unglcklich zu denken da ich den und den beleidigt habe. Ist das mein Gewissen. <br>\",\"eng\":\"For example: it makes me unhappy to think that I have offended such and such a person. Is that my conscience?<br>\",\"date\":\"1916-07-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,20r[4] (1916--0708) (NB)\",\"ger\":\"Kann man sagen: handle nach deinem Gewissen, es sei beschaffen wie es mag? <br>\",\"eng\":\"Can one say, \\\"Act according to your conscience, whatever it may be\\\"?<br>\",\"date\":\"1916-07-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,20r[5] (1916--0708) (NB)\",\"ger\":\"\",\"eng\":\"\",\"date\":\"1916-07-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,21r[1] (1916--0709) (NB)\",\"ger\":\"Wenn man nicht die allgemeinste Satzform angeben knnte, dann mte ein Moment kommen, wo wir pltzlich eine neue Erfahrung machen, sozusagen eine logische. <br>\",\"eng\":\"If the most general propositional form could not be given, then a time would have to come when we suddenly had a new experience, a logical one, as it were.<br>\",\"date\":\"1916-07-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,21r[2] (1916--0709) (NB)\",\"ger\":\"Dies ist natrlich unmglich. <br>\",\"eng\":\"That is impossible, of course.<br>\",\"date\":\"1916-07-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,21r[3] (1916--0709) (NB)\",\"ger\":\"Nicht vergessen, da (x) fx nicht heit; es gibt ein x so da fx, sondern: es gibt einen wahren Satz fx. <br>\",\"eng\":\"Don't forget that (x) fx does not mean: There is an x such that fx, but: There is a true proposition \\\"fx\\\".<br>\",\"date\":\"1916-07-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,21r[4] et 22r[1] (1916--0709) (NB)\",\"ger\":\"Der Satz fa spricht von bestimmten / Gegenstnden, der allgemeine Satz von <span class='underline_single'>allen</span> Gegenstnden. <br>\",\"eng\":\"The proposition fa speaks of particular objects, the general proposition of <span class='underline_single'>all</span> objects.<br>\",\"date\":\"1916-07-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,22r[2] (1916--0711) (NB)\",\"ger\":\"Der bestimmte Gegenstand ist eine sehr merkwrdige Erscheinung. <br>The particular object is a very remarkable phenomenon.<br>\",\"eng\":\"\",\"date\":\"1916-07-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,22r[3] (1916--0711) (NB)\",\"ger\":\"Statt alle Gegenstnde knnte man sagen: alle <span class='underline_single'>bestimmten Gegenstnde</span>. <br>\",\"eng\":\"Instead of \\\"all objects\\\" one could say: all <span class='underline_single'>particular objects</span>.<br>\",\"date\":\"1916-07-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,22r[4] (1916--0711) (NB)\",\"ger\":\"\",\"eng\":\"Once the particular objects are given, then <em>all</em> objects are given. In short, all objects are given along with the particular objects. [Cf. 5.524 (1).]<br>\",\"date\":\"1916-07-11\",\"pt-number\":\"  53202\",\"pt-page\":\"86[6]\",\"tlp-number\":\"5524 (1)*\",\"cross-references\":\"11.7.16 (4,5)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,22r[5] (1916--0711) (NB)\",\"ger\":\" / \\\\\\tWenn es Gegenstnde gibt, gibt es damit auch alle Gegenstnde. <br>\",\"eng\":\"Once objects are given, then thereby <em>all</em> objects are given. [Cf. 5.524 (1).]<br>\",\"date\":\"1916-07-11\",\"pt-number\":\"53202\",\"pt-page\":\"86[6]\",\"tlp-number\":\"5524 (1)*\",\"cross-references\":\"11.7.16 (4,5)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,23r[1] (1916--0711) (NB)\",\"ger\":\"Darum mu sich auch die Einheit der Elementarstze und der allgemeinen Stze herstellen lassen. <br>\",\"eng\":\"Thats why the unity of elementary propositions and general propositions must be established.<br>\",\"date\":\"1916-07-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,23r[2] (1916--0711) (NB)\",\"ger\":\" / \\\\\\tWenn nmlich die Elementarstze gegeben sind, so sind damit auch <span class='underline_single'>alle</span> Elementarstze gegeben und damit der allgemeine Satz.  Und ist damit nicht schon die Einheit hergestellt. <br>\",\"eng\":\"Once the elementary propositions are given, then thereby <span class='underline_single'>all</span><em> </em>elementary propositions are given.  And with that, hasnt the unity already been established?<br>\",\"date\":\"1916-07-11\",\"pt-number\":\"53203\",\"pt-page\":\"83[6]\",\"tlp-number\":\"5524 (2) \",\"cross-references\":\"11.7.16 (7)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,23r[3] (1916--0712? --0713?) (NB)\",\"ger\":\"Immer wieder fhlt man da auch im Elementarsatz von allen Gegenstnden die Rede ist. <br>\",\"eng\":\"Time and again, one has the feeling that even in an elementary proposition all objects are mentioned.<br>\",\"date\":\"1916-07-12\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,23r[4] et 24r[1] (1916--0713) (NB)\",\"ger\":\"Wenn zwei Operationen gegeben sind die sich nicht auf <span class='underline_single'>eine</span> reduzieren lassen, so mu sich zum mindesten  / eine allgemeine Form ihrer Kombination aufstellen lassen. <br>\",\"eng\":\"If two operations are given which cant be reduced to <span class='underline_single'>one</span>, then it must at least be possible to set up a general form of their combination.<br>\",\"date\":\"1916-07-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,24r[2] (1916--0713) (NB)\",\"ger\":\"Da sich offenbar leicht erklren lt wie mit diesen Operationen sich Stze bilden lassen und wie Stze nicht zu bilden sind so mu sich dies auch <span class='underline_single'>irgendwie</span> exakt ausdrcken lassen. <br>\",\"eng\":\"Obviously, it is easy to explain how propositions may and may not be constructed by means of this operation. Hence there must also <span class='underline_single'>somehow</span> be an exact way in which this can find expression.<br>\",\"date\":\"1916-07-13\",\"pt-number\":\"5503\",\"pt-page\":\"13.7.16 (4) [Vgl. 83[7]]\",\"tlp-number\":\"5503* \",\"cross-references\":\"13.7.16 (4) [Vgl. 83[7]]\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,24r[3] (1916--0714) (NB)\",\"ger\":\"Und dieser Ausdruck mu auch schon in der allgemeinen Form des Operationszeichens gegeben sein. <br>\",\"eng\":\"And this expression must also already be given in the general form of the operation sign.<br>\",\"date\":\"1916-07-14\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,24r[4] et 25r[1] (1916--0714) (NB)\",\"ger\":\"Ja mu dies nicht der einzige legitime Ausdruck der Anwendung der Operation sein. Offenbar  / ja! <br>\",\"eng\":\"After all, mustnt this be the only legitimate expression of the application of an operation? Obviously the answer is yes!<br>\",\"date\":\"1916-07-14\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,25r[2] (1916--0714) (NB)\",\"ger\":\"Denn wenn die Operationsform berhaupt ausgedrckt werden kann, dann mu sie es so, da sie nur richtig angewendet werden <span class='underline_single'>kann</span>. <br>\",\"eng\":\"For if the operation form can be expressed at all, then it must be expressed in such a way that it <span class='underline_single'>can</span> only be applied correctly.<br>\",\"date\":\"1916-07-14\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,25r[3] (1916--0714)\",\"ger\":\"Was aber ist der richtige Ausdruck fr (x) . x? <br>\",\"eng\":\"But what is the correct expression for (x) . x?<br>\",\"date\":\"1916-07-14\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,25r[4] (1916--0714)\",\"ger\":\"() . [   ] <br> (,)  = 0 (x, y, ) <br>()():().0(,,, ) <br>(){0 ( )}  <br>\",\"eng\":\"() . [   ] <br> (,)  = 0 (x, y, ) <br>()():().0(,,, ) <br>(){0 ( )}  <br>\",\"date\":\"1916-07-14\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,26r[1] (1916--0714)\",\"ger\":\"Jetzt noch das Abwechseln zwischen (x) und (x) ausdrcken. Dann aber die Allgemeinheit der Form wie in der Ancestral Relation! <br>\",\"eng\":\"Now to express the alternation between (x) and (x). In this case, however, generality of form as in the ancestral relation.<br>\",\"date\":\"1916-07-14\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,26r[2] (1916--0714)\",\"ger\":\"\",\"eng\":\"\",\"date\":\"1916-07-14\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,26r[3] (1916--0715)\",\"ger\":\"Hier kann vernnftigerweise nicht von einer Existenz von Dingen die Rede sein da auch der Satz aRb schon den Bedingungen entspricht. <br>\",\"eng\":\"Here it isnt appropriate to talk of things existing since the proposition aRb already meets the conditions.<br>\",\"date\":\"1916-07-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,26r[4] (1916--0715)\",\"ger\":\"Nichts scheint einfacher zu sein als ein Satz wie a ist ein Nachkomme von b! <br>\",\"eng\":\"Nothing seems simpler than a proposition such as \\\"a is a descendant of b\\\"!<br>\",\"date\":\"1916-07-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,27r[1] (1916--0716)\",\"ger\":\"xRy.               R<br>\",\"eng\":\"xRy.               R<br>\",\"date\":\"1916-07-16\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,27r[2] (1916--0720)\",\"ger\":\"Meine alte Einteilung aller Satzformen war im Grunde richtig nur da eine andere Art der Allgemeinheit bentigt wird. <br>\",\"eng\":\"My old classification of all propositional forms was correct in principle except that a different kind of generality is required.<br>\",\"date\":\"1916-07-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,27r[3] (1916--0720) (NB)\",\"ger\":\"Der Mensch kann sich nicht ohne weiteres glcklich machen. <br>\",\"eng\":\"Man cannot make himself happy without difficulty.<br>\",\"date\":\"1916-07-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,27r[4] (1916--0720) (NB)\",\"ger\":\"Wer in der Gegenwart lebt, lebt ohne Furcht und Hoffnung. <br>\",\"eng\":\"Whoever lives in the present lives without fear and hope.<br>\",\"date\":\"1916-07-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,27r[5] et 28r[1] (1916--0721) (NB)\",\"ger\":\"Was fr eine Bewandtnis hat es eigentlich mit dem menschlichen  / Willen? Ich will Willen vor allem den Trger von Gut und Bse nennen. <br>\",\"eng\":\"What is the real significance of the human will? First and foremost, I want to speak of \\\"will\\\" as the bearer of good and evil.<br>\",\"date\":\"1916-07-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,28r[2] (1916--0721) (NB)\",\"ger\":\"Stellen wir uns einen Menschen vor der keines seiner Glieder gebrauchen und daher im gewhnlichen Sinne seinen <span class='underline_single'>Willen</span> nicht bettigen knnte. Er knnte aber denken und <span class='underline_single'>wnschen</span> und einem anderen seine Gedanken mitteilen. Knnte also auch durch den Anderen Bses oder Gutes tun. Dann ist klar da die Ethik auch fr ihn Geltung htte und er im <span class='underline_single'>ethischen Sinne</span> Trger eines <span class='underline_single'>Willens</span> ist. <br>\",\"eng\":\"Let us imagine a person who could use none of his limbs and so couldnt exercise his <span class='underline_single'>will</span> in the ordinary sense. He could, however, think and <span class='underline_single'>want</span> and communicate his thoughts to another. So he could also do evil or good through the other. Then it is clear that ethics would apply to him too, and that he is the bearer of a <span class='underline_single'>will</span> in the <span class='underline_single'>ethical sense</span>.<br>\",\"date\":\"1916-07-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,28r[3] et 29r[1] (1916--0721) (NB)\",\"ger\":\"Ist nun ein prinzipieller Unterschied zwischen diesem / Willen und <span class='underline_single'>dem</span> der den menschlichen Krper in Bewegung setzt? <br>\",\"eng\":\"Now is there any relevant difference between this will and the one which sets the human body in motion?<br>\",\"date\":\"1916-07-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,29r[2] (1916--0721) (NB)\",\"ger\":\"Oder liegt hier der Fehler darin da auch schon das <span class='underline_single'>Wnschen</span> (resp. Denken) eine Handlung des Willens ist? (Und in diesem Sinne wre allerdings der Mensch <span class='underline_single'>ohne</span> Willen nicht lebendig.) <br>\",\"eng\":\"Or is the mistake here that even this <span class='underline_single'>wanting</span> ( thinking) is an activity of the will? (And in this sense, indeed, a man <span class='underline_single'>without</span> will would not be alive.)<br>\",\"date\":\"1916-07-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,29r[3] (1916--0721) (NB)\",\"ger\":\"Ist aber ein Wesen denkbar das nur vorstellen (etwa sehen) aber gar nicht wollen knnte. In irgend einem Sinne scheint dies unmglich. Wre es aber mglich dann knnte es auch eine Welt geben ohne Ethik. <br>\",\"eng\":\"But is a being conceivable that could only represent (see, perhaps) but not will at all? In some sense this seems impossible. But if it were possible then there could also be a world without ethics.<br>\",\"date\":\"1916-07-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,30r[1] (1916--0724) (NB)\",\"ger\":\"Die Welt und das Leben sind Eins. <br>\",\"eng\":\"The world and life are one. [5.621.]<br>\",\"date\":\"1916-07-24\",\"pt-number\":\"533531\",\"pt-page\":\"83[8]\",\"tlp-number\":\"5621 \",\"cross-references\":\"11.6.16 (6)+   24.7.16 (1)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,30r[2] (1916--0724) (NB)\",\"ger\":\"Das physiologische Leben ist natrlich nicht das Leben. Und auch nicht das psychologische. Das Leben, ist die Welt. <br>\",\"eng\":\"Of course, physiological life is not \\\"life\\\". And neither is psychological life. Life is the world.<br>\",\"date\":\"1916-07-24\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,30r[3] (1916--0724) (NB)\",\"ger\":\" / \\\\\\tDie Ethik handelt nicht von der Welt. Die Ethik mu eine Bedingung der Welt sein wie die Logik. <br>\",\"eng\":\"Ethics is not about the world. Ethics must be a condition of the world, like logic.<br>\",\"date\":\"1916-07-24\",\"pt-number\":\"6422\",\"pt-page\":\"83[11]\",\"tlp-number\":\"6421 (2)\",\"cross-references\":\"24.7.16 (3)+    30.7.16 (9)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,30r[4] (1916--0724) (NB)\",\"ger\":\" / \\\\\\tEthik und sthetik sind Eins. <br>\",\"eng\":\"Ethics and aesthetics are one and the same. [<em>See</em> 6.421.]<br>\",\"date\":\"1916-07-24\",\"pt-number\":\"64221\",\"pt-page\":\"83[9]\",\"tlp-number\":\"6421 (3)* \",\"cross-references\":\"24.7.16 (4)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,30r[5] et 31r[1] (1916--0729) (NB)\",\"ger\":\"Denn da der Wunsch mit seiner Erfllung in keinem logischen Zusammenhang steht ist eine logische Tatsache. Und da die Welt des Glcklichen  / eine <span class='underline_single'>andere</span> ist als die Welt des Unglcklichen ist auch klar. <br>\",\"eng\":\"For it is a fact of logic that wanting has no logical connection with its fulfillment. And it is also clear that the world of the happy man is a <span class='underline_single'>different</span> one from that of the unhappy man. [<em>Cf</em>. 6.43.]<br>\",\"date\":\"1916-07-29\",\"pt-number\":\"64411\",\"pt-page\":\"83[12]\",\"tlp-number\":\"643 (3)\",\"cross-references\":\"29.7.16 (1, 13)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,31r[2] (1916--0729) (NB)\",\"ger\":\"Ist sehen eine Ttigkeit? <br>\",\"eng\":\"Is seeing an activity?<br>\",\"date\":\"1916-07-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,31r[3] (1916--0729) (NB)\",\"ger\":\"Kann man gut wollen, bse wollen und nicht wollen? <br>\",\"eng\":\"Is it possible to will good, to will evil, and not to will?<br>\",\"date\":\"1916-07-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,31r[4] (1916--0729) (NB)\",\"ger\":\"Oder ist nur der glcklich der <span class='underline_single'>nicht</span> will? <br>\",\"eng\":\"Or is only he happy who does <span class='underline_single'>not</span> will?<br>\",\"date\":\"1916-07-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,31r[5] (1916--0729) (NB)\",\"ger\":\"Seinen Nchsten lieben das hiee, Wollen! <br>\",\"eng\":\"\\\"To love one's neighbor\\\" would amount to willing!<br>\",\"date\":\"1916-07-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,31r[6] et 32r[1] (1916--0729) (NB)\",\"ger\":\"Kann man aber wnschen und doch nicht unglcklich sein wenn der Wunsch nicht in Erfllung geht? <br>     (Und diese Mglichkeit  / besteht ja immer.) <br>\",\"eng\":\"But can one want and yet not be unhappy if the wish is not fulfilled? (And this possibility always exists).<br>\",\"date\":\"1916-07-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,32r[2] (1916--0729) (NB)\",\"ger\":\"Ist es, nach den allgemeinen Begriffen, gut, seinem Nchsten <span class='underline_single'>nichts</span> zu wnschen, weder Gutes noch Schlechtes? <br>\",\"eng\":\"Is it, in general terms, good to want <span class='underline_single'>nothing</span> for one's neighbor, neither good nor bad?<br>\",\"date\":\"1916-07-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,32r[3] (1916--0729) (NB)\",\"ger\":\"Und doch scheint in einem gewissen Sinne das nicht Wnschen das einzig Gute zu sein. <br>\",\"eng\":\"And yet not wanting seems to be the only good, in a certain sense.<br>\",\"date\":\"1916-07-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,32r[4] (1916--0729) (NB)\",\"ger\":\"Hier mache ich noch grobe Fehler! Kein Zweifel! <br>\",\"eng\":\"I am still making serious mistakes here! No doubt!<br>\",\"date\":\"1916-07-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,32r[5] et 33r[1] (1916--0729) (NB)\",\"ger\":\"Allgemein wird angenommen, da es bse ist dem Anderen Unglck zu wnschen. Kann das richtig sein? Kann es schlechter sein  / als dem anderen Glck zu wnschen? <br>     Es scheint da sozusagen darauf anzukommen, <span class='underline_single'>wie</span> man wnscht. <br>\",\"eng\":\"It is generally supposed that it is evil to want the other person to be unhappy. Can that be right? Can it be worse than wanting the other to be happy?<br>     It seems to depend on how one wishes, in a sense.<br>\",\"date\":\"1916-07-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,33r[2] (1916--0729) (NB)\",\"ger\":\"Man scheint nicht mehr sagen zu knnen als: Lebe glcklich! <br>\",\"eng\":\"It seems one can't say anything more than: Live happily!<br>\",\"date\":\"1916-07-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,33r[3] (1916--0729) (NB)\",\"ger\":\"Die Welt des Glcklichen ist eine andere als die des Unglcklichen. <br>\",\"eng\":\"The world of the happy man is a different one from that of the unhappy man. [6.43 (3).]<br>\",\"date\":\"1916-07-29\",\"pt-number\":\"64411\",\"pt-page\":\"83[12]\",\"tlp-number\":\"643 (3)\",\"cross-references\":\"29.7.16 (1, 13)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,33r[4] (1916--0729) (NB)\",\"ger\":\"Die Welt des Glcklichen ist <span class='underline_single'>eine glckliche Welt</span>. <br>\",\"eng\":\"The world of the happy man is <span class='underline_single'>a happy world</span>.<br>\",\"date\":\"1916-07-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,33r[5] (1916--0729) (NB)\",\"ger\":\"Kann es also eine Welt geben die weder glcklich noch unglcklich ist? <br>\",\"eng\":\"Then can there be a world that is neither happy nor unhappy?<br>\",\"date\":\"1916-07-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,34r[1] et 35r[1] (1916--0730) (NB)\",\"ger\":\"Der erste Gedanke bei der Aufstellung eines allgemeinen ethischen Gesetzes von der Form Du sollst   ist: Und was dann, wenn ich es nicht tue?. <br>Es ist aber klar da die Ethik nichts mit Strafe und Lohn zu tun hat. Also mu diese Frage nach den Folgen einer Handlung belanglos sein. Zum Mindesten drfen diese Folgen nicht Ereignisse sein. Denn etwas mu doch an jener Fragestellung richtig sein. Es mu zwar eine <span class='underline_single'>Art</span> von Lohn und ethischer Strafe geben aber diese mssen in der Handlung  / selbst liegen. <br>     Und das ist auch klar da der Lohn etwas Angenehmes die Strafe etwas Unangenehmes sein mu. <br>\",\"eng\":\"When an ethical law of the form You ought to is laid down, one's first thought is, And whats going to happen if I dont do it? <br>But clearly ethics has nothing to do with punishment and reward in the ordinary sense. So this question about the <em>consequences </em>of an action must be irrelevant.  At least these consequences must not be events. For there must be something right about that way of asking the question after all. While there must be a <em>kind </em>of ethical reward and punishment, these are bound to reside in the action itself. <br>And it is clear also that the reward must be something pleasant, the punishment something unpleasant. [<em>See</em> 6.422.]<br>\",\"date\":\"1916-07-30\",\"pt-number\":\"64412\",\"pt-page\":\"84[1]\",\"tlp-number\":\"6422\",\"cross-references\":\"30.7.16 (1,2,3)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,35r[2] (1916--0730) (NB)\",\"ger\":\"Immer wieder komme ich darauf zurck, da einfach das glckliche Leben gut das unglckliche schlecht ist. Und wenn ich mich <span class='underline_single'>jetzt</span> frage: aber <span class='underline_single'>warum</span> soll ich gerade glcklich leben so erscheint mir das von selbst als eine tautologische Fragestellung; es scheint da sich das glckliche Leben von selbst rechtfertigt, da es das einzig richtige Leben <span class='underline_single'>ist</span>. <br>\",\"eng\":\"I keep coming back to this: that only the happy life is good, the unhappy life bad. And if I now ask myself: \\\"but why should I even live happily?\\\" this of itself strikes me as a tautological question. It seems that the happy life is self-justifying, that it is the only right life.<br>\",\"date\":\"1916-07-30\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,36r[1] (1916--0730) (NB)\",\"ger\":\" / \\\\\\tAlles dies ist eigentlich in gewissem Sinne tief geheimnisvoll! <span class='underline_single'>Es ist klar</span> da sich die Ethik nicht aussprechen <span class='underline_single'>lt</span>! <br>\",\"eng\":\"In some curious sense all this is actually deeply mysterious!! <span class='underline_single'>Clearly</span>, ethics <span class='underline_single'>cannot</span> be proclaimed! [<em>Cf</em>. 6.421.]<br>\",\"date\":\"1916-07-30\",\"pt-number\":\"6421\",\"pt-page\":\"83[10]\",\"tlp-number\":\"6421 (1)\",\"cross-references\":\"30.7.16 (5)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,36r[2] (1916--0730) (NB)\",\"ger\":\"Man knnte aber so sagen: Das glckliche Leben scheint in irgend einem Sinne <span class='underline_single'>harmonischer</span> zu sein als das unglckliche. In welchem aber?? <br>\",\"eng\":\"But one could say: The happy life seems to be more <span class='underline_single'>harmonious</span> than the unhappy one, in some sense. But in what sense??<br>\",\"date\":\"1916-07-30\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,36r[3] et 37r[1] (1916--0730) (NB)\",\"ger\":\"Was ist das objektive Merkmal des glcklichen, harmonischen Lebens? Da ist es wieder klar da es kein solches Merkmal, das sich <span class='underline_single'>beschreiben</span> liee, geben kann. <br>     Dies Merkmal kann kein physisches sondern nur ein metaphysisches, / ein transcendentes sein. <br>\",\"eng\":\"What is the objective characteristic of the happy, harmonious life? Here it is again clear that there can be no such characteristic that can be <span class='underline_single'>described</span>. <br>     This characteristic cannot be a physical one but only a metaphysical one, a transcendent one.<br>\",\"date\":\"1916-07-30\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,37r[2] (1916--0730) (NB)\",\"ger\":\" / \\\\\\tDie Ethik ist transcendent. <br>\",\"eng\":\"\",\"date\":\"1916-07-30\",\"pt-number\":\"6422\",\"pt-page\":\"83[11]\",\"tlp-number\":\"6421 (2)\",\"cross-references\":\"24.7.16 (3)+    30.7.16 (9)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,37r[3] (1916--0801) (NB)\",\"ger\":\"84[2]\\t\\t\\t<span class='underline_single'>1.8.16 (1)</span>   <span class='underline_single'>1.8.16 (2)</span><br>Wie sich alles verhlt, ist Gott.       <br>\",\"eng\":\"How things stand, is God.<br>\",\"date\":\"1916-08-01\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,37r[4] (1916--0801) (NB)\",\"ger\":\"84[2]\\t\\t\\t<span class='underline_single'>1.8.16 (1)</span>   <span class='underline_single'>1.8.16 (2)</span><br> / \\\\\\tGott ist, wie sich alles verhlt. <br>\",\"eng\":\"God is, how things stand.<br>\",\"date\":\"1916-08-01\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,37r[5] (1916--0801) (NB)\",\"ger\":\"Nur aus dem Bewutsein der <span class='underline_single'>Einzigkeit meines Lebens</span> entspringt Religion  Wissenschaft  und Kunst. <br>\",\"eng\":\"Only out of a consciousness of the <span class='underline_single'>uniqueness of my life</span> do religion - science - and art arise.<br>\",\"date\":\"1916-08-01\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,37r[6] (1916--0802) (NB)\",\"ger\":\"Und dieses Bewutsein ist das Leben selber. <br>\",\"eng\":\"And this consciousness is life itself.<br>\",\"date\":\"1916-08-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,37r[7] (1916--0802) (NB)\",\"ger\":\"Kann es eine Ethik geben wenn es auer mir kein Lebewesen gibt? <br>\",\"eng\":\"Can there be any ethics if there is no living being other than myself?<br>\",\"date\":\"1916-08-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,38r[1] (1916--0802) (NB)\",\"ger\":\"Wenn die Ethik etwas Grundlegendes sein soll, || : ja!. <br>\",\"eng\":\"If ethics is supposed to be something fundamental, there can.<br>\",\"date\":\"1916-08-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,38r[2] (1916--0802) (NB)\",\"ger\":\"Wenn ich recht habe; so gengt es nicht zum ethischen Urteil, da eine Welt gegeben sei. <br>     Die Welt ist dann an sich weder gut noch bse. <br>\",\"eng\":\"If I am right, then it is not sufficient for ethical judgment that a world is given. <br>     Then the world in itself is neither good nor evil.<br>\",\"date\":\"1916-08-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,38r[3] (1916--0802) (NB)\",\"ger\":\"Denn es mu fr die Existenz der Ethik gleich bleiben ob es auf der Welt lebende Materie gibt oder nicht. Und es ist klar da eine Welt in der nur tote Materie ist an sich weder gut noch bse ist also kann auch die Welt der Lebewesen an sich weder gut noch bse sein. <br>\",\"eng\":\"As far as the existence of ethics is concerned, it must make no difference whether there is living matter in the world or not. And if it is clear that a world in which there is only dead matter is in itself neither good nor evil, then even the world of living creatures can in itself be neither good nor evil.<br>\",\"date\":\"1916-08-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,39r[1] (1916--0802) (NB)\",\"ger\":\" / \\\\\\tGut und Bse tritt erst durch das <span class='underline_single'>Subjekt</span> ein. Und das Subjekt gehrt nicht zur Welt sondern ist eine Grenze der Welt. <br>\",\"eng\":\"Good and evil enter only through the subject. And the subject is a limit, not a part, of the world. [<em>Cf</em>. 5.632.]<br>\",\"date\":\"1916-08-02\",\"pt-number\":\"533542\",\"pt-page\":\"84[3]\",\"tlp-number\":\"5632\",\"cross-references\":\"2.8.16 (7)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,39r[2] (1916--0802) (NB)\",\"ger\":\"Man knnte (Schopenhauerisch) sagen: Die Welt der Vorstellung ist weder gut noch bse, sondern das wollende Subjekt. <br>\",\"eng\":\"One could say (Schopenhauerianly): It is not the world as idea that is either good or evil, but the willing subject.<br>\",\"date\":\"1916-08-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,39r[3] (1916--0802) (NB)\",\"ger\":\"Die vllige Unklarheit aller dieser Stze ist mir bewut. <br>\",\"eng\":\"I am conscious of the complete unclarity of all these sentences.<br>\",\"date\":\"1916-08-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,39r[4] et 40r[1] (1916--0802) (NB)\",\"ger\":\"Nach dem Frheren mte also das wollende Subjekt glcklich oder unglcklich sein und Glck und Unglck  / knnen nicht zur Welt gehren. <br>\",\"eng\":\"According to the foregoing, the willing subject would have to be happy or unhappy, and happiness and unhappiness could not be part of the world.<br>\",\"date\":\"1916-08-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,40r[2] (1916--0802) (NB)\",\"ger\":\"Wie das Subjekt kein Teil der Welt ist sondern eine Voraussetzung ihrer Existenz so sind Gut und Bse, Prdikate des Subjekts, nicht Eigenschaften in der Welt. <br>\",\"eng\":\"As the subject is not a part of the world but a presupposition of its existence, so good and evil, which are predicates of the subject, are not properties in the world.<br>\",\"date\":\"1916-08-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,40r[3] (1916--0802) (NB)\",\"ger\":\"Ganz verschleiert ist hier das Wesen des Subjekts.<br>\",\"eng\":\"The nature of the subject is completely veiled here.<br>\",\"date\":\"1916-08-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,40r[4] (1916--0802) (NB)\",\"ger\":\"Ja, meine Arbeit hat sich ausgedehnt von den Grundlagen der Logik zum Wesen der Welt. <br>\",\"eng\":\"Yes, my work has broadened out from the foundations of logic to the essence of the world.<br>\",\"date\":\"1916-08-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,40r[5] et 41r[1] (1916--0804) (NB)\",\"ger\":\"Ist nicht am Ende das vorstellende Subjekt bloer  / Aberglaube. <br>\",\"eng\":\"Isnt the subject that entertains ideas ultimately just superstition?<br>\",\"date\":\"1916-08-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,41r[2] (1916--0804) (NB)\",\"ger\":\" / \\\\\\tWo in der Welt ist ein metaphysisches Subjekt zu merken? <br>\",\"eng\":\"Where in the world is a metaphysical subject discernable? [<em>See</em> 5.633 (1).]<br>\",\"date\":\"1916-08-04\",\"pt-number\":\"533543\",\"pt-page\":\"84[4]\",\"tlp-number\":\"5633*\",\"cross-references\":\"4.8.16 (2,3,4)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,41r[3] (1916--0804) (NB)\",\"ger\":\" / \\\\\\tDu sagst es verhlt sich hier ganz wie bei Auge und Gesichtsfeld. Aber das Auge siehst Du wirklich <span class='underline_single'>nicht</span>. <br>     Und ich glaube da nichts am Gesichtsfeld darauf schlieen lt da es von einem Auge gesehen wird. <br>\",\"eng\":\"You say this is just like the case of the eye and the visual field. But as a matter of fact, you do <span class='underline_single'>not</span><em> </em>see the eye. [See 5.633 (2).]<br>And I believe that nothing in the visual field<em> </em>suggests that it is seen by an eye. [Cf. 5.633 (3).]<br>\",\"date\":\"1916-08-04\",\"pt-number\":\"533543\",\"pt-page\":\"84[4]\",\"tlp-number\":\"5633*\",\"cross-references\":\"4.8.16 (2,3,4)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,41r[4] (1916--0805) (NB)\",\"ger\":\"Das vorstellende Subjekt ist wohl leerer Wahn. Das wollende Subjekt aber gibt es. <br>\",\"eng\":\"The subject that entertains ideas is surely an empty illusion. But the willing subject exists.  [<em>Cf</em>. 5.631 (1).]<br>\",\"date\":\"1916-08-05\",\"pt-number\":\" 53354\",\"pt-page\":\"60[3]\",\"tlp-number\":\"5631 (1)\",\"cross-references\":\"5.8.16 (1)+20.10.16 (4)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,42r[1] (1916--0805) (NB)\",\"ger\":\"Wre der Wille nicht, so gbe es auch nicht jenes Zentrum der Welt das wir das Ich nennen und das der Trger der Ethik ist. <br>\",\"eng\":\"If the will did not exist, neither would that center of the world which we call the I, and which is the bearer of ethics.<br>\",\"date\":\"1916-08-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,42r[2] (1916--0805) (NB)\",\"ger\":\"Gut und bse ist wesentlich nur das Ich, nicht die Welt. <br>\",\"eng\":\"It is really only the I, not the world, that is good and evil.<br>\",\"date\":\"1916-08-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,42r[3] (1916--0805) (NB)\",\"ger\":\"Das Ich, das Ich ist das tief Geheimnisvolle! <br>\",\"eng\":\"The I, the I is profoundly mysterious!<br>\",\"date\":\"1916-08-05\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,42r[4] (1916--0807) (NB)\",\"ger\":\"Das Ich ist kein Gegenstand. <br>\",\"eng\":\"The I is not an object.<br>\",\"date\":\"1916-08-07\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,42r[5] (1916--0808? --0811?) (NB)\",\"ger\":\"Jedem Gegenstand stehe ich objektiv gegenber. Dem Ich nicht. <br>\",\"eng\":\"I objectively face every object. Not the I.<br>\",\"date\":\"1916-08-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,43r[1] (1916--0811) (NB)\",\"ger\":\" / \\\\\\tEs gibt also wirklich eine Art und Weise, wie in der Philosophie<span class='underline_single'> in einem nicht psychologischen Sinne</span> vom Ich die Rede sein kann und mu. <br>\",\"eng\":\"So there really is a way in which in philosophy one can and must speak of the I in <span class='underline_single'>a non-psychological </span><span class='underline_single'>sense</span>.  [<em>Cf</em>. 5.641 (1).]<br>\",\"date\":\"1916-08-11\",\"pt-number\":\"533551\",\"pt-page\":\"85[1]\",\"tlp-number\":\"5641 (1)\",\"cross-references\":\"11.8.16 (2)**   \",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,43r[2] (1916--0812) (NB)\",\"ger\":\"Das Ich tritt in die Philosophie dadurch ein, da die Welt <span class='underline_single'>meine</span> Welt ist. <br>\",\"eng\":\"The I enters into philosophy by way of the worlds being <span class='underline_single'>my</span> world. [<em>See</em> 5.641 (2).]<br>\",\"date\":\"1916-08-12\",\"pt-number\":\"533551\",\"pt-page\":\"85[1]\",\"tlp-number\":\"5641 (2)\",\"cross-references\":\"   12.8.16 (1)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,43r[3] (1916--0812) (NB)\",\"ger\":\" / \\\\\\tDas Gesichtsfeld hat nmlich nicht etwa eine solche Form: <br>\",\"eng\":\"The form of the visual field is surely not like this:<br>\",\"date\":\"1916-08-12\",\"pt-number\":\"5335431\",\"pt-page\":\"84[5]\",\"tlp-number\":\"56331**\",\"cross-references\":\"12.8.16 (2)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,43r[4] et 44r[1] (1916--0812) (NB)\",\"ger\":\" / \\\\\\tDas hngt damit zusammen da kein Teil unserer Erfahrung  / a priori ist. <br>\",\"eng\":\"What this is connected with is that no part of our experience is <em>a priori</em>. [<em>See</em> 5.634 (1).]<br>\",\"date\":\"1916-08-12\",\"pt-number\":\"533544a\",\"pt-page\":\"85[2]\",\"tlp-number\":\"5634 (1)\",\"cross-references\":\"12.8.16 (3)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,44r[2] (1916--0812) (NB)\",\"ger\":\" / \\\\\\tAlles was wir sehen, knnte auch anders sein. <br>     Alles was wir berhaupt beschreiben knnen, knnte auch anders sein. <br>\",\"eng\":\"Everything we see could also be otherwise.<br>Everything we can describe at all could also be otherwise. [<em>See</em> 5.634 (2-3).]<br>\",\"date\":\"1916-08-12\",\"pt-number\":\"533545\",\"pt-page\":\"85[3]\",\"tlp-number\":\"5634 (2-3)\",\"cross-references\":\"12.8.16 (4,5)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,44r[3] (1916--0813) (NB)\",\"ger\":\"Angenommen der Mensch knnte seinen Willen nicht bettigen mte aber alle Not dieser Welt leiden, was knnte ihn dann glcklich machen? <br>\",\"eng\":\"Suppose a man could not exercise his will but had to suffer all the misery of this world, then what could make him happy?<br>\",\"date\":\"1916-08-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,44r[4] et 45r[1] (1916--0813) (NB)\",\"ger\":\"Wie kann der Mensch berhaupt glcklich sein, da er doch die Not dieser Welt nicht abwehren kann? /      Eben durch das Leben der Erkenntnis. <br>\",\"eng\":\"How can man be happy at all, since he cannot ward off the misery of this world? Simply by a life of knowledge.<br>\",\"date\":\"1916-08-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,45r[2] (1916--0813) (NB)\",\"ger\":\"Das gute Gewissen ist das Glck welches das Leben der Erkenntnis gewhrt. <br>\",\"eng\":\"A life of knowledge offers the happiness of a good conscience.<br>\",\"date\":\"1916-08-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,45r[3] (1916--0813) (NB)\",\"ger\":\"Das Leben der Erkenntnis ist das Leben, welches glcklich ist, der Not der Welt zum Trotz. <br>\",\"eng\":\"A life of knowledge is a life that is happy in spite of the misery of the world.<br>\",\"date\":\"1916-08-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,45r[4] (1916--0813) (NB)\",\"ger\":\"Nur das Leben ist glcklich welches auf die Annehmlichkeiten der Welt verzichten kann. <br>     Ihm sind die Annehmlichkeiten der Welt nur so viele Gnaden des Schicksals. <br>\",\"eng\":\"The only life that is happy is the life that can renounce the comforts of the world. <br>     To it the comforts of the world are only so many graces of fate.<br>\",\"date\":\"1916-08-13\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,46r[1] et 47r[1] (1916--0816) (NB)\",\"ger\":\"Da ein Punkt nicht zugleich rot und grn sein kann mu dem ersten Anschein nach keine <span class='underline_single'>logische</span> Unmglichkeit sein. Aber schon die physikalische Ausdrucksweise reduziert sie zu einer kinetischen Unmglichkeit. Man sieht zwischen Rot und Grn besteht eine Verschiedenheit der Struktur. <br>     Und nun ordnet sie die Physik gar noch in eine Reihe. Und nun sieht man wie hier die wahre Struktur der Gegenstnde ans Licht gebracht wird. <br>     Da ein Teilchen nicht zu gleicher Zeit an zwei Orten sein kann das  / sieht schon vielmehr aus wie eine <span class='underline_single'>logische</span> Unmglichkeit. <br>     Fragen wir z.B. warum so taucht sofort der Gedanke auf: Nun wir wrden eben Teilchen die sich an zwei Orten befnden verschiedene nennen, und das scheint alles wieder aus der Struktur des Raumes und der Teilchen zu folgen. <br>\",\"eng\":\"That a point cannot be red and green at the same time may not seem to be a logical impossibility at first sight. But the very language of physics itself reduces it to a kinetic impossibility. One sees there is a difference in structure between red and green.<br>     And now physics arranges them even further, into a series. And now one sees here how the true structure of objects is brought to light.<br>That a particle cannot be in two places at the same time does rather look like a <span class='underline_single'>logical</span> impossibility.<br>If we ask why, for example, then the thought immediately comes up: Well, we would call particles that were in two places different, and this all seems to follow in turn from the structure of space and of particles. [Cf. 6.3751.]<br>\",\"date\":\"1916-08-16\",\"pt-number\":\"63751\",\"pt-page\":\"88[1]\",\"tlp-number\":\"63751 (1-2)**\",\"cross-references\":\"16.8.16 (3,4)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,47r[2] (1916--0817) (NB)\",\"ger\":\"Operation ist der bergang von einem Glied zum folgenden einer Formen-Reihe. <br>\",\"eng\":\"An operation is the transition from one term to the next one in a series of forms.<br>\",\"date\":\"1916-08-17\",\"pt-number\":\"500162\",\"pt-page\":\"81[6]\",\"tlp-number\":\"5252 a+ \",\"cross-references\":\"26.4.16 (1,2)**   17.8.16(1)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,47r[3] (1916--0817) (NB)\",\"ger\":\" / \\\\\\tOperation und Formen-Reihe sind quivalente. <br>\",\"eng\":\"The operation and series of forms are equivalents.<br>\",\"date\":\"1916-08-17\",\"pt-number\":\"5005341\",\"pt-page\":\"93[3]\",\"tlp-number\":\"5232* \",\"cross-references\":\"17.8.16 (1)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,47r[4] et 48r[1] (1916--0819? --0829?) (NB)\",\"ger\":\"Die Frage ist, ob die gewhnliche kleine Anzahl von Grundoperationen gengt um alle mglichen Operationen herzustellen. <br>\",\"eng\":\"The question is whether the usual small number of fundamental operations is sufficient to construct all possible operations.<br>\",\"date\":\"1916-08-19\",\"pt-number\":\" 53071\",\"pt-page\":\"80[4]\",\"tlp-number\":\"5474 \",\"cross-references\":\"29.8.16 (1)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,48r[2] (1916--0829) (NB)\",\"ger\":\"Es scheint, da dies so sein mu. <br>\",\"eng\":\"It looks like this must be so.<br>\",\"date\":\"1916-08-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,48r[3] (1916--0829) (NB)\",\"ger\":\"Man kann auch fragen, ob man von jedem Ausdruck auf jeden verwandten mit jenen Grundoperationen bergehen kann. <br>\",\"eng\":\"One can also ask whether one can pass from any expression to any related ones with these fundamental operations.<br>\",\"date\":\"1916-08-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,48r[4] (1916--0902) (NB)\",\"ger\":\"Hier sieht man da der Solipsismus streng durchgefhrt mit dem reinen Realismus zusammenfllt. <br>\",\"eng\":\"Here one sees that solipsism, strictly worked out, coincides with pure realism. [<em>See</em> 5.64.]<br>\",\"date\":\"1916-09-02\",\"pt-number\":\"53355\",\"pt-page\":\"85[4]\",\"tlp-number\":\"564\",\"cross-references\":\"2.9.16 (1,2)   15.10.16 (21)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,49r[1] (1916--0902) (NB)\",\"ger\":\" / \\\\\\tDas Ich des Solipsismus schrumpft zum ausdehnungslosen Punkt zusammen und es bleibt die ihm koordinierte Realitt bestehen. <br>\",\"eng\":\"The I of solipsism shrinks to an extensionless point, and what remains is the reality co-ordinated with it. [<em>See</em> 5.64.]<br>\",\"date\":\"1916-09-02\",\"pt-number\":\"53355\",\"pt-page\":\"85[4]\",\"tlp-number\":\"564\",\"cross-references\":\"2.9.16 (1,2)   15.10.16 (21)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,49r[2] (1916--0902) (NB)\",\"ger\":\"Was geht mich die Geschichte an? Meine Welt ist die erste und einzige! <br>\",\"eng\":\"What does history have to do with me? Mine is the first and only world!<br>\",\"date\":\"1916-09-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,49r[3] (1916--0902) (NB)\",\"ger\":\"Ich will berichten, wie <span class='underline_single'>ich</span> die Welt vorfand. <br>\",\"eng\":\"I want to report how <span class='underline_single'>I</span> found the world.<br>\",\"date\":\"1916-09-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,49r[4] et 50r[1] (1916--0902) (NB)\",\"ger\":\"Was andere mir auf der Welt ber die Welt sagten ist ein ganz kleiner und  / nebenschlicher Teil meiner Welt-Erfahrung. <br>\",\"eng\":\"What others in the world have told me about the world is a very small and incidental part of my worldly experience.<br>\",\"date\":\"1916-09-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,50r[2] (1916--0902) (NB)\",\"ger\":\"<span class='underline_single'>Ich</span> habe die Welt zu beurteilen, die Dinge zu messen. <br>\",\"eng\":\"<span class='underline_single'>I</span> have to judge the world, to measure things.<br>\",\"date\":\"1916-09-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,50r[3] et 51r[1] (1916--0902) (NB)\",\"ger\":\" Das philosophische Ich ist nicht der Mensch, nicht der menschliche Krper oder die menschliche Seele mit den psychologischen Eigenschaften, sondern das metaphysische Subjekt die Grenze (nicht ein Teil) der Welt. Der menschliche Krper aber, <span class='underline_single'>mein</span> Krper insbesondere ist ein Teil der Welt  / unter anderen Teilen der Welt unter Tieren, Pflanzen, Steinen etc. etc. <br>\",\"eng\":\"The philosophical I is not the human being, not the human body, nor the human soul with psychological properties, but rather the metaphysical subject, the limit (not a part) of the world. [<em>Cf</em>. 5.641.] The human body, however, my body in particular, is a part of the world among other parts of the world, among animals, plants, stones, etc., etc.<br>\",\"date\":\"1916-09-02\",\"pt-number\":\"533552\",\"pt-page\":\"94[5]\",\"tlp-number\":\"5641 (3)* \",\"cross-references\":\"2.9.16 (7)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,51r[2] (1916--0902) (NB)\",\"ger\":\"Wer das einsieht wird seinem Krper oder dem menschlichen Krper nicht eine bevorzugte Stelle in der Welt einrumen wollen. <br>Er wird Menschen und Tiere ganz naiv als hnliche und zusammengehrige Dinge betrachten. <br>\",\"eng\":\"Anyone who realizes this will not want to assign his body or the human body a privileged place in the world. <br>He will regard humans and animals quite naively as things that are similar and belong together.<br>\",\"date\":\"1916-09-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,51r[3] (1916--0911) (NB)\",\"ger\":\"Die Art und Weise wie die Sprache bezeichnet spiegelt sich in ihrem Gebrauche wieder. <br>\",\"eng\":\"\",\"date\":\"1916-09-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,52r[1] (1916--0911) (NB)\",\"ger\":\"Da die Farbe keine Eigenschaft ist  zeigt die Analyse der Physik und   \\t\\t <br>\",\"eng\":\"\",\"date\":\"1916-09-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,52r[2] (1916--0911) (NB)\",\"ger\":\"Da die Farben keine Eigenschaften sind, zeigt die Analyse der Physik, zeigen die internen Relationen in welchen die Physik die Farben zeigt. <br>\",\"eng\":\"That colors are not properties is shown by an analysis in physics, in which physics shows the internal relations of colors.<br>\",\"date\":\"1916-09-11\",\"pt-number\":\"41022331\",\"pt-page\":\"95[3]\",\"tlp-number\":\"4123 (1-2)\",\"cross-references\":\"11.9.16 (2)+   MN 222 (7)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,52r[3] (1916--0911) (NB)\",\"ger\":\" \\tWende dies auch auf Klnge an. <br>\",\"eng\":\"Apply this to sounds too.<br>\",\"date\":\"1916-09-11\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,52r[4] et 53r[1] (1916--0912) (NB)\",\"ger\":\"Jetzt wird klar warum ich dachte Denken und Sprechen wre dasselbe. Das Denken nmlich ist eine Art Sprache. / Denn der Gedanke ist natrlich <span class='underline_single'>auch</span> ein logisches Bild des Satzes, und somit ebenfalls eine Art Satz. <br>\",\"eng\":\"Now its becoming clear why I thought thinking and speaking were the same. Because thinking is a kind of language. For a thought is of course a logical picture of a proposition too, and so it just is a kind of proposition.<br>\",\"date\":\"1916-09-12\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,53r[2] (1916--0919) (NB)\",\"ger\":\"Die Menschheit hat immer nach einer Wissenschaft gesucht in welcher simplex sigillum veri ist.<br>\",\"eng\":\"Mankind has always sought a science in which <em>simplex </em><em>sigillum</em><em> </em><em>veri</em> holds. [Cf. 5.4541 (2-3).]<br>\",\"date\":\"1916-09-19\",\"pt-number\":\"530225\",\"pt-page\":\"76[3]\",\"tlp-number\":\"54541 (2-3)* \",\"cross-references\":\"5.3.15 (1)  19.9.16 (1)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,53r[3] et 54r[1] (1916--0919) (NB)\",\"ger\":\"Es kann nicht eine ordentliche oder eine unordentliche Welt geben so da man sagen knnte unsere Welt ist ordentlich. Sondern in jeder mglichen Welt ist eine, wenn auch komplizierte Ordnung gerade so wie es im  / Raume auch nicht unordentliche und ordentliche Punktverteilungen gibt sondern jede Punktverteilung ist ordentlich. <br>[Diese Bemerkung ist nur Material fr einen Gedanken.] <br>\",\"eng\":\"There cannot be an orderly or an disorderly world, so that one could say our world is orderly. But in every possible world there is an order, even if it is a complicated one, just as in space too there arent disorderly and orderly point distributions. Rather, every distribution of points is orderly. <br>[This remark is only material for a thought].<br>\",\"date\":\"1916-09-19\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,54r[2] (1916--0919) (NB)\",\"ger\":\"Die Kunst ist ein Ausdruck. <br>\",\"eng\":\"\",\"date\":\"1916-09-19\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,54r[3] (1916--0919) (NB)\",\"ger\":\"Das gute Kunstwerk ist der vollendete Ausdruck. <br>\",\"eng\":\"A good work of art is a consummate expression.<br>\",\"date\":\"1916-09-19\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,54r[4] (1916--1007) (NB)\",\"ger\":\"Das Kunstwerk ist der Gegenstand sub specie aeternitatis gesehen; und das gute Leben ist die Welt sub specie aeternitatis gesehen. Dies ist der Zusammenhang zwischen Kunst und Ethik.<br>\",\"eng\":\"A work of art is an object seen <em>sub specie aeternitatis</em>; and the good life is the world seen <em>sub specie aeterni</em><em>tatis.</em> This is the connection between art and ethics. [<em>Cf</em>. 6.45 (1).]<br>\",\"date\":\"1916-10-07\",\"pt-number\":\" 6431\",\"pt-page\":\"85[6]\",\"tlp-number\":\"645 (1)*\",\"cross-references\":\"7.10.16 (2,3)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,55r[1] (1916--1007) (NB)\",\"ger\":\" / \\\\\\tDie gewhnliche Betrachtungsweise sieht die Gegenstnde gleichsam aus ihrer Mitte, die Betrachtung sub specie aeternitatis von auerhalb.<br>\",\"eng\":\"The usual way of looking at objects sees them from their midst, as it were, the view sub specie aeternitatis from outside.<br>\",\"date\":\"1916-10-07\",\"pt-number\":\"6431\",\"pt-page\":\"85[6]\",\"tlp-number\":\"645 (1)*\",\"cross-references\":\"7.10.16 (2,3)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,55r[2] (1916--1007) (NB)\",\"ger\":\" / \\\\\\tSo da sie die ganze Welt als Hintergrund haben.<br>\",\"eng\":\"In such a way that they have the whole world as background.<br>\",\"date\":\"1916-10-07\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,55r[3] (1916--1007) (NB)\",\"ger\":\" / \\\\\\tIst es etwa das da sie den Gegenstand <span class='underline_single'>mit</span> Raum und Zeit sieht statt <span class='underline_single'>in</span> Raum und Zeit.<br>\",\"eng\":\"Is this it perhaps: the object is seen <span class='underline_single'>together with</span> space and time instead of <span class='underline_single'>within</span> space and time?<br>\",\"date\":\"1916-10-07\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,55r[4] (1916--1007) (NB)\",\"ger\":\"Jedes Ding bedingt die ganze logische Welt, sozusagen den ganzen logischen Raum.<br>\",\"eng\":\"Each thing presupposes the whole logical world, the whole of logical space, so to speak.<br>\",\"date\":\"1916-10-07\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,55r[5] (1916--1007) (NB)\",\"ger\":\"(Es drngt sich der Gedanke auf): Das Ding sub specie aeternitatis gesehen ist das Ding mit dem ganzen logischen Raum gesehen. <br>\",\"eng\":\"(The thought impresses itself): The thing seen <em>sub specie aeternitatis</em> is the thing seen together with the whole of logical space.<br>\",\"date\":\"1916-10-07\",\"pt-number\":\" 6431\",\"pt-page\":\"85[6]\",\"tlp-number\":\"645 (1)*\",\"cross-references\":\"7.10.16 (2,3)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,56r[1] (1916--1008) (NB)\",\"ger\":\"Als Ding unter Dingen ist jedes Ding gleich unbedeutend als Welt jedes gleich bedeutend. <br>\",\"eng\":\"As a thing among things, each thing is equally insignificant; as a world, each is equally significant.<br>\",\"date\":\"1916-10-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,55v[1] (1916--1008)\",\"ger\":\"<em>Unter</em><em> </em><em>Schmerzen</em><em>:</em> [Comment on writing of opposite page 56r.]<br>\",\"eng\":\"In pain: [Comment on writing of opposite page 56r.]<br>\",\"date\":\"1916-10-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"verso\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,56r[2] (1916--1008) (NB)\",\"ger\":\"Habe ich den Ofen kontempliert und es wird mir nun gesagt: jetzt kennst Du aber nur den Ofen so scheint mein Resultat allerdings kleinlich. Denn das stellt es so dar als htte ich den Ofen unter den vielen vielen Dingen der Welt studiert. Habe ich aber den Ofen kontempliert so war <span class='underline_single'>er</span> meine Welt. Und alles andere dagegen bla. <br>\",\"eng\":\"If I have been contemplating the stove and then am told: but now all you know is the stove, then my result does indeed look trivial. Because this represents it in such a way as if I had studied the oven among the many many things of the world. But if I was contemplating the stove, <span class='underline_single'>it</span> was my world. And everything else pales by comparison.<br>\",\"date\":\"1916-10-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,55v[2] (1916--1008) (NB)\",\"ger\":\"<em>Manches Gute im Groen im </em><em>einzelnen</em><em> aber schlecht.</em><br>\",\"eng\":\"Something good about the whole, but bad in details.<br>\",\"date\":\"1916-10-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"verso\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,57r[1] (1916--1008) (NB)\",\"ger\":\"Man kann eben die bloe gegenwrtige Vorstellung sowohl auffassen als das nichtige momentane Bild in der ganzen zeitlichen Welt als auch als die wahre Welt unter Schatten. <br>\",\"eng\":\"One can equally well regard the bare present idea as a trivial momentary picture within the whole temporal world, and as the true world among shadows.<br>\",\"date\":\"1916-10-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\" Ms-103,56v[1] (1916--1008)\",\"ger\":\"\",\"eng\":\"\",\"date\":\"1916-10-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"verso\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,57r[2] (1916--1009) (NB)\",\"ger\":\"Nun ist aber endlich der Zusammenhang der Ethik mit der Welt klar zu machen. <br>\",\"eng\":\"But now at last the connection of ethics with the world has to be made clear.<br>\",\"date\":\"1916-10-09\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,57r[3] (1916--1012) (NB)\",\"ger\":\"Ein Stein, der Krper eines Tiers, der Krper eines Menschen, mein Krper, stehen alle auf gleicher Stufe. <br>\",\"eng\":\"A stone, the body of an animal, the body of a man, my body, are all on the same level.<br>\",\"date\":\"1916-10-12\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,57r[4] et 58r[1] (1916--1012) (NB)\",\"ger\":\"Darum ist was geschieht ob es von einem Stein oder  / von meinem Krper geschieht weder gut noch schlecht. <br>\",\"eng\":\"That is why what happens, whether it is done by a stone or by my body, is neither good nor bad.<br>\",\"date\":\"1916-10-12\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,58r[2] (1916--1012) (NB)\",\"ger\":\"Die Zeit ist einsinnig mu ein Unsinn sein. <br>\",\"eng\":\"\\\"Time has just one direction\\\" must be a piece of nonsense.<br>\",\"date\":\"1916-10-12\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,58r[3] (1916--1012) (NB)\",\"ger\":\"Die Einsinnigkeit ist eine logische Eigenschaft der Zeit. <br>\",\"eng\":\"Having just one direction is a logical property of time.<br>\",\"date\":\"1916-10-12\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,58r[4] (1916--1012) (NB)\",\"ger\":\"Denn wenn man jemanden frge wie er sich die Einsinnigkeit vorstellt so wrde er sagen: die Zeit wre nicht einsinnig wenn sich ein Ereignis wiederholen knnte. <br>\",\"eng\":\"For if one were to ask someone how he imagines having just one direction, he would say: time would not have just one direction if an event could itself be repeated.<br>\",\"date\":\"1916-10-12\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,58r[5] et 59r[1] (1916--1012) (NB)\",\"ger\":\"Da sich aber ein Ereignis nicht wiederholen kann liegt geradeso  / wie da ein Krper nicht zu gleicher Zeit an zwei Orten sein kann im logischen Wesen des Ereignisses. <br>\",\"eng\":\"But the impossibility of an event itselfs being repeated, like that of a body's being in two places at once, is involved in the logical nature of an event.<br>\",\"date\":\"1916-10-12\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,59r[2] (1916--1012) (NB)\",\"ger\":\" / \\\\\\tEs ist wahr: der Mensch <span class='underline_single'>ist</span> der Mikrokosmos: Ich bin meine Welt. <br>\",\"eng\":\"Truly, Man <span class='underline_single'>is</span> the microcosm: I am my world. [<em>Cf</em>. 5.63.]<br>\",\"date\":\"1916-10-12\",\"pt-number\":\"533532\",\"pt-page\":\"85[5]\",\"tlp-number\":\"563*\",\"cross-references\":\"12.10.16 (7,8)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,59r[3] (1916--1015) (NB)\",\"ger\":\"     Was man sich nicht denken kann, darber kann man auch nicht reden. <br>\",\"eng\":\"What one can't imagine, one can't speak of, too. [<em>Cf</em>. 5.61 (4).]<br>\",\"date\":\"1916-10-15\",\"pt-number\":\" 540421\",\"pt-page\":\"90[3]\",\"tlp-number\":\"561 (4)\",\"cross-references\":\"15.10.16 (1)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,59r[4] (1916--1015) (NB)\",\"ger\":\"Bedeutung bekommen die Dinge erst durch ihr Verhltnis zu meinem Willen. <br>\",\"eng\":\"Things get \\\"meaning\\\" only in virtue of their relation to my will.<br>\",\"date\":\"1916-10-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,59r[5] (1916--1015) (NB)\",\"ger\":\"Denn Jedes Ding ist was es ist und kein ander Ding. <br>\",\"eng\":\"For \\\"every thing is what it is and not another thing\\\".<br>\",\"date\":\"1916-10-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,60r[1] (1916--1015) (NB)\",\"ger\":\"Eine Auffassung: Wie ich aus meiner Physiognomie auf meinen Geist (Charakter, Willen) schlieen kann so aus der Physiognomie jedes Dinges auf <span class='underline_single'>seinen</span> Geist (Willen). <br>\",\"eng\":\"One view: As I can infer my spirit (character, will) from my physiognomy, so I can infer the spirit (will) of each thing from <span class='underline_single'>its</span> physiognomy.<br>\",\"date\":\"1916-10-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,60r[2] (1916--1015) (NB)\",\"ger\":\"Kann ich aber aus meiner Physiognomie auf meinen Geist <span class='underline_single'>schlieen</span>? <br>\",\"eng\":\"\",\"date\":\"1916-10-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,60r[3] (1916--1015) (NB)\",\"ger\":\"Ist dieses Verhltnis nicht rein empirisch? <br>\",\"eng\":\"Isn't this relation merely empirical?<br>\",\"date\":\"1916-10-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,60r[4] (1916--1015) (NB)\",\"ger\":\"Drckt mein Krper wirklich etwas aus? <br>     Ist er selbst der interne Ausdruck von etwas? <br>\",\"eng\":\"Does my body really express anything? <br>     Is it itself an internal expression of something?<br>\",\"date\":\"1916-10-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,60r[5] et 61r[1] (1916--1015) (NB)\",\"ger\":\"Ist etwa das bse Gesicht an sich bse oder blo weil es  / empirisch mit bser Laune verbunden ist? <br>\",\"eng\":\"Is an angry face, for instance, angry in itself or merely because it is empirically connected with an angry temper?<br>\",\"date\":\"1916-10-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,61r[2] (1916--1015) (NB)\",\"ger\":\"Aber es ist klar da der Kausalnexus gar kein Nexus ist. <br>\",\"eng\":\"But it is clear that the causal nexus is not a nexus at all. [<em>Cf</em>. 5.136.]<br>\",\"date\":\"1916-10-15\",\"pt-number\":\" 50441\",\"pt-page\":\"16[5]\",\"tlp-number\":\"5136\",\"cross-references\":\"15.10.16 (10)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,61r[3] (1916--1015) (NB)\",\"ger\":\"Ist es denn wahr, da sich mein Charakter nach der psychophysischen Auffassung nur im Bau meines Krpers oder meines Gehirns und nicht ebenso im Bau der ganzen brigen Welt ausdrckt? <br>     Hier liegt ein springender Punkt. <br>\",\"eng\":\"Is it true, then, that on the psychophysical view my character expresses itself only in the construction of <span class='underline_single'>my</span> body or my brain and not equally in the construction of the rest of the world? <br>\",\"date\":\"1916-10-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,61r[4] (1916--1015) (NB)\",\"ger\":\"Dieser Parallelismus besteht also eigentlich zwischen meinem Geist i.e. dem Geist und der Welt. <br>\",\"eng\":\"So this parallelism ultimately obtains between my spirit, i.e. spirit, and the world.<br>\",\"date\":\"1916-10-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,62r[1] (1916--1015) (NB)\",\"ger\":\"Bedenke nur da der Geist der Schlange des Lwen <span class='underline_single'>dein</span> Geist ist. Denn nur von Dir her kennst du berhaupt den Geist. <br>\",\"eng\":\"But keep in mind that the spirit of a serpent, of a lion, is <span class='underline_single'>your</span> spirit. For it is only from yourself that you are acquainted with spirit at all.<br>\",\"date\":\"1916-10-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,62r[2] (1916--1015) (NB)\",\"ger\":\"Es ist nun freilich die Frage warum habe ich der Schlange gerade diesen Geist gegeben. <br>\",\"eng\":\"Now of course the question is: why have I given a serpent this very spirit?<br>\",\"date\":\"1916-10-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,62r[3] (1916--1015) (NB)\",\"ger\":\"Und die Antwort hierauf kann nur im psychophysischen Parallelismus liegen: Wenn Ich so ausshe wie die Schlange und das tte was sie tut so wre ich so und so. <br>\",\"eng\":\"And the answer to this can only lie in psychophysical parallelism: If I were to look like the serpent and do what it does, I would be such-and-such.<br>\",\"date\":\"1916-10-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,62r[4] (1916--1015) (NB)\",\"ger\":\"Das Gleiche beim Elefanten, bei der Fliege bei der Wespe. <br>\",\"eng\":\"The same with the elephant, with the fly, with the wasp.<br>\",\"date\":\"1916-10-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,63r[1] (1916--1015) (NB)\",\"ger\":\"Es frgt sich aber ob nicht eben auch hier wieder (und gewi ist es so) mein Krper mit dem der Wespe und der Schlange auf einer Stufe stehen so da ich weder von dem der Wespe auf meinen noch von meinem auf den der Wespe geschlossen habe. <br>\",\"eng\":\"But the question arises whether even here, again, my body is not on the same level with that of the wasp and the serpent (and surely it is so), so that I have neither inferred from that of the wasp to mine nor from mine to that of the wasp.<br>\",\"date\":\"1916-10-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,63r[2] (1916--1015) (NB)\",\"ger\":\"Ist das die Lsung des Rtsels warum die Menschen immer glaubten <span class='underline_single'>ein</span> Geist sei der ganzen Welt gemein. <br>\",\"eng\":\"Is this the solution of the riddle why men always believed <span class='underline_single'>one</span> spirit to be shared by the whole world?<br>\",\"date\":\"1916-10-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,63r[3] et 64r[1] (1916--1015) (NB)\",\"ger\":\"Und dann wre er freilich auch den unbelebten Dingen  / gemeinsam. <br>\",\"eng\":\"And then, of course, it would be shared by lifeless things, too.<br>\",\"date\":\"1916-10-15\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,64r[2] (1916--1015) (NB)\",\"ger\":\" / \\\\\\tDer Weg den ich gegangen bin ist der:<br>Der Idealismus scheidet aus der Welt als unik die Menschen aus, der Solipsismus scheidet mich allein aus, und endlich sehe ich da auch ich zur brigen Welt gehre auf der einen Seite bleibt also <span class='underline_single'>nichts</span> brig auf der anderen als unik <span class='underline_single'>die Welt</span>. So fhrt der Idealismus streng durchdacht zum Realismus. <br>\",\"eng\":\"This is the path I have taken: <br>Idealism sets men apart from the world as unique, solipsism set me apart, and eventually I see that I too belong with the rest of the world, so that on the one hand <span class='underline_single'>nothing</span> is left, and on the other as unique, <span class='underline_single'>the world</span>. Thus idealism, strictly thought out, leads to realism. [<em>Cf</em>. 5.64.]<br>\",\"date\":\"1916-10-15\",\"pt-number\":\"53355\",\"pt-page\":\"85[4]\",\"tlp-number\":\"564\",\"cross-references\":\"2.9.16 (1,2)   15.10.16 (21)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,64r[3] et 65r[1] (1916--1017) (NB)\",\"ger\":\"Und in diesem Sinne kann ich auch  / von einem der ganzen Welt gemeinsamen Willen sprechen. <br>     Aber dieser Wille ist in einem hheren Sinne <span class='underline_single'>mein</span> Wille. <br>\",\"eng\":\"And in this sense I can also speak of a will common to the whole world. <br>     But in a more elevated sense this will is <span class='underline_single'>my</span> will.<br>\",\"date\":\"1916-10-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,65r[2] (1916--1017) (NB)\",\"ger\":\"Wie meine Vorstellung die Welt ist so ist mein Wille der Welt-Wille. <br>\",\"eng\":\"Just as my idea is the world, my will is the world-will.<br>\",\"date\":\"1916-10-17\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,65r[3] (1916--1020) (NB)\",\"ger\":\"Es ist klar da mein Gesichtsraum der Lnge nach anders beschaffen ist als der Breite nach. <br>\",\"eng\":\"It is clear that my visual space is constituted differently in length than in breadth.<br>\",\"date\":\"1916-10-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,65r[4] et 66r[1] (1916--1020) (NB)\",\"ger\":\"Es verhlt sich nicht so, da ich mich einfach berall bemerke wo ich etwas sehe, sondern ich befinde mich auch immer in einem bestimmten Punkt meines Gesichtsraumes  / mein Gesichtsraum hat also quasi eine Form. <br>\",\"eng\":\"\",\"date\":\"1916-10-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,66r[2] (1916--1020) (NB)\",\"ger\":\"Trotzdem aber ist es wahr da ich das Subjekt nicht sehe. <br>\",\"eng\":\"\",\"date\":\"1916-10-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,66r[3] (1916--1020) (NB)\",\"ger\":\"Es ist wahr da das erkennende Subjekt nicht in der Welt ist, da es kein erkennendes Subjekt gibt. <br>\",\"eng\":\"\",\"date\":\"1916-10-20\",\"pt-number\":\"53354\",\"pt-page\":\"60[3]\",\"tlp-number\":\"5631 (1)\",\"cross-references\":\"5.8.16 (1)+20.10.16 (4)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,66r[4] et 67r[1] (1916--1020) (NB)\",\"ger\":\" Ich kann mir jedenfalls vorstellen da ich den Willensakt ausfhre um meinen Arm zu heben aber mein Arm sich nicht bewegt. (Eine Sehne sei etwa gerissen.) Ja, aber wird man sagen, die Sehne bewegt sich doch und  / dies zeigt eben da sich mein Willensakt auf die Sehne und nicht auf den Arm bezogen hat. Aber gehen wir weiter und nehmen an, auch die Sehne bewegte sich nicht und so fort. Wir wrden dann dazu kommen, da sich der Willensakt berhaupt nicht auf einen Krper bezieht, da es also im gewhnlichen Sinne des Wortes keinen Willensakt gibt. <br>\",\"eng\":\"\",\"date\":\"1916-10-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,67r[2] (1916--1020) (NB)\",\"ger\":\"Das knstlerische Wunder ist, da es die Welt gibt. Da es das gibt was es gibt. <br>\",\"eng\":\"\",\"date\":\"1916-10-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,68r[1] (1916--1020) (NB)\",\"ger\":\"Ist das das Wesen der knstlerischen Betrachtungsweise, da sie die Welt mit glcklichem Auge betrachtet? <br>\",\"eng\":\"\",\"date\":\"1916-10-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,68r[2] (1916--1020) (NB)\",\"ger\":\"Ernst ist das Leben heiter ist die Kunst.<br>\",\"eng\":\"\",\"date\":\"1916-10-20\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,68r[3] (1916--1021) (NB)\",\"ger\":\"Denn etwas ist wohl an der Auffassung als sei das Schne der Zweck der Kunst. Und das Schne ist eben das was glcklich macht. <br>\",\"eng\":\"\",\"date\":\"1916-10-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,68r[4] et 69r[1] (1916--1029) (NB)\",\"ger\":\"     Knnte man nicht sagen die Allgemeinheit ist der Zusammensetzung ebensowenig koordiniert wie Tatsache dem Ding? / Beide Arten von Operationszeichen mssen oder knnen im Satz nebeneinander vorkommen. <br>\",\"eng\":\"\",\"date\":\"1916-10-29\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,69r[2] (1916--1104) (NB)\",\"ger\":\"Ist der Wille eine Stellungnahme zur Welt. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,69r[3] (1916--1104) (NB)\",\"ger\":\" Der Wille scheint sich immer auf eine Vorstellung beziehen zu mssen. Wir knnen uns z.B. nicht vorstellen da wir einen Willensakt ausgefhrt htten ohne gesprt zu haben da wir ihn ausgefhrt haben. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,69r[4] et 70r[1] (1916--1104) (NB)\",\"ger\":\" Es knnte sonst etwa die Frage entstehen  / ob er schon <span class='underline_single'>ganz</span> ausgefhrt sei. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,70r[2] (1916--1104) (NB)\",\"ger\":\" Es ist sozusagen klar, da wir fr den Willen einen Halt in der Welt brauchen. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,70r[3] (1916--1104) (NB)\",\"ger\":\"Der Wille ist eine Stellungnahme des Subjekts zur Welt. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,70r[4] (1916--1104) (NB)\",\"ger\":\"Das Subjekt ist das wollende Subjekt. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,70r[5] et 71r[1] (1916--1104) (NB)\",\"ger\":\"Haben die Gefhle die mich von dem Vorgang eines Willensakts berzeugen irgend eine besondere Eigenschaft die sie von anderen Vorstellungen  / unterscheidet? <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,71r[2] (1916--1104) (NB)\",\"ger\":\"\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,71r[3] (1916--1104) (NB)\",\"ger\":\"Dann wre es aber denkbar da ich etwa daraufkme da z.B. dieser Sessel direkt meinem Willen folgt. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,71r[4] (1916--1104) (NB)\",\"ger\":\"\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,71r[5] et 72r[1] (1916--1104) (NB)\",\"ger\":\"Bei dem Zeichnen des Vierecks <br>  im Spiegel bemerkt man da man es nur ausfhren kann wenn man vom Gesichtsbild ganz absieht und nur das Muskelgefhl zu Hilfe nimmt   also handelt es sich hier  / doch um zwei ganz verschiedene Willensakte.   Der eine bezieht sich auf den Gesichtsteil der Welt der andere auf den Teil des Muskelgefhls. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,72r[2] (1916--1104) (NB)\",\"ger\":\"Haben wir mehr als erfahrungsmige Evidenz da es sich in beiden Fllen um die Bewegung desselben Krperteils handelt? <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,72r[3] (1916--1104) (NB)\",\"ger\":\" Verhlt es sich also so da ich meine Handlungen mit meinem Willen nur begleite? <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,72r[4] et 73r[1] (1916--1104) (NB)\",\"ger\":\"Aber wie kann ich dann  / voraussagen  und das kann ich doch in einem gewissen Sinne  da ich in 5 Minuten meinen Arm heben werde? Da ich dies wollen werde? <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,73r[2] (1916--1104) (NB)\",\"ger\":\"Es ist klar: Es ist unmglich zu wollen ohne nicht schon den Willensakt auszufhren. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,73r[3] (1916--1104) (NB)\",\"ger\":\" Der Willensakt ist nicht die Ursache der Handlung sondern die Handlung selbst. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,73r[4] (1916--1104) (NB)\",\"ger\":\"Man kann nicht wollen ohne zu tun. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,74r[1] (1916--1104) (NB)\",\"ger\":\"Wenn der Wille ein Objekt in der Welt haben mu so kann es auch die beabsichtigte Handlung sein. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,74r[2] (1916--1104) (NB)\",\"ger\":\"Und der Wille mu ein Objekt haben. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,74r[3] (1916--1104) (NB)\",\"ger\":\"Sonst htten wir gar keinen Halt und knnten nicht wissen was wir wollten. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,74r[4] (1916--1104) (NB)\",\"ger\":\"Und knnten nicht Verschiedenes wollen. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,74r[5] et 75r[1] (1916--1104) (NB)\",\"ger\":\" Geschieht denn nicht die gewollte Bewegung des Krpers gerade so wie jedes Ungewollte in  / der Welt nur da sie vom Willen begleitet ist? <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,75r[2] (1916--1104) (NB)\",\"ger\":\" Aber sie ist nicht nur vom <span class='underline_single'>Wunsch</span> begleitet! Sondern vom Willen. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,75r[3] (1916--1104) (NB)\",\"ger\":\"Wir fhlen uns sozusagen fr die Bewegung verantwortlich. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,75r[4] (1916--1104) (NB)\",\"ger\":\"Mein Wille greift irgendwo in der Welt an, und an andern greift er wieder nicht an. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,75r[5] (1916--1104) (NB)\",\"ger\":\"Wnschen ist nicht Tun. Aber, Wollen ist Tun. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,75r[6] et 76r[1] (1916--1104) (NB)\",\"ger\":\"(Mein Wunsch bezieht sich z.B. auf die Bewegung  / des Sessels, mein Willen auf ein Muskelgefhl.) <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,76r[2] (1916--1104) (NB)\",\"ger\":\"Da ich einen Vorgang will besteht darin da ich den Vorgang mache nicht darin da ich etwas anders tue was den Vorgang verursacht. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,76r[3] (1916--1104) (NB)\",\"ger\":\"Wenn ich etwas bewege so bewege ich mich. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,76r[4] (1916--1104) (NB)\",\"ger\":\"Wenn ich einen Vorgang mache so gehe ich vor. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,76r[5] (1916--1104) (NB)\",\"ger\":\"Aber: Ich kann nicht alles wollen.  <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,77r[1] (1916--1104) (NB)\",\"ger\":\"Aber was heit das: Ich kann <span class='underline_single'>das</span> nicht wollen. <br>     Kann ich denn versuchen etwas zu wollen. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,77r[2] (1916--1104) (NB)\",\"ger\":\"     Es scheint nmlich durch die Betrachtung des Wollens als stnde ein Teil der Welt mir nher als ein anderer (was unertrglich wre). <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,77r[3] (1916--1104) (NB)\",\"ger\":\"Aber freilich ist es ja unleugbar da ich in einem populren Sinne Gewisses tue und anderes nicht tue. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,77r[4] et 78r[1] (1916--1104) (NB)\",\"ger\":\"So stnde also der Wille der Welt nicht  / quivalent gegenber was unmglich sein mu. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,78r[2] (1916--1104) (NB)\",\"ger\":\"Der Wunsch geht dem Ereignis voran der Wille begleitet es. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,78r[3] (1916--1104) (NB)\",\"ger\":\" / \\\\\\tAngenommen ein Vorgang wrde meinen Wunsch begleiten. Hatte ich den Vorgang gewollt. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,78r[4] (1916--1104) (NB)\",\"ger\":\" Schiene dies Begleiten nicht zufllig im Gegensatz zu dem gezwungen des Willens. <br>\",\"eng\":\"\",\"date\":\"1916-11-04\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,78r[5] et 79r[1] (1916--1108) (NB)\",\"ger\":\"Ist der Glaube eine Erfahrung? <br>Ist der Gedanke eine  / Erfahrung? <br>\",\"eng\":\"\",\"date\":\"1916-11-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,79r[2] (1916--1108) (NB)\",\"ger\":\"Alle Erfahrung ist Welt und braucht nicht das Subjekt. <br>\",\"eng\":\"\",\"date\":\"1916-11-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,79r[3] (1916--1108) (NB)\",\"ger\":\"Der Willensakt ist keine Erfahrung. <br>\",\"eng\":\"\",\"date\":\"1916-11-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,79r[4] (1916--1119) (NB)\",\"ger\":\"Was fr ein Grund ist da, zur Annahme eines wollenden Subjekts? <br>\",\"eng\":\"\",\"date\":\"1916-11-19\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,79r[5] (1916--1119) (NB)\",\"ger\":\"Gengt nicht wieder <span class='underline_single'>meine Welt</span> zur Individualisierung? <br>\",\"eng\":\"\",\"date\":\"1916-11-19\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,79r[6] et 80r[1] (1916--1121) (NB)\",\"ger\":\"Da es mglich ist die allgemeine Satzform aufzustellen sagt nichts anderes als: Jede mgliche Satzform  / mu sich <span class='underline_single'>voraussehen</span> <span class='underline_double'>lassen</span>. <br>\",\"eng\":\"\",\"date\":\"1916-11-21\",\"pt-number\":\"443012\",\"pt-page\":\"78[11]\",\"tlp-number\":\"45 (3a) \",\"cross-references\":\"16.4.16 (1)+   21.11.16 (1)+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,80r[2] (1916--1121) (NB)\",\"ger\":\"Und <span class='underline_single'>das</span> heit: Wir knnen nie zu einer Satzform kommen von der wir sagen knnten: Ja da es so etwas gibt, das hat sich nicht voraussehen lassen. <br>     Denn das wrde heien da wir eine neue Erfahrung gemacht htten die erst diese Satzform ermglicht hat. <br>\",\"eng\":\"\",\"date\":\"1916-11-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,80r[3] et 81r[1] (1916--1121) (NB)\",\"ger\":\"Also: Die allgemeine Satzform mu sich aufstellen lassen, weil die mglichen Satzformen a priori sein mssen. / Weil die mglichen Satzformen a priori sind, darum gibt es die allgemeine Satzform. <br>\",\"eng\":\"\",\"date\":\"1916-11-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,81r[2] (1916--1121) (NB)\",\"ger\":\"Dabei ist es vollkommen gleichgltig ob die gegebenen Grundoperationen durch die alle Stze entstehen sollen dieselben ber die logischen Stufen hinausfhren, oder ob sie innerhalb der Stufen bleiben. <br>\",\"eng\":\"\",\"date\":\"1916-11-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,81r[3] (1916--1121) (NB)\",\"ger\":\"Einen Satz den wir jemals werden bilden knnen, htten wir auch jetzt gleich bilden knnen. <br>\",\"eng\":\"\",\"date\":\"1916-11-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,81r[4] et 82r[1] (1916--1121) (NB)\",\"ger\":\"Wir brauchen jetzt die  / Klrung des Begriffes der atomistischen Funktion und des Begriffes und so weiter. <br>\",\"eng\":\"\",\"date\":\"1916-11-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,82r[2] (1916--1121) (NB)\",\"ger\":\"Der Begriff Und so weiter, in Zeichen  , ist einer der allerwichtigsten und wie alle anderen unendlich fundamental. <br>\",\"eng\":\"\",\"date\":\"1916-11-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,82r[3] (1916--1121) (NB)\",\"ger\":\"Durch ihn allein nmlich sind wir berechtigt die Logik resp. Mathematik so weiter aus den Grundgesetzen und Urzeichen aufzubauen. <br>\",\"eng\":\"\",\"date\":\"1916-11-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,82r[4] et 83r[1] (1916--1121) (NB)\",\"ger\":\"Das Und so weiter tritt sofort im Uranfang der alten Logik ein  / wenn gesagt wird da wir nun nach der Angabe der Urzeichen ein Zeichen nach dem anderen so weiter entwickeln knnen. <br>\",\"eng\":\"\",\"date\":\"1916-11-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,83r[2] (1916--1121) (NB)\",\"ger\":\"Ohne diesen Begriff wrden wir bei den Urzeichen einfach stehen bleiben und knnten nicht <span class='underline_single'>weiter</span>. <br>\",\"eng\":\"\",\"date\":\"1916-11-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,83r[3] (1916--1121) (NB)\",\"ger\":\"Der Begriff und so weiter ist quivalent mit dem Begriffe der Operation. <br>\",\"eng\":\"\",\"date\":\"1916-11-21\",\"pt-number\":\"\",\"pt-page\":\" 118[5] \",\"tlp-number\":\"             52523+\",\"cross-references\":\"21.11.16 (12)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,83r[4] et 84r[1] (1916--1121) (NB)\",\"ger\":\"Nach dem Operationszeichen folgt das Zeichen  , welches bedeutet  / da das Resultat der Operation wieder zur Basis derselben Operation genommen werden kann; und so weiter. <br>\",\"eng\":\"\",\"date\":\"1916-11-21\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,84r[2] (1916--1122) (NB)\",\"ger\":\"Der Begriff der Operation ist ganz allgemein derjenige, nach welchem nach einer Regel Zeichen gebildet werden knnen. <br>\",\"eng\":\"\",\"date\":\"1916-11-22\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,84r[3] (1916--1123) (NB)\",\"ger\":\"Worauf sttzt sich die Mglichkeit der Operation. <br>\",\"eng\":\"\",\"date\":\"1916-11-23\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,84r[4] (1916--1123) (NB)\",\"ger\":\"Auf den allgemeinen Begriff der strukturellen hnlichkeit. <br>\",\"eng\":\"\",\"date\":\"1916-11-23\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,85r[1] (1916--1123) (NB)\",\"ger\":\"Wie ich z.B. die Elementarstze auffasse, mu ihnen etwas gemeinsam sein; sonst knnte ich berhaupt nicht kollektiv von ihnen allen als den Elementarstzen sprechen. <br>\",\"eng\":\"\",\"date\":\"1916-11-23\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,85r[2] (1916--1123) (NB)\",\"ger\":\"Dann mssen sie aber auch als Resultate von Operationen aus einander entwickelt werden knnen. <br>\",\"eng\":\"\",\"date\":\"1916-11-23\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,85r[3] et 86r[1] (1916--1123) (NB)\",\"ger\":\"Denn wenn zwei Elementarstzen wirklich etwas gemeinsam ist was einem Elementarsatz und einem zusammengesetzten nicht gemeinsam ist, so  / mu sich dies Gemeinsame irgend wie allgemein zum Ausdruck bringen lassen. <br>\",\"eng\":\"\",\"date\":\"1916-11-23\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,86r[2] (1916--1124) (NB)\",\"ger\":\"Wenn das allgemeine Kennzeichen der Operation bekannt sein wird dann wird auch klar sein aus welchen Elementarbestandteilen eine <span class='underline_single'>Operation</span> immer besteht. <br>\",\"eng\":\"\",\"date\":\"1916-11-24\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,86r[3] (1916--1124) (NB)\",\"ger\":\"Wenn die allgemeine Form der Operation gefunden ist so haben wir auch die allgemeine Form des Auftretens des Begriffs Und so weiter. <br>\",\"eng\":\"\",\"date\":\"1916-11-24\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,87r[1] (1916--1126) (NB)\",\"ger\":\"Alle Operationen sind aus den Grundoperationen zusammengesetzt. <br>\",\"eng\":\"\",\"date\":\"1916-11-26\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,87r[2] (1916--1127? --1128?) (NB)\",\"ger\":\"Entweder eine Tatsache ist in einer anderen enthalten, oder sie ist unabhngig von ihr. <br>\",\"eng\":\"\",\"date\":\"1916-11-27\",\"pt-number\":\" 121\",\"pt-page\":\"78[10]\",\"tlp-number\":\"121\",\"cross-references\":\"28.11.16+\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,87r[3] (1916--1202) (NB)\",\"ger\":\"Die hnlichkeit der Allgemeinheitsbezeichnung mit dem Argument zeigt sich wenn wir statt a schreiben (ax).x. <br>\",\"eng\":\"\",\"date\":\"1916-12-02\",\"pt-number\":\"     5322\",\"pt-page\":\"63[5]\",\"tlp-number\":\"3.11.14 (12)** 2.12.16 (1)+  (Pilch: 53221)\",\"cross-references\":\"3.11.14 (12)** 2.12.16 (1)+  (Pilch: 53221)\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,87r[4] et 88r[1] (1916--1202) (NB)\",\"ger\":\"Man knnte die Argumente auch so einfhren da sie nur auf einer Seite des Gleichheitszeichens  / auftreten. Also immer analog (x)  x  x = a statt a. <br>\",\"eng\":\"\",\"date\":\"1916-12-02\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,88r[2] (1916--1202) (NB)\",\"ger\":\" / \\\\\\tDie richtige Methode in der Philosophie wre eigentlich die nichts zu sagen als was sich sagen lt also Naturwissenschaftliches also etwas was mit Philosophie nichts zu tun hat. Und dann immer wenn ein anderer etwas Metaphysisches sagen wollte ihm nachweisen da er gewissen Zeichen in seinen Stzen keine Bedeutung gegeben hat. <br>\",\"eng\":\"\",\"date\":\"1916-12-02\",\"pt-number\":\"653\",\"pt-page\":\"85[7]\",\"tlp-number\":\"653 a\",\"cross-references\":\"2.12.16 (3)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,88r[3] et 89r[1] (1916--1202) (NB)\",\"ger\":\" / \\\\\\tDiese Methode wre fr  / den anderen unbefriedigend (er htte nicht das Gefhl da wir ihn Philosophie lehrten) aber sie wre die einzig richtige. <br>\",\"eng\":\"\",\"date\":\"1916-12-02\",\"pt-number\":\"6531\",\"pt-page\":\"86[1]\",\"tlp-number\":\"653 b*\",\"cross-references\":\"2.12.16 (4)*\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,89r[2] (1917--0107) (NB)\",\"ger\":\"         86[4]\\t\\t\\t<span class='underline_single'>7.1.17 (1,2,</span><span class='underline_single'>4)*</span><span class='underline_single'>*</span><br>In dem Sinne, in welchem es eine Hierarchie der Stze gibt, gibt es, natrlich, auch eine Hierarchie der Wahrheiten und der Verneinungen etc. <br>\",\"eng\":\"\",\"date\":\"1917-01-07\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,89r[3] (1917--0107) (NB)\",\"ger\":\"         86[4]\\t\\t\\t<span class='underline_single'>7.1.17 (1,2,</span><span class='underline_single'>4)*</span><span class='underline_single'>*</span><br>/ \\\\\\tIn dem Sinne aber in welchem es, im allgemeinsten Sinne, Stze gibt, gibt es nur eine Wahrheit und eine Verneinung. <br>\",\"eng\":\"\",\"date\":\"1917-01-07\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,90r[1] (1917--0107) (NB)\",\"ger\":\"Dieser Sinn wird aus jenem gewonnen indem der Satz im allgemeinen aufgefat wird als das Resultat der <span class='underline_single'>einen</span> Operation, welche alle Stze aus der untersten Stufe erzeugt. etc. <br>\",\"eng\":\"\",\"date\":\"1917-01-07\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,90r[2] (1917--0107) (NB)\",\"ger\":\"         86[4]\\t\\t\\t<span class='underline_single'>7.1.17 (1,2,</span><span class='underline_single'>4)*</span><span class='underline_single'>*</span><br> / \\\\\\tDie unterste Stufe und die Operation kann die ganze Hierarchie vertreten. <br>\",\"eng\":\"\",\"date\":\"1917-01-07\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,90r[3] (1917--0108) (NB)\",\"ger\":\"Es ist klar da das logische Produkt zweier Elementarstze nie eine Tautologie sein kann. <br>\",\"eng\":\"\",\"date\":\"1917-01-08\",\"pt-number\":\" 63752\",\"pt-page\":\"94[6]\",\"tlp-number\":\"63751 (3)** \",\"cross-references\":\"8.1.17 (1,2)**\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,91r[1] (1917--0108) (NB)\",\"ger\":\"Ist das logische Produkt zweier Stze eine Kontradiktion und die Stze scheinen Elementarstze zu sein. So sieht man da in diesem Falle der Schein trgt. (Z.B.: A ist rot und A ist grn.) <br>\",\"eng\":\"\",\"date\":\"1917-01-08\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,91r[2] (1917--0110) (NB)\",\"ger\":\"Wenn der Selbstmord erlaubt ist dann ist alles erlaubt. <br>\",\"eng\":\"\",\"date\":\"1917-01-10\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,91r[3] (1917--0110) (NB)\",\"ger\":\"Wenn etwas nicht erlaubt ist dann ist der Selbstmord nicht erlaubt. <br>\",\"eng\":\"\",\"date\":\"1917-01-10\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,92r[1] (1917--0110) (NB)\",\"ger\":\"Dies wirft ein Licht auf das Wesen der Ethik. Denn der Selbstmord ist sozusagen die elementare Snde. <br>\",\"eng\":\"\",\"date\":\"1917-01-10\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"},{\"type\":\"recto\",\"manuscript\":\"Ms-103,92r[2] (1917--0110) (NB)\",\"ger\":\"Und wenn man ihn untersucht so ist es wie wenn man den Quecksilberdampf untersucht um das Wesen der Dmpfe zu erfassen. <br>\",\"eng\":\"\",\"date\":\"1917-01-10\",\"pt-number\":\"\",\"pt-page\":\"\",\"tlp-number\":\"\",\"cross-references\":\"\",\"original-type\":\"recto\"}];\n\n//# sourceURL=webpack:///./src/recto.json?");

